aketa.',NULL,'2017-02-27 11:40:25','text',2,NULL,'Jose Sanchez'),(944852,10,'EmptyScreenContactsDescribe','fi','Valitse Asiakkuudenhallinnan moduulin luettelosta kontakteja linkitettäväksi hallitsemaasi projektiin,tai  lisää uusia tai muokkaa olemassaolevia kontakteja. Näin hyödyntämällä Asiakkuudenhallinnan ominaisuuksia voit työskennellä tehokkaammin.',NULL,'2017-01-15 12:23:38','text',2,NULL,'Arto Ryynanen'),(455658,10,'EmptyScreenContactsDescribe','Neutral','Select the existing CRM contacts from the list to link them with the project you manage, or add new contacts. Edit the contacts personal information. A deeper integration with the CRM will help you manage your work more efficiently.','','2016-09-19 10:38:56','text',2,NULL,'Console'),(964642,10,'EmptyScreenContactsDescribe','sk','Vyberte existujúci CRM kontakt zo zoznamu na prepojenie s projektom ktorý spravujete, alebo pridajte nové kontakty. Upraviť osobné údaje kontaktu. Hlbšia integrácia s CRM vám pomôže spravovať svoju prácu efektívnejšie.',NULL,'2017-04-22 21:19:03','text',2,NULL,'Jan Kuna'),(953946,10,'EmptyScreenContactsDescribe','sv','Markera de befintliga CRM-kontakter från listan för att länka dem med projektet du hantera, eller lägga till nya kontakter. Redigera kontakter personlig information. En djupare integration med CRM hjälper dig att hantera ditt arbete mer effektivt.\n',NULL,'2017-02-28 11:42:02','text',2,NULL,'Christian Alfredsson'),(968865,10,'EmptyScreenContasctsHeader','bg','Списъкът с контакти е празен',NULL,'2017-05-05 22:33:13','text',2,NULL,'Georgi Iliev'),(945769,10,'EmptyScreenContasctsHeader','fi','Kontaktiluettelo on tyhjä',NULL,'2017-01-15 20:26:22','text',2,NULL,'Arto Ryynanen'),(455659,10,'EmptyScreenContasctsHeader','Neutral','The contact list is empty','','2016-09-19 10:38:56','text',2,NULL,'Console'),(964663,10,'EmptyScreenContasctsHeader','sk','Zoznam kontaktov je prázdny',NULL,'2017-04-22 21:26:08','text',2,NULL,'Jan Kuna'),(953952,10,'EmptyScreenContasctsHeader','sv','Kontaktlistan är tom',NULL,'2017-02-28 11:43:59','text',2,NULL,'Christian Alfredsson'),(455660,10,'Filter_NoProjects','Neutral','There are no projects matching this filter','','2017-05-03 10:51:01','text',2,NULL,'Console'),(964665,10,'Filter_NoProjects','sk','Žiadny projekt nezodpovedá tomuto filtru',NULL,'2017-04-22 21:27:18','text',2,NULL,'Jan Kuna'),(953958,10,'Filter_NoProjects','sv','Det finns inga projekt som matchar detta filter',NULL,'2017-02-28 11:45:51','text',2,NULL,'Christian Alfredsson'),(968809,10,'Follow','bg','Следвай',NULL,'2017-05-05 22:11:03','text',2,NULL,'Georgi Iliev'),(953437,10,'Follow','eu-ES','Jarraitu',NULL,'2017-02-23 08:11:28','text',2,NULL,'Jose Sanchez'),(455661,10,'Follow','Neutral','Follow','','2016-09-19 10:38:56','text',2,NULL,'Console'),(949831,10,'Follow','ro','Urmărire',NULL,'2017-01-27 17:18:04','text',2,NULL,'Florentina'),(964585,10,'Follow','sk','Sledovať',NULL,'2017-04-22 21:03:13','text',2,NULL,'Jan Kuna'),(953668,10,'Follow','sv','Följ',NULL,'2017-02-28 08:22:20','text',2,NULL,'Christian Alfredsson'),(737237,10,'HelpAnswerFollowProject','az-Latn-AZ','Yaratdığınız layinənin meneceri deyilsinizsə, lakin layihədəki hadisələri izləmək istəyirsinizsə, bu qutunu işarələyin. Bütün yaradılmış pillələr, tapşırıqlar və müzakirələr haqqında məlumatlar \"Yeniliklər\" adlı portal xəbərlərinə əlavə olunacaqlar.',NULL,'2016-07-22 11:46:04','text',2,NULL,'Console'),(968817,10,'HelpAnswerFollowProject','bg','Поставете отметка в това квадратче, ако не сте мениджър на проекта, който създавате, но искате да проследите всички промени в него. Информацията за всички новосъздадени етапи, задачи и дискусии ще бъде включена в ежедневното \"Какво е новото известие\".',NULL,'2017-05-05 22:15:52','text',2,NULL,'Georgi Iliev'),(963734,10,'HelpAnswerFollowProject','cs','Zaškrtněte toto pole, pokud nejste manager projektu, který právě vytváříte, ale máte zájem sledovat jeho všechny změny. Informace o všech nově vytvořených milnících, úkolech a diskuzí mohou být zahrnuty v denním upozornění Co je nového.   ',NULL,'2017-04-21 12:25:04','text',2,NULL,'Jan Kuna'),(953420,10,'HelpAnswerFollowProject','eu-ES','Markatu kutxa hau sortzen ari zaren proiektuaren kudeatzailea ez bazara baina proiektuko aldaketen berri izan nahi baduzu. Mugarri, ataza eta eztabaida guztiei buruzko informazioa gehituo zaio atariaren berri batzen dituen eguneroko jakinarazpenari.',NULL,'2017-02-23 08:05:51','text',2,NULL,'Jose Sanchez'),(946259,10,'HelpAnswerFollowProject','fi','Valitse tämä valintaruutu, jos et ole tämän projektin päällikkö, mutta haluat seurata kaikkia sen muutoksia. Saat päivittäisessä tiedotteessa yhteenvedon uusista välitavoitteista, tehtävistä ja keskusteluista.',NULL,'2017-01-16 06:45:32','text',2,NULL,'Arto Ryynanen'),(455662,10,'HelpAnswerFollowProject','Neutral','Check this box if you are not a manager of the project you are creating but wish to track all the changes within it. The information about all the newly created milestones, tasks and discussions will be included into the daily What\'s new notification.','','2016-09-19 10:38:56','text',2,NULL,'Console'),(964568,10,'HelpAnswerFollowProject','sk','Zaškrtnite toto pole, ak nie ste manažérom projektu ktorý vytvárate, ale chcete sledovať všetky zmeny v ňom. Informácie o všetkých novovytvorených míľnikoch, úlohách a diskusiách budú zahrnuté do denného Oznámenia o novinkách.',NULL,'2017-04-22 21:00:25','text',2,NULL,'Jan Kuna'),(953912,10,'HelpAnswerFollowProject','sv','\nMarkera rutan om du inte är ansvarig för projekt som du skapar, men vill spåra alla förändringar inom den. Informationen om alla nyskapade milstolpar, uppgifter och diskussioner kommer att ingå i den dagliga Nyheter anmälan.',NULL,'2017-02-28 11:37:06','text',2,NULL,'Christian Alfredsson'),(968864,10,'HelpAnswerPrivateProject','bg','{1}Частният проект{2} е начин да ограничите достъпа до вашия проект, така че само членовете на вашия екип да имат достъп до него.{0} Запазването на вашия проект като частен също ви позволява да зададете права на достъп за всеки съотборник в този проект ..',NULL,'2017-05-05 22:32:55','text',2,NULL,'Georgi Iliev'),(969417,10,'HelpAnswerPrivateProject','cs','{1}Soukromý projekt{2} je způsob, jak omezit přístup k vašemu projektu tak, že jen členové vašeho týmu k němu budou mít přístup. Uložení projektu jako soukromý také umožňuje nastavit přístupové práva pro každého člena týmu vevnitř tohoto projektu.',NULL,'2017-05-06 08:30:28','text',2,NULL,'Jiří Cigánek'),(455663,10,'HelpAnswerPrivateProject','Neutral','The {1}Private Project{2} is a way to restrict the access to your project so that only your team members could access it.{0} Saving your project as a private also allows you to set access rights for each teammate inside this project.','','2016-09-19 10:38:56','text',2,NULL,'Console'),(964662,10,'HelpAnswerPrivateProject','sk','{1}Súkromný projekt{2} je spôsob, ako obmedziť prístup k vášmu projektu tak, že len členovia vášho tímu k nemu budú mať prístup. Uloženie projektu ako súkromný taktiež umožňuje nastaviť prístupové práva pre každého člena tímu vo vnútri tohto projektu.',NULL,'2017-04-22 21:26:04','text',2,NULL,'Jan Kuna'),(953951,10,'HelpAnswerPrivateProject','sv','Den {1} privat projekt {2} är ett sätt att begränsa tillgången till ditt projekt så att bara dina gruppmedlemmar kan komma åt den. {0} Spara ditt projekt som en privat också kan du ställa in åtkomsträttigheter för varje lagkamrat i detta projekt.\n',NULL,'2017-02-28 11:43:54','text',2,NULL,'Christian Alfredsson'),(968863,10,'HelpAnswerPrivateProjectTeam','bg','{1}Частният проект{2} е начин да ограничите достъпа до вашия проект, така че само членовете на вашия екип да имат достъп до него.',NULL,'2017-05-05 22:31:36','text',2,NULL,'Georgi Iliev'),(969416,10,'HelpAnswerPrivateProjectTeam','cs','{1}Soukromý projekt{2} je způsob, jak omezit přístup k vašemu projektu tak, že jen členové vašeho týmu k němu budou mít přístup.',NULL,'2017-05-06 08:29:04','text',2,NULL,'Jiří Cigánek'),(953610,10,'HelpAnswerPrivateProjectTeam','eu-ES','{1}Proiektu Pribatua{2} zure proiektua babesteko modu bat da, horrela zure taldekideak baino ezin izango dira sartu.',NULL,'2017-02-27 11:45:13','text',2,NULL,'Jose Sanchez'),(455664,10,'HelpAnswerPrivateProjectTeam','Neutral','The {1}Private Project{2} is a way to restrict the access to your project so that only your team members could access it.','','2016-09-19 10:38:57','text',2,NULL,'Console'),(964661,10,'HelpAnswerPrivateProjectTeam','sk','{1}Súkromný projekt{2} je spôsob, ako obmedziť prístup k vášmu projektu tak, že len členovia vášho tímu k nemu budú mať prístup.',NULL,'2017-04-22 21:25:32','text',2,NULL,'Jan Kuna'),(953950,10,'HelpAnswerPrivateProjectTeam','sv','Det {1}private projektet{2} är ett sätt att spärra tillgång till projektet så bara din projektgrupp kan komma åt det.',NULL,'2017-02-28 11:43:37','text',2,NULL,'Christian Alfredsson'),(968866,10,'HelpAnswerProjectMilestone','bg','Ключовият етап се използва за създаване на етап, който смятате за по-важен от другите.{0} Всички ключови етапи са маркирани с червената икона на клавиша, поставен близо до заглавието.',NULL,'2017-05-05 22:34:15','text',2,NULL,'Georgi Iliev'),(963735,10,'HelpAnswerProjectMilestone','cs','Klíčový milní bývá použit pro vytvoření milníku, který považujete za důležitější než ostatní.{0} Všechny klíčové milníky jsou označeny ikonkou červeného klíče umístěného blízko jeho názvu.',NULL,'2017-04-21 12:27:09','text',2,NULL,'Jan Kuna'),(455665,10,'HelpAnswerProjectMilestone','Neutral','The Key milestone is used to create a milestone that you consider to be more important than others.{0} All the key milestones are marked by the red key icon placed near its title.','','2016-09-19 10:38:57','text',2,NULL,'Console'),(964664,10,'HelpAnswerProjectMilestone','sk','Kľúčový míľnik sa používa na vytvorenie míľnika, ktorý považujete za dôležitejší ako ostatné.{0}Všetky kľúčové míľniky sú označené červenou ikonkou kľúča, umiestnenou vedľa jeho názvu.',NULL,'2017-04-22 21:26:25','text',2,NULL,'Jan Kuna'),(953953,10,'HelpAnswerProjectMilestone','sv','Nyckeln milstolpe används för att skapa en milstolpe som du anser vara viktigare än andra. {0} Alla viktiga milstolpar är markerade med den röda knappen ikon placerad nära dess titel.\n',NULL,'2017-02-28 11:44:15','text',2,NULL,'Christian Alfredsson'),(968872,10,'HelpAnswerProjectStatus','bg','Можете да превключвате между три състояния на проекта:{0}{1} Активен.{2} Всички създадени проекти, които понастоящем работите, са означени като активни, докато не решите да ги поставите на пауза или да ги завършите.{0}{1} .{2} Ако решите временно да прекратите работата по проекта, променете състоянието му на Спрян. За да възобновите проекта, направете го Активен.{0}{1} Затворено.{2} Когато работата по проекта приключи и всички задачи са затворени, завършете проекта си, като промените състоянието му в Затворен. За по-нататъшна работа ще трябва да го активирате отново.',NULL,'2017-05-05 22:41:38','text',2,NULL,'Georgi Iliev'),(969428,10,'HelpAnswerProjectStatus','cs','Můžete přepínat mezi třemi stavy projektu:{0}{1}Aktivní.{2} Všechny vytvořené projekty, na kterých v současné době pracujete jsou označeny jako aktivní, než se rozhodnete pro jejich pozastavení nebo uzavření.{0}{1}Pozastavený.{2} Pokud se rozhodnete dočasně pozastavit práci na svém projektu, změňte jeho stav na Pozastavený. Pokud chcete obnovit projekt, jednoduše ho aktivujte nastavením odpovídajícího stavu.{0}{1}Uzavřený.{2} Když je práce na projektu ukončená a všechny úlohy jsou uzavřeny, ukončíte projekt změnou jeho ​​stavu na Uzavřený. Pro další práci ho bude zapotřebí znovu aktivovat.',NULL,'2017-05-06 08:38:23','text',2,NULL,'Jiří Cigánek'),(946283,10,'HelpAnswerProjectStatus','fi','Voit asettaa projektin kolmeen eri tilaan:{0}{1}Aktiivinen.{2} Kaikki uudet projektin merkitään aktiivisiksi kunnes ne merkitään valmiiksi tai keskeytetään.{0}{1}Keskeytetty.{2} Jos haluat keskeyttää projektin tilapäisesti, aseta se tilaan Keskeytetty.{0}{1}Valmis.{2} Kun projektisi työt on tehty ja kaikki sen tehtävät suljettu, merkitse projekti valmiiksi. Valmiin projektin voi avata uudelleen merkitsemällä se aktiiviseksi.',NULL,'2017-01-16 07:01:55','text',2,NULL,'Arto Ryynanen'),(455666,10,'HelpAnswerProjectStatus','Neutral','You can switch between three project status:{0}{1}Active.{2} All the created projects you are currently working on are marked as active until you do not decide to pause or complete them.{0}{1}Paused.{2} If you decide to temporarily suspend the work on your project, change its status to Paused. To resume the project just make it active setting the corresponding status.{0}{1}Closed.{2} When the work on the project is done and all the tasks are closed, complete your project changing its status to Closed. For further work you will need to reactivate it.','','2016-09-19 10:38:57','text',2,NULL,'Console'),(964689,10,'HelpAnswerProjectStatus','sk','Môžete prepínať medzi troma stavmi projektu:{0}{1}Aktívny.{2} Všetky vytvorené projekty, na ktorých v súčasnej dobe pracujete sú označené ako aktívne, až kým sa nerozhodnete pre ich pozastavenie alebo uzatvorenie.{0}{1}Pozastavený.{2} Ak sa rozhodnete dočasne pozastaviť prácu na svojom projekte, zmeňte jeho stav na Pozastavený. Ak chcete obnoviť projekt, jednoducho ho aktivujte nastavením zodpovedajúceho stavu.{0}{1}Uzatvorený.{2} Keď je práca na projekte ukončená a všetky úlohy sú uzavreté, ukončite projekt zmenou jeho ​​stavu na Uzatvorený. Pre ďalšiu prácu ho bude potrebné znovu aktivovať.',NULL,'2017-04-22 21:33:17','text',2,NULL,'Jan Kuna'),(953972,10,'HelpAnswerProjectStatus','sv','Du kan växla mellan tre projektstatus. {0} {1} Aktiv {2} Alla skapade projekt som du för tillfället arbetar med är markerade som aktiv tills du inte bestämmer dig för att pausa eller komplettera dem {0} {1} Paus. . {2} Om du väljer att tillfälligt avbryta arbetet med projektet, ändra dess status till Pausad. För att återuppta projektet bara göra det aktivt ställa in motsvarande status. {0} {1} Stängd. {2} När arbetet med projektet är klar och alla uppgifter är stängda, slutföra projektet ändra sin status till stängd. För det fortsatta arbetet måste du aktivera den.\n',NULL,'2017-02-28 11:48:35','text',2,NULL,'Christian Alfredsson'),(968874,10,'HelpAnswerProjectTeam','bg','За да добавите членове към екипа си, сега кликнете върху връзката {1}Управление на екипа{2} и изберете потребителите, които искате да добавите от списъка. {0}Също така можете да добавите/премахнете членове, които да преминат към {1}екипа{2} на страницата {1}Преглед{2} на проекта и кликнете върху бутона {1}Управление на екипа{2}.',NULL,'2017-05-05 22:47:43','text',2,NULL,'Georgi Iliev'),(969424,10,'HelpAnswerProjectTeam','cs','Pokud chcete přidat členy do svého týmu, klikněte na odkaz {1}Správa týmu{2} a vyberte ze seznamu uživatelů, které chcete přidat.{0} Můžete také přidat/odebrat členy týmu později, přepnutím na záložku {1}Tým{​​2} na vašem projektovém {1}přehledu{2} a kliknutím na tlačítko {1}Správa týmu{2}.',NULL,'2017-05-06 08:34:49','text',2,NULL,'Jiří Cigánek'),(455667,10,'HelpAnswerProjectTeam','Neutral','To add members to your team right now click the {1}Manage Team{2} link and select the users you wish to add from the list.{0} You can also add/remove teammates later switching to the {1}Team{2} tab on your project {1}Overview{2} page and clicking the {1}Manage Team{2} button.','','2016-09-19 10:38:57','text',2,NULL,'Console'),(964672,10,'HelpAnswerProjectTeam','sk','Ak chcete pridať členov do svojho tímu, kliknite na odkaz {1}Správa tímu{2} a vyberte zo zoznamu používateľov, ktorých chcete pridať.{0} Môžete tiež pridať/odobrať členov tímu neskôr, prepnutím na záložku {1}Tím{​​2} na vašom projektovom {1}prehľade{2} a kliknutím na tlačidlo {1}Správa tímu{2}.',NULL,'2017-04-22 21:30:22','text',2,NULL,'Jan Kuna'),(953962,10,'HelpAnswerProjectTeam','sv','Att lägga till medlemmar i ditt team just nu klicka på {1} Hantera Team {2} länken och välj de användare du vill lägga till i listan. {0} Du kan även lägga till / ta bort lagkamrater senare byta till {1} ​​Team { 2} fliken på ditt projekt {1} Översikt {2} sidan och klicka på knappen {1} Hantera team {2}.\n',NULL,'2017-02-28 11:46:35','text',2,NULL,'Christian Alfredsson'),(968816,10,'HelpAnswerRestrictAccessTeam','bg','По подразбиране всеки член на екипа по проекта може да преглежда цялото съдържание в избрания проект: основни етапи, задачи, документи и дискусии. За да ограничите достъпа, просто изберете члена на екипа, на когото искате да зададете права за достъп и кликнете върху една от връзките вдясно. По същия начин можете да зададете правата за достъп за всеки член на екипа на проекта си, освен ако няма права на администратор на портала. Администраторът ONLYOFFICE ™ има пълен достъп до цялото съдържание във всички проекти.',NULL,'2017-05-05 22:15:01','text',2,NULL,'Georgi Iliev'),(963733,10,'HelpAnswerRestrictAccessTeam','cs','Ve výchozím nastavení může každý člen projektu zobrazit celý obsah vybraného projektu: milníky, úkoly, dokumenty, diskuzi. Chcete-li omezit přístup, vyberte spolupracovníka a nastavte přístupová práva kliknutím na jeden z odkazů vpravo. Stejnou cestou můžete nastavit přístupová práva pro každého člena vašeho projektu pokud on/ona již nemá administrátorská práva na portál. \nThe ONLYOFFICE™ administrator má úplný přístup k veškerému obsahů všech projektů.',NULL,'2017-04-21 12:21:57','text',2,NULL,'Jan Kuna'),(953418,10,'HelpAnswerRestrictAccessTeam','eu-ES','Lehenespen gisa, proiektuko partaide bakoitzak hautatutako proiektuko eduki guztia ikusi ahal izango du: mugarriak, atazak, dokumentuak eta eztabaidak. Sarbidea mugatzeko, taldekide bat aukeratu eta eskuineko esteketan klik egin besterik ez duzu egin behar. Era berean sarbide baimenak berrezarri ahal dituzu  proiektuko kide bakoitzean, horietako bat atari kudeatzailea izan ezean. ONLYOFFICE-n kudeatzaileak proiektu guztietan eduki guztira sartu ahal da.',NULL,'2017-02-23 08:04:21','text',2,NULL,'Jose Sanchez'),(455668,10,'HelpAnswerRestrictAccessTeam','Neutral','By default, each project team member can view all content inside the selected project: milestones, tasks, documents and discussions. To restrict the access just select the teammate you wish to set access rights for and click one of the links to the right. The same way you can set the access rights for each member of your project team unless he/she does not have portal administrator privileges. The ONLYOFFICE™ administrator has full access to all content across all projects.','','2016-09-19 10:38:57','text',2,NULL,'Console'),(964566,10,'HelpAnswerRestrictAccessTeam','sk','V predvolenom nastavení, každý člen projektového tímu môže vidieť všetok obsah vo vnútri vybraného projektu: míľniky, úlohy, dokumenty a diskusie. Ak chcete obmedziť prístup, vyberte člena tímu ktorému chcete nastaviť prístupové práva a kliknite na jeden z odkazov vpravo. Rovnakým spôsobom môžete nastaviť prístupové práva pre každého člena projektového tímu, ak nemá oprávnenia správcu portálu. ONLYOFFICE™ správca má plný prístup k celému obsahu vo všetkých projektoch.',NULL,'2017-04-22 20:59:52','text',2,NULL,'Jan Kuna'),(953911,10,'HelpAnswerRestrictAccessTeam','sv','Som standard kan varje projekt teammedlem se allt innehåll i det valda projektet: milstolpar, uppgifter, dokument och diskussioner. Att begränsa tillgången välj bara lagkamrat du vill ställa in åtkomsträttigheter för och klicka på någon av länkarna till höger. På samma sätt kan du ställa in åtkomsträttigheter för varje medlem i din projektgrupp om han / hon inte har portaladministratörsbehörighet. Den ONLYOFFICE ™ Administratören har full tillgång till allt innehåll i alla projekt.\n',NULL,'2017-02-28 11:36:49','text',2,NULL,'Christian Alfredsson'),(968883,10,'HelpQuestionFollowProject','bg','Какво означава следване на този проект?',NULL,'2017-05-05 22:52:16','text',2,NULL,'Georgi Iliev'),(969426,10,'HelpQuestionFollowProject'