ReportLateMilestones_Description','cs','{0}{2}Report milníků po termínu zobrazí seznam milníků po termínu splnění.{3}{2}Chcete-li zobrazit tyto milníky ve všech projektech, klikněte nyní na tlačítko Vytvořit report.{3}{2}Chcete-li zobrazit tyto milníky pouze pro určitý projekt, vyberte nejdříve požadovaný projekt z rozevíracího seznamu, a pak klikněte na Generovat report.{3}{1}',NULL,'2017-04-21 13:26:52','text',2,NULL,'Jan Kuna'),(456047,13,'ReportLateMilestones_Description','Neutral','{0}{2}The Overdue Milestones report will display a list of overdue milestones.{3}{2}To view the overdue milestones across all projects, click on Generate Report right away.{3}{2}To view the overdue milestones for a given project only, select the desired project from the drop-down list, and then click on Generate Report.{3}{1}','','2016-09-19 10:39:07','text',2,NULL,'Console'),(964251,13,'ReportLateMilestones_Description','sk','{0}{2}Report míľnikov po termíne zobrazí zoznam míľnikov po termíne splnenia.{3}{2}Ak chcete zobraziť míľniky po termíne vo všetkých projektoch, kliknite na tlačítko Vytvoriť report.{3}{2}Ak chcete zobraziť míľniky po termíne len pre určitý projekt vyberte najprv požadovaný projekt z rozbaľovacieho zoznamu v sekcii Filter, a potom kliknite na Generovať report.{3}{1}',NULL,'2017-04-21 17:40:31','text',2,NULL,'Jan Kuna'),(965588,13,'ReportLateMilestones_Description','sv','Förseningar',NULL,'2017-04-27 09:28:57','text',2,NULL,'Mattias Norgren'),(946306,13,'ReportLateMilestones_Title','fi','Myöhästyneet välitavoitteet',NULL,'2017-01-16 07:16:46','text',2,NULL,'Arto Ryynanen'),(456048,13,'ReportLateMilestones_Title','Neutral','Overdue Milestones','','2016-09-19 10:39:07','text',2,NULL,'Console'),(954051,13,'ReportLateMilestones_Title','sv','Milstolpar som är försenade',NULL,'2017-02-28 11:53:51','text',2,NULL,'Christian Alfredsson'),(970306,13,'ReportLateTasks_Description','cs','{0}{2}Report zpožděných úkolů zobrazí seznam úkolů po termínu splnění.{3}{2}Chcete-li zo