.',NULL,'2017-04-21 10:44:39','text',2,NULL,'Jan Kuna'),(959835,19,'ChangeOwnerDescription','de','Sobald die Änderungen angewandt werden, erhält der aktuelle Ordnerbesitzer die Zugriffsberechtigungen entsprechend den Zugriffseinstellungen der Gruppe, der er gehört oder Zugriffsberechtigungen gemäß den Standardordnerberechtigungen.',NULL,'2017-03-23 10:38:32','text',2,NULL,'Evgenia'),(962232,19,'ChangeOwnerDescription','es','Cuando los cambios sean aplicados, el propietario actual del archivo /la carpeta obtendrá derechos según los derechos de acceso de tal grupo, en el cual él participa, o según los derechos predeterminados, ajustados para esta carpeta.',NULL,'2017-04-03 13:38:09','text',2,NULL,'Ekaterina.Heidel'),(937631,19,'ChangeOwnerDescription','fi','Siinä vaiheessa kun muutokset ovat tehty, niin nykyinen kansion omistaja saa käyttöoikeudet ryhmän käyttöoikeuksien asetusten mukaan, mihin hän kuuluu, tai kansion vastaavien oletusarvojen mukaan.',NULL,'2017-03-06 13:18:46','text',3,NULL,'Arto Ryynanen'),(961584,19,'ChangeOwnerDescription','fr','Une fois les modifications appliquées, le propriétaire actuel du fichier/dossier obtiendra les droits d’accès selon les paramètres d’accès du groupe auquel il appartient ou selon les autorisations du dossier par défaut.',NULL,'2017-03-30 08:51:45','text',2,NULL,'Nadine Yablonskaya'),(956326,19,'ChangeOwnerDescription','Neutral','Once the changes are applied, the current file/folder owner gets access rights according to the access settings of the group he/she belongs to or according to the default folder permissions.','','2017-03-07 08:30:02','text',2,NULL,'Svetlana'),(960166,19,'ChangeOwnerDescription','nl','Als de wijzigingen eenmaal zijn doorgevoerd',NULL,'2017-03-23 14:29:26','text',2,NULL,'Hsing-Foo Wang'),(956327,19,'ChangeOwnerDescription','ru','Как только изменения будут применены, текущий владелец файла/папки получит права доступа, соответствующие правам доступа той группы, к которой он принадлежит, или соответству