ya'),(456640,19,'EmptyScreenDescrCorporate','Neutral','The \'Common Documents\' section shows all the documents shared by portal administrator for common access. Only portal administrator can create folders in this section, but with the access granted the portal users can also upload their files here.','','2016-09-19 10:39:22','text',2,NULL,'Console'),(958433,19,'EmptyScreenDescrCorporate','sv','Det \'Gemensamma Dokument\' avsnittet visar alla dokument som delas av portaladministratören för gemensam tillgång. Endast portaladministratören kan skapa mappar i det här avsnittet, men med tillgång beviljat kan portalanvändare också ladda upp sina filer här.',NULL,'2017-03-21 08:54:35','text',2,NULL,'Emma Tellström'),(963516,19,'EmptyScreenDescrDragDrop','cs','Přetáhněte soubory Vašeho počítače sem a nahrajte je na Váš portál ještě snadněji.',NULL,'2017-04-21 09:55:48','text',2,NULL,'Jan Kuna'),(948723,19,'EmptyScreenDescrDragDrop','es','Arrastre y suelte los archivos desde su ordenador para subirlos a su portal con más facilidad.',NULL,'2017-01-25 09:02:46','text',2,NULL,'Ekaterina.Heidel'),(952524,19,'EmptyScreenDescrDragDrop','eu-ES','Arrastra eta jaregin fitxategiak zure ordenagailutik errezago igotzeko atarira.',NULL,'2017-02-20 13:50:51','text',2,NULL,'Jose Sanchez'),(936486,19,'EmptyScreenDescrDragDrop','hr','Ovdje privucite i spustite datoteke sa vašeg računala kako bi ih lakše prenjeli na portal.',NULL,'2016-12-22 18:57:11','text',2,NULL,'Petar Lacić'),(456641,19,'EmptyScreenDescrDragDrop','Neutral','Drag-and-drop the files from your computer here to upload them to your portal even more easily.','','2016-09-19 10:39:22','text',2,NULL,'Console'),(958272,19,'EmptyScreenDescrDragDrop','sv','Dra-och-släpp filer från datorn för att ladda upp dem till portalen ännu lättare.',NULL,'2017-03-21 08:06:57','text',2,NULL,'Emma Tellström'),(963665,19,'EmptyScreenDescrForme','cs','Sekce \"Sdíleno mnou\" je používána pro zobrazení souborů, ke kterým Vám dali přístup Vaši přátelé nebo kolegové. Pokud jste neotevřeli poslední verzi dokumentu, je pak tento dokument označen jako \"nový\". Kliknutím na příslušné tlačítko můžete odstranit soubory.',NULL,'2017-04-21 11:16:50','text',2,NULL,'Jan Kuna'),(456642,19,'EmptyScreenDescrForme','Neutral','The \'Shared with Me\' section is used to show the files which your friends or colleagues gave you access to. In case you haven\'t seen the latest changes in the documents they are marked \'new\'. You can remove the files from the list clicking the appropriate button.','','2016-09-19 10:39:22','text',2,NULL,'Console'),(958464,19,'EmptyScreenDescrForme','sv','Avsnittet \'Delade med mig\' används för att visa de filer som dina vänner eller kollegor gav dig tillgång till. Om du inte har sett de senaste ändringarna är de märkta \"nya\". Du kan ta bort filer från listan genom att klicka på motsvarande knapp.',NULL,'2017-03-21 09:05:45','text',2,NULL,'Emma Tellström'),(963656,19,'EmptyScreenDescrMy','cs','Dokumenty a snímky, které vy {0} vytvoříte {1} nebo {2} nahrajete{3} na portál, zůstávají v sekci \"Moje Dokumenty\". Můžete je {4}otevřít{5} a {6}editovat{7} pomocí ONLYOFFICE™ editoru, sdílet je se svými přáteli a kolegy nebo rozdělit do dalších složek.',NULL,'2017-04-21 11:04:17','text',2,NULL,'Jan Kuna'),(946316,19,'EmptyScreenDescrMy','fi','Asiakirjat ja kuvat jotka {0}luot{1} tai {2}lisäät{3} sivustolle säilytetään Omat asiakirjat kansiossa. Voit {4}avata{5}, {6}muokata{7} ja jakaa niitä muiden käyttäjien kanssa sekä järjestellä niitä kansioihin.\n\nYhteiset ja sinulle jaetut asiakirjat löydät tämän ikkunan vasemmassa ylälaidassa olevasta alasvetovalikosta.\n',NULL,'2017-01-16 07:21:53','text',2,NULL,'Arto Ryynanen'),(456643,19,'EmptyScreenDescrMy','Neutral','The documents and image files you {0}create{1} or {2}upload{3} to the portal are kept here in \'My Documents\' section. You can {4}open{5} and {6}edit{7} them using the ONLYOFFICE™ portal editor, share them with friends or colleagues, organize into folders.','','2016-09-19 10:39:22','text',2,NULL,'Console'),(958446,19,'EmptyScreenDescrMy','sv','De dokument och bildfiler som du {0} skapar{1} eller {2}laddar upp{3} till portalen hålls här i avsnittet \"Mina dokument\". Du kan {4}öppna{5} och {6}redigera{7} dem med ONLYOFFICE™ portalen redigerare, dela dem med vänner eller kollegor, organisera i mappar.',NULL,'2017-03-21 08:59:32','text',2,NULL,'Emma Tellström'),(963657,19,'EmptyScreenDescrMyPoor','cs','Dokumenty a snímky, které vy {2} nahrajete{3} na portál, zůstávají v sekci \"Moje Dokumenty\". Můžete je sdílet se svými přáteli a kolegy nebo je roztřídit do složek.',NULL,'2017-04-21 11:05:40','text',2,NULL,'Jan Kuna'),(456644,19,'EmptyScreenDescrMyPoor','Neutral','The documents and image files you {2}upload{3} to the portal are kept here in \'My Documents\' section. You can share them with friends or colleagues, organize into folders.','','2016-09-19 10:39:22','text',2,NULL,'Console'),(759486,19,'EmptyScreenDescrMyPoor','nl','De documenten en afbeeldingen die u {2}upload{3} naar de portal zijn opgeslagen in \'Mijn Documenten\' sectie. U kunt deze delen met vrienden of collega\'s en beheren in mappen.',NULL,'2016-08-23 09:58:11','text',2,NULL,'Console'),(958448,19,'EmptyScreenDescrMyPoor','sv','De dokument och bildfiler som du {2}laddar upp{3} till portalen hålls här i avsnittet \"Mina dokument\". Du kan dela dem med vänner eller kollegor, organisera i mappar.',NULL,'2017-03-21 09:00:49','text',2,NULL,'Emma Tellström'),(936979,19,'EmptyScreenDescrMyPoor','tr','{2} tarafından portala {3} yüklenen dokümanlar ve resim dosyaları burada \'Belgelerim\' bölümünde saklanır. Onları arkadaşlarınız veya iş arkadaşlarınızla paylaşabilir, klasörler halinde organize edebilirsiniz.',NULL,'2016-12-25 16:09:49','text',2,NULL,'Vedat Nommaz'),(963658,19,'EmptyScreenDescrProject','cs','Dokumenty a snímky, které vytvoříte nebo nahrajete pro Váš projekt, jsou uloženy v této sekci. Můžete je otevřít a editovat pomocí ONLYOFFICE™ editoru nebo je roztřídit do složek.',NULL,'2017-04-21 11:06:52','text',2,NULL,'Jan Kuna'),(456645,19,'EmptyScreenDescrProject','Neutral','The documents and image files you create or upload for your project are kept in this section. You can open and edit them using the ONLYOFFICE™ portal editor, organize into folders.','','2016-09-19 10:39:22','text',2,NULL,'Console'),(958449,19,'EmptyScreenDescrProject','sv','De dokument och bildfiler som du skapar eller överför för projektet hålls i detta avsnitt. Du kan öppna och redigera dem med hjälp av ONLYOFFICE™ portalen redigerare, organisera i mappar.',NULL,'2017-03-21 09:01:30','text',2,NULL,'Emma Tellström'),(963664,19,'EmptyScreenDescrTrash','cs','Sekce Koš je místo, kam jsou všechny smazané soubory přemístěny. Můžete je obnovit v případě, že byly smazány nedopatřením nebo je odstraňte trvale. Prosím berte v úvahu, že pokud vymažete Vaše soubory z Koše, již je nemůžete znovu obnovit. ',NULL,'2017-04-21 11:14:10','text',2,NULL,'Jan Kuna'),(456646,19,'EmptyScreenDescrTrash','Neutral','The \'Recycle Bin\' section is where all the deleted files are moved. You can either restore them in case they are deleted by mistake or delete them permanently. Please note, that when you delete the files from the \'Recycle Bin\' they cannot be restored any longer.','','2016-09-19 10:39:22','text',2,NULL,'Console'),(958459,19,'EmptyScreenDescrTrash','sv','\"Papperskorgen \" är där alla borttagna filer flyttas. Du kan antingen återskapa dem om de tas bort av misstag eller ta bort dem permanent. Observera att när du tar bort filerna från \"Papperskorgen \" kan de inte återställas längre.',NULL,'2017-03-21 09:04:25','text',2,NULL,'Emma Tellström'),(963577,19,'EmptyScreenFilter','cs','V této části nelze zobrazit žádné soubory, které odpovídají Vašemu filtru.',NULL,'2017-04-21 10:40:46','text',2,NULL,'Jan Kuna'),(948774,19,'EmptyScreenFilter','es','Aquí no hay archivos para mostrar que coinciden con este filtro',NULL,'2017-01-25 09:18:55','text',2,N