DocumentTitle\":\"$DocumentURL\".\n\n^Přijali jste tento e-mail, protože jste registrovaným uživatel  \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portálu.^',NULL,'2017-04-21 11:48:00','text',2,NULL,'Jan Kuna'),(950231,20,'pattern_DocuSignComplete','de','h1. Alle Unterzeichner haben den Signiervorgang erfolgreich abgeschlossen $DocumentTitle\n\nDurch diese E-Mail-Benachrichtigung werden Sie darüber informiert, dass alle Unterzeichner den Signiervorgang abgeschlossen haben. \"$DocumentTitle\":\"$DocumentURL\".\n\n^Sie erhalten diese E-Mail, weil Sie ein registrierter Benutzer/in von \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" Portal sind.^',NULL,'2017-02-01 07:19:54','text',2,NULL,'Evgenia'),(949021,20,'pattern_DocuSignComplete','es','h1. Trabajo con el documento ha sido finalizado $DocumentTitle\n\nTodas las personas han firmado el documento \"$DocumentTitle\":\"$DocumentURL\".\n\n^Usted ha recibido este mensaje como un usuario registrado en el portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".^',NULL,'2017-01-25 12:56:19','text',2,NULL,'Ekaterina.Heidel'),(937195,20,'pattern_DocuSignComplete','fi','h1. Kaikki allekirjoittajat viimeistelivät: $DocumentTitle\n\nTämä on tiedonanto, jossa ilmoitamme että kaikki allekirjoittajat viimeistelivät: \"$DocumentTitle\":\"$DocumentURL\".\n\n^Saat tämän sähköpostin koska olet rekisteröity käyttäjä: \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portaaliin.^',NULL,'2017-01-07 14:06:57','text',2,NULL,'Arto Ryynanen'),(933915,20,'pattern_DocuSignComplete','fr','h1. Tous les signataires ont signé $DocumentTitle\n\nCe courriel est pour vous informer que tous les signataires ont signé \"$DocumentTitle\":\"$DocumentURL\".\n\n^Vous avez reçu ce courriel parce que vous êtes un utilisateur enregistré sur le portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" .^',NULL,'2016-11-08 12:43:56','text',2,NULL,'Nadine Yablonskaya'),(933909,20,'pattern_DocuSignComplete','Neutral','h1. All signers completed $DocumentTitle\n\nThis is an email notification to inform you that all signers completed \"$DocumentTitle\":\"$DocumentURL\".\n\n^You receive this email because you are a registered user of the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal.^','','2016-11-15 14:52:57','text',2,NULL,'Svetlana'),(960213,20,'pattern_DocuSignComplete','nl','h1. Alle ondertekenaars hebben ondertekend',NULL,'2017-03-23 14:47:54','text',2,NULL,'Hsing-Foo Wang'),(933912,20,'pattern_DocuSignComplete','ru','h1. Работа с документом завершена $DocumentTitle\n\nВсе стороны подписали конверт \"$DocumentTitle\":\"$DocumentURL\".\n\n^Вы получили это сообщение, так как зарегистрированы на портале \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".^',NULL,'2016-11-08 12:40:24','text',2,NULL,'Svetlana'),(965294,20,'pattern_DocuSignComplete','sk','h1. Všetci signatári vyplnili $DocumentTitle\n\nToto je e-mailové upozornenie, ktoré vás informuje, že všetci signatári vyplnili \"$DocumentTitle\":\"$DocumentURL\".\n\n^Tento email ste dostali, pretože ste registrovaným používateľom \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portálu.^',NULL,'2017-04-25 10:30:34','text',2,NULL,'Jan Kuna'),(958744,20,'pattern_DocuSignComplete','sv','h1. Alla tecknare färdigställde $DocumentTitle\n\nDetta är en epostavisering för att informera dig att alla tecknare färdigställde \"$DocumentTitle\":\"$DocumentURL\".\n\n^Du får detta mejl för att du är en registrerad användare av \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portalen.^',NULL,'2017-03-21 10:04:37','text',2,NULL,'Emma Tellström'),(963698,20,'pattern_DocuSignStatus','cs','h1.$Message: $DocumentTitle\n\nPřihlaste se do Vašeho DocuSign účtu pro více informací.\n\n^Obdrželi jste tento e-mail, protože jste zaregistrovaný uživatel \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portálu.^',NULL,'2017-04-21 11:40:37','text',2,NULL,'Jan Kuna'),(949961,20,'pattern_DocuSignStatus','de','h1. $Message: $DocumentTitle\n\nFür weitere Informationen melden Sie sich bei Ihrem DocuSign Konto an.\n\n^Sie erhalten diese E-Mail, da Sie registrierter Benutzer/in\"${__VirtualRootPath}\":\"${__VirtualRootPath}\" des Portals sind.^',NULL,'2017-01-30 08:23:06','text',2,NULL,'Evgenia'),(949020,20,'pattern_DocuSignStatus','es','h1. $Message: $DocumentTitle\n\nPara recibir una información adicional entre en su cuenta de DocuSign.\n\n^Usted ha recibido este mensaje como un usuario registrado en el portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".^',NULL,'2017-01-25 12:56:08','text',2,NULL,'Ekaterina.Heidel'),(937194,20,'pattern_DocuSignStatus','fi','h1. $Message: $DocumentTitle\n\nKirjaudu sisään DocuSign tilillesi lisätietoa varten.\n\n^Saat tämän sähköpostin koska olet rekisteröity käyttäjä: \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portaaliin.^',NULL,'2017-01-07 14:05:09','text',2,NULL,'Arto Ryynanen'),(933908,20,'pattern_DocuSignStatus','fr','h1. $Message: $DocumentTitle\n\nPour en savoir plus, connectez-vous à votre compte.\n\n^Vous avez reçu cet e-mail parce que vous êtes un utilisateur enregistré sur le portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal.^',NULL,'2016-11-08 12:04:14','text',2,NULL,'Nadine Yablonskaya'),(933743,20,'pattern_DocuSignStatus','Neutral','h1. $Message: $DocumentTitle\n\nSign in to your DocuSign account for more information.\n\n^You receive this email because you are a registered user of the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal.^','','2016-11-08 12:00:14','text',2,NULL,'Console'),(960212,20,'pattern_DocuSignStatus','nl','h1. $Message',NULL,'2017-03-23 14:47:25','text',2,NULL,'Hsing-Foo Wang'),(933869,20,'pattern_DocuSignStatus','ru','h1. $Message: $DocumentTitle\n\nДля получения дополнительной информации зайдите в свой аккаунт DocuSign.\n\n^Вы получили это сообщение, так как зарегистрированы на портале \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".^',NULL,'2016-11-07 16:21:53','text',2,NULL,'Svetlana'),(965296,20,'pattern_DocuSignStatus','sk','h1. $Message: $DocumentTitle\n\nAk chcete získať ďalšie informácie, prihláste sa do svojho účtu DocuSign.\n\n^Tento email ste dostali, pretože ste registrovaným používateľom \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portálu.^',NULL,'2017-04-25 10:31:03','text',2,NULL,'Jan Kuna'),(958730,20,'pattern_DocuSignStatus','sv','h1. $Message: $DocumentTitle\n\nLogga in på ditt DocuSign konto för mer information.\n\n^Du får detta mejl för att du är en registrerad användare av \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portalen.^',NULL,'2017-03-21 09:57:53','text',2,NULL,'Emma Tellström'),(963699,20,'pattern_LinkToEmail','cs','h1. Access granted to document: \"$DocumentTitle\":\"$DocumentURL\"\n\n$__DateTime $__AuthorName (\"$UserEmail\":\"mailto:$UserEmail\")Vám dal přístup k \"$DocumentTitle\":\"$DocumentURL\" dokumentu s následujícími přístupovými právy: \"$AccessRights\".\n\n$Message\n',NULL,'2017-04-21 11:42:14','text',2,NULL,'Jan Kuna'),(949034,20,'pattern_LinkToEmail','es','h1. Acceso concedido al documento: \"$DocumentTitle\":\"$DocumentURL\"\n\n$__DateTime $__AuthorName (\"$UserEmail\":\"mailto:$UserEmail\") le ha concedido el acceso al documento \"$DocumentTitle\":\"$DocumentURL\" con los derechos de acceso: \"$AccessRights\". \n\n$Message ',NULL,'2017-01-25 13:04:02','text',2,NULL,'Ekaterina.Heidel'),(456746,20,'pattern_LinkToEmail','Neutral','h1. Access granted to document: \"$DocumentTitle\":\"$DocumentURL\"\r\n\r\n$__DateTime $__AuthorName (\"$UserEmail\":\"mailto:$UserEmail\") granted you the access to the \"$DocumentTitle\":\"$DocumentURL\" document with the following access rights: \"$AccessRights\".\r\n\r\n$Message','','2016-09-19 10:39:25','text',2,NULL,'Console'),(965292,20,'pattern_LinkToEmail','sk','h1.Prístup k dokumentu: \"$DocumentTitle\":\"$DocumentURL\" bol udelený\n\n\n$__DateTime $__AuthorName (\"$UserEmail\":\"mailto:$UserEmail\") Vám udelil prístup k dokumentu \"$DocumentTitle\":\"$DocumentURL\" s nasledujúcimi právami: \"$AccessRights\".\n\n$Message',NULL,'2017-04-25 10:30:18','text',2,NULL,'Jan Kuna'),(958737,20,'pattern_LinkToEmail','sv','h1. Åtkomst beviljad till dokument: \"$DocumentTitle\":\"$DocumentURL\"\n\n$__DateTime $__AuthorName (\"$UserEmail\":\"mailto:$UserEmail\") beviljade dig åtkomst till \"$DocumentTitle\":\"$DocumentURL\" dokumentet med dessa rättigheter: \"$AccessRights\".\n\n$Message',NULL,'2017-03-21 10:01:12','text',2,NULL,'Emma Tellström'),(970342,20,'pattern_MailMergeEnd','cs','h1. Odeslání emailů dokončeno\n\nToto je potvrzující email, který informuje o požadavku na odeslání $MailsCount zpráv a proces odesílání je nyní ukončen. $Message\n\nÚspěšně odeslané zprávy lze nalézt ve složce \"Odeslaná\":\"$__VirtualRootPath/addons/mail/#sent\" modulu Mail.\n\n^Dostal jste tento email, protože jste registrovaný uživatel portálu \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".^',NULL,'2017-05-10 20:43:05','text',2,NULL,'Jiří Dobruský'),(950230,20,'pattern_MailMergeEnd','de','h1. Mailing ist abgeschlossen\n\nEs ist eine Nachricht, um Sie zu benachrichtigen, dass der Mailing $MailsCount Nachrichten, der Sie beantragt haben, ist nun abgeschlossen.\n\nSie können den Status dieser Mail-Nachrichten in Ihrem \"Gesendet\":\"$__VirtualRootPath/addons/mail/#sent\" Ordner des Mail-Moduls überprüfen.\n\n^Sie erhalten diese Nachricht, weil Sie ein registrierter Benutzer von\"${__VirtualRootPath}\":\"${__VirtualRootPath}\" Portal sind.^',NULL,'2017-02-01 07:19:25','text',2,NULL,'Evgenia'),(949026,20,'pattern_MailMergeEnd','es','h1. Envío está completo\n\nEs un mensaje de correo electrónico para notificarle que el envío de mensajes de $MailsCount que usted ha solicitado ha finalizado.\n\nPuede comprobar el estado de estos mensajes de correo electrónico en su carpeta \"Enviado\":\"$__VirtualRootPath/addons/mail/# enviado\" del módulo Correo.\n\n^Usted ha recibido este mensaje como un usuario registrado en el \"${__VirtualRootPath}\":\".${__VirtualRootPath}\"portal.^',NULL,'2017-01-25 13:00:38','text',2,NULL,'Ekaterina.Heidel'),(944737,20,'pattern_MailMergeEnd','fi','h1. Sähköpostilähetys valmis\n\nTämä on sähköposti tiedonanto, jossa ilmoitamme että olet pyytänyt $MailsCount viestin lähetystä ja käsittely on nyt valmis. $Message\n\nVoit löytää onnistuneesti lähetetyt viestit \"Lähetetty\":\"$__VirtualRootPath/addons/mail/#sent\" kansiosta sähköposti moduulissa.\n\n^Saat tämän sähköpostin koska olet rekisteröity käyttäjä \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portaaliin.^',NULL,'2017-01-15 11:24:51','text',2,NULL,'Arto Ryynanen'),(933917,20,'pattern_MailMergeEnd','fr','h1. Diffusion terminée\n\nCe courriel est pour vous informer que la diffusion des messages $MailsCount que vous avez demandée est maintenant terminée.\n\nVous pouvez vérifier le statut de ces messages dans votre dossier \"Envoyés\":\"$__VirtualRootPath/addons/mail/#sent\" du module \"Mail\".\n\n^Vous recevez cet email car vous êtes un utilisateur enregistré du portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".^\n',NULL,'2016-11-08 13:01:45','text',2,NULL,'Nadine Yablonskaya'),(933910,20,'pattern_MailMergeEnd','Neutral','h1. Mailing completed\n\nThis is an email notification to inform you that you have requested the mailing of $MailsCount messages and the process is now complete. $Message\n\nThe successfully sent mail messages can be found in your \"Sent\":\"$__VirtualRootPath/addons/mail/#sent\" folder of the Mail module.\n\n^You receive this email because you are a registered user of the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal.^','','2016-11-15 14:52:57','text',2,NULL,'Svetlana'),(761733,20,'pattern_MailMergeEnd','nl','h1. Mailing voltooid\n\nDit is een mail bericht om u te informeren dat de mailing van $MailsCount berichten nu voltooid is.\n\nU kunt de status van deze berichten vinden in uw \"Verzonden\":\"$__VirtualRootPath/addons/mail/#sent\" map van de Mail module.\n\n^U ontvangt deze mail omdat u een geregistreerde gebruiker van de \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal bent.^',NULL,'2016-11-08 12:33:17','text',3,NULL,'Console'),(933914,20,'pattern_MailMergeEnd','ru','h1. Рассылка завершена\n\nЗавершена отправка $MailsCount сообщений, которую вы запросили.\n\nСтатус этих писем можно проверить в папке \"Отправленные\":\"$__VirtualRootPath/addons/mail/#sent\" модуля \"Почта\".\n\n^Вы получили это сообщение, так как зарегистрированы на портале \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".^',NULL,'2016-11-08 12:41:13','text',2,NULL,'Svetlana'),(965295,20,'pattern_MailMergeEnd','sk','h1. Odoslanie pošty je dokončené\n\nPožiadali ste o zasielanie správ v účte $MailsCount a toto e-mailové upozornenie Vás informuje o tom, že odosielanie je dokončené. $Message\n\nÚspešne odoslané e-mailové správy môžete nájsť v priečinku \"Odoslané\":\"$__VirtualRootPath/addons/mail/#sent\" v module MAIL.\n\n^Tento email ste dostali, pretože ste registrovaným používateľom \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portálu.^',NULL,'2017-04-25 10:30:47','text',2,NULL,'Jan Kuna'),(958746,20,'pattern_MailMergeEnd','sv','h1. Utskick färdigställt\n\nDetta är en epostavisering för att informera dig att du har begärt ett utskick av $MailsCount meddelanden och processen är nu färdig. $Message\n\nDet skickade meddelandet kan du se i din \"Sent\":\"$__VirtualRootPath/addons/mail/#sent\" mapp i Mejl modulen.\n\n^Du får detta mejl för att du är en registrerad användare av \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portalen.^',NULL,'2017-03-21 10:06:37','text',2,NULL,'Emma Tellström'),(970346,20,'pattern_ShareDocument','cs','h1. Umožněn přístup k dokumentu: \"$DocumentTitle\":\"$DocumentURL\"\n\n$__DateTime Uživatel \"$__AuthorName\":\"$__AuthorUrl\" vám přidal přístup k \"$DocumentTitle\":\"$DocumentURL\" s uživatelskými právy: \"$AccessRights\".\n\n$Message\n\n^Obdržel jste tento email, protože jste registrovaným uživatelem portálu \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Pokud nechcete dostávat upozornění na sdílené dokumenty, upravte \"nastavení odběru\":\"$RecipientSubscriptionConfigURL\".^',NULL,'2017-05-10 20:52:25','text',2,NULL,'Jiří Dobruský'),(949027,20,'pattern_ShareDocument','es','h1.Acceso concedido al documento: \"$DocumentTitle\":\"$DocumentURL\"\n\n$__DateTime \"$__AuthorName\":\"$__AuthorUrl\" le ha concedido el acceso al documento \"$DocumentTitle\":\"$DocumentURL\" con permisos de acceso: \"$AccessRights\".\n\n$Message\n\n^Usted ha recibido este mensaje como un usuario registrado en el portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Si no desea recibir notificaciones sobre los documentos compartidos con Usted, por favor, maneje sus \"ajustes de suscripción\":\"$RecipientSubscriptionConfigURL\".^',NULL,'2017-01-25 13:02:20','text',2,NULL,'Ekaterina.Heidel'),(456748,20,'pattern_ShareDocument','Neutral','h1. Access granted to document: \"$DocumentTitle\":\"$DocumentURL\"\r\n\r\n$__DateTime \"$__AuthorName\":\"$__AuthorUrl\" granted you the access to the \"$DocumentTitle\":\"$DocumentURL\" document with the following access rights: \"$AccessRights\". \r\n\r\n$Message \r\n\r\n^You receive this email because you are a registered user of the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal. If you do not want to receive the notifications about the shared documents, please manage your \"subscription settings\":\"$RecipientSubscriptionConfigURL\".^','','2016-09-19 10:39:25','text',2,NULL,'Console'),(965288,20,'pattern_ShareDocument','sk','h1.Prístup k dokumentu: \"$DocumentTitle\":\"$DocumentURL\" bol udelený\n\n$__DateTime \"$__AuthorName\":\"$__AuthorUrl\" Vám udelil prístup k dokumentu \"$DocumentTitle\":\"$DocumentURL\" s právami: \"$AccessRights\".\n\n$Message \n\n^Túto správu ste dostali, pretože ste registrovaným používateľom \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portálu.  Ak si neprajete prijímať oznámenia o dokumentoch s vami zdieľanými, zmeňte prosím svoje \"nastavenia odberu\":\"$RecipientSubscriptionConfigURL\".^',NULL,'2017-04-25 10:29:26','text',2,NULL,'Jan Kuna'),(958733,20,'pattern_ShareDocument','sv','h1. Åtkomst beviljad till dokument: \"$DocumentTitle\":\"$DocumentURL\"\n\n$__DateTime \"$__AuthorName\":\"$__AuthorUrl\" beviljade dig åtkomst till \"$DocumentTitle\":\"$DocumentURL\" dokumentet med dessa rättigheter: \"$AccessRights\". \n\n$Message \n\n^Du får detta mejl för att du är en registrerad användare av \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portalen. Om du inte vill få aviseringar om delade dokument, ändra dina prenumerationsinställningar:\"$RecipientSubscriptionConfigURL\".^',NULL,'2017-03-21 10:00:27','text',2,NULL,'Emma Tellström'),(970347,20,'pattern_ShareFolder','cs','\n\ns uživatelskými právy: \"$AccessRights\".\n\nAdresa vašeho portálu: \"$__VirtualRootPath\":\"$__VirtualRootPath\"\n\nh1. Umožněn přístup ke složce: \"$DocumentTitle\":\"$__VirtualRootPath/products/files/#$FolderID\"\n\n$__DateTime Uživatel \"$__AuthorName\":\"$__AuthorUrl\" vám přidal přístup ke složce \"$DocumentTitle\":\"$__VirtualRootPath/products/files/#$FolderID\" s uživatelskými právy: \"$AccessRights\".\n\n$Message\n\n^Obdržel jste tento email, protože jste registrovaným uživatelem portálu \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Pokud nechcete dostávat upozornění na sdílené složky, upravte \"nastavení odběru\":\"$RecipientSubscriptionConfigURL\".^',NULL,'2017-05-10 20:55:12','text',2,NULL,'Jiří Dobruský'),(949024,20,'pattern_ShareFolder','es','h1.Acceso concedido a la carpeta: \"$DocumentTitle\":\"$__VirtualRootPath/products/files/#$FolderID\"\n\n$__DateTime user \"$__AuthorName\":\"$__AuthorUrl\" le ha concedido el acceso a la carpeta \"$DocumentTitle\":\"$__VirtualRootPath/products/files/#$FolderID\" con permisos de acceso: \"$AccessRights\".\n\n$Message\n\n^Usted ha recibido este mensaje como un usuario registrado en el portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Si no desea recibir notificaciones sobre las carpetas compartidas con Usted, por favor, maneje sus \"ajustes de suscripción\":\"$RecipientSubscriptionConfigURL\".^\n\n',NULL,'2017-01-25 12:58:54','text',2,NULL,'Ekaterina.Heidel'),(456749,20,'pattern_ShareFolder','Neutral','h1. Access granted to folder: \"$DocumentTitle\":\"$__VirtualRootPath/products/files/#$FolderID\"\r\n\r\n$__DateTime \"$__AuthorName\":\"$__AuthorUrl\" granted you the access to the \"$DocumentTitle\":\"$__VirtualRootPath/products/files/#$FolderID\" folder with the following access rights: \"$AccessRights\". \r\n\r\n$Message \r\n\r\n^You receive this email because you are a registered user of the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal. If you do not want to receive the notifications about the shared folders, please manage your \"subscription settings\":\"$RecipientSubscriptionConfigURL\".^','','2016-09-19 10:39:25','text',2,NULL,'Console'),(965289,20,'pattern_ShareFolder','sk','h1.Prístup k priečinku \"$DocumentTitle\":\"$__VirtualRootPath/products/files/#$FolderID\" bol udelený.\n\n$__DateTime \"$__AuthorName\":\"$__AuthorUrl\" Vám povolil prístup k priečinku \"$DocumentTitle\":\"$__VirtualRootPath/products/files/#$FolderID\" s právami: \"$AccessRights\".\n\n$Message \n\n^Túto správu ste dostali, pretože ste registrovaným užívateľom \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portálu.  Ak si neprajete prijímať oznámenia o dokumentoch s vami zdieľanými, zmeňte prosím svoje \"nastavenia odberu\":\"$RecipientSubscriptionConfigURL\".^',NULL,'2017-04-25 10:29:43','text',2,NULL,'Jan Kuna'),(958740,20,'pattern_ShareFolder','sv','h1. Åtkomst beviljad till mapp: \"$DocumentTitle\":\"$__VirtualRootPath/products/files/#$FolderID\"\n\n$__DateTime \"$__AuthorName\":\"$__AuthorUrl\" beviljade dig åtkomst till \"$DocumentTitle\":\"$__VirtualRootPath/products/files/#$FolderID\" mappen med dessa rättigheter: \"$AccessRights\". \n\n$Message \n\n^Du får detta mejl för att du är en registrerad användare av \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portalen. Om du inte vill få aviseringar om delade dokument, ändra dina prenumerationsinställningar:\"$RecipientSubscriptionConfigURL\".^',NULL,'2017-03-21 10:03:13','text',2,NULL,'Emma Tellström'),(963701,20,'subject_DocuSignComplete','cs','Dokumenty. Všichni přihlášení vyplnili $DocumentTitle',NULL,'2017-04-21 11:46:10','text',2,NULL,'Jan Kuna'),(949960,20,'subject_DocuSignComplete','de','Dokumente. Alle Unterzeichner/innen haben $ DocumentTitle abgeschlossen',NULL,'2017-01-30 08:15:53','text',2,NULL,'Evgenia'),(949032,20,'subject_DocuSignComplete','es','Documentos. Todas las personas han firmado.',NULL,'2017-01-25 13:03:09','text',2,NULL,'Ekaterina.Heidel'),(937191,20,'subject_DocuSignComplete','fi','Asiakirjat. Kaikki allekirjoittajat viimeistelivät $DocumentTitle',NULL,'2017-01-07 14:02:33','text',2,NULL,'Arto Ryynanen'),(933906,20,'subject_DocuSignComplete','fr','Documents. Tous les signataires ont signé $DocumentTitle',NULL,'2016-11-08 11:20:09','text',2,NULL,'Nadine Yablonskaya'),(933744,20,'subject_DocuSignComplete','Neutral','Documents. All signers completed $DocumentTitle','','2017-05-03 10:51:20','text',2,NULL,'Console'),(960210,20,'subject_DocuSignComplete','nl','Bestanden. Alle ondertekenaars',NULL,'2017-03-23 14:46:41','text',2,NULL,'Hsing-Foo Wang'),(933867,20,'subject_DocuSignComplete','ru','Документы. Все стороны подписали $DocumentTitle',NULL,'2016-11-07 16:13:08','text',2,NULL,'Svetlana'),(965299,20,'subject_DocuSignComplete','sk','Dokumenty. Všetci signatári vyplnili $ DocumentTitle',NULL,'2017-04-25 10:31:15','text',2,NULL,'Jan Kuna'),(958722,20,'subject_DocuSignComplete','sv','Dokument. Alla tecknare färdiga $DocumentTitle',NULL,'2017-03-21 09:54:27','text',2,NULL,'Emma Tellström'),(963696,20,'subject_DocuSignStatus','cs','Dokumenty. Stav přihlášení byl změněn',NULL,'2017-04-21 11:36:54','text',2,NULL,'Jan Kuna'),(950228,20,'subject_DocuSignStatus','de','Dokumente. Der Signiervorgang-Status wurde geändert',NULL,'2017-02-01 07:18:39','text',2,NULL,'Evgenia'),(949033,20,'su