 09:16:25','text',2,NULL,'Jiří Redr'),(950907,28,'AuthorizationKeysHelpText','de','Detaillierte Anweisungen zum Anschließen dieses Dienstes finden Sie in unserem {0} Hilfe-Center {1}, das ihnen alle notwendigen Informationen liefert. ',NULL,'2017-02-13 08:20:16','text',2,NULL,'Evgenia'),(949544,28,'AuthorizationKeysHelpText','es','Para recibir unas instrucciones detalladas acerca de conexión de este servicio, por favor, visite nuetro {0}Centro de Ayuda{1}, donde se puede encontrar toda la información necesaria.',NULL,'2017-01-27 07:34:00','text',2,NULL,'Ekaterina.Heidel'),(938101,28,'AuthorizationKeysHelpText','fi','Lisätietoa tämän palvelun yhdistämisestä voit lukea {0}Tukikeskuksesta{1}, mikä antaa kaiken tarvittavan tiedon.',NULL,'2017-01-09 15:15:48','text',2,NULL,'Arto Ryynanen'),(933933,28,'AuthorizationKeysHelpText','fr','Pour obtenir les instructions concernant la connection de ce service, consultez notre {0}Cente d\'aide{1} qui fournit toutes les informations nécessaires.',NULL,'2016-11-09 08:08:57','text',2,NULL,'Nadine Yablonskaya'),(933765,28,'AuthorizationKeysHelpText','Neutral','For more detailed instructions about connecting this service, please refer to our {0}Help Center{1} that provides all the necessary information.','','2016-11-07 11:14:06','text',2,NULL,'Console'),(933824,28,'AuthorizationKeysHelpText','ru','Для получения подробных инструкций по подключению этого сервиса, пожалуйста, перейдите в наш {0}Справочный центр{1}, где приводится вся необходимая информация.',NULL,'2016-11-07 13:36:06','text',2,NULL,'Svetlana'),(967460,28,'AuthorizationKeysSupportText','cs','Pokud stále máte nějaké otázky ohledně připojení služby nebo potřebujete technickou pomoc, neváhejte kontaktovat náš {0}Support-team{1}',NULL,'2017-05-03 11:56:31','text',2,NULL,'Jiří Redr'),(950911,28,'AuthorizationKeysSupportText','de','Wenn Sie noch Fragen zur Einrichtung dieses Dienstes haben oder technische Hilfe benötigen, wenden Sie sich bitte an unser {0} Support-Team {1}.',NULL,'2017-02-13 08:38:15','text',2,NULL,'Evgenia'),(949564,28,'AuthorizationKeysSupportText','es','Si Usted tiene algunas preguntas acerca de conexión de este servicio o le necesita ayuda, Usted siempre puede contactar con nuestro {0}Equipo de Soporte Técnico{1}.',NULL,'2017-01-27 08:50:30','text',2,NULL,'Ekaterina.Heidel'),(945635,28,'AuthorizationKeysSupportText','fi','Jos sinulla on kysymyksiä miten ottaa yhteyttä tähän palveluun tai tarvitset teknistä apua, ole hyvä ja ota yhteyttä  {0}Tukipalveluumme{1}.',NULL,'2017-01-15 19:09:45','text',2,NULL,'Arto Ryynanen'),(933945,28,'AuthorizationKeysSupportText','fr','Si vous avez encore des questions concernant la connexion de ce service ou vous avez besoin d\'assistance technique, n’hésitez pas à contacter notre {0} Équipe d\'assistance {1}.',NULL,'2016-11-09 11:32:51','text',2,NULL,'Nadine Yablonskaya'),(933766,28,'AuthorizationKeysSupportText','Neutral','If you still have some questions on how to connect this service or need technical assistance, please feel free to contact our {0}Support Team{1}.','','2016-11-07 11:14:06','text',2,NULL,'Console'),(933826,28,'AuthorizationKeysSupportText','ru','Если у вас остались вопросы по подключению этого сервиса или вам требуется помощь, вы всегда можете обратиться в нашу {0}Службу поддержки{1}.',NULL,'2016-11-07 13:38:06','text',2,NULL,'Svetlana'),(966380,28,'AuthorizationKeysText','cs','Možnost Autorizační klíče, která Vám umožňuje připojit Váš ONLYOFFICE™ portál se službami třetích stran jako jsou Twitter, Facebook, DropBox atd. Připojte Váš portál k Facebooku, Twitteru nebo Linkedin, pokud nechcete zadávat Vaše portálové pověření pokaždé, když do něj vstoupíte. Připojit portál se službami jako DropBox, OneDriv atd. pro přesun dokumentů ze všech těchto úložišť do ONLYOFFICE™ modulu Dokumenty. Připojte ONLYOFFICE™ portál k Facebooku (aktualizujte informace o lidech) pro aktuální informace Vašich CRM kontaktů. ',NULL,'2017-05-02 09:15:05','text',2,NULL,'Jiří Redr'),(764343,28,'AuthorizationKeysText','de','Berechtigungsschlüssel erlauben Ihr ONLYOFFICE™ Portal mit Drittleistungen wie Twitter, Facebook, Dropbox usw. zu verbinden. Verbinden Sie Ihr Portal mit Facebook, Twitter oder Linkedin, wenn Sie Ihre Zugangsdaten jedes Mal beim Eintritt nicht eingeben wollen. Verknüpfen Sie es mit Dropbox, OneDrive usw. um Dokumente aus diesen Speichern in den Modul ONLYOFFICE™ Documents zu übertragen. Verbinden Sie Ihr ONLYOFFICE™ Portal mit Facebook (aktuelle Information über Personen), um die Information über Ihre CRM-Kontakte aufzufrischen.',NULL,'2016-07-15 12:25:47','text',2,NULL,'Console'),(764344,28,'AuthorizationKeysText','es','Claves de autorización es la opción que le permite conectar su portal ONLYOFFICE™ a los servicios de tercer partido por ejemplo a Twitter, Facebook, Dropbox etc. Conecte su portal a Facebook, Twitter o Linkedin si usted no quiere introducir sus datos de acceso cada vez que accede al portal. Conéctelo a Dropbox, OneDrive, etc. para transferir los documentos de tales servicios de alojamiento al módulo Documentos ONLYOFFICE™. Conecte su portal a Facebook (información sobre personas) para actualizar la información sobre sus contactos CRM. ',NULL,'2016-07-15 12:25:54','text',2,NULL,'Console'),(944857,28,'AuthorizationKeysText','fi','Valtuutusavaimien avulla voit kytkeä sivustosi palveluihin kuten Twitter, Facebook tai Dropbox. Yhdistä portaalisi Facebookiin, Twitteriin DropBoxiin jne, niin sinun ei tarvitse aina syöttää sivustosi käyttäjätunnusta ja salasanaa kun kirjaudut sisään. Linkitä palveluihin kuten Dropbox, OneDrive, Zohoon tms, niin voit siirtää asiakirjoja Asiakirjat moduuliin. Yhdistä portaalisi Facebookiin saadaksesi päivitettyä kontakteja Asiakkuudenhallintaasi.',NULL,'2017-01-15 12:31:40','text',2,NULL,'Arto Ryynanen'),(764346,28,'AuthorizationKeysText','fr','Clés d\'autorisation vous permettent de connecter votre portail ONLYOFFICE™ aux services tiers tels que Twitter, Facebook, Dropbox etc. Connectez votre portail à Facebook, Twitter ou Linkedin si vous n\'avez pas envie de taper vos données lors de chaque accès au portail. Liez-le aux services tels que Dropbox, OneDrive, etc. pour transférer les documents de tous ces stockages au module Documents ONLYOFFICE™. Connectez le portail ONLYOFFICE™ à Facebook (information sur les personnes) pour mettre à jour les données de vos contacts CRM.',NULL,'2016-07-15 12:25:31','text',2,NULL,'Console'),(764347,28,'AuthorizationKeysText','id','Sandi otorisasi adalah pilihan untuk menghubungkan portal ONLYOFFICE™ dengan layanan pihak ketiga seperti Twitter, Facebook, Dropbox, dll. Hubungkan portal Anda dengan Facebook, Twitter atau LinkedIn jika Anda tidak ingin menuliskan kata sandi setiap kali ingin masuk ke portal. Tautkan portal dengan layanan semacam Dropbox, OneDrive, Zoho, dll. untuk mentransfer dokumen dari seluruh penyimpanan dalam modul ONLYOFFICE™ Document. Hubungkan portal ONLYOFFICE™ dengan Facebook (pembaruan informasi mengenai orang) untuk memuat ulang informasi kontak CRM Anda.',NULL,'2016-07-15 12:26:16','text',2,NULL,'Console'),(764348,28,'AuthorizationKeysText','it','Chiavi di autorizzazione ti permettono di collegare il tuo portale ONLYOFFICE™ ai servizi di terzi tra quali Twitter, Facebook, Dropbox ecc. Collega il tuo portale a Facebook, Twitter o Linkedin se non desideri inserire i tuoi dati ogni vola quando accedi al portale. Collegalo ai servizi Dropbox, OneDrive, Zoho ecc. per trasferire i documenti da queste risorse di archiviazione al modulo Documenti ONLYOFFICE™. Collega il portale ONLYOFFICE™ a Facebook (dati sulle persone) per aggiornare i dati dei tuoi contatti CRM.',NULL,'2016-07-15 12:26:25','text',2,NULL,'Console'),(458604,28,'AuthorizationKeysText','Neutral','Authorization keys is the option which allows you to connect your ONLYOFFICE™ portal with the third party services like Twitter, Facebook, DropBox etc. Connect your portal with Facebook, Twitter or Linkedin if you don\'t want to introduce your portal credentials every time you enter it. Link it up with such services like DropBox, OneDrive, etc. to transfer the documents from all those storages to ONLYOFFICE™ Documents module. Connect ONLYOFFICE™ portal with Facebook (update information about people) to refresh the information about your CRM contacts.','','2016-09-19 10:40:14','text',2,NULL,'Console'),(764349,28,'AuthorizationKeysText','pt-BR','Chaves de Autorização é a opção que permite que você conecte seu portal ONLYOFFICE™ com serviços de terceiros, como o Twitter, Facebook, Dropbox, etc. Conecte seu portal com o Facebook, Twitter ou Linkedin se você não desejar inserir suas credenciais do portal todas as vezes que entrar. Vincule-o com serviços como Dropbox, OneDrive, Zoho, etc., para transferir os documentos de todos os armazenamentos para o módulo Documentos do ONLYOFFICE™. Conecte o portal ONLYOFFICE™ com o Facebook (atualizar as informações sobre as pessoas) para atualizar a informação sobre os seus contatos do CRM',NULL,'2016-07-15 12:26:32','text',2,NULL,'Console'),(764350,28,'AuthorizationKeysText','ru','Ключи авторизации позволяют подключить портал ONLYOFFICE™ к сторонним сервисам, таким как Twitter, Facebook, Dropbox и т.д. Подключите портал к Facebook, Twitter или Linkedin, если Вы не хотите каждый раз при входе вводить свои учетные данные на портале. Привяжите портал к таким сервисам, как Dropbox, OneDrive и т.д. чтобы перенести документы из всех этих хранилищ в модуль Документы ONLYOFFICE™. Подключите портал ONLYOFFICE™ к Facebook (актуальная информация о людях), чтобы обновлять сведения о контактах CRM.',NULL,'2016-07-15 12:27:01','text',2,NULL,'Console'),(764351,28,'AuthorizationKeysText','sl','Avtorizacijski ključi so možnost, ki dovoljuje, da svoj ONLYOFFICE™ portal povežete z tujimi storitvami, kot je Twitter, Facebook, Dropbox itd. Če svojih poverilnic ob vsakem vstopu ne želite vnašati, svoj portal povežite s Facebook-om, Twitter-jom, ali Linkedin-om. Storitve, kot je Dropbox, OneDrive, Zoho itd. povežite za prenos dokumentov na ONLYOFFICE™ modul dokumentov. ONLYOFFICE™ portal povežite s Facebookom (Posodobi informacije o ljudeh za osvežitev informacij o svojih CRM kontaktih.',NULL,'2016-07-15 12:26:43','text',2,NULL,'Console'),(764352,28,'AuthorizationKeysText','tr','Yetkilendirme anahtarları ONLYOFFICE™ portalınızı Twitter, Facebook, Dropbox, vs. gibi üçüncü kişi hizmetlerine bağlamanıza izin veren bir seçenektir. Portal ehliyetinizi her defasında tanıtmak istemiyorsanız portalınızı Facebook,Twitter yada Linkedin\'le bağlayın. Dropbox,OneDrive,Zoho,vs. gibi servislere bağlayarak, tüm bu depolardan ONLYOFFICE™ Döküman modülüne transfer yapabilirsiniz. ONLYOFFICE™ portalını Facebook\'la (insanlar hakkındaki bilgileri güncelleme) bağlayarak CRM kişileriyle ilgili bilgileri tazeleyebilirsiniz.',NULL,'2016-07-15 12:26:52','text',2,NULL,'Console'),(967497,28,'AuthorizationLink','cs','Pokyny pro získání přístupových klíčů',NULL,'2017-05-03 12:21:31','text',2,NULL,'Jiří Redr'),(950917,28,'AuthorizationLink','de','Genaue Instruktionen, wie man Verbindungsschlüssel bekommt',NULL,'2017-02-13 08:53:54','text',2,NULL,'Evgenia'),(949568,28,'AuthorizationLink','es','Instrucción acerca de como obtener las claves de conexión',NULL,'2017-01-27 08:59:32','text',2,NULL,'Ekaterina.Heidel'),(937769,28,'AuthorizationLink','fi','Ohje kuinka saada yhteysavaimet',NULL,'2017-01-08 15:39:16','text',2,NULL,'Arto Ryynanen'),(933946,28,'AuthorizationLink','fr','Instructions nécessaires pour obtenir les clés de connection',NULL,'2016-11-09 11:43:48','text',2,NULL,'Nadine Yablonskaya'),(933586,28,'AuthorizationLink','Neutral','Instruction on how to get connection keys',NULL,'2016-11-02 15:04:40','text',2,NULL,'Svetlana'),(933616,28,'AuthorizationLink','ru','Инструкция по получению ключей для подключения',NULL,'2016-11-02 15:50:41','text',2,NULL,'Svetlana'),(971568,28,'AuthTermsService','cs','Podmínky použití',NULL,'2017-05-17 14:19:57','text',2,NULL,'Jiří Redr'),(937927,28,'AuthTermsService','fi','Palvelun Käyttöehdot',NULL,'2017-01-08 16:30:06','text',2,NULL,'Arto Ryynanen'),(458605,28,'AuthTermsService','Neutral','Terms of Service','','2016-09-19 10:40:14','text',2,NULL,'Console'),(458606,28,'AutoBackupOff','Neutral','Disable','','2016-09-19 10:40:15','text',2,NULL,'Console'),(966825,28,'AutoBackupOn','cs','Povolit',NULL,'2017-05-02 13:34:48','text',2,NULL,'Jiří Redr'),(458607,28,'AutoBackupOn','Neutral','Enable','','2016-09-19 10:40:15','text',2,NULL,'Console'),(937211,28,'AutoBackupText','fi','Käytä tätä vaihtoehtoa portaalin tietojen automaattiseen varmuuskopiointiin',NULL,'2017-01-07 14:26:20','text',2,NULL,'Arto Ryynanen'),(458608,28,'AutoBackupText','Neutral','Use this option for automatic backup of the portal data.','','2016-09-19 10:40:15','text',2,NULL,'Console'),(966382,28,'AutoDataBackup','cs','Automatická záloha',NULL,'2017-05-02 09:15:19','text',2,NULL,'Jiří Redr'),(458609,28,'AutoDataBackup','Neutral','Automatic backup','','2016-09-19 10:40:15','text',2,NULL,'Console'),(764390,28,'AutoDataBackupHelp','de','Die Option {0}Automatische Sicherung{1} wird genutzt, um die Portaldatensicherung für die spätere Wiederherstellung auf dem Server oder SaaS-Portal zu automatisieren. Wählen Sie den Datenspeicher, Aufbewahrungszeit und die maximale Anzahl der gespeicherten Kopien.{2}{0}Hinweis:{1} Vor dem Speichern der Sicherungsdaten auf dem Konto Dritter (Dropbox, Box.com, OneDrive oder Google Drive) müssen Sie dieses Konto mit dem Modul Dokumente verbinden.',NULL,'2016-07-15 12:31:37','text',2,NULL,'Console'),(764391,28,'AutoDataBackupHelp','es','La opción {0}Copia de seguridad automática{1} se usa para automatizar el proceso de creación de copia de seguridad del portal para poder restaurarla más tarde en un servidor local o portal SaaS. Elija el almacenamiento para los datos, periodo de creación de copia y el número máximo de copias guardadas.{2}{0}Nota:{1} antes de guardar la copia de seguridad en una cuenta de terceros (Dropbox, Box.com, OneDrive o Google Drive), usted necesitará conectar esta cuenta a la carpeta Documentos Comunes ONLYOFFICE.',NULL,'2016-07-15 12:31:44','text',2,NULL,'Console'),(937212,28,'AutoDataBackupHelp','fi','{0}Automaattisen varmuuskopioinnin{1} vaihtoehtoa käytetään tallentamaan portaalin tietoja automaattisesti, jotta ne voidaan palauttaa myöhemmin paikalliseen palvelimeen tai SaaS portaaliin. Valitse talletustapa, automaattisen varmuuskopioinnin jakso ja maksimimäärä tallennettuja kopioita.{2}{0}Huom:{1} ennenkuin voit tallentaa varmuuskopion kolmannen osapuolen tilille (DropBox, Box.com, OneDrive tai Google Drive), tulee sinun yhdistää tämä tili ONLYOFFICEN  Yleisten asiakirjojen kansioon.',NULL,'2017-01-07 14:31:23','text',2,NULL,'Arto Ryynanen'),(764392,28,'AutoDataBackupHelp','fr','L\'option {0}Sauvegarde automatique{1} est utilsée pour automatiser le processus de sauvegarde des données de portail en vue de le restaurer plus tard sur un serveur local ou portail SaaS. Sélectionnez le stockage de données, période de sauvegarde automatique et nombre maximal de copies sauvegardées.{2}{0}Remarque:{1} avant de pouvoir enregistrer des données de sauvegarde sur un compte tiers (Dropbox, Box.com, OneDrive ou Google Drive), vous avez besoin de connecter ce compte au dossier Documents communs ONLYOFFICE.',NULL,'2016-07-15 12:31:50','text',2,NULL,'Console'),(764393,28,'AutoDataBackupHelp','it','L\'opzione {0}Backup automatico{1} si usa per automatizzare il processo di creazione del copia di backup del portale per poter restituirlo in seguito su un server locale o un portale SaaS. Seleziona il posto di memorizzazione dei dati, il periodo di backup automatico ed il numero massimo di copie salvate.{2}{0}Nota:{1} per poter salvare i dati di backup su un account di terzi (Dropbox, Box.com, OneDrive o Google Drive), hai bisogno di collegare questo account alla cartella dei Documenti Comuni ONLYOFFICE.',NULL,'2016-07-15 12:31:56','text',2,NULL,'Console'),(458610,28,'AutoDataBackupHelp','Neutral','The {0}Automatic backup{1} option is used to automate the portal data backup process to be able to restore it later on a local server or SaaS portal. Choose the data storage, automatic backup period and maximal number of saved copies.{2}{0}Note:{1} before you can save the backup data to a third party account (DropBox, Box.com, OneDrive or Google Drive), you will need to connect this account to ONLYOFFICE Common Documents folder.','','2016-09-19 10:40:15','text',2,NULL,'Console'),(764394,28,'AutoDataBackupHelp','pt-BR','A opção {0}Backup automático{1} é usada para automatizar o processo de backup de dados portal para ser possível restaurá-lo mais tarde em um servidor local ou portal SaaS. Escolha o armazenamento de dados, período de backup automático e número máximo de cópias salvas.{2}{0}Nota:{1} antes que você possa salvar os dados de backup para uma conta de terceiros (Dropbox, Box.com, OneDrive ou Google Drive), você precisará conectar essa conta para o módulo de Documentos.',NULL,'2016-07-15 12:32:11','text',2,NULL,'Console'),(764395,28,'AutoDataBackupHelp','ru','Опция {0}Автоматическое резервное копирование данных{1} используется для автоматизации процесса создания резервных копий данных для последующего их восстановления на локальном сервере или SaaS-портале. Выберите хранилище для данных, период автоматического сохранения и максимальное число хранимых копий.{2}{0}Обратите внимание:{1} прежде чем Вы сможете сохранять резервные копии в стороннем аккаунте (Dropbox, Box.com, OneDrive или Google Drive), потребуется подключить его к папке \"Общие документы\" ONLYOFFICE.',NULL,'2016-07-15 12:32:15','text',2,NULL,'Console'),(458611,28,'BackToHomeLink','Neutral','Go to title page','','2016-09-19 10:40:15','text',2,NULL,'Console'),(458612,28,'Backup','Neutral','Backup','','2016-09-19 10:40:15','text',2,NULL,'Console'),(966326,28,'BackupCloud','cs','Cloud Amazon',NULL,'2017-05-02 08:43:42','text',2,NULL,'Jiří Redr'),(458613,28,'BackupCloud','Neutral','