allita ajankäyttöään sivuston kalenterilla{5}{4}Käyttää Chat toimintoa ja keskustella muiden sivuston käyttäjien kanssa.{5}{3}',NULL,'2017-03-29 14:52:52','text',2,NULL,'Александр'),(961314,28,'CollaboratorCanDescribe2','fr','{0}{!Guest} peut :{1}{2}{4}joindre et télécharger des fichiers ;{5}{4}visualiser le contenu et ajouter des commentaires ;{5}{4}organiser un planning en utilisant le Calendrier ;{5}{4}utiliser le Chat pour discuter avec les autres utilisateurs du portail en ligne.{5}{3}',NULL,'2017-03-29 14:54:22','text',2,NULL,'Александр'),(961316,28,'CollaboratorCanDescribe2','id','{0}{!Guest} can:{1}{2}{4}melampirkan dan mengunduh file;{5}{4}melihat dan membuat komentar pada konten terbuka di portal;{5}{4}mengatur jadwalnya menggunakan Kalender;{5}{4}menggunakan Chat untuk mengobrol online dengan pengguna lain di portal.{5}{3}',NULL,'2017-03-29 14:55:54','text',2,NULL,'Александр'),(961318,28,'CollaboratorCanDescribe2','it','{0}{!Guest} può:{1}{2}{4}allegare e scaricare file;{5}{4}visualizzare e commentare il contenuto aperto;{5}{4}organizzare il suo orario usando Calendario;{5}{4}usare Chat per chattare con altri utenti.{5}{3}',NULL,'2017-03-29 14:57:28','text',2,NULL,'Александр'),(961127,28,'CollaboratorCanDescribe2','Neutral','{0}{!Guest} can:{1}{2}{4}attach and download files;{5}{4}view and comment the portal open content;{5}{4}organize his/her schedule using the Calendar;{5}{4}use Talk to chat with other portal users online.{5}{3}','','2017-03-28 14:11:46','text',2,NULL,'Console'),(961320,28,'CollaboratorCanDescribe2','nl','{0}{!Guest} kan {1}{2}{4}bijlages toevoegen en bestanden downloaden;{5}{4}portal-inhoud weergeven en commentaar geven, {5}{4}zijn/haar agenda bijhouden door middel van de Kalender en {5}{4}Talk gebruiken om te chatten met andere portalgebruikers online.{5}{3}',NULL,'2017-03-29 14:59:35','text',2,NULL,'Александр'),(961322,28,'CollaboratorCanDescribe2','pt-BR','{0}{!Guest} pode:{1}{2}{4}anexar e baixar arquivos;{5}{4}ver e comentar o con