n the Documents module.','','2016-11-07 11:13:52','text',2,NULL,'Svetlana'),(933615,28,'ConsumersBitlyDescription','ru','Подключить сервис Bitly для сокращения пригласительных ссылок на портал и ссылок для доступа к файлам в модуле \'Документы\'.',NULL,'2016-11-02 15:50:22','text',2,NULL,'Svetlana'),(967454,28,'ConsumersBitlyInstruction','cs','Pokud přidáte službu Bitly, získáte zkrácené odkazy na pozvánky pro nové uživatele ONLYOFFICE™ a zároveň zkrácené odkazy k dokumentům v modulu Dokumenty, které byly sdíleny externími uživateli.',NULL,'2017-05-03 11:37:21','text',2,NULL,'Jiří Redr'),(950909,28,'ConsumersBitlyInstruction','de','Wenn Sie den Bitly-Dienst hinzufügen, erhalten Sie verkürzte Links, um neue Nutzer zum ONLYOFFICE ™ -Portal einzuladen und verkürzte Links zu dem Modul \"Dokumente\", der mit externen Benutzern geteilt wurde.',NULL,'2017-02-13 08:34:14','text',2,NULL,'Evgenia'),(949563,28,'ConsumersBitlyInstruction','es','Si Usted añade el servicio Bitly, Usted podrá recibir los enlaces acortados para invitar a nuevos usuarios al portal ONLYOFFICE™ y los enlaces acortados para los documentos en el módulo \'Documentos\' compartidos con los usuarios externos.',NULL,'2017-01-27 08:47:14','text',2,NULL,'Ekaterina.Heidel'),(933944,28,'ConsumersBitlyInstruction','fr','Si vous ajoutez le service Bitly, vous pouvez inviter de nouveaux utilisateurs au portail ONLYOFFICE™ en utilisant les liens raccourcis. En plus, ces liens peuvent être utilisés pour les documents disponibles dans le module Documents et qui ont été partagés avec des utilisateurs externes.',NULL,'2016-11-09 11:30:44','text',2,NULL,'Nadine Yablonskaya'),(933632,28,'ConsumersBitlyInstruction','Neutral','If you add the Bitly service you will get shortened links to invite new users to the ONLYOFFICE™ portal and shortened links to documents in the Documents module that have been shared with external users.','','2016-11-07 11:13:52','text',2,NULL,'Svetlana'),(933645,28,'ConsumersBitlyInstruction','ru','Д