nstruction','de','Wenn man die Anwendung des Box-Dienstes hinzufügt, kann man sein Box-Konto mit dem Modul \"Dokumente\" verknüpfen. Dies  ermöglicht das Hochladen und Erstellen neuer Dateien in Box, Bearbeiten der bestehenden Dateien, Kopieren und Löschen, Freigabe von Dateien oder Ordnern mit ONLYOFFICE ™ Portalbenutzer.',NULL,'2017-02-06 07:16:46','text',2,NULL,'Evgenia'),(949554,28,'ConsumersBoxInstruction','es','Si Usted añade la aplicación del servicio Box, Usted podrá conectar su cuenta de Box en el módulo \'Documentos\'. Este permite cargar y crear unos archivos nuevos en Box, editar unos archivos existentes, copiar y eliminarlos, compartir los archivos y carpetas con los usuarios de portal ONLYOFFICE™.',NULL,'2017-01-27 08:04:50','text',2,NULL,'Ekaterina.Heidel'),(933935,28,'ConsumersBoxInstruction','fr','Si vous ajoutez une application du service Box, vous pouvez connecter votre compte Box au module Documents. Cela vous permet de télécharger et créer de nouveaux fichiers dans Box, modifier ceux qui existent déjà, copier et supprimer, partager des fichiers et des dossiers avec les utilisateurs du portail ONLYOFFICE™.',NULL,'2016-11-09 09:32:09','text',2,NULL,'Nadine Yablonskaya'),(933626,28,'ConsumersBoxInstruction','Neutral','If you add an application of the Box service you will be able to connect your Box account in the Documents module. This will allow to upload and create new files in Box, edit existing ones, copy and delete them, share files and folders with ONLYOFFICE™ portal users.','','2016-11-07 11:13:52','text',2,NULL,'Svetlana'),(933636,28,'ConsumersBoxInstruction','ru','Добавив приложение сервиса Box, Вы сможете подключить свой аккаунт Box в модуле \'Документы\'. Это позволит загружать и создавать новые файлы в Box, редактировать существующие, копировать и удалять их, предоставлять доступ к файлам и папкам для пользователей портала ONLYOFFICE™.',NULL,'2016-11-02 16:15:34','text',2,NULL,'Svetlana'),(966409,28,'ConsumersBoxKey','cs','Box ID',NULL,