6 07:27:02','text',2,NULL,'Evgenia'),(949556,28,'ConsumersDocuSignInstruction','es','Si Usted añade la aplicación del servicio DocuSign, Usted podrá firmar los documentos del módulo \'Documentos\'. Este permite enviar el archivo para recibir una firma electrónica a los empleados de portal ONLYOFFICE™ por medio del servicio DocuSugn. El archivo firmado será guardado en el módulo \'Documentos\' de portal ONLYOFFICE™.',NULL,'2017-01-27 08:11:36','text',2,NULL,'Ekaterina.Heidel'),(933936,28,'ConsumersDocuSignInstruction','fr','Si vous ajoutez une application du service DocuSign vous pouvez signer des fichiers à partir du module Documents. Cela permet d’envoyer un fichier pour la signature électronique aux employés du portail ONLYOFFICE™ via le service DocuSugn. Le fichier signé sera sauvegardé dans le module Documents de ONLYOFFICE™.',NULL,'2016-11-09 09:40:52','text',2,NULL,'Nadine Yablonskaya'),(933884,28,'ConsumersDocuSignInstruction','Neutral','If you add an application of the DocuSign service you will be able to sign files from the Documents module. This will allow to send a file for electronic signature to the ONLYOFFICE™ portal employees via the DocuSugn service. The signed file will be saved in the ONLYOFFICE™ Documents module.','','2016-11-15 14:53:30','text',2,NULL,'Svetlana'),(933885,28,'ConsumersDocuSignInstruction','ru','Добавив приложение сервиса DocuSign, Вы сможете подписывать файлы модуля \'Документы\'. Это позволит Вам отправлять файл на получение электронной подписи сотрудникам портала ONLYOFFICE™ средствами сервиса DocuSugn. Подписанный файл будет сохранён в модуле \'Документы\' портала ONLYOFFICE™.',NULL,'2016-11-08 09:40:21','text',2,NULL,'Svetlana'),(966786,28,'ConsumersDocuSignKey','cs','DocuSign Klíč',NULL,'2017-05-02 13:21:47','text',2,NULL,'Jiří Redr'),(950008,28,'ConsumersDocuSignKey','de','DocuSign Schlüssel',NULL,'2017-01-30 10:37:36','text',2,NULL,'Evgenia'),(949532,28,'ConsumersDocuSignKey','es','Clave de DocuSign',NULL,'2017-01-27 05:51: