dáte aplikaci služby Dropbox, budete pak moci připojit Váš Dropbox účet v modulu Dokumenty. Toto Vám umožní nahrávat a vytvářet nové soubory v Dropboxu, upravovat stávající soubory, kopírovat a mazat je, sdílet je a složky spolu s uživateli portálu ONLYOFFICE™.',NULL,'2017-05-03 11:01:07','text',2,NULL,'Jiří Redr'),(950663,28,'ConsumersDropBoxInstruction','de','Wenn man die Anwendung des Dropbox-Dienstes hinzufügt, kann man sein Dropbox -Konto mit dem Modul \"Dokumente\" verknüpfen. Dies  ermöglicht das Hochladen und Erstellen neuer Dateien in Dropbox, Bearbeiten der bestehenden Dateien, Kopieren und Löschen, Freigabe von Dateien oder Ordnern mit ONLYOFFICE ™ Portalbenutzer.',NULL,'2017-02-06 07:28:38','text',2,NULL,'Evgenia'),(949558,28,'ConsumersDropBoxInstruction','es','Si Usted añade la aplicación del servicio Dropbox, Usted podrá conectar su cuenta de Dropbox en el módulo \'Documentos\'. Este permite cargar y crear unos archivos nuevos en Dropbox, editar unos archivos existentes, copiar y eliminarlos, compartir los archivos y carpetas con los usuarios de portal ONLYOFFICE™.',NULL,'2017-01-27 08:14:48','text',2,NULL,'Ekaterina.Heidel'),(933937,28,'ConsumersDropBoxInstruction','fr','Si vous ajoutez une application du service Dropbox, vous pouvez connecter votre compte Dropbox au module Documents. Cela permet de télécharger et créer de nouveaux fichiers dans Dropbox, modifier ceux qui existent déjà, copier et supprimer, partager des fichiers et des dossiers avec les utilisateurs du portail ONLYOFFICE™.',NULL,'2016-11-09 09:56:27','text',2,NULL,'Nadine Yablonskaya'),(933627,28,'ConsumersDropBoxInstruction','Neutral','If you add an application of the Dropbox service you will be able to connect your Dropbox account in the Documents module. This will allow to upload and create new files in Dropbox, edit existing ones, copy and delete them, share files and folders with ONLYOFFICE™ portal users.','','2016-11-07 11:13:52','text',2,NULL,'Svetlana'),(933637,28,'ConsumersDropBoxInstruction','ru','Добавив приложение сервиса Dropbox, Вы сможете подключить свой аккаунт Dropbox в модуле \'Документы\'. Это позволит загружать и создавать новые файлы в Dropbox, редактировать существующие, копировать и удалять их, предоставлять доступ к файлам и папкам для пользователей портала ONLYOFFICE™.',NULL,'2016-11-02 16:16:51','text',2,NULL,'Svetlana'),(966795,28,'ConsumersDropBoxKey','cs','DropBox ID',NULL,'2017-05-02 13:27:36','text',2,NULL,'Jiří Redr'),(765501,28,'ConsumersDropBoxKey','de','Dropbox ID',NULL,'2016-07-15 12:27:40','text',2,NULL,'Console'),(765502,28,'ConsumersDropBoxKey','es','ID de Dropbox',NULL,'2016-07-15 12:27:46','text',2,NULL,'Console'),(765505,28,'ConsumersDropBoxKey','id','ID Dropbox',NULL,'2016-07-15 12:27:51','text',2,NULL,'Console'),(458686,28,'ConsumersDropBoxKey','Neutral','DropBox ID','','2016-09-19 10:40:17','text',2,NULL,'Console'),(765507,28,'ConsumersDropBoxKey','pt-BR','ID da Dropbox',NULL,'2016-07-15 12:27:57','text',2,NULL,'Console'),(765508,28,'ConsumersDropBoxKey','ru','Dropbox ID',NULL,'2016-07-15 12:28:08','text',2,NULL,'Console'),(765510,28,'ConsumersDropBoxKey','tr','Dropbox ID',NULL,'2016-07-15 12:28:03','text',2,NULL,'Console'),(966797,28,'ConsumersDropBoxSecret','cs','DropBox Klíč',NULL,'2017-05-02 13:27:44','text',2,NULL,'Jiří Redr'),(765511,28,'ConsumersDropBoxSecret','de','Dropbox-Schlüssel',NULL,'2016-07-15 12:30:48','text',2,NULL,'Console'),(765512,28,'ConsumersDropBoxSecret','es','Clave de Dropbox',NULL,'2016-07-15 12:30:54','text',2,NULL,'Console'),(765515,28,'ConsumersDropBoxSecret','id','Kunci Dropbox',NULL,'2016-07-15 12:31:02','text',2,NULL,'Console'),(458687,28,'ConsumersDropBoxSecret','Neutral','DropBox Key','','2016-09-19 10:40:17','text',2,NULL,'Console'),(765517,28,'ConsumersDropBoxSecret','pt-BR','Chave da Dropbox',NULL,'2016-07-15 12:31:09','text',2,NULL,'Console'),(765518,28,'ConsumersDropBoxSecret','ru','Ключ Dropbox',NULL,'2016-07-15 12:31:19','text',2,NULL,'Console'),(765520,28,'Con