acebookDescription','cs','Připojte aplikaci k přihlášení do portálů pomocí Facebookového účtu a vyhledejte kontakty.',NULL,'2017-05-02 11:22:55','text',2,NULL,'Jiří Redr'),(949985,28,'ConsumersFacebookDescription','de','Verbinden Sie die Anwendung, um sich ins Portal via Facebook anzumelden und Kontakte zu suchen.',NULL,'2017-01-30 09:00:49','text',2,NULL,'Evgenia'),(949316,28,'ConsumersFacebookDescription','es','Conectar la aplicación para acceder al portal usando la cuenta Facebook y buscar contactos.',NULL,'2017-01-26 12:51:30','text',2,NULL,'Ekaterina.Heidel'),(937143,28,'ConsumersFacebookDescription','fi','Yhdistä sovellus jotta voit kirjautua portaaliin Facebook tilin kautta ja etsiä kontakteja.',NULL,'2017-01-07 13:23:32','text',2,NULL,'Arto Ryynanen'),(933691,28,'ConsumersFacebookDescription','fr','Connecter l\'application pour accèder au portail en utilisant le compte Facebook et la recherche des contacts.',NULL,'2016-11-07 09:57:21','text',2,NULL,'Nadine Yablonskaya'),(933599,28,'ConsumersFacebookDescription','Neutral','Connect the application to sign in to the portal using a Facebook account and search for contacts.','','2016-11-07 11:13:52','text',2,NULL,'Svetlana'),(933609,28,'ConsumersFacebookDescription','ru','Подключить приложение для входа на портал по учетной записи Facebook и поиска контактов.',NULL,'2016-11-02 15:40:45','text',2,NULL,'Svetlana'),(967353,28,'ConsumersFacebookInstruction','cs','Pokud přidáte aplikaci služby Facebook, budete moci připojit Váš Facebook účet na Vaší profilovou stránku, takže se budete moci přes ni přihlásit do ONLYOFFICE™. Také budete moci nalézt svůj kontakt na Facebook účet v CRM modulu a připojit ho ke stránce \"Upravit osobu/společnost\"',NULL,'2017-05-03 11:03:59','text',2,NULL,'Jiří Redr'),(950664,28,'ConsumersFacebookInstruction','de','Wenn man die Anwendung des Facebook -Dienstes hinzufügt, kann man sein Facebook-Konto mit der Profilseite verknüpfen. So meldet man sich ins ONLYOFFICE™ Portal mit eigenen Facebook-Login-Daten an. Sie können auch ein Facebook-Konto des Kontakts im CRM-Modul finden und mit \"Person / Firma bearbeiten\" verknüpfen.\n\n',NULL,'2017-02-06 08:02:20','text',2,NULL,'Evgenia'),(949559,28,'ConsumersFacebookInstruction','es','Si Usted añade la aplicación del servicio Facebook, Usted podrá conectar el acceso al portal ONLYOFFICE™ en la página de su perfil con ayuda de la cuenta Facebook. También Usted podrá encontrar y enlazar la cuenta de Facebook en la página de \'Editar persona/empresa\' en el módulo CRM.',NULL,'2017-01-27 08:27:52','text',2,NULL,'Ekaterina.Heidel'),(946332,28,'ConsumersFacebookInstruction','fi','Jos lisäät Facebookin palvelun sovelluksen, niin voit yhdistää Facebook tilisi profiilisi sivulle, jotta voit kirjautua sisään ONLYOFFICEN portaaliin sitä käyttämällä. Voit myös löytää kontaktisi Facebook tilin Asiakkuudenhallinnan moduulissa ja linkittää sen \'Muokkaa henkilöä/yritystä\' sivulla.',NULL,'2017-01-16 18:19:44','text',2,NULL,'Arto Ryynanen'),(933938,28,'ConsumersFacebookInstruction','fr','Si vous ajoutez une application du service Facebook, vous pouvez connecter votre compte Facebook sur votre page de profil en vue de l\'utiliser pour accéder au portail ONLYOFFICE™. Cela vous permet également trouver un compte Facebook d’un contact dans le module CRM et  le lier sur la page « Modifier personne/entreprise ».',NULL,'2016-11-09 10:01:00','text',2,NULL,'Nadine Yablonskaya'),(933675,28,'ConsumersFacebookInstruction','Neutral','If you add an application of the Facebook service you will be able to connect your Facebook account on your profile page so that you can sign in to the ONLYOFFICE™ portal using it. You will also be able to find a Facebook account of a contact in the CRM module and link it on the \'Edit person/company\' page.','','2016-11-07 11:13:52','text',2,NULL,'Svetlana'),(933677,28,'ConsumersFacebookInstruction','ru','Добавив приложение сервиса Facebook, Вы сможете на странице своего профиля подключить вход на портал ONLYOFFICE™ с помощью аккаунта Facebook. Также Вы сможете на странице редактирования персоны или компании CRM находить и привязывать аккаунт Facebook.',NULL,'2016-11-03 07:52:24','text',2,NULL,'Svetlana'),(967152,28,'ConsumersFacebookKey','cs','Facebook ID',NULL,'2017-05-03 08:53:54','text',2,NULL,'Jiří Redr'),(458691,28,'ConsumersFacebookKey','Neutral','Facebook ID','','2016-09-19 10:40:17','text',2,NULL,'Console'),(967154,28,'ConsumersFacebookSecret','cs','Facebook klíč',NULL,'2017-05-03 08:54:10','text',2,NULL,'Jiří Redr'),(458692,28,'ConsumersFacebookSecret','Neutral','Facebook Key','','2016-09-19 10:40:17','text',2,NULL,'Console'),(966341,28,'ConsumersFacebookSecretDefalt','cs','App Token',NULL,'2017-05-02 08:51:40','text',2,NULL,'Jiří Redr'),(949970,28,'ConsumersFacebookSecretDefalt','de','App Token',NULL,'2017-01-30 08:39:53','text',2,NULL,'Evgenia'),(949225,28,'ConsumersFacebookSecretDefalt','es','App Token',NULL,'2017-01-26 12:04:39','text',2,NULL,'Ekaterina.Heidel'),(937663,28,'ConsumersFacebookSecretDefalt','fi','Sovelluksen merkkijono',NULL,'2017-01-08 14:51:40','text',2,NULL,'Arto Ryynanen'),(949055,28,'ConsumersFacebookSecretDefalt','fr','Jeton d\'utilisateur',NULL,'2017-01-26 06:15:23','text',2,NULL,'Nadine Yablonskaya'),(937067,28,'ConsumersFacebookSecretDefalt','Neutral','App Token','','2017-01-09 07:04:25','text',2,NULL,'Svetlana'),(961601,28,'ConsumersFacebookSecretDefalt','nl','App Token',NULL,'2017-03-30 09:33:40','text',2,NULL,'Hsing-Foo Wang'),(937069,28,'ConsumersFacebookSecretDefalt','ru','App Token',NULL,'2016-12-27 13:33:44','text',2,NULL,'Svetlana'),(967249,28,'ConsumersGoogle','cs','Google Klíč',NULL,'2017-05-03 09:28:57','text',2,NULL,'Jiří Redr'),(458693,28,'ConsumersGoogle','Neutral','Google Key','','2016-09-19 10:40:17','text',2,NULL,'Console'),(966610,28,'ConsumersGoogleDescription','cs','Připojit projekt k přihlášení do portálu pomocí Google účtu a spravujte Google Drive soubory a složky.',NULL,'2017-05-02 11:26:25','text',2,NULL,'Jiří Redr'),(950906,28,'ConsumersGoogleDescription','de','Verbinden Sie das Projekt mithilfe eines Google-Kontos und verwalten Sie Google Drive-Dateien und Ordner.',NULL,'2017-02-13 08:15:01','text',2,NULL,'Evgenia'),(949382,28,'ConsumersGoogleDescription','es','Conectar el proyecto para acceder al portal usando la cuenta de Google y manejar los archivos y carpetas de Google Drive.',NULL,'2017-01-26 13:19:20','text',2,NULL,'Ekaterina.Heidel'),(937671,28,'ConsumersGoogleDescription','fi','Yhdistä projekti, jotta voi kirjautua sisään käyttämällä Google tiliä ja hallinnoida Google Drive tiedostoja ja kansioita.',NULL,'2017-01-08 14:56:09','text',2,NULL,'Arto Ryynanen'),(933928,28,'ConsumersGoogleDescription','fr','Se connecter au projet pour accéder au portail en utilisant le compte Google et pour gérer les fichiers et les dossiers Google Drive.',NULL,'2016-11-09 07:36:18','text',2,NULL,'Nadine Yablonskaya'),(933611,28,'ConsumersGoogleDescription','Neutral','Connect the project to sign in to the portal using a Google account and manage Google Drive files and folders.','','2016-11-07 11:13:52','text',2,NULL,'Svetlana'),(933612,28,'ConsumersGoogleDescription','ru','Подключить проект для входа на портал по учетной записи Google и для управления файлами и папками Google Drive.',NULL,'2016-11-02 15:43:25','text',2,NULL,'Svetlana'),(967339,28,'ConsumersGoogleInstruction','cs','Pokud přidáte projekt Google služby, budete moci připojit svůj Google účet k Vaší profilové stránce, takže se tím budete moci přihlásit do ONLYOFFICE™ portálu stejně jako připojit svůj Google Drive účet k modelu Dokumenty. Toto umožní nahrávat a vytvářet nové soubory v Google Drive, upravovat stávající soubory, kopírovat a mazat je, sdílet soubory a složky mezi ONLYOFFICE™ uživateli portálu.',NULL,'2017-05-03 10:55:00','text',2,NULL,'Jiří Redr'),(950908,28,'ConsumersGoogleInstruction','de','Wenn Sie ein Projekt des Google-Dienstes hinzufügen, können Sie Ihr Google-Konto mit Ihrer Profilseite verbinden, sodass Sie sich im ONLYOFFICE ™ -Portal anmelden und Ihr Google Drive-Konto im Modul Dokumente verbinden können. Dies ermöglicht Ihnen, neue Dateien in Google Drive hochzuladen und zu erstellen, bestehende zu bearbeiten, sie zu kopieren und zu löschen, Dateien und Ordner den ONLYOFFICE ™ Portalbenutzern freizugeben.\n',NULL,'2017-02-13 08:28:24','text',2,NULL,'Evgenia'),(949553,28,'ConsumersGoogleInstruction','es','Si Usted añade un proyecto del servicio Google, Usted podrá conectar el acceso a su portal ONLYOFFICE™ con ayuda de la cuenta Google y conectar su cuenta de Google Drive en el módulo \'Documentos\'. Este permite cargar y crear unos archivos nuevos en Google Drive, editar unos archivos existentes, copiar y eliminarlos, compartir los archivos y carpetas con los usuarios de portal ONLYOFFICE™.',NULL,'2017-01-27 07:53:43','text',2,NULL,'Ekaterina.Heidel'),(946331,28,'ConsumersGoogleInstruction','fi','Jos lisäät Google palvelun projektin, niin voit ottaa yhteyttä Google tiliisi profiilisivulla, ja voit kirjautua sisään ONLYOFFICE portaaliin samalla kun otat yhteyttä Google Drive tiliin Asiakirjojen moduulissa. Tämä antaa mahdollisuuden ladata ja luoda uusia tiedostoja Google Drivessa, muokata nykyisiä, kopioida ja poistaa niitä, jakaa tiedostoja ja kansioita ONLYOFFICE portaalin käyttäjille.',NULL,'2017-01-16 18:16:41','text',2,NULL,'Arto Ryynanen'),(933934,28,'ConsumersGoogleInstruction','fr','En ajoutant un projet du service Google, vous pourrez connecter votre compte Google sur la page de votre profil en vue de l\'utiliser pour l\'accès au portail ONLYOFFICE™ et connecter votre compte Google Drive au module Documents. Cela vous permettra de télécharger et de créer de nouveaux fichiers dans Google Drive, modifier ceux qui existent déjà, copier et supprimer, partager des fichiers et des dossiers avec les utilisateurs du portail ONLYOFFICE™.',NULL,'2016-11-09 09:29:35','text',2,NULL,'Nadine Yablonskaya'),(933634,28,'ConsumersGoogleInstruction','Neutral','If you add a project of the Google service you will be able to connect your Google account on your profile page so that you can sign in to the ONLYOFFICE™ portal using it as well as connect your Google Drive account in the Documents module. This will allow to upload and create new files in Google Drive, edit existing ones, copy and delete them, share files and folders with ONLYOFFICE™ portal users.','','2016-11-07 11:13:52','text',2,NULL,'Svetlana'),(933635,28,'ConsumersGoogleInstruction','ru','Добавив проект сервиса Google, Вы сможете на странице своего профиля подключить вход на портал ONLYOFFICE™ с помощью аккаунта Google и подключить свой аккаунт Google Drive в модуле \'Документы\'. Это позволит загружать и создавать новые файлы в Google Drive, редактировать существующие, копировать и удалять их, предоставлять доступ к файлам и папкам для пользователей портала ONLYOFFICE™.',NULL,'2016-11-02 16:14:31','text',2,NULL,'Svetlana'),(967248,28,'ConsumersGoogleKey','cs','Google ID',NULL,'2017-05-03 09:28:49','text',2,NULL,'Jiří Redr'),(458694,28,'ConsumersGoogleKey','Neutral','Google ID','','2016-09-19 10:40:17','text',2,NULL,'Console'),(967250,28,'ConsumersGoogleSecret','cs','Google Klíč',NULL,'2017-05-03 09:29:02','text',2,NULL,'Jiří Redr'),(458695,28,'ConsumersGoogleSecret','Neutral','Google Key','','2016-09-19 10:40:17','text',2,NULL,'Console'),(967701,28,'ConsumersLinkedIn','cs','Linkedin Klíč',NULL,'2017-05-04 07:09:53','text',2,NULL,'Jiří Redr'),(458696,28,'ConsumersLinkedIn','Neutral','Linkedin Key','','2016-09-19 10:40:17','text',2,NULL,'Console'),(966607,28,'ConsumersLinkedInDescription','cs','Připojte aplikaci k přihlášení do portálu pomocí LinkedIn účtu. ',NULL,'2017-05-02 11:23:37','text',2,NULL,'Jiří Redr'),(949986,28,'ConsumersLinkedInDescription','de','Verbinden Sie die Anwendung, um sich ins Portal via LinkedIn anzumelden.',NULL,'2017-01-30 09:01:43','text',2,NULL,'Evgenia'),(949317,28,'ConsumersLinkedInDescription','es','Conectar la aplicación para acceder a