struction','cs','Pokud přidáte aplikaci služby Twitter, budete moci připojit svůj Twitter účet k Vaší profilové stránce, takže se touto službou budete moci přihlásit k Vašemu ONLYOFFICE™. Budete moci také nalézt svůj Twitter účet v CRM modulu a spojit ho na stránce \"Upravit osobu/společnost\" a sledovat Twitter novinky.',NULL,'2017-05-03 11:35:26','text',2,NULL,'Jiří Redr'),(950667,28,'ConsumersTwitterInstruction','de','Wenn man die Anwendung des Twitter-Dienstes hinzufügt, kann man sein Twitter-Konto mit der Profilseite verknüpfen. So meldet man sich ins ONLYOFFICE™ Portal mit eigenen Twitter-Login-Daten an. Sie können auch ein Facebook-Konto der Person im CRM-Modul finden und mit \"Person / Firma bearbeiten\" verknüpfen und Twitter-Newsfeedaktualisierungen durchschauen.',NULL,'2017-02-06 08:12:44','text',2,NULL,'Evgenia'),(949562,28,'ConsumersTwitterInstruction','es','Si Usted añade la aplicación del servicio Twitter, Usted podrá conectar el acceso al portal ONLYOFFICE™ en la página de su perfil con ayuda de la cuenta Twitter. También Usted podrá enlazar la cuenta Twitter y leer noticias en la página de \'Editar persona/empresa\' en el módulo CRM.',NULL,'2017-01-27 08:41:31','text',2,NULL,'Ekaterina.Heidel'),(946335,28,'ConsumersTwitterInstruction','fi','Jos lisää Twitter palvelun sovelluksen, niin voit yhdistää Twitter tilisi profiilisivullesi, jotta voit kirjautua sisään ONLYOFFICE  portaaliin sitä käyttämällä. Voit myös löytää henkilön Twitter tilin Asiakkuudenhallinnan moduulissa ja linkittää sen  \'Muokkaa henkilöä/yritystä\' sivulla ja sitten selailla Twitterin uutisten syötteitä.',NULL,'2017-01-16 18:25:37','text',2,NULL,'Arto Ryynanen'),(933943,28,'ConsumersTwitterInstruction','fr','Si vous ajoutez une application du service Twitter, vous pouvez connecter votre compte Twitter sur la page de votre profil en vue de l\'utiliser pour la connexion au portail ONLYOFFICE™. Cela vous permet également de trouver un compte Twitter d’une personne dans le module CRM et le lier sur la page « Modifier personne/entreprise », et ensuite afficher le fil d\'actualités sur Twitter.',NULL,'2016-11-09 11:10:12','text',2,NULL,'Nadine Yablonskaya'),(933676,28,'ConsumersTwitterInstruction','Neutral','If you add an application of the Twitter service you will be able to connect your Twitter account on your profile page so that you can sign in to the ONLYOFFICE™ portal using it. You will also be able to find a Twitter account of a person in the CRM module and link it on the \'Edit person/company\' page and then view Twitter news feed.','','2016-11-07 11:13:52','text',2,NULL,'Svetlana'),(933678,28,'ConsumersTwitterInstruction','ru','Добавив приложение сервиса Twitter, Вы сможете на странице своего профиля подключить вход на портал ONLYOFFICE™ с помощью аккаунта Twitter. Также Вы сможете на странице персоны или компании CRM привязывать аккаунт и читать новости Twitter.',NULL,'2016-11-03 07:52:36','text',2,NULL,'Svetlana'),(458706,28,'ConsumersTwitterKey','Neutral','Twitter ID','','2016-09-19 10:40:17','text',2,NULL,'Console'),(966280,28,'ConsumersTwitterKeyDefault','cs','Přístupový Token',NULL,'2017-05-02 08:14:19','text',2,NULL,'Jiří Redr'),(949962,28,'ConsumersTwitterKeyDefault','de','Zugriffstoken',NULL,'2017-01-30 08:34:58','text',2,NULL,'Evgenia'),(949139,28,'ConsumersTwitterKeyDefault','es','Token de acceso',NULL,'2017-01-26 09:29:49','text',2,NULL,'Ekaterina.Heidel'),(937658,28,'ConsumersTwitterKeyDefault','fi','Pääsyn merkkijono',NULL,'2017-01-08 14:50:39','text',2,NULL,'Arto Ryynanen'),(933680,28,'ConsumersTwitterKeyDefault','fr','Jeton d\'accès',NULL,'2016-11-07 08:46:38','text',2,NULL,'Nadine Yablonskaya'),(933549,28,'ConsumersTwitterKeyDefault','Neutral','Access Token','','2016-11-01 09:19:41','text',2,NULL,'Console'),(933604,28,'ConsumersTwitterKeyDefault','ru','Токен доступа',NULL,'2016-11-02 15:35:01','text',2,NULL,'Svetlana'),(458707,28,'ConsumersTwitterSecret','Neutral','Twitter Key','','2016-09-19 10:40:17','text',2,NULL,'Cons