ablonskaya'),(459587,28,'CookieSettingsTitle','Neutral','Cookie Settings','','2016-09-19 10:40:38','text',2,NULL,'Console'),(930402,28,'CookieSettingsTitle','ru','Настройки файлов cookie',NULL,'2016-10-04 14:01:35','text',2,NULL,'Svetlana'),(966666,28,'CopyToClipboard','cs','Kopírovat odkaz',NULL,'2017-05-02 11:47:09','text',2,NULL,'Jiří Redr'),(458714,28,'CopyToClipboard','Neutral','Copy the link','','2016-09-19 10:40:17','text',2,NULL,'Console'),(966669,28,'CorporateUse','cs','Firemní použití',NULL,'2017-05-02 11:47:57','text',2,NULL,'Jiří Redr'),(458715,28,'CorporateUse','Neutral','Corporate Use','','2016-09-19 10:40:17','text',2,NULL,'Console'),(968235,28,'CouldNotRecoverPasswordForLdapUser','cs','Obnovení hesla pro uživatele LDAP je zakázána',NULL,'2017-05-04 14:08:55','text',2,NULL,'Jiří Redr'),(458716,28,'CouldNotRecoverPasswordForLdapUser','Neutral','Password recovery operation is prohibited for an LDAP user','','2016-09-19 10:40:17','text',2,NULL,'Console'),(458717,28,'CreateButton','Neutral','Create','','2016-09-19 10:40:17','text',2,NULL,'Console'),(966691,28,'CreateNewProfile','cs','Vytvořit nový profil',NULL,'2017-05-02 11:59:53','text',2,NULL,'Jiří Redr'),(458718,28,'CreateNewProfile','Neutral','Create New Profile','','2016-09-19 10:40:17','text',2,NULL,'Console'),(967129,28,'CreateReportError','cs','Chyba během generování hlášení',NULL,'2017-05-03 08:40:38','text',2,NULL,'Jiří Redr'),(458719,28,'CreateReportError','Neutral','Error while generating report','','2016-09-19 10:40:18','text',2,NULL,'Console'),(458720,28,'CreatingBackup','Neutral','creating backup','','2016-09-19 10:40:18','text',2,NULL,'Console'),(458721,28,'CtrlEnterKeys','Neutral','Ctrl+Enter','','2016-09-19 10:40:18','text',2,NULL,'Console'),(458722,28,'Custom','Neutral','Custom','','2016-09-19 10:40:18','text',2,NULL,'Console'),(458723,28,'CustomDomainName','Neutral','Custom domain name','','2016-09-19 10:40:18','text',2,NULL,'Console'),(935462,28,'Customization','Neutral','Customization','','2016-11-30 13:41:27','text',2,NULL,'Console'),(936088,28,'Customization','ru','Кастомизация',NULL,'2016-12-15 14:09:26','text',2,NULL,'Svetlana'),(458724,28,'CustomNamingPeopleSchema','Neutral','Custom','','2016-09-19 10:40:18','text',2,NULL,'Console'),(458725,28,'DataBackup','Neutral','Data Backup','','2016-09-19 10:40:18','text',2,NULL,'Console'),(966155,28,'DataBackupHelp','cs','{0}Možnost zálohy dat{1} je použita pro zálohování portálových dat, aby je bylo možné později obnovit na Váš místní server nebo SaaS portál. Vyberte úložiště pro data (nezapomeňte vyplnit Vaše Amazon detaily, aby jste k nim měli přístup).{2} Pokud se rozhodnete zahrnout mail, pouze zprávy posledních 30 dní budou zálohovány.{2}\n{0}Poznámka:{1}musíte připojit účet třetí strany (DropBox, Box.com, OneDrive nebo Google Drive) k složce ONLYOFFICE Běžné Dokumenty před tím, než tam budete moci uložit vaše zálohovaná data.',NULL,'2017-04-28 14:45:48','text',2,NULL,'Jiří Redr'),(765991,28,'DataBackupHelp','de','Die Option {0}Daten-Backup{1} wird genutzt, um die Daten des Portals für die zukünftige Wiederherstellung auf dem lokalen Server oder SaaS-Portal zu sichern. Wählen Sie den Datenspeicher (vergessen Sie nicht die Angaben für den Zugriff auf Amazon einzugeben).{2}\nWenn Sie die E-Mail-Nachrichten einzuschließen wählen, werden nur die Nachrichten für den letzten 30 Tagen gesichert werden.\n{0}Hinweis:{1} Sie brauchen das Konto Dritter (Dropbox, Box.com, OneDrive oder Google Drive) mit ONLYOFFICE-Modul Dokumente zu verknüpfen, bevor Sie die Möglichkeit haben, Ihre Sicherungskopien dort zu speichern. ',NULL,'2016-07-15 12:23:04','text',2,NULL,'Console'),(765992,28,'DataBackupHelp','es','La opción {0}Copia de seguridad de datos{1} se usa para crear el backup de los datos de su portal para que usted pueda restaurarlos más tarde en su servidor local o portal SaaS. Seleccione el almacenamiento para los datos (no olvide introducir los detalles de Amazon para poder acceder a ellos).{2}\nSi decide incluir el correo, sólo los mensajes de los últimos 30 días serán respaldados.{2}\n{0}Nota:{1} usted necesita conectar su cuenta de tercer partido (Dropbox, Box.com, OneDrive o Google Drive) a la carpeta Documentos Comunes ONLYOFFICE antes para que pueda guardar su copia de seguridad allí.',NULL,'2016-07-15 12:23:10','text',2,NULL,'Console'),(944875,28,'DataBackupHelp','fi','{0}Varmuuskopiointi{1} mahdollistaa kaiken portaalin tiedon varmuuskopioinnin sen palauttamiseksi myöhemmin paikalliseen palvelimeen tai SaaS portaaliin. Valitse tallennuspaikka tiedolle.{2}Jos valitset sähköpostivaihtoehdon, niin vain viestit viimeiseltä 30 päivän ajalta tallennetaan. {2}{0}Huom:{1} sinun tulee yhdistää ulkopuolinen tallennuspalvelusi (Dropbox, Box.com, OneDrive tai Google Drive) ONLYOFFICE Asiakirjat moduuliin ennen kuin voit varmuuskopioida sinne.',NULL,'2017-01-15 12:44:55','text',2,NULL,'Arto Ryynanen'),(765994,28,'DataBackupHelp','fr','L\'option {0}Sauvegarde de données{1} est utilisée pour sauvegarder les données du portail pour pouvoir les restaurer plus tard sur le serveur local ou le portail SaaS. Sélectionez le stockage pour les données (n\'oubliez pas d\'ajouter vos details d\'Amazon afin de l\'accéder).{2}\nSi vous choisissez d\'inclure mail, seuls les messages pour les 30 derniers jours seront sauvegardés.{2}\n{0}Remarque:{1}vous devez connecter votre compte tiers (Dropbox, Box.com, OneDrive ou Google Drive) au dossier Documents Communs ONLYOFFICE avant que vous puissiez enregistrer votre sauvegarde.',NULL,'2016-07-15 12:23:25','text',2,NULL,'Console'),(765995,28,'DataBackupHelp','id','{0}Pilihan Backup Data{1} digunakan untuk membuat cadangan data portal agar dapat dikembalikan sewaktu-waktu ke server lokal atau portal SaaS. Pilihlah lokasi penyimpanan data (jangan lupa memasukkan rincian akun Amazon Anda agar dapat mengaksesnya).{2} {0}Catatan:{1} Anda harus menghubungkan akun pihak ketiga (Dropbox, Box.com, OneDrive atau Google Drive) dengan ONLYOFFICE Dokumen untuk dapat menyimpan backup di sana.',NULL,'2016-07-15 12:23:31','text',2,NULL,'Console'),(765996,28,'DataBackupHelp','it','{0}Backup dei dati{1} si usa per creare una copia di backup dei dati del portale per poter ripristinarla in seguito sul server locale o portale SaaS. Seleziona la risorsa di archiviazione per i dati (non dimenticare di inserire i tuoi dati di Amazon per accedere).{2}\n{0}Nota:{1} prima di poter salvare la copia di backup creata su un account esterno (Dropbox, Box.com, OneDrive o Google Drive) hai bisogno di collegarlo ai Documenti ONLYOFFICE.',NULL,'2016-07-15 12:23:39','text',2,NULL,'Console'),(458726,28,'DataBackupHelp','Neutral','{0}Data Backup{1} option is used to backup the portal data to be able to restore it later to your local server or SaaS portal. Select the storage for the data (do not forget to enter your Amazon details to be able to access it).{2}\nIf you choose to include mail, only the messages for the last 30 days will be backed up.{2}\n{0}Note:{1} you need to connect your third party account (DropBox, Box.com, OneDrive or Google Drive) to ONLYOFFICE Common Documents folder before you will be able to save your backup there.','','2016-09-19 10:40:18','text',2,NULL,'Console'),(961385,28,'DataBackupHelp','nl','{0}Gegevens backup{1} optie wordt gebruikt om een backup te maken en later te kunnen herstellen naar uw lokale portaal of SaaS protaal. Selecteer de gegevens opslag type (vergeet niet uw Amazon gegevens in te geven om er bij te kunnen.).{2}\nAls u de optie email selecteerd worden alleen de emails van de laatste 30 dagen opgenomen in de backup.{2}\n{0}Opmerking:{1} u dient eerst uw overige accounts (Dropbox, Box.com, OneDrive of Google Drive) toe te voegen aan de ONLYOFFICE algemene documenten folder voordat u uw backup op een van deze kunt bewaren.',NULL,'2017-03-30 07:39:41','text',2,NULL,'Hsing-Foo Wang'),(765997,28,'DataBackupHelp','pt-BR','A opção {0}Backup de Dados{1} é usada para fazer backup dos dados do portal para permitir restaurá-lo posteriormente para seu servidor local ou portal SaaS. Selecione o armazenamento para os dados (não se esqueça de inserir seus detalhes Amazon para conseguir ter acesso).{2}\n{0}Nota:{1} você precisa de uma conta de terceiros (Dropbox, Box.com, OneDrive ou Google Drive) para os Documentos ONLYOFFICE antes de poder salvar seu backup lá.',NULL,'2016-07-15 12:23:48','text',2,NULL,'Console'),(765998,28,'DataBackupHelp','ru','Опция {0}Резервное копирование данных{1} используется для создания резервной копии данных, чтобы в дальнейшем их можно было восстановить на локальном сервере или в SaaS-портале. Выберите хранилище для данных (не забудьте указать сведения для получения доступа к Amazon).{2}\nЕсли вы решили включить почту в резервную копию, в нее будут включены только сообщения за последние 30 дней.{2}\n{0}Обратите внимание:{1} прежде чем Вы сможете сохранять резервные копии в стороннем аккаунте (Dropbox, Box.com, OneDrive или Google Drive), потребуется подключить его к папке \"Общие документы\" ONLYOFFICE.',NULL,'2016-07-15 12:24:21','text',2,NULL,'Console'),(765999,28,'DataBackupHelp','sl','{0}Varnostno kopiranje podatkov{1} možnost je uporabljena za kasnejšnje obnavljanje podatkov na lokalni strežnik ali SaaS portal. Izberite shrambo podatkov (ne pozabite vnesti svojih Amazon podatkov, ki bodo omogočali dostop).{2} {0}Opomba:{1} Svoj tuj račun morate povezati (Dropbox, Box.com, OneDrive ali Google Drive) z ONLYOFFICE dokumenti, preden boste tam lahko shranili svoje varnostno kopiranje.\n',NULL,'2016-07-15 12:23:57','text',2,NULL,'Console'),(766000,28,'DataBackupHelp','tr','{0}Veri Yedekleme{1} seçeneği daha sonra geri yüklemek için portal verilerinin yedeklenmesini sağlar. Böylece sonradan yerel sunucunuza yada SaaS portalınıza geri yükleyebilirsiniz. Veri için depo seçin (erişebilmek için Amazon bilgilerinizi girmeyi unutmayın). {2} {0}Not:{1} Yedeklemenizi buraya kaydedebilmek için önceden üçüncü kişi hesabınızı (Dropbox, Box.com, OneDrive or Google Drive) ONLYOFFICE dökümanlarınıza bağlamanız gerekmektedir.',NULL,'2016-07-15 12:24:05','text',2,NULL,'Console'),(966751,28,'DataManagement','cs','Správa dat',NULL,'2017-05-02 12:42:30','text',2,NULL,'Jiří Redr'),(937205,28,'DataManagement','fi','Tiedon hallinta',NULL,'2017-01-07 14:20:44','text',2,NULL,'Arto Ryynanen'),(458727,28,'DataManagement','Neutral','Data Management','','2016-09-19 10:40:18','text',2,NULL,'Console'),(458728,28,'Day','Neutral','day','','2016-09-19 10:40:18','text',2,NULL,'Console'),(458729,28,'DaysOne','Neutral','days','','2016-09-19 10:40:18','text',2,NULL,'Console'),(458730,28,'DaysTwo','Neutral','days','','2016-09-19 10:40:18','text',2,NULL,'Console'),(458731,28,'DeactivateButton','Neutral','Deactivate','','2016-09-19 10:40:18','text',2,NULL,'Console'),(458732,28,'DeactivatePortalButton','Neutral','Deactivate','','2016-09-19 10:40:18','text',2,NULL,'Console'),(458733,28,'DeactivatePortalSuccessMessage','Neutral','Your account has been successfully deactivated.{0}In 10 seconds you will be redirected {1}here{2}','','2016-09-19 10:40:18','text',2,NULL,'Console'),(970551,28,'DeactivationDeletionPortal','cs','Portálová deaktivace/odstranění',NULL,'2017-05-12 14:22:19','text',2,NULL,'Jiří Redr'),(458734,28,'DeactivationDeletionPortal','Neutral','Portal Deactivation/Deletion','','2016-09-19 10:40:18','text',2,NULL,'Console'),(458735,28,'DeactivationDesc','Neutral','Use this option to deactivate your portal temporarily.','','2016-09-19 10:40:18','text',2,NULL,'Console'),(458736,28,'Default','Neutral','Default','','2016-09-19 10:40:18','text',2,NULL,'Console'),(967863,28,'DefaultPageSettingsChoiseOfProducts','cs','Volba Modulu',NULL,'2017-05-04 10:40:59','text',2,NULL,'Jiří Redr'),(944759,28,'DefaultPageSettingsChoiseOfProducts','fi','Moduulin valinta',NULL,'2017-01-15 11:37:53','text',2,NULL,'Arto Ryynanen'),(458737,28,'DefaultPageSettingsChoiseOfProducts','Neutral','Module choice','','2016-09-19 10:40:18','text',2,NULL,'Console'),(96675