'{!Guests}','','2016-09-19 10:40:22','text',2,NULL,'Console'),(967277,28,'GuestsCaption','cs','Návštěvníci',NULL,'2017-05-03 10:30:02','text',2,NULL,'Jiří Redr'),(458916,28,'GuestsCaption','Neutral','Guests','','2016-09-19 10:40:22','text',2,NULL,'Console'),(961708,28,'GuestsCaption','nl','Gasten',NULL,'2017-03-30 09:56:23','text',2,NULL,'Hsing-Foo Wang'),(970376,28,'Help','cs','Nápověda',NULL,'2017-05-10 21:06:10','text',2,NULL,'Jiří Dobruský'),(458917,28,'Help','Neutral','Help','','2016-09-19 10:40:22','text',2,NULL,'Console'),(967464,28,'HelpAnswerAccountDeactivation','cs','Pokud si přejete {1}deaktivovat{2} portál, Váš portál a všechny informace s ním spojené budou zablokovány tak, že k nim nikdo nebude mít přístup na určité období. Klikněte na tlačítko {1}Deaktivovat{2}. Odkaz pro potvrzení této operace bude odeslán na e-mailovou adresu vlastníka portálu.{0}V případě, že se chcete vrátit k ONLYOFFICE™  portálu a pokračovat v jeho užívání, musíte použít druhý odkaz v potvrzovacím e-mailu. Proto prosíme, uschovejte si tento e-mail na bezpečném místě.{0}Pokud si myslíte, že již nebudete ONLYOFFICE™  používat a budete ho chtít {1}odstranit{2} navždy, klikněte na tlačítko {1}Vymazat{2}. Prosím berte na vědomí, že pak nebudete moci znovu aktivovat nebo obnovit jakékoli informace, které s ním jsou spojené. ',NULL,'2017-05-03 12:10:14','text',2,NULL,'Jiří Redr'),(458918,28,'HelpAnswerAccountDeactivation','Neutral','If you wish to {1}deactivate{2} the portal, your portal and all information associated with it will be blocked so that no one has access to it for a particular period. To do that click the {1}Deactivate{2} button. A link to confirm the operation will be sent to the email address of the portal owner.{0}In case you want to come back to the ONLYOFFICE™ portal and resume using it you will need to use the second link provided in the confirmation email. So, please, keep this email in a safe place.{0}If you do not think you will use the ONLYOFFICE™ portal and would like to {1}delete{2} your portal permanently submit your request using the {1}Delete{2} button. Please, keep in mind that you will not be able to reactivate your portal or recover any information associated with it.','','2016-09-19 10:40:22','text',2,NULL,'Console'),(966224,28,'HelpAnswerAdminMessSettings','cs','{1}Nastavení správce zpráv{2}je způsob, jak kontaktovat administrátora portálu.{0}Povolit možnost pro zobrazení kontaktního formuláře na {1}Přihlašovací{2}stránce, takže lidé mohou poslat zprávu administrátorovi i v případě, když mají problém s přístupem na portál.{0}Nastavené parametry začnou fungovat poté, co kliknete na tlačítko {1}Uložit{2} v dolní části.',NULL,'2017-05-02 07:10:41','text',2,NULL,'Jiří Redr'),(458919,28,'HelpAnswerAdminMessSettings','Neutral','{1}Administrator Message Settings{2} is a way to contact the portal administrator.{0}Enable this option to display the contact form on the {1}Sign In{2} page so that people could send the message to the portal administrator in case they have troubles accessing the portal.{0}To make the parameters you set take effect click the {1}Save{2} button at the bottom of the section.','','2016-09-19 10:40:22','text',2,NULL,'Console'),(966259,28,'HelpAnswerColorTheme','cs','{1}Barevné motivy{2}Vám umožňují přizpůsobit Vaše portálové rozhraní podle Vaší firemní značky.{0}Vyberte jeden barevný motiv ze seznamu vlevo.{0}Chcete-li použít vybraný motiv, klikněte na tlačítko {1}Uložit{0} v dolní části.',NULL,'2017-05-02 07:15:38','text',2,NULL,'Jiří Redr'),(966196,28,'HelpAnswerColorTheme','fr','Lesd {1}thèmes de couleur{2} vous permettent de personnaliser l\'interface de votre portail pour l\'adapter au style de votre entreprise.{0} Sélectionnez un des thèmes de couleur dans la liste gauche.{0} Pour appliquer le thème de couleur sélectionné, cliquez sur le bouton {1}Enregistrer{2} en bas de cette section.',NULL,'2017-04-29 14:06:42','text',2,NULL,'Nadine Yablonskaya'),(458920,28,'HelpAnswerColorTheme','Neutral','{1}Color Themes{2} let you customize your portal interface according to your company brand.{0} Select one of the color themes from the list on the left.{0} To apply the selected color theme, click the {1}Save{2} button at the bottom of this section.','','2016-09-19 10:40:22','text',2,NULL,'Console'),(966157,28,'HelpAnswerDefaultPageSettings','cs','{0}Původní Výchozí stránka{1}je způsob výběru modulu, na který se dostanete přímo po přihlášení na portál nebo kliknutím na logo ONLYOFFICE™, pokud jste již přihlášeni. Kliknutím na {0}Ulož{1} v dolní sekci uložíte své nastavené své parametry.',NULL,'2017-04-28 14:55:29','text',2,NULL,'Jiří Redr'),(944874,28,'HelpAnswerDefaultPageSettings','fi','{0}Aloitussivun{1} avulla voit määritellä sen moduulin, joka avautuu kun kirjaudut sisään portaaliisi tai klikkaat ONLYOFFICE™ logoa, kun olet sisäänkirjautuneena. Kun olet tehnyt haluamasi määritykset, klikkaa {0}Tallenna{1} painiketta osion lopussa.',NULL,'2017-01-15 12:41:20','text',2,NULL,'Arto Ryynanen'),(458921,28,'HelpAnswerDefaultPageSettings','Neutral','{0}Default Start Page{1} is a way to select the module you go to right after you log in to the portal or click the ONLYOFFICE™ logo when you have already signed in. To make the parameters you set take effect click the {0}Save{1} button at the bottom of the section.','','2016-09-19 10:40:22','text',2,NULL,'Console'),(966260,28,'HelpAnswerDNSSettings','cs','{1}Nastavení DNS{2} je možnost, jak nastavit alternativní URL pro Váš ONLYOFFICE™ portál.{0}Zaškrtněte{1}Vlastní název domény{2}a zadejte Váš vlastní název domény pro ONLYOFFICE™ portál níže.{0}Chcete-li nastavené parametry aktivovat, klikněte na tlačítko {1}Uložit{2} v dolní části.',NULL,'2017-05-02 07:20:28','text',2,NULL,'Jiří Redr'),(458922,28,'HelpAnswerDNSSettings','Neutral','{1}DNS Settings{2} is a way to set an alternative URL for your ONLYOFFICE™ portal.{0}Check the {1}Custom domain name{2} box and specify your own domain name for the ONLYOFFICE™ portal in the field below.{0} To make the parameters you set take effect click the {1}Save{2} button at the bottom of the section.','','2016-09-19 10:40:22','text',2,NULL,'Console'),(966269,28,'HelpAnswerGreetingSettings','cs','{1}Nastavení uvítací stránky{2} je možnost, kterou změníte výchozí název portálu, který je zobrazen na {1}Uvítací stránce{2} Vašeho portálu. Stejný název se také používá pro pole{1}Od{2} ve vašich emailových upozornění Vašeho portálu.{0}Zadejte název, který chcete, do pole {1}Název{2}. ',NULL,'2017-05-02 08:06:59','text',2,NULL,'Jiří Redr'),(966193,28,'HelpAnswerGreetingSettings','fr','Les {1}paramètres de la page d\'accueil{2} est un moyen de changer le titre du portail par défaut qui s\'affiche sur la {1}Page d\'accueil{2} de votre portail.Ce titre est également utilisé pour le champ {1}De{2} des notifications par courrier électronique. {0}Entrez le nom dans le champ {1}Titre{2}.',NULL,'2017-04-29 14:03:39','text',2,NULL,'Nadine Yablonskaya'),(458923,28,'HelpAnswerGreetingSettings','Neutral','{1}Welcome Page Settings{2} is a way to change the default portal title to be displayed on the {1}Welcome Page{2} of your portal. The same name is also used for the {1}From{2} field of your portal email notifications.{0}Enter the name you like in the {1}Title{2} field.','','2016-09-19 10:40:22','text',2,NULL,'Console'),(971400,28,'HelpAnswerLinkInviteSettings','cs','Sdílejte odkaz a pozvěte své kolegy do Vašeho portálu. ',NULL,'2017-05-17 10:21:42','text',2,NULL,'Jiří Redr'),(458924,28,'HelpAnswerLinkInviteSettings','Neutral','Share the link to invite your colleagues to your portal.','','2016-09-19 10:40:22','text',2,NULL,'Console'),(961430,28,'HelpAnswerLinkInviteSettings','nl','Met de Uitnodigingslink kunt u mensen uitnodigen om gebruik te maken van je portaal.',NULL,'2017-03-30 07:49:38','text',2,NULL,'Hsing-Foo Wang'),(966262,28,'HelpAnswerLngTimeSettings','cs','{1}Nastavení jazyka a časového pásma{2}je možnost pro změnu jazyka na celém portálu pro všechny jeho uživatele a nastavení časového pásma tak, aby všechny události ONLYOFFICE™ portálu byly zobrazeny ve správném datu a času.{0}Chcete-li změněné parametry aktivovat, klikněte na tlačítko {1}Uložit{2} v dolní části.',NULL,'2017-05-02 07:29:50','text',2,NULL,'Jiří Redr'),(458925,28,'HelpAnswerLngTimeSettings','Neutral','{1}Language and Time Zone Settings{2} is a way to change the language of the whole portal for all portal users and to configure the time zone so that all the events of the ONLYOFFICE™ portal will be shown with the correct date and time.{0}To make the parameters you set take effect click the {1}Save{2} button at the bottom of the section.','','2016-09-19 10:40:22','text',2,NULL,'Console'),(966263,28,'HelpAnswerLogoSettings','cs','{1}Nastavení loga{2} je možnost, aby jste změnili logo, které je zobrazeno na {1}Uvítací stránce{2} Vašeho portálu.{0}Pro nahrazení portálového loga klikněte na odkaz {1}Změnit logo{1} vpravo a vyberte obrázek, který je uložen ve Vašem počítači, aby jste ho nahráli na portál.{0}Prosím berte na vědomí, že nemůžete nahrát obrázek větší než {1}250x100 pixelů{2}, jinak bude změněna jeho velikost. Maximální velikost obrázku nesmí překročit{1}1 MB{2}.',NULL,'2017-05-02 07:33:51','text',2,NULL,'Jiří Redr'),(458926,28,'HelpAnswerLogoSettings','Neutral','{1}Logo Settings{2} is a way to change the default logo to be displayed on the {1}Welcome Page{2} of your portal.{0} To replace the portal logo click the {1}Change Logo{2} link to the right and select the image stored on your computer to load it to your portal.{0}Please, keep in mind that you can upload an image not larger than {1}250x100 pixels{2}, otherwise resizing will take place. The maximum image size cannot exceed {1}1 MB{2}.','','2016-09-19 10:40:22','text',2,NULL,'Console'),(966268,28,'HelpAnswerMailDomainSettings','cs','{1}Nastavení důvěryhodné mailové domény{2} je možnost, která nastaví mailové servery používané pro vlastní registraci uživatele.{0}Buď můžete zaškrtnout možnost {1}Vlastní domény{2} a zadat důvěryhodné mailové server v polích níže, takže osoba, která má na něm účet, se bude moci zaregistrovat sám pomocí odkazu Připojit na {1}Přihlašovací{2}stránce nebo zakázat tuto volbu.{0}Chcete-li nově nastavené parametry aktivovat, klikněte na tlačítko {1}Uložit{2} v dolní části.',NULL,'2017-05-02 08:00:23','text',2,NULL,'Jiří Redr'),(458927,28,'HelpAnswerMailDomainSettings','Neutral','{1}Trusted Mail Domain Settings{2} is a way to specify the mail servers used for user self-registration.{0}You can either to check the {1}Custom domains{2} option and enter the trusted mail server in the field below so that person who has an account at it will be able to register him(her)self by clicking the Join link on the {1}Sign In{2} page or disable this option.{0}To make the parameters you set take effect click the {1}Save{2} button at the bottom of the section.','','2016-09-19 10:40:22','text',2,NULL,'Console'),(966264,28,'HelpAnswerPasswordSettings','cs','{1}Nastavení síly hesla{2} je způsob, jak určit efektivitu a odolnost hesla, pokud ho někdo bude chtít prolomit.{0}Použijte lištu{1}Minimální délka hesla{2} pro určení jeho délky. Zaškrtněte příslušné pole níže pro určení znaků, které musí heslo obsahovat.{0}Chcete-li nastavené parametry aktivovat, klikněte na tlačítko {1}Uložit{2} v dolní části.',NULL,'2017-05-02 07:39:03','text',2,NULL,'Jiří Redr'),(458928,28,'HelpAnswerPasswordSettings','Neutral','{1}Password Strength Settings{2}is a way to determine the effectiveness of a password in resisting guessing and brute-force attacks.{0}Use the {1}Minimum Password Length{2} bar to determine how long the password should be. Check the appropriate boxes below to determine the character set that must be used in the password.{0}To make the parameters you set take effect click the {1}Save{2} button at the bottom of the section.','','2016-09-19 10:40:22','text',2,NULL,'Console'),(966266,28,'HelpAnswerPortalAccessSettings','cs','{1}Veřejný portál{2} je volná volba, která umožňuje komukoli vidět Váš veřejný obsah bez registrace. Žádné soukromé projekty nejsou k dispozici a CRM modul je pro takové portály zakázán.{0}Registrace veřejných portálů není omezena počtem uživatelů, noví uživatelé jsou přidáni na žádost portálového administrátora. Použijte možnost {1}Zaregistrovat nové uživatele okamžitě{2}, aby jste odstranili nutnost potvrzení registrace.',NULL,'2017-05-02 07:45:53','text',2,NULL,'Jiří Redr'),(944876,28,'HelpAnswerPortalAccessSettings','fi','{1}Julkinen portaali{2} on ilmainen vaihtoehto, joka mahdollistaa kenen tahansa selata julkista tietoasi ilman rekisteröintiä. Yksityisiä projekteja ei ole saatavilla ja Asiakkuudenhallinnan moduuli on poistettu käytöstä.{0}Rekisteröityneiden käyttäjien määrää ei ole rajoitettu ja portaalin ylläpitäjä voi hyväksyä rekisteröinnin pyynnöt. Käytä {1}Hyväksy uudet käyttäjät välittömästi{2} poistaaksesi kaikki rajoitukset sivustosi rekisteröinnin vahvistukseen.',NULL,'2017-01-15 12:47:15','text',2,NULL,'Arto Ryynanen'),(458929,28,'HelpAnswerPortalAccessSettings','Neutral','{1}Public Portal{2} is a free option that allows anyone to view your public contents without registration. No private projects are available and the CRM module is disabled for such portals.{0}Registration to public portals is not limited in number of users, new users are added upon the request to the portal administrator. Use the {1}Register new users Immediately{2} option to remove any registration confirmation necessity.','','2016-09-19 10:40:22','text',2,NULL,'Console'),(967288,28,'HelpAnswerPortalRename','cs','Zde můžete změnit Vaši adresu portálu. Vložte část, která se objeví vedle onlyoffice.com/onlyoffice.eu portálové adresy.{0}\n{1}Upozornění{2}: Vaše stará portálová adresa bude dostupná pouze pro uživatele ONLYOFFICE poté, co kliknete na tlačítko {1}Uložit{2}. ',NULL,'2017-05-03 10:35:56','text',2,NULL,'Jiří Redr'),(950753,28,'HelpAnswerPortalRename','de','Hier können Sie Ihre Portaladresse ändern. Geben Sie den Teil ein, der neben der onlyoffice.com/onlyoffice.eu Portal-Adresse angezeigt wird.{0}\n{1}Sei bemerkt{2}: Ihre alte Portal-Adresse steht zu Verfügung für neue ONLYOFFICE Benutzer, sobald Sie die Druckschalter {1}Speichern{2} klicken.',NULL,'2017-02-07 07:45:32','text',2,NULL,'Александр'),(950755,28,'HelpAnswerPortalRename','es','Puede cambiar la dericción de su portal aquí. Introduzca la parte que aparecerá junto a la dirección de portal onlyoffice.com/onlyoffice.eu.{0}\n{1}Por favor note{2}: su dirección de portal anterior estará disponible para nuevos usuarios de ONLYOFFICE al hacer clic en el botón {1}Guardar{2}.',NULL,'2017-02-07 07:45:58','text',2,NULL,'Александр'),(950756,28,'HelpAnswerPortalRename','fi','Tässä voit vaihtaa portaalisi osoitteen. Syötä osa joka ilimaantuu onlyoffice.com/onlyoffice.eu portaalin osoitteen oheen.{0}\n{1}Huom{2}: portaalisi osoite tulee saataville uusille ONLYOFFICE käyttäjille sen jälkeen kun klikkaat {1}Tallenna{2} painiketta.',NULL,'2017-02-07 07:46:22','text',2,NULL,'Александр'),(966194,28,'HelpAnswerPortalRename','fr','Ici vous pouvez changer l\'adresse du portail. Entrez la partie de l\'adresse du portail qui va apparaître à côté de onlyoffice.com/onlyoffice.eu.{0}\n{1}Remarque{2} : votre ancienne adresse du portail sera disponible pour les nouveaux utilisateurs de ONLYOFFICE une fois que vous cliquez sur le bouton {1}Enregistrer{2}.',NULL,'2017-04-29 14:04:29','text',2,NULL,'Nadine Yablonskaya'),(950758,28,'HelpAnswerPortalRename','it','Qui tu puoi cambiare il tuo indirizzo portale. Inserisci la parte che apparirà accanto all\'indirizzo portale onlyoffice.com/onlyoffice.eu.{0}\n{1}Nota{2}: il tuo vecchio indirizzo portale sarà disponibile per i nuovi utenti di ONLYOFFICE una volta che tu fai clic sul pulsante {1}Salva{2}.',NULL,'2017-02-07 07:47:09','text',2,NULL,'Александр'),(950752,28,'HelpAnswerPortalRename','Neutral','Here you can change your portal address. Enter the part that will appear next to the onlyoffice.com/onlyoffice.eu portal address.{0}\n{1}Please note{2}: your old portal address will become available to new ONLYOFFICE users once you click the {1}Save{2} button.','','2017-02-13 09:10:21','text',2,NULL,'Александр'),(950759,28,'HelpAnswerPortalRename','ru','Здесь вы можете изменить адрес портала. Введите часть адреса портала, которая идет перед onlyoffice.com/onlyoffice.eu.{0}\n{1}Обратите внимание{2}: ваш старый адрес портала станет доступен для новых пользователей ONLYOFFICE, как только вы нажмете кнопку {1}Сохранить{2}.',NULL,'2017-02-07 07:47:31','text',2,NULL,'Александр'),(966265,28,'HelpAnswerPortalVersion','cs','{1}Verze portálu{2} je možnost, která dovoluje přepínat mezi dostupnými verzemi ONLYOFFICE™  portálu. {0}Buď můžete použít novou verzi, nebo přepnout zpátky do předchozí verze portálu.{0} Chcete-li nastavené parametry aktivovat, klikněte na tlačítko{1}Uložit{2} v dolní části. ',NULL,'2017-05-02 07:41:36','text',2,NULL,'Jiří Redr'),(966195,28,'HelpAnswerPortalVersion','fr','La{1}version du portail{2} est un moyen de commuter entre les versions disponibles du portail ONLYOFFICE™.{0}Vous pouvez utiliser la nouvelle version ou revenir à la version précédente du portail.{0}Pour valider les changements effectués, cliquez sur le bouton {1}Enregistrer{2} en bas de la section.',NULL,'2017-04-29 14:05:24','text',2,NULL,'Nadine Yablonskaya'),(458931,28,'HelpAnswerPortalVersion','Neutral','{1}Portal Version{2} is a way to switch between the available ONLYOFFICE™ portal versions.{0}You can either use the new version or switch back to the previous version of the portal.{0}To make the parameters you set take effect click the {1}Save{2} button at the bottom of the section.','','2016-09-19 10:40:22','text',2,NULL,'Console'),(966267,28,'HelpAnswerTeamTemplate','cs','{1}Týmová šablona{2} je přizpůsobitelný způsob, jak nastavit název organizace (nebo skupiny), její členy nebo jejich aktivity.{0}Vyberte si ze seznamu{1}Šablon{2} dostupnou přednastavenou volbu nebo zadejte vlastní názvy vybráním možnosti {1}Vlastní{2} ze seznamu.{0}Chcete-li aktivovat nové nastavení, klikněte na tlačítko {1}Uložit{2} v dolní části.',NULL,'2017-05-02 07:53:25','text',2,NULL,'Jiří Redr'),(458932,28,'HelpAnswerTeamTemplate','Neutral','{1}Team Template{2} is a customizable way to name the organization (or group), its members and their activities.{0}Drop down the {1}Template{2} list to choose one of the available presets or enter the names yourselves selecting the {1}Custom{2} option from the list.{0}To apply the selected template use the {1}Save{2} button at the bottom of the section.','','2016-09-19 10:40:22','text',2,NULL,'Console'),(967820,28,'HelpAnswerTransferPortal','cs','Migrace portál na server nejblíže Vaší geografické poloze zajistí rychlejší odezvu portálu. Čím blíže jsou Vaši uživatelé a klienti k serveru, tím rychlejší bude portál.{0}Pro zahájení migračního procesu klikněte na tlačítko {1}Změnit region server{2} v dolní sekci.{0}{1}Poznámka:{2}již nemůžete zrušit proces migrace poté, co ji spustíte. Upozorňujeme také, že z důvodu technických omezení bude přesunuta pouze pošta posledních 30 dní.',NULL,'2017-05-04 09:22:18','text',2,NULL,'Jiří Redr'),(458933,28,'HelpAnswerTransferPortal','Neutral','Migrating the portal to the servers of the region closest to your geographical location will make the portal response faster. The closer your users and clients are located to the server region, the faster the portal speed will be.{0}To start the migration process click the {1}Change Server Region{2} button at the section bottom.{0}{1}Note:{2} once the process is started, it cannot be canceled. Please also note that due to technical limitations only the mail for the last 30 days will be transferred.','','2016-09-19 10:40:22','text',2,NULL,'Console'),(967286,28,'HelpCenter','cs','Centrum nápovědy',NULL,'2017-05-03 10:33:17','text',2,NULL,'Jiří Redr'),(458934,28,'HelpCenter','Neutral','Help Center','','2016-09-19 10:40:22','text',2,NULL,'Console'),