ekle',NULL,'2016-11-24 11:48:17','text',3,NULL,'Console'),(771549,28,'InviteUsersAsCollaborators','uk','Додати користувачів як гостів',NULL,'2016-11-24 11:48:17','text',3,NULL,'Console'),(967611,28,'InviteUsersToPortalLink','cs','Pozvat uživatele do portálu',NULL,'2017-05-04 06:14:37','text',2,NULL,'Jiří Redr'),(950953,28,'InviteUsersToPortalLink','de','Benutzer zu dem Portal einladen',NULL,'2017-02-13 09:38:16','text',2,NULL,'Evgenia'),(950329,28,'InviteUsersToPortalLink','es','Invitar usuarios al portal',NULL,'2017-02-01 12:40:54','text',2,NULL,'Ekaterina.Heidel'),(937072,28,'InviteUsersToPortalLink','fi','Kutsu käyttäjiä portaaliin',NULL,'2017-01-11 07:26:37','text',3,NULL,'Arto Ryynanen'),(938652,28,'InviteUsersToPortalLink','fr','Inviter des utilisateurs sur le portail',NULL,'2017-01-11 07:29:30','text',2,NULL,'Александр'),(771553,28,'InviteUsersToPortalLink','it','Invita utenti al portale',NULL,'2016-11-24 11:48:39','text',3,NULL,'Console'),(938651,28,'InviteUsersToPortalLink','Neutral','Invite users to portal','','2017-01-19 16:23:35','text',2,NULL,'Александр'),(949884,28,'InviteUsersToPortalLink','ru','Пригласить пользователей',NULL,'2017-01-28 09:36:21','text',2,NULL,'Svetlana'),(771555,28,'InviteUsersToPortalLink','sl','Povabi uporabnike na portal',NULL,'2016-11-24 11:48:39','text',3,NULL,'Console'),(459019,28,'IPSecurityDisable','Neutral','Disable','','2016-09-19 10:40:24','text',2,NULL,'Console'),(966826,28,'IPSecurityEnable','cs','Povolit',NULL,'2017-05-02 13:34:50','text',2,NULL,'Jiří Redr'),(459020,28,'IPSecurityEnable','Neutral','Enable','','2016-09-19 10:40:24','text',2,NULL,'Console'),(966160,28,'IpSecurityHelp','cs','{0}Zabezpečení IP{1} je použita pro omezení přihlášení do portálu ze všech IP adres kromě určitých adres. Můžete nastavit povolené IP adresy použitím jejich přesné IP adresy v IPv4 formátu (#.#.#.#, kde # jsou hodnoty od 0 až 255) nebo rozsah IP (ve formátu #.#.#.#-#.#.#.#). IP zabezpečení nefunguje pro majitele portálů, ti se mohou přihlásit z jakékoli IP adresy.',NULL,'2017-04-28 15:02:45','text',2,NULL,'Jiří Redr'),(950940,28,'IpSecurityHelp','de','{0}IP-Sicherheit{1} wird genutzt, um den Zugriff auf das Portal für alle IP-Adressen außer für bestimmte einzuschränken. Sie können die zugelassenen IP-Adressen mithilfe von exakten IP-Adressen im IPv4-Format (#.#.#.#, wo # ein nummerischer Wert von 0 bis 255 ist) oder IP-Adressbereich (im Format #.#.#.#-#.#.#.#) einstellen.',NULL,'2017-02-13 09:34:59','text',2,NULL,'Evgenia'),(950316,28,'IpSecurityHelp','es','{0}Seguridad de IP{1} se usa para restringir acceso al portal de todas las direcciones IP excepto las direcciones especificadas. Usted puede especificar las direcciones IP permitidas usando las direcciones IP precisas en el formato IPv4 (#.#.#.#, donde # es un valor numérico de 0 a 255) o un rango de las direcciones IP (en el formato #.#.#.#-#.#.#.#). Seguridad de IP no funciona para propietarios de portal, ellos pueden entrar en el portal desde cualquiera dirección IP.',NULL,'2017-02-01 11:56:31','text',2,NULL,'Ekaterina.Heidel'),(459021,28,'IpSecurityHelp','Neutral','{0}IP Security{1} is used to restrict login to the portal from all IP addresses except certain addresses. You can set the allowed IP addresses using either exact IP addresses in the IPv4 format (#.#.#.#, where # is a numeric value from 0 to 255) or IP range (in the #.#.#.#-#.#.#.# format). The IP security does not work for portal owners, they can access the portal from any IP address.','','2016-09-19 10:40:24','text',2,NULL,'Console'),(967628,28,'IpSecurityNav','cs','Zabezpečení protokolu TCP/IP',NULL,'2017-05-04 06:20:04','text',2,NULL,'Jiří Redr'),(459022,28,'IpSecurityNav','Neutral','IP Security','','2016-09-19 10:40:24','text',2,NULL,'Console'),(967196,28,'IpSecurityWarning','cs','Nejdřív se musí určit Vaše aktuální IP adresa nebo její rozsah, jinak bude zablokován Váš přístup do portálu hned poté, co uložíte nastavení. Vlastník portálu bude mít přístup k portálu z jakékoli IP adresy. ',NULL,'2017-05-03 09:11:02','text',2,NULL,'Jiří Redr'),(937737,28,'IpSecurityWarning','fi','Ensin sinun tulee määritellä nykyinen IP-osoitteesi tai IP-osoitteen alue, johon nykyinen IP-osoitteesi kuuluu, muussa tapaukessa portaaliisi pääsy voidaan estää heti asetusten talletuksen jälkeen. Portaalin omistajalla on pääsy portaaliin mistä tahansa IP-osoitteesta.',NULL,'2017-01-08 15:27:31','text',2,NULL,'Arto Ryynanen'),(459023,28,'IpSecurityWarning','Neutral','First you need to specify your current IP or the IP range your current IP address belongs to, otherwise your portal access will be blocked right after you save the settings. The portal owner will have the portal access from any IP address.','','2016-09-19 10:40:24','text',2,NULL,'Console'),(967814,28,'IsMailMigration','cs','Migrovat také ONLYOFFICE™ Mail (není doporučeno)',NULL,'2017-05-04 09:16:58','text',2,NULL,'Jiří Redr'),(459024,28,'IsMailMigration','Neutral','Migrate ONLYOFFICE™ Mail as well (not recommended)','','2016-09-19 10:40:25','text',2,NULL,'Console'),(967634,28,'IssuerURL','cs','URL emitenta ',NULL,'2017-05-04 06:22:45','text',2,NULL,'Jiří Redr'),(459025,28,'IssuerURL','Neutral','Issuer URL','','2016-09-19 10:40:25','text',2,NULL,'Console'),(966389,28,'JoinToAffilliateProgram','cs','Staňte se naším Affiliate',NULL,'2017-05-02 09:17:18','text',2,NULL,'Jiří Redr'),(459026,28,'JoinToAffilliateProgram','Neutral','Become our Affiliate','','2016-09-19 10:40:25','text',2,NULL,'Console'),(950989,28,'KeepTariffInviteGuests','de','Sie können weitere Benutzer als {!guests} hinzufügen oder den Zahlungsplan auf einen anderen ändern, der höhere Benutzeranzahl zulässt.',NULL,'2017-02-14 08:20:05','text',2,NULL,'Evgenia'),(956359,28,'KeepTariffInviteGuests','es','Usted puede seguir añadiendo a usuarios como {!guests} o pasar al plan de precios con el número de usuarios más grande.',NULL,'2017-03-06 14:32:11','text',2,NULL,'Александр'),(771635,28,'KeepTariffInviteGuests','fi','Voit jatkaa käyttäjien l