pTariffInviteGuests','uk','Можна продовжити додавати учасників як гостей або змінити тарифний план на тарифний план з більшою кількістю користувачів.\n',NULL,'2016-11-24 11:49:16','text',3,NULL,'Console'),(966770,28,'LabelDontShowMessage','cs','Nezobrazovat tuto zprávu',NULL,'2017-05-02 12:51:33','text',2,NULL,'Jiří Redr'),(459028,28,'LabelDontShowMessage','Neutral','Do not show this message','','2016-09-19 10:40:25','text',2,NULL,'Console'),(967656,28,'Language','cs','Jazyk',NULL,'2017-05-04 06:28:36','text',2,NULL,'Jiří Redr'),(459029,28,'Language','Neutral','Language','','2016-09-19 10:40:25','text',2,NULL,'Console'),(970377,28,'LastName','cs','Příjmení',NULL,'2017-05-10 21:06:14','text',2,NULL,'Jiří Dobruský'),(459030,28,'LastName','Neutral','Last Name','','2016-09-19 10:40:25','text',2,NULL,'Console'),(967672,28,'LdapSettings','cs','LDAP nastavení',NULL,'2017-05-04 06:30:30','text',2,NULL,'Jiří Redr'),(459031,28,'LdapSettings','Neutral','LDAP Settings','','2016-09-19 10:40:25','text',2,NULL,'Console'),(938023,28,'LdapSettingsAuthentication','fi','Käyttäjän todentaminen',NULL,'2017-01-09 06:30:43','text',2,NULL,'Arto Ryynanen'),(459032,28,'LdapSettingsAuthentication','Neutral','User Authentication','','2016-09-19 10:40:25','text',2,NULL,'Console'),(966831,28,'LdapSettingsAuthenticationHelper','cs','Povolit tuto možnost, pokud nemá současný Windows uživatel práva na čtení z LDAP serveru/Active Directory a zadejte údaje jiného uživatele, který má čtecí práva.',NULL,'2017-05-02 13:38:45','text',2,NULL,'Jiří Redr'),(937712,28,'LdapSettingsAuthenticationHelper','fi','Ota käyttöön tämä vaihtoehto, jos nykyisellä Windows käyttäjällä ei ole oikeuksia lukea LDAP palvelimelta/Active Directory hakemistosta, ja syötä toisen käyttäjän tunnukset jolla on lukuoikeus.',NULL,'2017-01-08 15:14:49','text',2,NULL,'Arto Ryynanen'),(459033,28,'LdapSettingsAuthenticationHelper','Neutral','Enable this option if the current Windows user does not have rights to read from LDAP server/Active Directory, and enter the credentials of another user with the read rights.','','2016-09-19 10:40:25','text',2,NULL,'Console'),(966613,28,'LdapSettingsConnectError','cs','Chyba připojení',NULL,'2017-05-02 11:27:57','text',2,NULL,'Jiří Redr'),(459034,28,'LdapSettingsConnectError','Neutral','Connection error','','2016-09-19 10:40:25','text',2,NULL,'Console'),(950194,28,'LdapSettingsDscr','es','El módulo LDAP permite importar usuarios o grupos del servidor LDAP, también realizar autentificación de usuarios en el portal usando login/contraseña almacenados en el servidor LDAP. Usuarios serán importados inmediatamente después de guardar los ajustes. Usuarios nuevos añadidos más tarde serán importados durante su primera autentificación en el portal. Se puede actualizar inmediatamente información sobre los usuarios editada en el servidor LDAP usando el botón \'Sincronizar LDAP\' abajo. Se puede ajustar el módulo LDAP de una manera flexible según las necesidades específicas, pero se requieren unos 	conocimientos ciertos en LDAP.',NULL,'2017-01-31 09:50:33','text',2,NULL,'Ekaterina.Heidel'),(933954,28,'LdapSettingsDscr','fr','Le module LDAP permet d\'importer des utilisateurs et des groupes à partir d\'un serveur LDAP. Il permet, aussi, de réaliser l\'authentification de l\'utilisateur en utilisant l\'identifiant et le mot de passe stockés au sein du LDAP. Les utilisateurs seront importés immédiatement après l\'enregistrement des paramètres. L\'information sur les utilisateurs modifiée sur le serveur LDAP peut être mise à jour immédiatement à l\'aide du bouton \'Synchroniser LDAP. Le module LDAP peut être configuré de façon très flexible pour répondre à des besoins précis, de ce fait, une certaine connaissance LDAP est requise.',NULL,'2016-11-09 13:18:12','text',2,NULL,'Nadine Yablonskaya'),(933551,28,'LdapSettingsDscr','Neutral','The LDAP module allows you to import users and groups from the LDAP server, as well as provide user authentication on the portal using the login/password, stored in an LDAP server. Users will be imported immediately after saving the settings. New users added later will be imported during their first authentication on the portal. The information about the users edited at the LDAP server can be immediately updated using the \'Sync LDAP\' button below. The LDAP module can be very flexibly configured to meet specific needs, but also requires some knowledge of LDAP.','','2016-11-01 09:19:47','text',2,NULL,'Console'),(933617,28,'LdapSettingsDscr','ru','Модуль LDAP позволяет импортировать пользователей и группы с сервера LDAP, а также осуществлять аутентификацию пользователей на портале с помощью логина и пароля, сохраненных на сервере LDAP. Пользователи будут импортированы сразу после сохранения настроек. Новые пользователи, добавленные позже, будут импортированы при их первой аутентификации на портале. Информацию о пользователях, измененную на сервере LDAP, можно мгновенно обновить, нажав кнопку \'Синхронизировать LDAP\' ниже. Модуль LDAP можно очень гибко настроить в соответствии с конкретными требованиями, но для этого также требуются определенные знания LDAP.',NULL,'2016-11-02 15:52:04','text',2,NULL,'Svetlana'),(966821,28,'LdapSettingsEmptyField','cs','Prázdné pole',NULL,'2017-05-02 13:34:37','text',2,NULL,'Jiří Redr'),(459035,28,'LdapSettingsEmptyField','Neutral','Empty field','','2016-09-19 10:40:25','text',2,NULL,'Console'),(966833,28,'LdapSettingsEnableLdapAuthenticationHelper','cs','Povolit tuto možnost, pokud chcete přidat uživatele z LDAP serveru/Active Directory do ONLYOFFICE™ automaticky. Přidaní uživatelé se mohou autorizovat pomocí pověření jejich LDAP serveru/Active Directory. ONLYOFFICE™ neukládá uživatelská hesla lokálně a autentizace probíhá odesláním uživatelské jména a hesla na LDAP server/Active Directory.',NULL,'2017-05-03 07:20:40','text',2,NULL,'Jiří Redr'),(459036,28,'LdapSettingsEnableLdapAuthenticationHelper','Neutral','Enable this option if you want to add users from LDAP server/Active Directory to ONLYOFFICE™ automatically. The added users will be able to authorize using their LDAP server/Active Directory credentials. ONLYOFFICE™ does not save the user passwords locally and will authenticate users sending their login and password to LDAP server/Active Directory.','','2016-09-19 10:40:25','text',2,NULL,'Console'),(938028,28,'LdapSettingsErrorCantCreateUsers','fi','Käyttäjiä ei voitu luoda, vastaanotettu tieto on virheellinen.',NULL,'2017-01-09 06:33:08','text',2,NULL,'Arto Ryynanen'),(459037,28,'LdapSettingsErrorCantCreateUsers','Neutral','Users could not be created, the received data are incorrect.','','2016-09-19 10:40:25','text',2,NULL,'Console'),(937978,28,'LdapSettingsErrorCantGetLdapSettings','fi','Palvelin ei kyennyt saamaan asetuksia.',NULL,'2017-01-09 06:12:52','text',2,NULL,'Arto Ryynanen'),(459038,28,'LdapSettingsErrorCantGetLdapSettings','Neutral','The server could not get settings.','','2016-09-19 10:40:25','text',2,NULL,'Console'),(937979,28,'LdapSettingsErrorCantSaveLdapSettings','fi','Palvelin ei kyennyt tallentamaan asetuksia.',NULL,'2017-01-09 06:13:08','text',2,NULL,'Arto Ryynanen'),(459039,28,'LdapSettingsErrorCantSaveLdapSettings','Neutral','The server could not save settings.','','2016-09-19 10:40:25','text',2,NULL,'Console'),(967490,28,'LdapSettingsErrorCredentialsNotValid','cs','Špatné přihlašovací jméno nebo heslo',NULL,'2017-05-03 12:19:17','text',2,NULL,'Jiří Redr'),(937767,28,'LdapSettingsErrorCredentialsNotValid','fi','Virheellinen tunnus tai salasana.',NULL,'2017-01-08 15:38:49','text',2,NULL,'Arto Ryynanen'),(459040,28,'LdapSettingsErrorCredentialsNotValid','Neutral','Incorrect login or password.','','2016-09-19 10:40:25','text',2,NULL,'Console'),(967671,28,'LdapSettingsErrorDomainNotFound','cs','LDAP doména nebyla nalezena.',NULL,'2017-05-04 06:30:25','text',2,NULL,'Jiří Redr'),(950023,28,'LdapSettingsErrorDomainNotFound','de','LDAP Domain ist nicht gefunden.',NULL,'2017-01-30 10:55:32','text',2,NULL,'Evgenia'),(9