onnées, il suffit de mettre à jour l\'{0}IP de Mail Server{1} et/ou les informations d\'identification ici. Si vous avez créé un nouveau {0}Mail Server{1} et vous souhaitez le connecter, vous devez d\'abord supprimer les anciennes données sur la {2}page de Mail Server{3}.',NULL,'2016-10-31 11:54:19','text',2,NULL,'Nadine Yablonskaya'),(459584,28,'MailServiceWarning','Neutral','Warning: you already have Mail Domain settings and mailboxes for users present in your {0}Mail{1} module. Changing the settings here you realize that these changes can affect their work and result in mail server failure. If you completely moved the {0}Mail Server{1} to another computer and/or changed database access credentials, just update the {0}Mail Server IP{1} and/or credentials here. If you created a new {0}Mail Server{1} and want to connect it, you need to delete the old data at the {2}Mail Server page{3} first.','','2016-09-19 10:40:38','text',2,NULL,'Console'),(930449,28,'MailServiceWarning','ru','Предупреждение: у вас уже есть настройки почтового домена и почтовые ящики для пользователей в модуле {0}Почта{1}. Изменяя настройки здесь, вы должны понимать, что эти изменения могут повлиять на их работу и вызвать сбой в работе почтового сервера. Если вы полностью перенесли {0}Почтовый сервер{1} на другой компьютер и/или изменили учетные данные для доступа к базе данных, просто обновите здесь {0}IP-адрес почтового сервера{1} и/или учетные данные. Если вы создали новый {0}Почтовый сервер{1} и хотите его подключить, сначала необходимо удалить старые данные на {2}странице Почтового сервера{3}.',NULL,'2016-10-04 15:37:24','text',2,NULL,'Svetlana'),(968148,28,'MainPageTitle','cs','ONLYOFFICE™',NULL,'2017-05-04 13:08:30','text',2,NULL,'Jiří Redr'),(459142,28,'MainPageTitle','Neutral','ONLYOFFICE™','','2016-09-19 10:40:27','text',2,NULL,'Console'),(961657,28,'MainPageTitle','nl','ONLYOFFICE™',NULL,'2017-03-30 09:45:48','text',2,NULL,'Hsing-Foo Wang'),(967781,28,'MaleSexStatus','cs','Muž',NULL,'20