420,28,'PricingPageSettingsCbxText','ru','Страница платежей доступна только для администраторов',NULL,'2016-10-04 14:36:25','text',2,NULL,'Svetlana'),(966163,28,'PricingPageSettingsHelp','cs','{0}Nastavení cenové stránky{1} dovoluje portálovým administrátorům povolit nebo zakázat viditelnost cenovou stránku všem uživatelům nebo nastavit viditelnost pouze pro portálové administrátory.',NULL,'2017-04-28 15:07:54','text',2,NULL,'Jiří Redr'),(950903,28,'PricingPageSettingsHelp','de','{0}Einstellungen der Preise-Seite{1} ermöglichen dem Portaladministrator, die Sichtbarkeit der Preise-Seite für alle Benutzer zu aktivieren oder zu deaktivieren, indem sie nur für die Portaladministratoren sichtbar wird.',NULL,'2017-02-13 08:07:56','text',2,NULL,'Evgenia'),(949125,28,'PricingPageSettingsHelp','es','{0}Ajustes de la Página de Pagos{1} permiten al administrador de portal activar o desactivar la visibilidad de la página de pagos para todos los usuarios haciendola visible solo para administradores de portal.',NULL,'2017-01-26 09:24:24','text',2,NULL,'Ekaterina.Heidel'),(937090,28,'PricingPageSettingsHelp','fi','{0}Hinnoittelusivun Asetukset{1} antaa mahdollisuuden portaalin pääkäyttäjän näyttää tai poistaa näkyvistä hinnoittelusivun näkyvyyden kaikille käyttäjille siten että pääkäyttäjät vain näkevät sen.',NULL,'2017-01-07 09:01:01','text',2,NULL,'Arto Ryynanen'),(933408,28,'PricingPageSettingsHelp','fr','Les {0}paramètres de la page des prix{1} permettent à l\'administrateur du portail d\'activer ou de désactiver la visibilité de la page des prix pour tous les utilisateurs en la rendant visible uniquement aux administrateurs du portail.',NULL,'2016-10-28 10:38:10','text',2,NULL,'Nadine Yablonskaya'),(459589,28,'PricingPageSettingsHelp','Neutral','{0}Pricing Page Settings{1} allow the portal administrator to enable or disable the pricing page visibility to all users making it visible to the portal administrators only.','','2016-09-19 10:40:38','text',2,NULL,'Console'),(930418,28,'PricingPageSettingsHelp','ru','{0}Настройки страницы платежей{1} позволяют администратору портала включить или отключить видимость страницы платежей для всех пользователей, сделав ее видимой только для администраторов портала.',NULL,'2016-10-04 14:35:30','text',2,NULL,'Svetlana'),(970581,28,'PricingPageSettingsTitle','cs','Nastavení cenové stránky',NULL,'2017-05-12 14:36:38','text',2,NULL,'Jiří Redr'),(950045,28,'PricingPageSettingsTitle','de','Einstellungen der Preisgestaltung-Seite',NULL,'2017-01-30 11:23:02','text',2,NULL,'Evgenia'),(950148,28,'PricingPageSettingsTitle','es','Ajustes de Página de Pagos',NULL,'2017-01-31 07:01:48','text',2,NULL,'Ekaterina.Heidel'),(937955,28,'PricingPageSettingsTitle','fi','Hinnoittelusivun asetukset',NULL,'2017-01-09 05:54:58','text',2,NULL,'Arto Ryynanen'),(933443,28,'PricingPageSettingsTitle','fr','Paramètres de la page des prix',NULL,'2016-10-28 13:03:58','text',2,NULL,'Nadine Yablonskaya'),(459590,28,'PricingPageSettingsTitle','Neutral','Pricing Page Settings','','2016-09-19 10:40:38','text',2,NULL,'Console'),(930417,28,'PricingPageSettingsTitle','ru','Настройки страницы платежей',NULL,'2016-10-04 14:31:32','text',2,NULL,'Svetlana'),(966714,28,'ProductCRMAndVoIP','cs','CRM',NULL,'2017-05-02 12:32:00','text',2,NULL,'Jiří Redr'),(944877,28,'ProductCRMAndVoIP','fi','Asiakkuudenhallinta',NULL,'2017-01-15 12:47:42','text',2,NULL,'Arto Ryynanen'),(459251,28,'ProductCRMAndVoIP','Neutral','CRM','','2016-09-19 10:40:30','text',2,NULL,'Console'),(967865,28,'ProductsAndInstruments','cs','Moduly & Nástroje',NULL,'2017-05-04 10:41:11','text',2,NULL,'Jiří Redr'),(944763,28,'ProductsAndInstruments','fi','Moduulit ja työkalut',NULL,'2017-01-15 11:38:24','text',2,NULL,'Arto Ryynanen'),(459252,28,'ProductsAndInstruments','Neutral','Modules & Tools','','2016-09-19 10:40:30','text',2,NULL,'Console'),(774450,28,'ProductsAndInstruments_Info','az-Latn-AZ','Ehtiyacınız olan ONLYOFFICE™ modullarını və alətlərini seçin. Yasaqlanmış modullar və alətlər bütün portal istifadəçilərindən gizlədiləcəklər. Nəzərdə saxlayın ki, modulların və alətlərin icazəli edilməsindən sonra onlar bütün portal istifadəçilərinə açıq olurlar. Girişi məhdudlaşdırmaq üçün Portal Ayarlarının Giriş Hüquqları bölməsinə keçin.',NULL,'2016-11-24 11:51:27','text',3,NULL,'Console'),(971338,28,'ProductsAndInstruments_Info','cs','Vyberte ONLYOFFICE moduly a nástroje, které potřebujete. Zakázané moduly a nástroje budou skryty pro všechny portálové {!users}. Mějte na vědomí, že poté, co znovu povolíte moduly a nástroje, budou k dispozici všem portálovým {!users}. Pro omezení přístupu, koukněte se do sekce Přístupová práva v Nastavení portálu.',NULL,'2017-05-17 09:44:13','text',2,NULL,'Jiří Redr'),(950959,28,'ProductsAndInstruments_Info','de','Wählen Sie die gewünschten ONLYOFFICE™-Module und -Tools. Die deaktivierten Module und Tools werden für andere Portalbenutzer ausgeblendet. Beachten Sie, dass die Module und Tools nach der Aktivierung für alle Portalbenutzer verfügbar werden. Um den Zugriff darauf zu beschränken, öffnen Sie die Sektion \"Zugriffsrechte\" der Portaleinstellungen.',NULL,'2017-02-13 09:39:55','text',2,NULL,'Evgenia'),(956348,28,'ProductsAndInstruments_Info','es','Seleccione módulos y herramientas de ONLYOFFICE™ necesarios para Usted. Módulos y herramientas desactivados serán ocultados de todos los {!users} del portal. Recuerde que después de activación estos módulos y herramientas serán disponibles a todos los {!users} del portal. Para restringir el acceso visite la sección \'Derechos de acceso\' en \'Ajustes\' del portal.',NULL,'2017-03-06 14:28:14','text',2,NULL,'Александр'),(944854,28,'ProductsAndInstruments_Info','fi','Valitse tarvitsemasi ONLYOFFICE™ moduulit ja työkalut. Käytöstä poistetut moduulit ja työkalut piilotetaan kaikilta sivustosi käyttäjiltä. Käyttöön otetut moduulit ja työkalut näkyvät kaikille sivuston käyttäjille. Voit rajoittaa käyttöoikeuksia \'Asetukset\' osion \'Käyttöoikeudet\' sivulla.',NULL,'2017-01-15 12:26:51','text',2,NULL,'Arto Ryynanen'),(934434,28,'ProductsAndInstruments_Info','fr','Sélectionnez les modules et les outils ONLYOFFICE™ nécessaires. Les modules et les outils désactivés seront cachés de tous les {!users} du portail. N\'oubliez pas que, après l\'activation des modules et des outils, ils seront disponibles pour tous les {!users} du portail. Pour limiter l\'accès, consultez la section Droits d\'accès des Paramètres du portail.',NULL,'2016-11-24 13:38:11','text',2,NULL,'Nadine Yablonskaya'),(774455,28,'ProductsAndInstruments_Info','id','Pilih modul dan alat ONLYOFFICE™ yang Anda perlukan. Modul dan alat yang dinonaktifkan akan disembunyikan dari semua pengguna portal. Ingatlah bahwa setelah mengaktifkan kembali modul dan alat, modul dan alat tersebut juga akan tersedia bagi semua pengguna portal. Untuk membatasi aksesnya, baca bagian Hak Akses pada Pengaturan Portal.',NULL,'2016-11-24 11:51:27','text',3,NULL,'Console'),(774456,28,'ProductsAndInstruments_Info','it','Seleziona i moduli e gli strumenti ONLYOFFICE™ necessari. I moduli e gli strumenti disabilitati verranno nascosti da tutti gli utenti del portale. Tieni a mente che dopo la riattivazione dei moduli e degli strumenti essi verranno accessibili a tutti gli utenti del portale. Per limitare l\'accesso, vai alla sezione Diritti di accesso delle Impostazioni di portale.',NULL,'2016-11-24 11:51:27','text',3,NULL,'Console'),(774457,28,'ProductsAndInstruments_Info','ja','ONLYOFFICE™モジュールと必要なツールを選択します。無効化されたモジュールおよびツールは、すべてのポータル·ユーザーから隠されることになります。モジュールとツールを有効にした後、再び彼らが同様にすべてのポータル·ユーザーのために利用できるようになることを覚えておいてください。アクセスを制限するには、ポータルの設定の[アクセス権]の項を参照してください。',NULL,'2016-11-24 11:51:27','text',3,NULL,'Console'),(774458,28,'ProductsAndInstruments_Info','ko','ONLYOFFICE™ 모듈과 필요한 도구를 선택합니다.장애인 모듈과 도구는 모든 포털 사용자에게 표시됩니다. 모듈과 도구를 사용하도록 설정 한 후 다시 그뿐만 아니라 모든 포털 사용자가 사용할 수있게됩니다 것을 명심하십시오.액세스를 제한하려면 포털 설정의 액세스 권한 섹션을 참조하십시오.',NULL,'2016-11-24 11:51:27','text',3,NULL,'Console'),(774459,28,'ProductsAndInstruments_Info','lv','Izvēlieties ONLYOFFICE™ moduļus un rīkus kas jums ir nepieciešams. Atspējoti moduļi un instrumenti tiks paslēpti visiem portāla lietotājiem. Paturiet prātā, ka pēc moduļu un rīku ieslēgšanas tie būs atkal pieejami visiem portāla lietotājiem. Lai ierobežotu piekļuvi, skatiet Piekļuves Tiesības sadaļu Portāla iestatījumos.',NULL,'2016-11-24 11:51:27','text',3,NULL,'Console'),(934386,28,'ProductsAndInstruments_Info','Neutral','Select the ONLYOFFICE modules and tools you need. The disabled modules and tools will be hidden from all portal {!users}. Keep in mind that after enabling the modules and tools again they will become available for all portal {!users} as well. To restrict the access, refer to the Access Rights section of the Portal Settings.','','2016-11-28 08:43:16','text',2,NULL,'Александр'),(774460,28,'ProductsAndInstruments_Info','pt-BR','Selecione os módulos e ferramentas ONLYOFFICE™ que você precisa. Os módulos e ferramentas desativadas serão ocultados de todos os usuários do portal. Tenha em mente que depois de ativar os módulos e ferramentas de novo eles se tornarão disponíveis para todos os usuários do portal também. Para restringir o acesso, consulte a seção de Direitos de Acesso das Configurações do Portal.',NULL,'2016-11-24 11:51:27','text',3,NULL,'Console'),(934432,28,'ProductsAndInstruments_Info','ru','Выберите модули и инструменты ONLYOFFICE, которые Вам нужны. Отключенные модули и инструменты будут скрыты от всех участников портала со статусом {!Users}. Имейте в виду, что после того, как эти модули и инструменты будут снова включены, они также станут доступны для всех участников портала со статусом {!Users}. Чтобы ограничить доступ, обратитесь к разделу настроек портала \'Права доступа\'.',NULL,'2016-11-24 13:37:46','text',2,NULL,'Svetlana'),(774462,28,'ProductsAndInstruments_Info','sl','Izberite ONLYOFFICE™ module in orodja, ki jih potrebujete. Onemogočeni moduli in orodja bodo skriti pred uporabniki portala. Vedite, da bodo orodja in moduli, ko jih boste ponovno omogočili, na voljo za vse uporabnike portala. Za omejitev dostopa se obrnite na oddelek Pravice dostopa nastavitev portala.',NULL,'2016-11-24 11:51:27','text',3,NULL,'Console'),(774463,28,'ProductsAndInstruments_Info','tr','İhtiyacınız olan ONLYOFFICE™ modüllerini ve araçlarını seçin. Devre dışı bırakılan modüller ve araçlar portal kullanıcılarından gizlenecektir. Modülleri ve araçları tekrar etkinleştirdiğinizde bunların tüm portal kullanıcılarına açılacağını unutmayın. Erişimi sınırlamak için Portal Ayarlarındaki Erişim Hakları bölümüne bakın.',NULL,'2016-11-24 11:51:27','text',3,NULL,'Console'),(774464,28,'ProductsAndInstruments_Info','uk','Виберіть необхідні модулі та інструменти ONLYOFFICE™. Вимкнуті модулі та інструменти буде приховано від усіх користувачів порталу. Пам\'ятайте, що після повторного включення модулів та інструментів вони знову стануть доступними для всіх користувачів порталу. Щоб обмежити доступ, скористайтеся розділом \"Права доступу\" на вкладці \"Параметри порталу\".\n',NULL,'2016-11-24 11:51:27','text',3,NULL,'Console'),(459254,28,'ProductsAndInstruments_Instruments','Neutral','Tools','','2016-09-19 10:40:30','text',2,NULL,'Console'),(967864,28,'ProductsAndInstruments_Products','cs','Moduly',NULL,'2017-05-04 10:41:03','text',2,NULL,'Jiří Redr'),(944761,28,'ProductsAndInstruments_Products','fi','Moduulit',NULL,'2017-01-15 11:38:10','text',2,NULL,'Arto Ryynanen'),(459255,28,'ProductsAndInstruments_Products','Neutral','Modules','','2016-09-19 10:40:30','text',2,NULL,'Console'),(970594,28,'Profile','cs','Profil',NULL,'2017-05-12 14:43:00','text',2,NULL,'Jiří Redr'),(459256,28,'Profile','Neutral','Profile','','2016-09-19 10:40:30','text',2,NULL,'Console'),(970595,28,'ProfileRemoved','cs','Profil byl odstraněn',NULL,'2017-05-12 14:43:08','text',2,NULL,'Jiří Redr'),(459257,28,'ProfileRemoved','Neutral','Profile has been removed','','2016-09-19 10:40:30','text',2,NULL,'Console'),(971216,28,'PublicPortal','cs','Veřejný por