:20','text',2,NULL,'Jiří Redr'),(459370,28,'SmtpSettings','Neutral','SMTP Settings','','2016-09-19 10:40:33','text',2,NULL,'Console'),(967461,28,'SMTPSettingsHelp','cs','Pokud používáte Gmail účet pro SMTP server, nebudete moci poslat e-mail dokud neučiníte následující: přihlaste se do svého Gmail účtu pomocí standardního webového rozhraní a potvrďte všechny ověřovací otázky pro přihlášení k ONLYOFFICE™ účtu, pokud tedy nějaké jsou. {0}Doporučujeme používat port 587 nebo 25 pro odesílání e-mailových zpráv, ostatní porty mohou způsobit nesprávnou funkčnost SMTP.',NULL,'2017-05-03 12:00:23','text',2,NULL,'Jiří Redr'),(945636,28,'SMTPSettingsHelp','fi','Jos käytät Gmailin SMTP palvelinta, et voi lähettää sähköpostia ennen kuin teet seuraavaa: kirjaudu selaimellasi Gmailiin ja vastaa mahdollisiin kysymyksiin joilla sallit ONLYOFFICE™in käyttää tiliäsi. {0}Suosittelemme porttien 587 ja 25 käyttämistä lähteville sähköposteille.',NULL,'2017-01-15 19:10:02','text',2,NULL,'Arto Ryynanen'),(459371,28,'SMTPSettingsHelp','Neutral','If you use a Gmail account for SMTP server, you will not be able to send mail until you do the following: sign in to the Gmail account you use via its standard web interface and confirm any verification questions about the ONLYOFFICE™ access attempt to the account, in case there are some.{0}We recommend using ports 587 or 25 for the email messages to be sent, as other values might prevent the SMTP from the correct work.','','2016-09-19 10:40:33','text',2,NULL,'Console'),(945656,28,'SmtpSettingsText','fi','SMTP asetuksia tarvitaan, jotta voit perustaa sähköpostin viestien lähettämiseen portaalista käyttämällä omaa SMTP palvelintasi, sen sijaan mitä ONLYOFFICE™ käyttää. Ole hyvä ja täytä kaikki kentät ja klikkaa Tallenna painiketta. Voit käyttää Lähetä testiviesti painiketta jotta voit tarkistaa että kaikki syöttämäsi asetukset ovat oikein ja toimivat kuten pitää.',NULL,'2017-01-15 19:27:30','text',2,NULL,'Arto Ryynanen'),(459372,28,'SmtpSettingsText',