o možnosti vyberte odpovídající tlačítko. Všechna data budou uložena a budete je moci později povolit.{2} Doporučejeme Vám použít protokol SAML pro ještě větší bezpečnost.',NULL,'2017-04-28 15:25:26','text',2,NULL,'Jiří Redr'),(459384,28,'SsoSettingsHelp','Neutral','{0}Single Sign-on{1} allows to enable or disable third party authentication using the installed SSO services (Onelogin) without providing additional credentials.{2}\nSelect the most convenient SSO type for you (SAML/JWT) and enter the required fields using the information from the SSO service account. The hints for fields entries can be found next to them.{2}\nAfter enabling single sign-on select the {0}SSO Type{1} from the drop-down list, {0}Issuer URL{1}, {0}SSO Endpoint URL{1}, {0}SLO Endpoint URL{1} and {0}Signature Validation Type{1} (for JWT only).{2}\nTo disable this option select the appropriate radio button. All the data will be saved and you will be able to enable them later.{2}\nWe recommend that you use SAML protocol as more secure.','','2016-09-19 10:40:33','text',2,NULL,'Console'),(967323,28,'SsoSettingsIssuerUrlHelper','cs','Rozeznejte poskytovatele uživatelského účtu. Adresa URL emitenta se používá k ověření SAML odezvy nebo digitálního podpisu JWT-Tokenu. ',NULL,'2017-05-03 10:50:47','text',2,NULL,'Jiří Redr'),(459385,28,'SsoSettingsIssuerUrlHelper','Neutral','Identifies the user account provider. Issuer URL is used to validate the SAML response or JWT token digital signatures.','','2016-09-19 10:40:33','text',2,NULL,'Console'),(967501,28,'SsoSettingsNotValidToken','cs','Neplatný ověřovací token',NULL,'2017-05-03 12:22:32','text',2,NULL,'Jiří Redr'),(459386,28,'SsoSettingsNotValidToken','Neutral','Invalid authentication token','','2016-09-19 10:40:33','text',2,NULL,'Console'),(966540,28,'SsoSettingsPasswordOfClientCertificate','cs','Heslo klientského certifikátu',NULL,'2017-05-02 10:42:30','text',2,NULL,'Jiří Redr'),(937131,28,'SsoSettingsPasswordOfClientCertificate','fi','Asiakkaan sert