9,'EditSectionCaption','Neutral','Edit','','2016-09-19 10:41:29','text',2,NULL,'Console'),(959477,49,'EditSectionCaption','sv','Redigera',NULL,'2017-03-22 09:13:51','text',2,NULL,'Emma Tellström'),(461589,49,'EditSectionTitleFormat','Neutral','Edit section:{0}','','2016-09-19 10:41:29','text',2,NULL,'Console'),(959481,49,'EditSectionTitleFormat','sv','Redigera sektion:{0}',NULL,'2017-03-22 09:14:14','text',2,NULL,'Emma Tellström'),(461590,49,'editWiki_File','Neutral','File','','2016-09-19 10:41:29','text',2,NULL,'Console'),(959484,49,'editWiki_File','sv','Fil',NULL,'2017-03-22 10:45:17','text',2,NULL,'Emma Tellström'),(461591,49,'editWiki_FileName','Neutral','File Name','','2016-09-19 10:41:29','text',2,NULL,'Console'),(959487,49,'editWiki_FileName','sv','Filnamn',NULL,'2017-03-22 10:45:31','text',2,NULL,'Emma Tellström'),(461592,49,'editWiki_PageBody','Neutral','Text','','2016-09-19 10:41:29','text',2,NULL,'Console'),(959529,49,'editWiki_PageBody','sv','Text',NULL,'2017-03-22 10:50:25','text',2,NULL,'Emma Tellström'),(461593,49,'editWiki_PageName','Neutral','Page Title','','2016-09-19 10:41:29','text',2,NULL,'Console'),(959513,49,'editWiki_PageName','sv','Sidotitel',NULL,'2017-03-22 10:48:59','text',2,NULL,'Emma Tellström'),(461594,49,'editWiki_PagePreview','Neutral','Preview','','2016-09-19 10:41:29','text',2,NULL,'Console'),(959519,49,'editWiki_PagePreview','sv','Förhandsgranska',NULL,'2017-03-22 10:49:30','text',2,NULL,'Emma Tellström'),(461595,49,'editWiki_UploadCaption','Neutral','Upload File','','2016-09-19 10:41:29','text',2,NULL,'Console'),(959556,49,'editWiki_UploadCaption','sv','Ladda upp fil',NULL,'2017-03-22 12:36:12','text',2,NULL,'Emma Tellström'),(461596,49,'editWiki_UploadFileName','Neutral','Uploaded File Name','','2016-09-19 10:41:29','text',2,NULL,'Console'),(959557,49,'editWiki_UploadFileName','sv','Uppladdat filnamn',NULL,'2017-03-22 12:36:24','text',2,NULL,'Emma Tellström'),(461597,49,'Enlarge','Neutral','Zoom In','','2016-09-19 10:41:29','text',2,NULL,'Console'),(959550,49,'Enlarge','sv','Zooma in',NULL,'2017-03-22 12:35:35','text',2,NULL,'Emma Tellström'),(461599,49,'HelpPageCaption','Neutral','Help','','2016-09-19 10:41:29','text',2,NULL,'Console'),(959492,49,'HelpPageCaption','sv','Hjälp',NULL,'2017-03-22 10:46:08','text',2,NULL,'Emma Tellström'),(461598,49,'HelpPage_DefaultBody','Neutral','Creating wiki pages is very simple even if you have never used any markup language before. All you need to know is a few simple rules listed below. We hope you\'ll find them useful. \n\n@@TOC@@\n\n==Sections, Paragraphs, Lists, Lines==\n\nTo start a new section, use the = symbol at the beginning of a paragraph:\n\n<nowiki>\n<p>\n=Section=<br>\n==Subsection==<br>\n===Sub-subsection===<br>\n\n<p>\nInserting @@TOC@@ in a page will unite all page sections and subsections in a table of contents.\n</p>\n\nWiki markup ignores line breaks. You may use them to separate sentences within a paragraph. \n\n<p>\nUse the «br» tag to break lines without starting a new paragraph.  \n</p>\n\nTo start a new paragraph, press Enter twice just as you\'d do in any text editor. \n</p>\n</nowiki>\n\nMaking bulleted lists is simple:\n\n<nowiki>\n<p>\n* begin each list point with an asterisk;<br>\n** the more asterisks there are;<br>\n** the deeper the list level is.<br>\n</p>\n\n<p>\n# Numbered lists are not bad either:<br>\n## they look well-structured;<br>\n## and are easy to read.<br>\n</p>\n</nowiki>\n\n IF there is a space at the beginning of a line,\n THEN the line will be foRmaTTed the same way as it wERe typed; \n in the same font; with no line breaks;[[no links]].\n\nYou may use space at the beginning of a line if you need to: \n\n*paste some previously formatted text;\n*display source code; \n*create/paste ascii art (creating images by using text symbols).\n\nA horizontal line is denoted by four dashes: \n<nowiki>\n<p>\n---- \n</p>\n</nowiki>\n\n==Inserting Links==\n\n<nowiki>\n<p>\nTo insert the link to another wiki page, put the page title in double square brackets: <br> [[Help]]</p>\n\n<p>\nIn case the link and the title you want to be displayed on a page are different, type the link title after the | symbol: <br> [[Wiki Markup Help Page|Help Page]] </p> \n\n<p>\nExternal links are inserted right into the text, like this: <br> http://example.com</p> \n\n<p>\nIn case you need to change the external link title, put it in single square brackets, and type your title after a space: <br> [http://example.com YourTitle]</p> \n\n<p>\nTo insert an e-mail address, use single square brackets: <br> [mailto:mail@example.com]</p> \n\n<p> \nTo add a page to category, add the link to the desired category [[Category: Desired category]] at the bottom of the page.\n</p>\n</nowiki> \n\n==Formatting Text==\n\nUse the following tips to format your text:\n\n\'\'Italics\'\'\n\n<nowiki>\n<p>\n\'\'your text in italics goes here\'\'\n </p>\n</nowiki>\n\n\'\'\'Bold\'\'\'\n\n<nowiki>\n<p>\n\'\'\'your bold text goes here\'\'\'\n </p>\n</nowiki> \n\n\'\'\'\'\'Bold Italics\'\'\'\'\'\n<nowiki>\n<p>\n\'\'\'\'\'your text in bold italics goes here\'\'\'\'\'\n </p>\n</nowiki>\n\n__Underline__\n\n<nowiki>\n<p>\n__your underlined text goes here__\n </p>\n</nowiki>\n\n--Strike--\n\n<nowiki>\n\n<p>\n--text you need to strike out goes here--\n </p>\n</nowiki>\n\nIndexes: <sup>superscript</sup> and <sub>subscript</sub>\n\n<nowiki>\n\n<p>\n&lt;sub&gt;your subscript index&lt;/sub&gt<br>\n&lt;sup&gt;your superscript index&lt;/sup&gt\n</p>\n\n\n<p>\nYou may also use &lt;small&gt small text &lt;/small&gt for commentaries, special formatting for displaying &lt;code lang=\"language\"&gt;program code&lt;/code&gt; fragments and fixed pitch text for &lt;tt&gt;technical terms&lt;/tt&gt;.\n</p> \n\n</nowiki>\n\n==Inserting Images==\n\nTo be able insert images to a wiki page you´ll need to previously upload them to wiki. \n\nUse the following links to insert various types of images:\n\n<nowiki>\n<p>\nImage = [[Image:Image Title]]</p>\n<p>\nImage with fixed width = [[Image: Image Title | Width_px]]</p>\n<p>\nImage with description = [[Image:Image Title  | Description]]</p>\n<p>\nThumbnail image =  [[Image:Image Title | thumb]] – the image will be compressed and aligned to the right.\n</p>\n</nowiki>\n\n==HTML to Wiki Transfer==\n\nIf you have an html-formatted text that you would like to transfer here, you may do it quickly and easily. Click on \'\'\'Create new page\'\'\' on the \'\'\'Actions\'\'\' panel. Next paste your text into the editor window and switch to the wiki markup display by clicking on the Wiki icon on the formatting panel above. The html tags will be changed to wiki markup. Check the results, correct minor errors if any and press \'\'\'Publish\'\'\'. Your page is ready.','','2016-09-19 10:41:29','text',2,NULL,'Console'),(461600,49,'MainPage_DefaultBody','Neutral','\'\'\'Welcome to Wiki!\'\'\' \n\nHere you may create pages, interlink and unite them into categories via your web browser. Wiki is a convenient tool for keeping project-related documentation characterized by the following features:\n\n*multiple authors. Each portal member may edit the contents of any page.\n*quick editing. Click on \'\'\'Edit\'\'\' link availabe on every page and start editing right in your browser.\n*easy transfer from HTML to WIKI. Learn [[Internal:Help#HTML to Wiki Transfer|how]] \n*page version support. Check what\'s been edited by reverting the page to its previous version.\n\n@@TOC@@\n\n==Wiki Navigation and Structure==\n\nYou may navigate wiki through the \'\'\'Navigation Panel\'\'\' always available while you are inside the wiki. \n\n===Pages===\n\nAll the wiki pages that you create are sorted alphabetically on the [[Internal:Index|Index]] page.<br> \nAll newly created pages are displayed in chronological order on the [[Internal:NewPages|New Pages]] page.<br>\nA list of the most recently edited pages is located on the [[Internal:Recently|Recently Edited]] page.\n\n===Categories===\n\nYou may unite several related pages into a category. All categories with their corresponding pages are displayed on the [[Internal:Categories|Categories]] page. You may add a page to an already existing category, or create your own. Click [[Internal:Help|here]] for more information on how to assign a page to a category. \n\n===Files===\n\nYou may upload files of any size and format to wiki, as well as give links to uploaded pictures when creating wiki pages.  Read more about it [[Internal:Help#Inserting Images|here]].\n\n===Help===\n\nCreating pages for your wiki is easy. All you need to know is a few simple rules. Visit the [[Internal:Help|wiki markup tips]] to read through the wiki markup rules.  \n\n\n==Creating Your Wiki==\n\nTo create your own wiki, start with creating a new page by clicking on the \'\'\'Create new page\'\'\' link on the \'\'\'Actions\'\'\' panel. Next type your text in the text editor space. Use the [[Internal:Help|wiki markup tips]] for the text to be displayed correctly on a page.\n\nRemember that this is your personal space where you may organize everything according to your specific needs. Even the contents of this page is editable. For example, you may delete what\'s written here and paste links to your projects for your convenience. <br>Good luck!','','2016-09-19 10:41:29','text',2,NULL,'Console'),(461601,49,'MainPage_EmptyPage','Neutral','The page doesn\'t exist.  Click {here} to create and edit it.','','2016-09-19 10:41:29','text',2,NULL,'Console'),(959576,49,'MainPage_EmptyPage','sv','Sidan existerar inte. Klicka {här} för att skapa och redigera den.',NULL,'2017-03-22 12:38:41','text',2,NULL,'Emma Tellström'),(461602,49,'miniToolBar_Anchor','Neutral','Anchor','','2016-09-19 10:41:29','text',2,NULL,'Console'),(959441,49,'miniToolBar_Anchor','sv','Länk',NULL,'2017-03-22 07:49:43','text',2,NULL,'Emma Tellström'),(461603,49,'miniToolBar_Bold','Neutral','Bold','','2016-09-19 10:41:29','text',2,NULL,'Console'),(959444,49,'miniToolBar_Bold','sv','Fet',NULL,'2017