,'wikiVersionCaption','sv','ver.',NULL,'2017-03-22 12:36:27','text',2,NULL,'Emma Tellström'),(940574,57,'AutoupdateContactListDescription','fi','Kontaktiluettelo päivitetään automaattisesti, kun käyttäjiä lisätään tai poistetaan työntekijöiden listalta, joten sinun ei tarvitse tarkistaa sitä manuaalisesti.',NULL,'2017-01-12 21:53:19','text',2,NULL,'Arto Ryynanen'),(461635,57,'AutoupdateContactListDescription','Neutral','The contact list is updated automatically as people are added/removed from the list of employees, so you don\'t have to check it out manually.  ','','2016-09-19 10:41:30','text',2,NULL,'Console'),(960414,57,'AutoupdateContactListDescription','sv','Kontaktlistan uppdateras automatiskt när personer läggs till eller tas bort från listan med anställda, så du slipper kontrollera det manuellt.',NULL,'2017-03-24 12:36:19','text',2,NULL,'Axel Lindorin'),(940537,57,'ChatTabs','fi','Pikaviesti välilehdet',NULL,'2017-01-12 21:32:09','text',2,NULL,'Arto Ryynanen'),(461636,57,'ChatTabs','Neutral','Chat Tabs','','2016-09-19 10:41:30','text',2,NULL,'Console'),(959682,57,'ChatTabs','sv','Chattflikar',NULL,'2017-03-22 13:21:21','text',2,NULL,'Emma Tellström'),(461637,57,'ContactListWithOptions','Neutral','Contact List Options','','2016-09-19 10:41:30','text',2,NULL,'Console'),(959687,57,'ContactListWithOptions','sv','Kontaktlista alternativ',NULL,'2017-03-22 13:22:25','text',2,NULL,'Emma Tellström'),(940581,57,'IntegrationWith3rdPartyAppsSectionContent','fi','Voit käyttää myös muita pikaviestinohjelmia päästäksesi Talk pikaviestiin. Tehdäksesi tämän, sinun täytyy vain integroida Talk mihin tahansa IM asiakkaaseen, mikä tukee Jabber/XMPP:tä.',NULL,'2017-01-12 22:00:38','text',2,NULL,'Arto Ryynanen'),(461638,57,'IntegrationWith3rdPartyAppsSectionContent','Neutral','You may use a third-party desktop/mobile IM client to access Talk. To do that, you\'ll need to integrate Talk with any IM client that supports Jabber/XMPP.','','2016-09-19 10:41:30','text',2,NULL,'Console'),(960419,57,'IntegrationWith3rdPartyAppsSectionContent','sv','Du kan använda en tredje part skrivbord / mobil IM-klient för att få tillgång Talk. För att göra det, måste du sammankoppla Talk med någon IM-klient som stöder Jabber / XMPP.',NULL,'2017-03-24 12:55:23','text',2,NULL,'Axel Lindorin'),(940575,57,'IntegrationWith3rdPartyAppsSectionTitle','fi','Muiden pikaviesti sovellusten käyttö',NULL,'2017-01-12 21:53:55','text',2,NULL,'Arto Ryynanen'),(461639,57,'IntegrationWith3rdPartyAppsSectionTitle','Neutral','Third-Party Software Support','','2016-09-19 10:41:30','text',2,NULL,'Console'),(960416,57,'IntegrationWith3rdPartyAppsSectionTitle','sv','Tredje part programvarusupport',NULL,'2017-03-24 12:39:19','text',2,NULL,'Axel Lindorin'),(940561,57,'MessageFieldOptions','fi','Viestikentän vaihtoehdot',NULL,'2017-01-12 21:47:21','text',2,NULL,'Arto Ryynanen'),(461640,57,'MessageFieldOptions','Neutral','Message Field Options','','2016-09-19 10:41:30','text',2,NULL,'Console'),(959725,57,'MessageFieldOptions','sv','Meddelandefältsalternativ',NULL,'2017-03-22 13:27:11','text',2,NULL,'Emma Tellström'),(940562,57,'MirandaIMLink','fi','Miranda IM - pikaviesti ohjelman kotisivu. Pienempi, nopeampi, helpompi',NULL,'2017-01-12 21:47:46','text',2,NULL,'Arto Ryynanen'),(461641,57,'MirandaIMLink','Neutral','Miranda IM - the Miranda IM client home page.  Smaller, Faster, Easier','','2016-09-19 10:41:31','text',2,NULL,'Console'),(960398,57,'MirandaIMLink','sv','Miranda IM - Miranda IM klient hemsida. Mindre, Snabbare, Enklare',NULL,'2017-03-24 12:22:14','text',2,NULL,'Axel Lindorin'),(940569,57,'OverviewContent','fi','Talk on pikaviesti ohjelma, jolla sivuston käyttäjät voivat keskustella reaaliajassa, esim. työntekijöiden kesken.',NULL,'2017-01-12 21:52:18','text',2,NULL,'Arto Ryynanen'),(461642,57,'OverviewContent','Neutral','Talk is a corporate IM system for exchanging instant text messages among the employees in real time.','','2016-09-19 10:41:31','text',2,NULL,'Console'),(960400,57,'OverviewContent','sv','Talk är ett företags IM system för att utbyta snabbmeddelanden bland de anställda i realtid.',NULL,'2017-03-24 12:27:05','text',2,NULL,'Axel Lindorin'),(940570,57,'OverviewContentDescription','fi','Talk tarjoaa kaikki perinteiset pikaviestinohjelman toiminnot - tilan asetus, historian arkistointi, tiedostonsiirto, monen käyttäjän tuki ja paljon muuta.',NULL,'2017-01-12 21:52:36','text',2,NULL,'Arto Ryynanen'),(461643,57,'OverviewContentDescription','Neutral','Talk offers all the traditional features you expect from a messenger - choice of status, history archiving, file transfer, multi-user chat support, and more.','','2016-09-19 10:41:31','text',2,NULL,'Console'),(960410,57,'OverviewContentDescription','sv','Talk erbjuder alla de traditionella funktioner som du kan förvänta dig från en snabbmeddelandetjänst - Val av status, historia, arkivering, filöverföring, multi-användare chatt support, och mer.',NULL,'2017-03-24 12:32:50','text',2,NULL,'Axel Lindorin'),(940571,57,'OverviewSectionTitle','fi','Talk pikaviestin yleiskatsaus',NULL,'2017-01-12 21:52:47','text',2,NULL,'Arto Ryynanen'),(461644,57,'OverviewSectionTitle','Neutral','Talk Overview','','2016-09-19 10:41:31','text',2,NULL,'Console'),(960411,57,'OverviewSectionTitle','sv','Talk Översikt',NULL,'2017-03-24 12:33:10','text',2,NULL,'Axel Lindorin'),(940558,57,'OverviewWebClientDescription','fi','Käynnistä selaimessasi toimiva sovellus, jotta voit aloittaa nyt Talk pikaviestin käytön ilman aikaisempia asetuksia.',NULL,'2017-01-12 21:46:27','text',2,NULL,'Arto Ryynanen'),(461645,57,'OverviewWebClientDescription','Neutral','Launch our web client to start using Talk right now with no prior settings. ','','2016-09-19 10:41:31','text',2,NULL,'Console'),(960383,57,'OverviewWebClientDescription','sv','Starta vår webbklienten för att börja använda Talk just nu utan tidigare inställningar.',NULL,'2017-03-24 12:18:06','text',2,NULL,'Axel Lindorin'),(940544,57,'PidginLink','fi','Miljoonien käyttämä, ilmainen pikaviestiohjelma. Yhdistä helposti muihin keskusteluverkkoihin kuten MSN, Google Talk, Yahoo, AIM...',NULL,'2017-01-12 21:36:58','text',2,NULL,'Arto Ryynanen'),(461646,57,'PidginLink','Neutral','A free chat client used by millions. Connect easily to MSN, Google Talk, Yahoo, AIM and other chat networks all at once.','','2016-09-19 10:41:31','text',2,NULL,'Console'),(959799,57,'PidginLink','sv','En gratis chatt-klient som används av miljoner. Anslut enkelt till MSN, Google Talk, Yahoo, AIM och andra chattnätverk allt på en gång.',NULL,'2017-03-23 07:21:09','text',2,NULL,'Axel Lindorin'),(461647,57,'PsiLink','Neutral','The Cross-Platform JabberXMPP Client For Power Users','','2016-09-19 10:41:31','text',2,NULL,'Console'),(960415,57,'PsiLink','sv','Den plattformsoberoende JabberXMPP klienten för avancerade användare.',NULL,'2017-03-24 12:38:09','text',2,NULL,'Axel Lindorin'),(940565,57,'Recommended','fi','Suositellut sovellukset',NULL,'2017-01-12 21:49:42','text',2,NULL,'Arto Ryynanen'),(461648,57,'Recommended','Neutral','Recommended Clients','','2016-09-19 10:41:31','text',2,NULL,'Console'),(959748,57,'Recommended','sv','Rekommenderade klienter',NULL,'2017-03-22 13:28:38','text',2,NULL,'Emma Tellström'),(461649,57,'ScreenshotsSectionTitle','Neutral','Screenshots','','2016-09-19 10:41:31','text',2,NULL,'Console'),(959752,57,'ScreenshotsSectionTitle','sv','Skärmavklipp',NULL,'2017-03-22 13:28:54','text',2,NULL,'Emma Tellström'),(940559,57,'StartWebClientLink','fi','Käynnistä Webbisovellus',NULL,'2017-01-12 21:46:41','text',2,NULL,'Arto Ryynanen'),(461650,57,'StartWebClientLink','Neutral','Launch Web Client','','2016-09-19 10:41:31','text',2,NULL,'Console'),(960388,57,'StartWebClientLink','sv','Starta webbklient',NULL,'2017-03-24 12:18:55','text',2,NULL,'Axel Lindorin'),(940563,57,'StartWebClientLinkDescription','fi','Ei ylimääräisiä asetuksia! Klikkaa selaimessasi toimiva pikaviesti ohjelma ja aloita keskustelu.',NULL,'2017-01-12 21:49:01','text',2,NULL,'Art