ySpace, AIM, Email, Google Talk, Skype, ICQ, Jabber, IRC, Bonjour, and more!','','2016-09-19 10:41:31','text',2,NULL,'Console'),(960418,57,'TrillianLink','sv','Trillian - Windows, iPhone och webbaserade snabbmeddelanden, Stöder Astra, Windows Live, Facebook, Twitter, Yahoo, MySpace, AIM, e-post, Google Talk, Skype, ICQ, Jabber, IRC, Bonjour, och mycket mer!',NULL,'2017-03-24 12:51:23','text',2,NULL,'Axel Lindorin'),(959892,57,'WarningHeader','de','Achtung',NULL,'2017-03-23 12:30:14','text',2,NULL,'Evgenia'),(953531,57,'WarningHeader','es','Aviso',NULL,'2017-02-23 14:49:49','text',2,NULL,'Ekaterina.Heidel'),(950868,57,'WarningHeader','fr','Avertissement',NULL,'2017-02-09 08:37:03','text',2,NULL,'Nadine Yablonskaya'),(946434,57,'WarningHeader','Neutral','Warning','','2017-01-19 16:24:19','text',2,NULL,'Console'),(949887,57,'WarningHeader','ru','Внимание',NULL,'2017-01-28 10:01:01','text',2,NULL,'Svetlana'),(959773,57,'WarningHeader','sv','Varning',NULL,'2017-03-22 13:32:48','text',2,NULL,'Emma Tellström'),(953532,57,'WarningText','es','Para funcionamiento correcto de Chat este ordenador debe ser disponible para otros ordenadores en la red local o de Internet, y {0}Nombre de Servidor{1} debe ser el nombre de dominio o el nombre de ordenador local (no dirección IP), si existe el servidor DNS local. Se puede hacerlo especificando el {0}Nombre de Servidor{1} válido y la {0}Dirección de Servidor{1} con ayuda de la opción {2}Ajustes de DNS{3}.',NULL,'2017-02-23 14:49:52','text',2,NULL,'Ekaterina.Heidel'),(950872,57,'WarningText','fr','Pour que \"Chat\" puisse fonctionner correctement, cet ordinateur doit être accessible aux autres ordinateurs du réseau local ou de l\'Internet, le {0}Nom du serveur{1} doit être un nom de domaine ou un nom de l\'ordinateur local (pas une adresse IP), s\'il y a le serveur DNS local. On peut le faire à l\'aide de l\'option {2}Paramètres DNS{3} en définissant le {0}Nom du serveur{1} et l\'{0}Adresse du serveur{1} ',NULL,'2017-02-09 08:58:35','text',2,NULL,'Nadine Yablonskaya'),(946435,57,'WarningText','Neutral','For Talk to work correctly this computer must be accessible for the other computers in the local network or from the internet and the {0}Server Name{1} must be a domain name or a local computer name (not an IP address), in case there is a local DNS server. This can be done setting the valid {0}Server Name{1} and {0}Server Address{1} with the help of {2}DNS Settings{3} option.','','2017-01-19 16:24:19','text',2,NULL,'Console'),(949888,57,'WarningText','ru','Для корректной работы Чата этот компьютер должен быть доступен для других компьютеров в локальной сети или из интернета, а {0}Имя сервера{1} должно быть доменным именем или именем локального компьютера (не IP-адресом), при наличии локального DNS-сервера. Это можно сделать, указав действительное {0}Имя сервера{1} и {0}Адрес сервера{1} с помощью опции {2}Настройки DNS{3}.',NULL,'2017-01-28 10:17:38','text',2,NULL,'Svetlana'),(960377,57,'WarningText','sv','För Talk ska fungera korrekt måste datorn vara tillgänglig för de andra datorerna i det lokala nätverket eller från Internet och {0} servernamn {1} måste vara ett domännamn eller ett lokalt datornamn (inte en IP-adress), i Om det inte finns en lokal DNS-server. Detta kan göras ställa in giltiga {0} servernamn {1} och {0} Serveradress {1} med hjälp av {2} DNS-inställningar {3} alternativ.',NULL,'2017-03-24 12:10:49','text',2,NULL,'Axel Lindorin'),(461654,57,'YourStatusChanger','Neutral','Status Changer','','2016-09-19 10:41:31','text',2,NULL,'Console'),(461655,58,'BtnAccept','Neutral','Accept','','2016-09-19 10:41:31','text',2,NULL,'Console'),(959672,58,'BtnAccept','sv','Acceptera',NULL,'2017-03-22 13:20:13','text',2,NULL,'Emma Tellström'),(461656,58,'BtnAddToMailing','Neutral','Add to mass mailing','','2016-09-19 10:41:31','text',2,NULL,'Console'),(959673,58,'BtnAddToMailing','sv','Lägg till i massutskick',NULL,'2017-03-22 13:20:20','text',2,NULL,'Emma Tellström'),(940547,58,'BtnCloseHistory','fi'