'DeleteCustomFieldConfirmationText','fi','Valittu kenttä ja sen arvot poistetaan kaikista kontakteista, missä se sijaitsee. Haluatko varmasti jatkaa?',NULL,'2017-01-15 20:34:08','text',2,NULL,'Arto Ryynanen'),(457434,92,'DeleteCustomFieldConfirmationText','Neutral','The selected field with all the data will be deleted from all contacts where it is present. Are you sure you want to continue?','','2016-09-19 10:39:44','text',2,NULL,'Console'),(457435,92,'DeleteDealMilestone','Neutral','Delete stage','','2016-09-19 10:39:44','text',2,NULL,'Console'),(457436,92,'DeleteTag','Neutral','Delete tag','','2016-09-19 10:39:44','text',2,NULL,'Console'),(937197,92,'DeleteTaskCategoryConfirmation','fi','Luokan poisto',NULL,'2017-01-07 14:11:37','text',2,NULL,'Arto Ryynanen'),(457437,92,'DeleteTaskCategoryConfirmation','Neutral','Category deletion confirmation','','2016-09-19 10:39:44','text',2,NULL,'Console'),(457438,92,'DeleteTaskTemplate','Neutral','Delete task template','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945949,92,'DeleteTaskTemplateContainer','fi','Poista tehtävämallin säilö',NULL,'2017-01-15 21:41:27','text',2,NULL,'Arto Ryynanen'),(457439,92,'DeleteTaskTemplateContainer','Neutral','Delete task template container','','2016-09-19 10:39:44','text',2,NULL,'Console'),(457440,92,'DeleteUnusedTags','Neutral','Delete unused tags','','2016-09-19 10:39:44','text',2,NULL,'Console'),(457441,92,'Description','Neutral','Description','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945933,92,'DescriptionTextContactStage','fi','Kontaktin lämpötilan atsot mahdollistavat potentiaalisten ostajien luokittelun haluamallasi tavalla. Oletustasot ovat \"Kylmä\", \"Lämmin\" ja \"Kuuma\", sen mukaan kuinka halukkaita he ovat ostamaan tuotteitasi. ',NULL,'2017-01-15 21:37:50','text',2,NULL,'Arto Ryynanen'),(457442,92,'DescriptionTextContactStage','Neutral','Contact temperature levels let you characterize your potential buyers in a certain way. For instance, the temperature levels can be \"Cold\", \"Hot\", \"Warm\", which will mean the contact\'s willingness to buy your product.','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945745,92,'DescriptionTextContactStageEditDelete','fi','Voit muokata tai poistaa kontaktin lämpotilan tason, jos sitä ei ole liitetty mihinkään kontaktiin samalla tasolla.',NULL,'2017-01-15 20:19:54','text',2,NULL,'Arto Ryynanen');
INSERT  IGNORE INTO `res_data` VALUES (457443,92,'DescriptionTextContactStageEditDelete','Neutral','You can edit or delete the contact temperature levels only in case there are no contacts of this level.','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945768,92,'DescriptionTextContactType','fi','Kontaktien tyypit mahdollistavat kontaktien lajittelun tietyllä tavalla. Oletuksena kontaktityyppejä ovat \"Asiakas\", \"Kilpailija\", \"Kumppani\" ja \"Toimittaja\" - luokitellen kontakteja sen mukaan mikä on heidän roolinsa suhteessa organisaatioon.',NULL,'2017-01-15 20:26:08','text',2,NULL,'Arto Ryynanen'),(457444,92,'DescriptionTextContactType','Neutral','Contact types let you characterize your contacts in a certain way. The default contact types are \"Client\", \"Competitor\", \"Partner\", \"Supplier\" which classify the contacts based on their role in relation to the organization.','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945794,92,'DescriptionTextContactTypeEditDelete','fi','Voit muokata tai poistaa kontaktin tyypin vain jos sitä ei käytetä missään tämän tyypin kontaktitiedoissa.',NULL,'2017-01-15 20:36:20','text',2,NULL,'Arto Ryynanen'),(457445,92,'DescriptionTextContactTypeEditDelete','Neutral','You can edit or delete the contact type only in case there are no contacts of this type.','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945264,92,'DescriptionTextDealMilestone','fi','Mahdollisuuden vaiheiden avulla voit määrittää vaiheet kaupan loppuunsaattamiseksi. Voit lisätä uusia vaiheita kuten \"Kaupallinen tarjous\", \"Ennakkomaksu\", \"Suoritus\". Määritä vaiheiden järjestys hiirellä vetämällä.',NULL,'2017-01-15 13:55:20','text',2,NULL,'Arto Ryynanen'),(457446,92,'DescriptionTextDealMilestone','Neutral','Opportunity stages let you determine steps necessary to complete the deal. For instance, you can add opportunity stages \"Commercial offer\", \"Prepayment\", \"Execution\". Set\r\n\r\nthe necessary order for the opportunity stages dragging them.','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945332,92,'DescriptionTextDealMilestoneEditDelete','fi','Voit muokata tai poistaa mahdollisuuden vaiheen vain jos tässä vaiheessa ei ole mahdollisuuksia',NULL,'2017-01-15 14:13:12','text',2,NULL,'Arto Ryynanen'),(457447,92,'DescriptionTextDealMilestoneEditDelete','Neutral','You can edit or delete the opportunity stage only in case there are no opportunities at this stage.','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945963,92,'DescriptionTextHistoryCategory','fi','Tapahtumahistorian luokat mahdollistavat tapahtumahistorian ryhmittelyn. Vakioluokkia ovat muistio, sähköposti, puhelu ja tapaaminen. Järjestelmänvalvoja voi muokata luokkia.',NULL,'2017-01-15 21:45:49','text',2,NULL,'Arto Ryynanen'),(457448,92,'DescriptionTextHistoryCategory','Neutral','History event categories allow you to split your history events into groups. Standard history event categories are mail, note, phone call, meeting. You need to have administrator rights to be able to edit them.','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945984,92,'DescriptionTextHistoryCategoryEditDelete','fi','Voit muokata tai poistaa tapahtumahistorian luokan vain, jos siinä ei ole yhtään tapahtumahistoriaa.',NULL,'2017-01-15 21:56:04','text',2,NULL,'Arto Ryynanen'),(457449,92,'DescriptionTextHistoryCategoryEditDelete','Neutral','You can edit or delete the history event category only in case there are no history events in this category.','','2016-09-19 10:39:44','text',2,NULL,'Console'),(457450,92,'DescriptionTextTaskCategory','Neutral','Task categories let you divide your tasks into groups depending on the goals you intend to achieve. For instance, a task category can be \"Appointment\", \"Phone\r\n\r\ncall\" or \"Expression of gratitude\".','','2016-09-19 10:39:44','text',2,NULL,'Console'),(457451,92,'DescriptionTextTaskCategoryEditDelete','Neutral','You can edit or delete the task category stage only in case there are no tasks with this category.','','2016-09-19 10:39:44','text',2,NULL,'Console'),(457452,92,'DisplacementInDays','Neutral','Offset in days','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945951,92,'DownloadAllDataInZipArchive','fi','Lataa kaikki tiedot yhtenä ZIP-tiedostona',NULL,'2017-01-15 21:42:00','text',2,NULL,'Arto Ryynanen'),(457453,92,'DownloadAllDataInZipArchive','Neutral','Download all data in one ZIP-archive','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945985,92,'DownloadingAllDataInZipArchive','fi','ZIP-arkiston luominen aloitettiin',NULL,'2017-01-15 21:56:30','text',2,NULL,'Arto Ryynanen'),(457454,92,'DownloadingAllDataInZipArchive','Neutral','ZIP archive generation started','','2016-09-19 10:39:44','text',2,NULL,'Console'),(457455,92,'DownloadLinkText','Neutral','Link to download the ZIP archive','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945953,92,'EditCategory','fi','Muokkaa luokkaa',NULL,'2017-01-15 21:42:26','text',2,NULL,'Arto Ryynanen'),(457456,92,'EditCategory','Neutral','Edit category','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945956,92,'EditContactStage','fi','Muokkaa lämpötilan tasoa',NULL,'2017-01-15 21:42:55','text',2,NULL,'Arto Ryynanen'),(457457,92,'EditContactStage','Neutral','Edit temperature level','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945719,92,'EditContactType','fi','Muokkaa kontaktin tyyppiä',NULL,'2017-01-15 20:01:40','text',2,NULL,'Arto Ryynanen'),(457458,92,'EditContactType','Neutral','Edit contact type','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945954,92,'EditCustomField','fi','Muokkaa kenttää',NULL,'2017-01-15 21:42:35','text',2,NULL,'Arto Ryynanen'),(457459,92,'EditCustomField','Neutral','Edit field','','2016-09-19 10:39:44','text',2,NULL,'Console'),(457460,92,'EditDealMilestone','Neutral','Edit stage','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945952,92,'EditSelectedCategory','fi','Muokkaa tehtäväluokkaa «{0}»',NULL,'2017-01-15 21:42:18','text',2,NULL,'Arto Ryynanen'),(457461,92,'EditSelectedCategory','Neutral','Edit «{0}» task category','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945958,92,'EditSelectedContactStage','fi','Muokkaa lämpötilan tasoa «{0}»',NULL,'2017-01-15 21:43:17','text',2,NULL,'Arto Ryynanen'),(457462,92,'EditSelectedContactStage','Neutral','Edit the «{0}» temperature level','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945721,92,'EditSelectedContactType','fi','Muokkaa kontaktin tyyppiä \"{0}\"',NULL,'2017-01-15 20:02:06','text',2,NULL,'Arto Ryynanen'),(457463,92,'EditSelectedContactType','Neutral','Edit the \"{0}\" contact type','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945240,92,'EditSelectedDealMilestone','fi','Muokkaa mahdollisuuden vaihetta «{0}»',NULL,'2017-01-15 13:50:26','text',2,NULL,'Arto Ryynanen'),(457464,92,'EditSelectedDealMilestone','Neutral','Edit «{0}» opportunity stage','','2016-09-19 10:39:44','text',2,NULL,'Console'),(457465,92,'EditSelectedTaskTemplate','Neutral','Edit the «{0}» task template','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945957,92,'EditSelectedTaskTemplateContainer','fi','Muokkaa tehtävämallin säilöä «{0}»',NULL,'2017-01-15 21:43:07','text',2,NULL,'Arto Ryynanen'),(457466,92,'EditSelectedTaskTemplateContainer','Neutral','Edit the «{0}» task template container','','2016-09-19 10:39:44','text',2,NULL,'Console'),(457467,92,'EditTaskTemplate','Neutral','Edit task template','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945955,92,'EditTaskTemplateContainer','fi','Muokkaa tehtävämallin säilöä',NULL,'2017-01-15 21:42:46','text',2,NULL,'Arto Ryynanen'),(457468,92,'EditTaskTemplateContainer','Neutral','Edit task template container','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945978,92,'EmptyContentCustomFields','fi','Käyttäjän kenttäluettelo on tyhjä',NULL,'2017-01-15 21:52:01','text',2,NULL,'Arto Ryynanen'),(457469,92,'EmptyContentCustomFields','Neutral','The user field list is empty','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945982,92,'EmptyContentCustomFieldsDescript','fi','Käyttäjän kentät mahdollistavat tarvittavan lisätiedon keräämisen kontakteista, mahdollisuuksista ja tapauksista. Voit esimerkiksi luoda kentän \"Lähde\", johon tallennat tiedon mistä asiakas tuli, esim. mainos, suoramyynti, jne. Voit muokata tai poistaa käyttäjän kentän vain, jos sitä ei käytetä missään kontaktitiedossa, mahdollisuudessa tai tapauksessa.',NULL,'2017-01-15 21:54:44','text',2,NULL,'Arto Ryynanen'),(457470,92,'EmptyContentCustomFieldsDescript','Neutral','User fields let you determine additional information about the client, opportunity or case. For instance, you can add the \'Source\' field to specify where the user came from: advertisement, direct sale, etc. You can edit or delete the user field only in case there are no contacts or opportunities with this field value.','','2016-09-19 10:39:44','text',2,NULL,'Console'),(457471,92,'EmptyContentTags','Neutral','The tag list is empty','','2016-09-19 10:39:44','text',2,NULL,'Console'),(945324,92,'EmptyContentTagsDescript','fi','Tägejä/Tunnisteita voidaan käyttää kuvaamaan ja ryhmittelemään kontakteja (sekä yrityksiä että henkilöitä), mahdollisuuksia ja tapauksia. Voit esimerkiksi merkitä eri yrityksissä työskenteleviä, mutta samalla alalla toimivia, henkilöitä yhteisellä tunnisteella, mikä auttaa järestelyä ja hallintaa. Voit muokata tai poistaa tunnisteen vain jos sitä ei ole liitetty mihinkään kontaktiin, mahdollisuuteen tai tapaukseen.',NULL,'2017-01-15 14:11:01','text',2,NULL,'Arto Ryynanen'),(457472,92,'EmptyContentTagsDescript','Neutral','The tags can be used to describe and group contacts (both companies and persons), opportunities and cases which have something similar in them. For instance, you can tag all the persons from different companies but from the same sphere of business with a common tag for a better sorting. You can edit or delete the tag only in case there are no contacts, opportunities or cases with this tag.','','2016-09-19 10:39:44','text',2,NULL,'Console'),(457473,92,'EmptyContentTaskTemplates','Neutral','The list of task templates is empty','','2016-09-19 10:39:44','text',2,NULL,'Console'),(944800,92,'EmptyContentTaskTemplatesDescript','fi','Tehtävämallit mahdollistavat samankaltaisten tehtävien luonnin Asiakkuudenhallinnan moduulissa. Voit lisätä tehtäviä kontakteihin, mahdollisuuksiin ja tapauksiin yhdellä hiiren klikkauksella. Valitse tehtäväsäilö luodaksesi sinne erilaisille tehtävämalleille.',NULL,'2017-01-15 12:06:31','text',2,NULL,'Arto Ryynanen'),(457474,92,'EmptyContentTaskTemplatesDescript','Neutral','Task templates allow you to create similar tasks inside the CRM module. You can add the tasks to contacts, opportunities or cases with a single mouse click. Select the container to create a task for every container task template.','','2016-09-19 10:39:45','text',2,NULL,'Console'),(457475,92,'EmptyField','Neutral','This field must be filled correctly','','2016-09-19 10:39:45','text',2,NULL,'Console'),(942440,92,'EmptyLabelError','fi','Jokaisella kentällä on oltava otsikko. ',NULL,'2017-01-14 07:54:50','text',2,NULL,'Arto Ryynanen'),(457476,92,'EmptyLabelError','Neutral','Every field must have a title','','2016-09-19 10:39:45','text',2,NULL,'Console'),(942458,92,'EmptyTitleError','fi','Kentän otsikko ei voi olla tyhjä. ',NULL,'2017-01-14 08:04:28','text',2,NULL,'Arto Ryynanen'),(457477,92,'EmptyTitleError','Neutral','The field title cannot be empty','','2016-09-19 10:39:45','text',2,NULL,'Console'),(945959,92,'EnableSSL','fi','Ota käyttöön SSL',NULL,'2017-01-15 21:43:26','text',2,NULL,'Arto Ryynanen'),(457478,92,'EnableSSL','Neutral','Enable SSL','','2016-09-19 10:39:45','text',2,NULL,'Console'),(457479,92,'Export','Neutral','Export','','2016-09-19 10:39:45','text',2,NULL,'Console'),(457480,92,'ExportData','Neutral','Export of All Data','','2016-09-19 10:39:45','text',2,NULL,'Console'),(945793,92,'ExportDataSettingsInfo','fi','Vientitoiminto luo ZIP-arkiston, joka sisältää CSV-tiedostot kaikista Asiakkuudenhallinnan tiedoista (kont