Neutral','The default {0}logo{1} of your organization will be displayed on your {0}Invoices{1}.{3}\nTo replace the logo click the \'Change Logo\' link and select the image stored on your computer to load it to your portal. Please, keep in mind that you can upload an image not larger than {0}{4}x{5} pixels{1}, otherwise resizing will take place. The maximum image size cannot exceed  {0}{2}{1}.','','2016-09-19 10:39:46','text',2,NULL,'Console'),(457529,92,'Size','Neutral','Size','','2016-09-19 10:39:46','text',2,NULL,'Console'),(457530,92,'SMTPSettings','Neutral','SMTP Settings','','2016-09-19 10:39:46','text',2,NULL,'Console'),(945786,92,'SMTPSettingsDescription','fi','SMTP-asetukset tarvitaan, jotta voit lähettää sähköposteja Asiakkuudenhallinnassa oleviin asiakkaiden sähköpostiosoitteisiin. Täytä kaikki kentät ja klikkaa \'Tallenna\'-painiketta, jotta voit lähettää suoraan sähköposteja portaalista.',NULL,'2017-01-15 20:33:36','text',2,NULL,'Arto Ryynanen'),(457531,92,'SMTPSettingsDescription','Neutral','The SMTP settings are needed to set up an email account which will be used to send emails to the clients from the CRM client database. Please fill in all the fields and click the \'Save\' button to be able to send emails right from the portal.','','2016-09-19 10:39:46','text',2,NULL,'Console'),(457532,92,'SMTPSettingsHelp','Neutral','If you use a Gmail account for SMTP server, you will not be able to send mail until you do the following: sign in to the Gmail account you use via its standard web interface and confirm any verification questions about the ONLYOFFICE™ access attempt to the account, in case there are some.{0}We recommend using ports 587 or 25 for the email messages to be sent, as other values might prevent the SMTP from the correct work.','','2016-09-19 10:39:46','text',2,NULL,'Console'),(457533,92,'SubmitFormData','Neutral','Send data','','2016-09-19 10:39:46','text',2,NULL,'Console'),(457534,92,'TagAlreadyExistsError','Neutral','Tag with this title alr