henkilöiden, \"Yrityksen nimi\" yritysten tuomiseen. Tiedostot, jotka sisältävät enemmän kuin {0} riviä pitää jakaa pienempiin osiin onnistunutta tuomista varten. Varmista, että olet valinnut ne sivuston käyttäjät, jotka saavat pääsyn uusiin kontaktitietoihin. Muussa tapauksessa CSV-tiedostosta tuodut tiedot ovat vain sinun käytettävissäsi.',NULL,'2017-01-15 20:02:38','text',2,NULL,'Arto Ryynanen'),(457840,94,'ImportFromCSVStepOneDescription','Neutral','A properly formed CSV file should be selected on your computer HDD. It must contain the fields or columns separated by a delimiter which will be used to import persons or companies - \'First Name\' and \'Last Name\' for persons, \'Company Name\' for companies. The files containing more than {0} rows should be divided into smaller parts for proper importing. Make sure you selected the portal users who need to be granted access to the contact details, otherwise the data from the CSV file will be available to you only.','','2016-09-19 10:39:54','text',2,NULL,'Console'),(945789,94,'ImportFromCSVStepOneHeader','fi','Valitse CSV-tiedosto ja määritä käyttöoikeudet, ennen kuin tuot kontaktit',NULL,'2017-01-15 20:34:37','text',2,NULL,'Arto Ryynanen'),(457841,94,'ImportFromCSVStepOneHeader','Neutral','Select a CSV file and set access rights before you import contacts','','2016-09-19 10:39:54','text',2,NULL,'Console'),(945734,94,'ImportFromCSVStepTwoDescription','fi','Sovita tiedostosi sarakkeet vastaaviin ONLYOFFICE™ Asiakkuushallinnan kenttiin. Kiinnitä huomiota siihen, että tuodaksesi henkilön tiedot oikein, täytyy vähintään yhden sarakkeen vastata \"Etunimi\" kenttää Asiakkuudenhallinnassa. Yrityksen tietojen tuomista varten yhden tiedoston sarakkeen on vastattava  \"Yrityksen nimi\" kenttää. Päivämäärien tulee olla muodossa: {0}. ',NULL,'2017-01-15 20:09:33','text',2,NULL,'Arto Ryynanen'),(457842,94,'ImportFromCSVStepTwoDescription','Neutral','Match your file columns with the corresponding ONLYOFFICE™ CRM fields. Please pay your attention to the fact that to import persons correctly you need to have at least one column from your file matched with the \'First Name\' field of the ONLYOFFICE™ CRM. The same is for the company import, you will need to match the \'Company Name\' field to be able to import a company. The fields containing the dates must have the following format: {0}.','','2016-09-19 10:39:54','text',2,NULL,'Console'),(457843,94,'ImportFromCSVStepTwoHeader','Neutral','Please, verify the fields','','2016-09-19 10:39:54','text',2,NULL,'Console'),(945732,94,'ImportStartingPanelButton','fi','Siirry kontaktiluetteloon',NULL,'2017-01-15 20:06:12','text',2,NULL,'Arto Ryynanen'),(457844,94,'ImportStartingPanelButton','Neutral','Go to Contact List','','2016-09-19 10:39:54','text',2,NULL,'Console'),(945765,94,'ImportStartingPanelDescription','fi','Kontaktien tuominen voi kestää useita minuutteja riippuen tiedon määrästä.',NULL,'2017-01-15 20:23:54','text',2,NULL,'Arto Ryynanen'),(457845,94,'ImportStartingPanelDescription','Neutral','Import of contacts can take several minutes depending on the amount of your data.','','2016-09-19 10:39:54','text',2,NULL,'Console'),(457846,94,'ImportStartingPanelHeader','Neutral','Importing started','','2016-09-19 10:39:54','text',2,NULL,'Console'),(946030,94,'Industry','fi','Toimiala',NULL,'2017-01-15 22:20:11','text',2,NULL,'Arto Ryynanen'),(457847,94,'Industry','Neutral','Industry','','2016-09-19 10:39:54','text',2,NULL,'Console'),(457848,94,'JobTitle','Neutral','Position','','2016-09-19 10:39:54','text',2,NULL,'Console'),(457849,94,'LastName','Neutral','Last Name','','2016-09-19 10:39:54','text',2,NULL,'Console'),(457850,94,'Lead','Neutral','Lead','','2016-09-19 10:39:54','text',2,NULL,'Console'),(457851,94,'LoadPhoto','Neutral','Upload photo','','2016-09-19 10:39:54','text',2,NULL,'Console'),(457852,94,'LoadPhotoFromPC','Neutral','Upload photo from PC','','2016-09-19 10:39:54','text',2,NULL,'Console'),(457853,94,'LoadPhotoFromSocialMedia','Neutral