alData.Keys)\n#each\n\n$contactInfo: $AdditionalData.get_item($contactInfo)\n\n#end\n\n\n^You receive this email because you are a registered user of the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal. To change the notification type, please manage your \"subscription settings\":\"$RecipientSubscriptionConfigURL\".^','','2016-09-19 10:40:02','text',2,NULL,'Console'),(946052,95,'pattern_ExportCompleted','fi','h1. Asiakkuudenhallinnan tietojen vienti suoritettu onnistuneesti \n\nVoit ladata arkistotiedoston täältä: \"exportdata.zip\":\"${EntityRelativeURL}\". \n\n*Huomio*: Tämä linkki toimii vain 24 tuntia.\n\nJos sinulla on kysymyksiä tai tarvitset apua, ota yhteyttä meihin englanniksi osoitteessa \"support.onlyoffice.com\":\"http://support.onlyoffice.com\" \n\nTerveisin, \nONLYOFFICE™ Asiakastuki \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\" \n\n^Sait tämän sähköpostin, koska olet portaalin \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" rekisteröity käyttäjä. Jos et halua vastaanottaa näitä ilmoituksia, muuta \"Tilauksen asetuksiasi\":\"$RecipientSubscriptionConfigURL\".^',NULL,'2017-01-15 22:33:36','text',2,NULL,'Arto Ryynanen'),(458167,95,'pattern_ExportCompleted','Neutral','h1. CRM. Data export successfully completed\n\nPlease, follow this link to download the archive: \"exportdata.zip\":\"${EntityRelativeURL}\"\n\n*Note*: this link is valid for 24 hours only.\n\nIf you have any questions or need assistance please feel free to contact us at \"support.onlyoffice.com\":\"http://support.onlyoffice.com\"\n\nBest regards,\nONLYOFFICE™ Support Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"\n\n^You receive this email because you are a registered user of the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal. To change the notification type, please manage your \"subscription settings\":\"$RecipientSubscriptionConfigURL\".^','','2016-09-19 10:40:02','text',2,NULL,'Console'),(944908,95,'pattern_ImportCompleted','fi','h1. Asiakkuudenhallinn