0:41:05','text',2,NULL,'Console'),(966538,168,'CacheClearBtnText','cs','Vymazat mezipaměť',NULL,'2017-05-02 10:41:48','text',2,NULL,'Jiří Redr'),(458476,168,'CacheClearBtnText','Neutral','Clear the cache','','2016-09-19 10:40:11','text',2,NULL,'Console'),(966323,168,'CacheHelpText','cs','Všechny skripty použité pro správnou práci portálu jsou uloženy v mezipaměti, aby zajistili maximální výkon ONLYOFFICE™. Někdy (obvykle po větší aktualizaci nebo když je zjištěno nesprávné chování portálu) je nutné mezipaměť vymazat. Použijte tlačítko <b>Vymazat mezipaměť</b> pro vymazání skriptů ze serveru a jejich následné nahrání. Žádná data nebudou ztracena během této operace.',NULL,'2017-05-02 08:42:54','text',2,NULL,'Jiří Redr'),(458477,168,'CacheHelpText','Neutral','All the scripts used for the portal correct work are cached for ONLYOFFICE™ maximum performance. Sometimes (usually after a major update or when some incorrectness is observed in portal behavior) you need to clear the cache. Use the <b>Clear the Cache</b> button to flush the scripts from the server and reload them back again. No portal data will be lost during the operation.','','2016-09-19 10:40:11','text',2,NULL,'Console'),(458478,168,'CacheText','Neutral','Use this option if you observe some incorrectness in portal behavior','','2016-09-19 10:40:11','text',2,NULL,'Console'),(966451,168,'CacheTitle','cs','Mezipaměť',NULL,'2017-05-02 10:12:49','text',2,NULL,'Jiří Redr'),(458479,168,'CacheTitle','Neutral','Cache','','2016-09-19 10:40:11','text',2,NULL,'Console'),(961452,168,'CacheTitle','nl','Cache',NULL,'2017-03-30 07:56:09','text',2,NULL,'Hsing-Foo Wang'),(966515,168,'ContactUsText','cs','Podívejte se na naše {0}FAQ stránku{1} pokud máte nějaké otázky nebo nás kontaktujte na {2}support@onlyoffice.com{3}',NULL,'2017-05-02 10:34:21','text',2,NULL,'Jiří Redr'),(458480,168,'ContactUsText','Neutral','Check our {0}FAQ page{1} if you have any questions or contact us at {2}support@onlyoffice.com{3}','','2016-09-19 10:40