',NULL,'2017-01-09 19:39:48','text',2,NULL,'Arto Ryynanen'),(460886,250,'ItemARM','Neutral','ARM','','2016-09-19 10:41:09','text',2,NULL,'Console'),(938304,250,'ItemARMText','fi','Aseta yksilölliset pääsyoikeudet jokaiselle kontaktille - henkilölle tai yritykselle.',NULL,'2017-01-09 20:18:38','text',2,NULL,'Arto Ryynanen'),(460887,250,'ItemARMText','Neutral','Set up individual access rights for each contact - person or company.','','2016-09-19 10:41:09','text',2,NULL,'Console'),(937146,250,'ItemBrandYourWebOffice','fi','Vinkki #1: Päivitä yrityksesi logo nettitoimistoosi ',NULL,'2017-01-07 13:30:46','text',2,NULL,'Arto Ryynanen'),(460888,250,'ItemBrandYourWebOffice','Neutral','Tip #1: Brand your web-office','','2016-09-19 10:41:09','text',2,NULL,'Console'),(937151,250,'ItemBrandYourWebOfficeText','fi','Vaihda portaalin logon asetukset täällä: Asetukset >> Yleiset >> Mukauttaminen >> Logo Asetukset, ja lataa yrityksesi logot halutulla koolla. Portaalin otsikon vaihtamiseksi, joka näkyy Tervetuloa sivulla, siirry tänne: Asetukset >> Yleiset >> Mukauttaminen >> Tervehdysasetukset.',NULL,'2017-01-07 13:40:32','text',2,NULL,'Arto Ryynanen'),(460889,250,'ItemBrandYourWebOfficeText','Neutral','Change the portal logo settings following Settings >> Common >> White Label and uploading your company\'s logos of the specified sizes. To change the default portal title displayed on the Welcome page, go to Settings >> Common >> Customization >> Welcome Page Settings.','','2016-09-19 10:41:09','text',2,NULL,'Console'),(938215,250,'ItemCreateWorkspaceDocs','fi','Luo yksi työtila kaikille asiakirjoillesi',NULL,'2017-01-09 19:43:28','text',2,NULL,'Arto Ryynanen'),(460890,250,'ItemCreateWorkspaceDocs','Neutral','Create a single workspace for all your docs','','2016-09-19 10:41:09','text',2,NULL,'Console'),(938223,250,'ItemCustomization','fi','Mukauttaminen',NULL,'2017-01-09 19:49:20','text',2,NULL,'Arto Ryynanen'),(460891,250,'ItemCustomization','Neutral','Customization','','2016-09-19 10:41:09','text',2,NULL,'Console'),(938303,250,'ItemCustomizationText','fi','Aseta Asiakkuudenhallinnan järjestelmä yrityksesi tarpeiden mukaan. Mukauta käyttäjien kenttiä, aseta mahdollisuuksien vaiheet ja tehtävien luokat, luo yrityksen profiilisi siten että tieto näkyy myös laskuissa, jne.',NULL,'2017-01-09 20:18:07','text',2,NULL,'Arto Ryynanen'),(460892,250,'ItemCustomizationText','Neutral','Set up CRM system according to your company needs. Customize user fields, set opportunity stages and task categories, create the company profile to include this information into invoices, etc.','','2016-09-19 10:41:09','text',2,NULL,'Console'),(937148,250,'ItemCustomizeWebOfficeInterface','fi','Vinkki #3: Räätälöi nettitoimistosi näkymä',NULL,'2017-01-07 13:31:58','text',2,NULL,'Arto Ryynanen'),(460893,250,'ItemCustomizeWebOfficeInterface','Neutral','Tip #3: Customize your web-office interface','','2016-09-19 10:41:09','text',2,NULL,'Console'),(937231,250,'ItemCustomizeWebOfficeInterfaceText','fi','Nimeä portaalin ryhmät, sen jäsenet ja heidän aktiviteetit täällä: Asetukset >> Yleiset >> Organisaatiomalli. Voit myös samassa paikassa valita väriteeman, joka sopii parhaiten yrityksesi brändäykseen.',NULL,'2017-01-07 14:58:12','text',2,NULL,'Arto Ryynanen'),(460894,250,'ItemCustomizeWebOfficeInterfaceText','Neutral','Name the portal groups, its members and their activities following Settings >> Common >> Customization >> Team Template. Select the color theme that best suits your company brand.','','2016-09-19 10:41:09','text',2,NULL,'Console'),(950136,250,'ItemEnterpriseDocsTips1','de','<b>Tipp #1.</b> Nutzen Sie die Funktion <b>Zusammenbearbeitung in Echtzeit</b>, um den Interaktionsprozess beim Festlegen von Details oder beim Korrekturlesen eines Dokuments zu beschleunigen. Wählen Sie zwischen zwei Bearbeitungsmodi - <b>Halbformal</b> in dem die Änderungen automatisch auf dem Bildschirm des Mitautors erscheinen oder <b>Formal</b> in dem die Änderungen nur dann angezeigt werden, wenn sie von einem Mitautor gespeichert wurden.',NULL,'2017-01-30 13:44:08','text',2,NULL,'Evgenia'),(950495,250,'ItemEnterpriseDocsTips1','es','<b>Consejo №1.</b> Use la opción de <b>edición colaborativa en tiempo real</b> para apurar el proceso de interacción al especificar los detalles o revisar el documento. Elija un modo de co-edición más apropiado - <b>Rápido</b>, cuando Usted ve los cambios mientras su coautor está escribiendo o <b>Estricto</b>, cuando los cambios se muestran solo después de guardar el documento.',NULL,'2017-02-02 07:13:15','text',2,NULL,'Ekaterina.Heidel'),(938160,250,'ItemEnterpriseDocsTips1','fi','<b>Vinkki #1.</b> Käytä <b>Reaaliaikaista yhteistyöhön perustuvaa muokkauksen</b> ominaisuutta jotta voit nopeuttaa vuorovaikutuksen prosessia, kun määrittelet tai oikoluet asiakirjan tietoja. Valitse kahden erilaisen yhteistyön mallista - <b>Nopea</b> kun haluat nähdä muutoksia jo siinä vaiheessa kun kumppani on vielä kirjoittamassa asiakirjaa tai <b>Täsmällinen</b> kun muutokset näkyvät vasta kun asiakirja on tallennettu.',NULL,'2017-01-09 16:07:36','text',2,NULL,'Arto Ryynanen'),(949060,250,'ItemEnterpriseDocsTips1','fr','<b>Conseil №1.</b> Utilisez <b>l\'édition collaborative en temps réel</b> pour accélérer le processus d\'interaction lors de la précision des détails ou la révision des documents. Choisissez entre deux modes de l\'édition collaborative - <b>Rapide</b> quand vous voyez des changements que votre coauteur tape ou le mode <b>Strict</b> lorsque les modifications sont affichées uniquement après l’enregistrement du document.',NULL,'2017-01-26 07:37:34','text',2,NULL,'Nadine Yablonskaya'),(934196,250,'ItemEnterpriseDocsTips1','Neutral','<b>Tip #1.</b> Use the <b>Real-time co-editing</b> feature to  speed up the interaction process when specifying details or proofreading a document. Choose between two co-editing modes - <b>Fast</b> when you see changes as your co-author is typing or <b>Strict</b> when the changes are shown only after saving the document.','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936120,250,'ItemEnterpriseDocsTips1','ru','<b>Совет №1.</b> Используйте возможность <b>совместного редактирования в режиме реального времени</b>, чтобы ускорить процесс взаимодействия при уточнении деталей или корректировке документа. Выбирайте подходящий режим совместного редактирования - <b>Быстрый</b>, при котором изменения отображаются по мере ввода текста, или <b>Строгий</b>, при котором изменения отображаются только после сохранения документа.',NULL,'2016-12-15 14:58:19','text',2,NULL,'Svetlana'),(950138,250,'ItemEnterpriseDocsTips2','de','<b>Tipp #2.</b> Benutzen Sie <b>Versionshistorie</b> Option, um festzustellen wie das Dokument von Ihnen oder vom Ihrem Mitarbeiter bearbeitet wurde oder zu sehen, wer diese Änderungen gemacht hat. \n',NULL,'2017-01-30 13:45:26','text',2,NULL,'Evgenia'),(950497,250,'ItemEnterpriseDocsTips2','es','<b>Consejo #2.</b> Use la opción <b>Historia de versiones</b> para verificar los cambios realizados en un archivo por Usted y sus compañeros de equipo o ver quién hizo las ediciones específicas.',NULL,'2017-02-02 08:42:24','text',2,NULL,'Ekaterina.Heidel'),(938164,250,'ItemEnterpriseDocsTips2','fi','<b>Vinkki #2.</b> Käytä<b>Versiohistorian</b> vaihtoehtoa, jotta voit tarkistaa sinun ja tiimisi jäsenten tekemät muutokset tiedostoon, tai nähdä kuka suoritti tietyt muokkaukset.',NULL,'2017-01-09 16:13:35','text',2,NULL,'Arto Ryynanen'),(949041,250,'ItemEnterpriseDocsTips2','fr','<b>Conseil №2.</b> Utilisez l\'option <b>Historique des versions</b> pour vérifier les modifications apportées à un fichier par vous et par vos coéquipiers ou pour voir qui a fait les corrections spécifiques.',NULL,'2017-01-25 13:25:52','text',2,NULL,'Nadine Yablonskaya'),(934197,250,'ItemEnterpriseDocsTips2','Neutral','<b>Tip #2.</b> Use the <b>Version History</b> option to check the changes made to a file by you and your teammates or see who made the specific edits.','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936122,250,'ItemEnterpriseDocsTips2','ru','<b>Совет №2.</b> Используйте опцию <b>История версий</b>, чтобы отследить изменения, внесенные в файл вами или вашими коллегами, или узнать, кто внес те или иные поправки.',NULL,'2016-12-16 09:16:32','text',2,NULL,'Svetlana'),(950140,250,'ItemEnterpriseDocsTips3','de','<b>Tipp #3.</b> Nutzen Sie die Funktion <b>Review</b>, um manuelle Nachverfolgen von Änderungen und Zusammenführen zu vermeiden. Gewähren Sie einen schnellen Zugriff auf Ihr Dokument für die Überprüfung und lassen Sie andere Mitglieder die  Änderungen vornehmen, ohne das Dokument tatsächlich zu bearbeiten. Nehmen Sie die Vorschläge an oder lehnen Sie diese ab.',NULL,'2017-01-30 14:00:58','text',2,NULL,'Evgenia'),(950524,250,'ItemEnterpriseDocsTips3','es','<b>Consejo №3.</b> Use la opción <b>Revisión</b> para evitar el seguimiento de cambios manual. Comparta el documento concediendo los permisos para revisarlo para que otros usuarios puedan aconsejar sus correcciones sin editar este documento. 	Fácilmente acepte o rechace los cambios aconsejados.',NULL,'2017-02-02 09:25:54','text',2,NULL,'Ekaterina.Heidel'),(938168,250,'ItemEnterpriseDocsTips3','fi','<b>Vinkki #3.</b> Käytä <b>Arvioi</b> ominaisuutta jotta voit välttää manuaalista muutosten seurantaa ja yhdistelyä. Anna välittömästi pääsy asiakirjaasi arviointia varten ja anna muiden ehdottaa muutoksia niin että he eivät varsinaisesti muokkaa asiakirjaa.  Voit helposti hyväksyä tai hylätä ehdotetut muutokset.',NULL,'2017-01-09 16:20:45','text',2,NULL,'Arto Ryynanen'),(949061,250,'ItemEnterpriseDocsTips3','fr','<b>Conseil №3.</b> Utilisez la fonctionnalité de <b>Révision</b> pour éviter le suivi manuel des modifications. Accordez un accès rapide pour réviser votre document et pour permettre aux autres de proposer des modifications sans modifier le document. Acceptez ou refusez facilement les modifications suggérées.',NULL,'2017-01-26 08:01:57','text',2,NULL,'Nadine Yablonskaya'),(934198,250,'ItemEnterpriseDocsTips3','Neutral','<b>Tip #3.</b> Use the <b>Review</b> feature to avoid manual tracking changes and merging. Grant a quick access to your document for reviewing and let others suggest changes without actually editing the document. Easily accept or reject suggested changes.','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936124,250,'ItemEnterpriseDocsTips3','ru','<b>Совет №3.</b> Используйте возможность <b>Рецензирования</b>, чтобы избежать отслеживания и объединения изменений вручную. Предоставляйте доступ к документу с правами на рецензирование, чтобы другие могли предлагать свои правки, не редактируя при этом сам документ. Легко принимайте или отклоняйте предложенные изменения.',NULL,'2016-12-16 09:44:04','text',2,NULL,'Svetlana'),(950143,250,'ItemEnterpriseDocsTips4','de','<b>Tipp #4.</b> Teilen Sie Dokumente mit anderen Benutzern oder Personen. Hängen Sie Dokumente als Links an Ihre E-Mails an, um E-Mail-Datenverkehr zu verringern.',NULL,'2017-01-30 14:13:30','text',2,NULL,'Evgenia'),(950581,250,'ItemEnterpriseDocsTips4','es','<b>Consejo №4.</b> Comparta documentos con otros usuarios. Adjunte documentos como enlaces a sus mensajes de correo para reducir el tráfico de correo.',NULL,'2017-02-02 11:58:22','text',2,NULL,'Ekaterina.Heidel'),(938172,250,'ItemEnterpriseDocsTips4','fi','<b>Vinkki #4.</b> Jaa asiakirjoja muille käyttäjile tai henkilöille. Liitä asiakirjat linkkeinä sähköpostiisi, jotta voit vähentää sähköpostiliikennettä.',NULL,'2017-01-09 16:27:03','text',2,NULL,'Arto Ryynanen'),(949068,250,'ItemEnterpriseDocsTips4','fr','<b>Conseil №4.</b> Partagez des documents avec d\'autres utilisateurs. Joignez des documents en tant que liens à votre courriel pour diminuer le trafic de messages électroniques.',NULL,'2017-01-26 08:28:25','text',2,NULL,'Nadine Yablonskaya'),(934199,250,'ItemEnterpriseDocsTips4','Neutral','<b>Tip #4.</b> Share documents with other users or people. Attach documents as links to your email to reduce the mail traffic.','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936127,250,'ItemEnterpriseDocsTips4','ru','<b>Совет №4.</b> Предоставляйте доступ к документам для других пользователей. Прикрепляйте документы к письмам в виде ссылок для уменьшения почтового трафика.',NULL,'2016-12-16 09:53:21','text',2,NULL,'Svetlana'),(950881,250,'ItemEnterpriseDocsTips5','de','<b>Tipp #5.</b> Nutzen Sie <b>Mail Merge</b>, um personalisierte E-Mails oder Vorlagen zu erstellen und sparen Sie Zeit, die Sie in der Regel auf das Schreiben des gleichen Textes verbringen.',NULL,'2017-02-09 09:37:15','text',2,NULL,'Evgenia'),(950634,250,'ItemEnterpriseDocsTips5','es','<b>Consejo №5.</b> Use la función <b>Fusión</b> (Mail Merge) para crear un conjunto de los correos personalizados o plantillas para evitar la necesidad de escribir el mismo texto algunas veces y ahorrar tiempo.',NULL,'2017-02-06 05:18:43','text',2,NULL,'Ekaterina.Heidel'),(938176,250,'ItemEnterpriseDocsTips5','fi','<b>Vinkki #5.</b> Käytä <b>Sähköpostin</b> yhdistämisen toimintoa, jotta voit luoda mieluisan setin viesteistä tai mallipohjista ja säästä aikaa toiminnoista, joissa kirjoitat samaa tekstiä useita eri kertoja.',NULL,'2017-01-09 16:33:24','text',2,NULL,'Arto Ryynanen'),(950680,250,'ItemEnterpriseDocsTips5','fr','<b>Conseil #5.</b> Utilisez la fonction <b>Fusion et publipostage</b> pour créer un ensemble de messages personnalisés ou de modèles et pour économiser du temps que vous consacrez habituellement à écrire le même texte plusieurs fois.',NULL,'2017-02-06 09:19:23','text',2,NULL,'Nadine Yablonskaya'),(934200,250,'ItemEnterpriseDocsTips5','Neutral','<b>Tip #5.</b> Use the <b>Mail Merge</b> function to create a set of personalized messages or a templates and save time you usually spend on writing the same text several times.','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936136,250,'ItemEnterpriseDocsTips5','ru','<b>Совет №5.</b> Используйте функцию <b>Слияние</b> (Mail Merge) для создания множества персонализированных писем или шаблонов, чтобы не писать один и тот же текст несколько раз и сэкономить время.',NULL,'2016-12-16 10:11:24','text',2,NULL,'Svetlana'),(950145,250,'ItemEnterpriseDocsTips6','de','<b>Tipp #6.</b> Laden Sie kostenlose Anwendung ONLYOFFICE Desktop Editors für die Arbeit an Dokumenten ohne Internetverbindung. Merken Sie bitte, dass die App mit Ihrem ONLYOFFICE-Portal verbunden werden kann, um auf dort gespeicherte Dokumente zuzugreifen.',NULL,'2017-01-30 15:04:41','text',2,NULL,'Evgenia'),(950635,250,'ItemEnterpriseDocsTips6','es','<b>Consejo №6.</b> Descargue Editores Desktop de ONLYOFFICE gratuitos para trabajar con documentos sin conexión al Internet. Note que esta aplicación puede ser conectada al portal ONLYOFFICE para acceder a los documentos almacenados ahí.',NULL,'2017-02-06 06:06:07','text',2,NULL,'Ekaterina.Heidel'),(938177,250,'ItemEnterpriseDocsTips6','fi','<b>Vinkki #6.</b> Lataa ilmainen ONLYOFFICE Desktop Editori, niin voit työskennellä asiakirjojen kanssa ilman internet yhteyttä. Huomaa, että tämä sovellus voidaan yhdistää ONLYOFFICE portaaliisi, jotta saat pääsyn siellä sijaitseviin asiakirjoihin.',NULL,'2017-01-09 16:35:23','text',2,NULL,'Arto Ryynanen'),(949093,250,'ItemEnterpriseDocsTips6','fr','<b>Conseil №6.</b> Téléchargez les éditeurs de bureau ONLYOFFICE gratuitement pour travailler sur les documents sans la connexion internet. Notez que vous pouvez connecter ce logiciel à votre portail ONLYOFFICE pour accéder aux documents qui y sont stockés.',NULL,'2017-01-26 08:53:21','text',2,NULL,'Nadine Yablonskaya'),(934201,250,'ItemEnterpriseDocsTips6','Neutral','<b>Tip #6.</b> Download free ONLYOFFICE Desktop Editors to work on documents without Internet connection. Note that the app can be connected to your ONLYOFFICE portal to access documents stored there.','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936137,250,'ItemEnterpriseDocsTips6','ru','<b>Совет №6.</b> Скачайте бесплатные десктопные редакторы ONLYOFFICE для работы с документами без подключения к интернету. Обратите внимание на то, что это приложение можно подключить к порталу ONLYOFFICE и получить доступ к сохраненным на нем документам.',NULL,'2016-12-16 10:14:40','text',2,NULL,'Svetlana'),(950147,250,'ItemEnterpriseDocsTips7','de','<b>Tipp #7.</b>Laden Sie<b>ONLYOFFICE Documents App</b> herunter und lassen Sie sie auf Ihrem iOS Gerät installieren, um mit Dokumenten überall, jederzeit auch unterwegs zu arbeiten.',NULL,'2017-01-30 15:09:18','text',2,NULL,'Evgenia'),(950637,250,'ItemEnterpriseDocsTips7','es','<b>Consejo №7.</b> Descargue la aplicación móvil <b>ONLYOFFICE Documentos</b> e instale en su dispositivo iOS para trabajar con documentos a cualquier lugar, a cualquier hora, aún en movimiento.',NULL,'2017-02-06 06:13:58','text',2,NULL,'Ekaterina.Heidel'),(938179,250,'ItemEnterpriseDocsTips7','fi','<b>Vinkki #7.</b> Lataa <b>ONLYOFFICE Asiakirjojen sovellus</b> ja asenna se iOS laitteeseen, niin voit työskennellä asiakirjojen kanssa missä vaan, milloin vaan ja jopa liikenteessä.',NULL,'2017-01-09 16:37:12','text',2,NULL,'Arto Ryynanen'),(949096,250,'ItemEnterpriseDocsTips7','fr','<b>Conseil №7.</b> Téléchargez et installez l\'application <b>ONLYOFFICE Documents</b> sur votre appareil iOS pour travailler sur les documents à tout moment et en tout lieu.',NULL,'2017-01-26 09:08:30','text',2,NULL,'Nadine Yablonskaya'),(934202,250,'ItemEnterpriseDocsTips7','Neutral','<b>Tip #7.</b> Download <b>ONLYOFFICE Documents app</b> and install it on your iOS device to work with documents anywhere, anytime, even on the go.','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936139,250,'ItemEnterpriseDocsTips7','ru','<b>Совет №7.</b> Скачайте мобильное приложение <b>ONLYOFFICE Документы</b> и установите на iOS-устройство, чтобы работать с документами в любое время, из любой точки мира, где бы вы ни находились.',NULL,'2016-12-16 10:17:49','text',2,NULL,'Svetlana'),(938210,250,'ItemFeatureCommunity','fi','Yhteisö',NULL,'2017-01-09 19:41:13','text',2,NULL,'Arto Ryynanen'),(460895,250,'ItemFeatureCommunity','Neutral','Community','','2016-09-19 10:41:09','text',2,NULL,'Console'),(938157,250,'ItemFeatureCommunityText','fi','<b>Luo sisäinen sosiaalinen verkosto</b> blogeilla, foorumeila, kyselyillä jne. jotta voit organisoida tehokasta kaksisuuntaista kommunikaatiota. Lisäksi se auttaa sinua löytämään piileviä taitojasi, luovia henkilöitä, ja kehittää organisoimista ja johtamista.',NULL,'2017-01-09 15:56:41','text',2,NULL,'Arto Ryynanen'),(460896,250,'ItemFeatureCommunityText','Neutral','<b>Create an internal social network</b> with blogs, forums, polls, etc. to organize an efficient two-way communication. Moreover it allows you to discover hidden talents, creative persons, able to organize and lead.','','2016-09-19 10:41:09','text',2,NULL,'Console'),(938231,250,'ItemFeatureDocCoAuthoring','fi','Asiakirjan kirjoittaminen yhteistyönä',NULL,'2017-01-09 19:54:27','text',2,NULL,'Arto Ryynanen'),(460897,250,'ItemFeatureDocCoAuthoring','Neutral','Document Co-authoring','','2016-09-19 10:41:09','text',2,NULL,'Console'),(938305,250,'ItemFeatureDocCoAuthoringText','fi','Jaa asiakirjoja tiimisi jäsenten kanssa ja muokkaa niitä yhdessä reaaliajassa. Lisää kommentteja ja toimi vuorovaikutteisesti integroidun chat toiminnon avulla. ',NULL,'2017-01-09 20:19:59','text',2,NULL,'Arto Ryynanen'),(460898,250,'ItemFeatureDocCoAuthoringText','Neutral','Share docs with your team and edit them together in real time. Add comments and interact with your co-authors using the integrated chat.','','2016-09-19 10:41:09','text',2,NULL,'Console'),(938237,250,'ItemFeatureEmailSignature','fi','Sähköpostin allekirjoitus',NULL,'2017-01-09 19:55:30','text',2,NULL,'Arto Ryynanen'),(460899,250,'ItemFeatureEmailSignature','Neutral','Email Signature','','2016-09-19 10:41:09','text',2,NULL,'Console'),(938216,250,'ItemFeatureEmailSignatureText','fi','Luo tehokas sähköpostin allekirjoitus käyttämällä tekstiä, kuvia, linkkejä tai jopa HTML koodilla.',NULL,'2017-01-09 19:44:32','text',2,NULL,'Arto Ryynanen'),(460900,250,'ItemFeatureEmailSignatureText','Neutral','Create an effective email signature using text, picture, link or even generated HTML code.','','2016-09-19 10:41:09','text',2,NULL,'Console'),(938243,250,'ItemFeatureFolderForAtts','fi','Liitteiden kansio',NULL,'2017-01-09 19:57:50','text',2,NULL,'Arto Ryynanen'),(460901,250,'ItemFeatureFolderForAtts','Neutral','Folder for Attachments','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938302,250,'ItemFeatureFolderForAttsText','fi','Aseta kansio tallentamaan kaikki tulevat siihen kohdistetut liitteet',NULL,'2017-01-09 20:16:22','text',2,NULL,'Arto Ryynanen'),(460902,250,'ItemFeatureFolderForAttsText','Neutral','Set up a folder to automatically save all the future attachments into it.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938246,250,'ItemFeatureGanttChart','fi','Gantt Kaavio',NULL,'2017-01-09 19:58:23','text',2,NULL,'Arto Ryynanen'),(460903,250,'ItemFeatureGanttChart','Neutral','Gantt Chart','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938158,250,'ItemFeatureGanttChartText','fi','<b>Määrittele prosesseja, prioriteetteja ja riippuvuussuhteita</b>, mikä auttaa tiimiäsi suorittamaan paremmin tehtäviään. Seuraa etenemistä ja suorita ajan mittaan muutoksia hyödyntämällä visuaalista kaaviota projektistasi.',NULL,'2017-01-09 15:58:56','text',2,NULL,'Arto Ryynanen'),(460904,250,'ItemFeatureGanttChartText','Neutral','<b>Define processes, priorities and dependencies</b> to help your team to better perform tasks. Monitor progress and perform changes in time using a visualized picture of your project.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938277,250,'ItemFeatureLinksVSAttachments','fi','Linkit liitteiden sijaan',NULL,'2017-01-09 20:10:21','text',2,NULL,'Arto Ryynanen'),(460905,250,'ItemFeatureLinksVSAttachments','Neutral','Links Instead of Attachments','','2016-09-19 10:41:10','text',2,NULL,'Console'),(943495,250,'ItemFeatureLinksVSAttachmentsText','fi','Lisää linkki tiedostoon, sen sijaan että liittäisit sen, ja hallinnoi sen pääsyoikeuksia. Näin voit vähentää sähköpostiliikennettä ja isojen tiedostojen lähetyksiä.',NULL,'2017-01-14 19:10:12','text',2,NULL,'Arto Ryynanen'),(460906,250,'ItemFeatureLinksVSAttachmentsText','Neutral','Insert a link to a file instead of attaching it and manage access rights to it to reduce the mail traffic and send a large file.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(951059,250,'ItemFeatureMailboxAliases','es','Aliases de buzones de correo',NULL,'2017-02-16 13:21:09','text',2,NULL,'Ekaterina.Heidel'),(938280,250,'ItemFeatureMailboxAliases','fi','Postilaatikon aliakset',NULL,'2017-01-09 20:10:55','text',2,NULL,'Arto Ryynanen'),(460907,250,'ItemFeatureMailboxAliases','Neutral','Mailbox Aliases','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938317,250,'ItemFeatureMailboxAliasesText','fi','Käytä aliaksia jos haluat vaihtaa sähköpostiosoitetta ilman uuden postilaatikon luontia.',NULL,'2017-01-09 20:29:57','text',2,NULL,'Arto Ryynanen'),(460908,250,'ItemFeatureMailboxAliasesText','Neutral','Use the aliases if you need to change your email address without creating a new mailbox.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938278,250,'ItemFeatureMailGroups','fi','Sähköpostiryhmät',NULL,'2017-01-09 20:10:32','text',2,NULL,'Arto Ryynanen'),(460909,250,'ItemFeatureMailGroups','Neutral','Mail Groups','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938218,250,'ItemFeatureMailGroupsText','fi','Sähköpostiryhmän luonti on erinomainen tapa varmistaa että tietyt sähköpostit ovat saatavilla käyttäjäryhmille. Ei tarvitse kopioida viestejä, mikä vähentää uskomattoman määrän sähköposteihin tarvittavaa talletustilaa.',NULL,'2017-01-09 19:47:40','text',2,NULL,'Arto Ryynanen'),(460910,250,'ItemFeatureMailGroupsText','Neutral','Creating a mail group is a great way to make certain emails available for a group of users. No need to duplicate messages, which incredibly reduces the mail storage space.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938299,250,'ItemFeatureProjectDiscussions','fi','Projektin keskustelut',NULL,'2017-01-09 20:15:24','text',2,NULL,'Arto Ryynanen'),(460911,250,'ItemFeatureProjectDiscussions','Neutral','Project Discussions','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938159,250,'ItemFeatureProjectDiscussionsText','fi','<b>Keskustele aiheista</b> - mistä tahansa ongelmasta tai ajankohtaisesta kysymyksestä - tiimityöskentelyn avulla voitte helpommin löytää ratkaisun.',NULL,'2017-01-09 16:00:55','text',2,NULL,'Arto Ryynanen'),(460912,250,'ItemFeatureProjectDiscussionsText','Neutral','<b>Discuss issues</b> - any sort of problems and outstanding questions that occur - with your team to find a better solution together.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938310,250,'ItemFeatureTalk','fi','Puhu',NULL,'2017-01-09 20:24:24','text',2,NULL,'Arto Ryynanen'),(460913,250,'ItemFeatureTalk','Neutral','Talk','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938316,250,'ItemFeatureTalkText','fi','Käytä <b>chattihuonetta</b> jos haluat luoda konferenssin reaaliajassa, <b>sähköpostilistoja</b> jos haluat lähettää viestejä kerralla monelle henkilölle, <b>tiedonantoja</b> uutisten seurantaan.',NULL,'2017-01-09 20:29:25','text',2,NULL,'Arto Ryynanen'),(460914,250,'ItemFeatureTalkText','Neutral','Use <b>chat rooms</b> to create a conference in real time, <b>mailing lists</b> to send a message to many people at once, <b>notifications</b> to follow news.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938162,250,'ItemFeatureTips1CoEditingText','fi','<b>Vinkki #1.</b> Käytä <b>Reaaliaikaista yhteistyöhön perustuvan muokkauksen</b> ominaisuutta, jotta voit välttää manuaalista muutosten seurantaa. Voit yhdistää tai nopeuttaa vuorovaikutuksen prosessia kun määritellään tietoja tai oikoluetaan asiakirjaa.',NULL,'2017-01-09 16:10:50','text',2,NULL,'Arto Ryynanen'),(460915,250,'ItemFeatureTips1CoEditingText','Neutral','<b>Tip #1.</b> Use the <b>Real-time Co-editing</b> feature to avoid the manual tracking changes and merging and speed up the interaction process when specifying details or proofreading a document.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938163,250,'ItemFeatureTips2VersionHistoryText','fi','<b>Vinkki #2.</b> Käytä<b>Versiohistorian</b> vaihtoehtoa, jotta voit tarkistaa sinun ja tiimisi jäsenten tekemät muutokset tiedostoon, tai nähdä kuka suoritti tietyt muokkaukset.',NULL,'2017-01-09 16:13:23','text',2,NULL,'Arto Ryynanen'),(949042,250,'ItemFeatureTips2VersionHistoryText','fr','<b>Conseil №2.</b> Utilisez l\'option <b>Historique des versions</b> pour vérifier les modifications apportées à un fichier par vous et par vos coéquipiers ou pour voir qui a fait les corrections spécifiques.',NULL,'2017-01-25 13:27:12','text',2,NULL,'Nadine Yablonskaya'),(460916,250,'ItemFeatureTips2VersionHistoryText','Neutral','<b>Tip #2.</b> Use the <b>Version History</b> option to check the changes made to a file by you and your teammates or see who made the specific edits.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938166,250,'ItemFeatureTips3ShareDocsText','fi','<b>Vinkki #3. Jaa asiakirjoja</b> muille käyttäjille tai henkilöille, jotka eivät ole nettitoimistosi käyttäjiä. Liitä asiakirjoja linkkeinä sähköpostiin ja voit siten vähentää sähköpostiliikennettä.',NULL,'2017-01-09 16:15:54','text',2,NULL,'Arto Ryynanen'),(460917,250,'ItemFeatureTips3ShareDocsText','Neutral','<b>Tip #3. Share documents</b> with other users or people outside your cloud office. Attach documents as links to your email to reduce the mail traffic.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938167,250,'ItemFeatureTips3ShareDocsTextEnterprise','fi','<b>Vinkki #3. Jaa asiakirjoja</b> muille käyttäjille. Liitä asiakirjoja linkkeinä sähköpostiin ja voit siten vähentää sähköpostiliikennettä.',NULL,'2017-01-09 16:16:41','text',2,NULL,'Arto Ryynanen'),(460918,250,'ItemFeatureTips3ShareDocsTextEnterprise','Neutral','<b>Tip #3. Share documents</b> with other users. Attach documents as links to your email to reduce the mail traffic.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938170,250,'ItemFeatureTips4CloudStoragesText','fi','<b>Vinkki #4.</b> Voit tallentaa Nettitoimistosi asiakirjat useisiin erilaisiin *Pilvipalveluihin*, ja hallinnoida kaikki asiakirjat portaalin sisällä.',NULL,'2017-01-09 16:25:06','text',2,NULL,'Arto Ryynanen'),(460919,250,'ItemFeatureTips4CloudStoragesText','Neutral','<b>Tip #4.</b> Integrate your Web Office with different *Cloud Storages* to manage all your documents inside the portal.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938173,250,'ItemFeatureTips4MailMergeText','fi','<b>Vinkki #4.</b> Käytä <b>Sähköpostin</b> yhdistämisen toimintoa, jotta voit luoda mieluisan setin viesteistä tai mallipohjista ja säästä aikaa toiminnoista, joissa kirjoitat samaa tekstiä useita eri kertoja.',NULL,'2017-01-09 16:29:42','text',2,NULL,'Arto Ryynanen'),(460920,250,'ItemFeatureTips4MailMergeText','Neutral','<b>Tip #4.</b> Use the <b>Mail Merge</b> function to create a set of personalized messages or a templates and save time you usually spend on writing the same text several times.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938174,250,'ItemFeatureTips5iOSText','fi','<b>Vinkki #5.</b> Lataa <b>${LetterLogoText} Asiakirjojen sovellus</b> ja asenna se iOS laitteeseen, jolloin voit työskennellä asiakirjojen kanssa missä vaan, milloin vaan ja jopa liikenteessä.',NULL,'2017-01-09 16:31:12','text',2,NULL,'Arto Ryynanen'),(460921,250,'ItemFeatureTips5iOSText','Neutral','<b>Tip #5.</b> Download <b>${LetterLogoText} Documents app</b> and install it on your iOS device to work with documents anywhere, anytime, even on the go.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938248,250,'ItemImportProjects','fi','Projektien tuonti',NULL,'2017-01-09 19:59:55','text',2,NULL,'Arto Ryynanen'),(460922,250,'ItemImportProjects','Neutral','Import projects','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938315,250,'ItemImportProjectsBasecamp','fi','Tuo projekteja Basecamp sovelluksesta',NULL,'2017-01-09 20:27:10','text',2,NULL,'Arto Ryynanen'),(460923,250,'ItemImportProjectsBasecamp','Neutral','Import projects from Basecamp','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938250,250,'ItemIntegrateDocs','fi','Integroi asiakirjoja',NULL,'2017-01-09 20:01:32','text',2,NULL,'Arto Ryynanen'),(460924,250,'ItemIntegrateDocs','Neutral','Integrate documents','','2016-09-19 10:41:10','text',2,NULL,'Console'),(935705,250,'ItemIntegrateIM','de','Integrieren Sie IM-Client mit ${LetterLogoText} Chat und bleiben Sie dran',NULL,'2016-12-01 08:52:52','text',2,NULL,'Александр'),(935706,250,'ItemIntegrateIM','es','Integre su cliente de mensajería instantánea con ${LetterLogoText} chat y esté ajustado',NULL,'2016-12-01 08:52:56','text',2,NULL,'Александр'),(938251,250,'ItemIntegrateIM','fi','Integroi IM client toiminto ${LetterLogoText} jutteluun ja pysy ajan tasalla',NULL,'2017-01-09 20:02:55','text',2,NULL,'Arto Ryynanen'),(935707,250,'ItemIntegrateIM','fr','Intégrez votre client de MI avec Chat ${LetterLogoText} et restez à l\'écoute',NULL,'2016-12-01 08:53:00','text',2,NULL,'Александр'),(460925,250,'ItemIntegrateIM','Neutral','Integrate your IM client with ${LetterLogoText} talk and stay tuned','','2016-12-01 08:52:48','text',2,NULL,'Console'),(935708,250,'ItemIntegrateIM','ru','Интегрируйте свой IM-клиент с Чатом ${LetterLogoText} и оставайтесь на связи с коллегами',NULL,'2016-12-01 08:53:03','text',2,NULL,'Александр'),(938276,250,'ItemLinkWithProjects','fi','Linkitä projekteihin',NULL,'2017-01-09 20:10:01','text',2,NULL,'Arto Ryynanen'),(460926,250,'ItemLinkWithProjects','Neutral','Link with projects','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938342,250,'ItemLinkWithProjectsText','fi','Hankesuunnitelma voi edellyttää kokonaisen asiantuntijatiimin osallistumista. Luo projekti ja linkitä se hankesuunnitelmaan, jotta voit koordinoida työn tehokkaammmin. ',NULL,'2017-01-09 20:39:45','text',2,NULL,'Arto Ryynanen'),(460927,250,'ItemLinkWithProjectsText','Neutral','Working on an opportunity might require the involvement of the whole team of the specialists. Create a project and link it with the opportunity to coordinate the work more efficiently.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938279,250,'ItemMailIntegration','fi','Sähköpostin integrointi',NULL,'2017-01-09 20:10:40','text',2,NULL,'Arto Ryynanen'),(460928,250,'ItemMailIntegration','Neutral','Mail Integration','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938274,250,'ItemMailIntegrationText','fi','Pidä kaikki tiedot kontakteista, mahdollisuuksista ja tapauksista yhdessä paikassa, mukaanlukien sähköpostit. Linkitä keskustelu tai yksittäinen viesti haluttuun Asiakkuudenhallinnan elementtiin.',NULL,'2017-01-09 20:09:31','text',2,NULL,'Arto Ryynanen'),(460929,250,'ItemMailIntegrationText','Neutral','Keep all the information about contacts, opportunities and cases in one place including email correspondence. Link a conversation or a single message with a necessary CRM element.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(944859,250,'ItemModulesAndTools','fi','Vinkki #4: Valitse ${LetterLogoText} moduulit ja työkalut',NULL,'2017-01-15 12:32:34','text',2,NULL,'Arto Ryynanen'),(460930,250,'ItemModulesAndTools','Neutral','Tip #4: Select the ${LetterLogoText} modules and tools','','2016-09-19 10:41:10','text',2,NULL,'Console'),(944728,250,'ItemModulesAndToolsText','fi','${LetterLogoText} toimittaa sinulle täyden työkalusetin nettitoimistossa tapahtuvaan yhteistoimintaan. Voit aktivoida halutut työkalut täällä: Asetukset >> Moduulit ja Työkalut. Vastaavasti, voit piilottaa  osiot tai työkalut, joita et tarvitse.',NULL,'2017-01-15 11:20:40','text',2,NULL,'Arto Ryynanen'),(460931,250,'ItemModulesAndToolsText','Neutral','${LetterLogoText} provides you with a complete set of tools for office collaboration allowing you to enable those you need for your work following  Settings >> Common >> Modules & Tools. The disabled ones will be hidden.','','2016-09-19 10:41:10','text',2,NULL,'Console'),(960573,250,'ItemModulesAndToolsText','nl','${LetterLogoText} voorziet u in een complete set hulpmiddelen om samen te kunnen werken met collega\'s en stelt u in staat om de gewenste hulpmiddelen in te schakelen, volg Instellingen >> Algemeen >> Modules en tools. De hulpmiddelen die uitgeschakeld zijn zijn verborgen.',NULL,'2017-03-27 07:01:04','text',2,NULL,'Hsing-Foo Wang'),(950137,250,'ItemSaasDocsTips1','de','<b>Tipp #1.</b> Nutzen Sie die Funktion <b>Zusammenbearbeitung in Echtzeit</b>, um den Interaktionsprozess beim Festlegen von Details oder beim Korrekturlesen eines Dokuments zu beschleunigen. Wählen Sie zwischen zwei Bearbeitungsmodi - <b>Halbformal</b> in dem die Änderungen automatisch auf dem Bildschirm des Mitautors erscheinen oder <b>Formal</b> in dem die Änderungen nur dann angezeigt werden, wenn sie von einem Mitautor gespeichert wurden.',NULL,'2017-01-30 13:44:46','text',2,NULL,'Evgenia'),(950496,250,'ItemSaasDocsTips1','es','<b>Consejo №1.</b> Use la opción de <b>edición colaborativa en tiempo real</b> para apurar el proceso de interacción al especificar los detalles o revisar el documento. Elija un modo de co-edición más apropiado - <b>Rápido</b>, cuando Usted ve los cambios mientras su coautor está escribiendo o <b>Estricto</b>, cuando los cambios se muestran solo después de guardar el documento.',NULL,'2017-02-02 07:13:55','text',2,NULL,'Ekaterina.Heidel'),(938161,250,'ItemSaasDocsTips1','fi','<b>Vinkki #1.</b> Käytä <b>Reaaliaikaista yhteistyöhön perustuvaa muokkauksen</b> ominaisuutta jotta voit nopeuttaa vuorovaikutuksen prosessia, kun määrittelet tai oikoluet asiakirjan tietoja. Valitse kahden erilaisen yhteistyön mallista - <b>Nopea</b> kun haluat nähdä muutoksia jo siinä vaiheessa kun kumppani on vielä kirjoittamassa asiakirjaa tai <b>Täsmällinen</b> kun muutokset näkyvät vasta kun asiakirja on tallennettu.',NULL,'2017-01-09 16:08:04','text',2,NULL,'Arto Ryynanen'),(949059,250,'ItemSaasDocsTips1','fr','<b>Conseil №1.</b> Utilisez <b>l\'édition collaborative en temps réel</b> pour accélérer le processus d\'interaction lors de la précision des détails ou la révision des documents. Choisissez entre deux modes de l\'édition collaborative - <b>Rapide</b> quand vous voyez des changements que votre coauteur tape ou le mode <b>Strict</b> lorsque les modifications sont affichées uniquement après l’enregistrement du document.',NULL,'2017-01-26 07:37:28','text',2,NULL,'Nadine Yablonskaya'),(934221,250,'ItemSaasDocsTips1','Neutral','<b>Tip #1.</b> Use the <b>Real-time Co-editing</b> feature to  speed up the interaction process when specifying details or proofreading a document. Choose between two co-editing modes - <b>Fast</b> when you see changes as your co-author is typing or <b>Strict</b> when the changes are shown only after saving the document.','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936121,250,'ItemSaasDocsTips1','ru','<b>Совет №1.</b> Используйте возможность <b>совместного редактирования в режиме реального времени</b>, чтобы ускорить процесс взаимодействия при уточнении деталей или корректировке документа. Выбирайте подходящий режим совместного редактирования - <b>Быстрый</b>, при котором изменения отображаются по мере ввода текста, или <b>Строгий</b>, при котором изменения отображаются только после сохранения документа.',NULL,'2016-12-16 09:16:16','text',2,NULL,'Svetlana'),(950139,250,'ItemSaasDocsTips2','de','<b>Tipp #2.</b> Benutzen Sie <b>Versionshistorie</b> Option, um festzustellen wie das Dokument von Ihnen oder vom Ihrem Mitarbeiter bearbeitet wurde oder zu sehen, wer diese Änderungen gemacht hat. \n',NULL,'2017-01-30 13:45:30','text',2,NULL,'Evgenia'),(950498,250,'ItemSaasDocsTips2','es','<b>Consejo #2.</b> Use la opción <b>Historia de versiones</b> para verificar los cambios realizados en un archivo por Usted y sus compañeros de equipo o ver quién hizo las ediciones específicas.',NULL,'2017-02-02 08:50:04','text',2,NULL,'Ekaterina.Heidel'),(938165,250,'ItemSaasDocsTips2','fi','<b>Vinkki #2.</b> Käytä<b>Versiohistorian</b> vaihtoehtoa, jotta voit tarkistaa sinun ja tiimisi jäsenten tekemät muutokset tiedostoon, tai nähdä kuka suoritti tietyt muokkaukset.',NULL,'2017-01-09 16:13:44','text',2,NULL,'Arto Ryynanen'),(949043,250,'ItemSaasDocsTips2','fr','<b>Conseil №2.</b> Utilisez l\'option <b>Historique des versions</b> pour vérifier les modifications apportées à un fichier par vous et par vos coéquipiers ou pour voir qui a fait les corrections spécifiques.',NULL,'2017-01-25 13:28:10','text',2,NULL,'Nadine Yablonskaya'),(934222,250,'ItemSaasDocsTips2','Neutral','<b>Tip #2.</b> Use the <b>Version History</b> option to check the changes made to a file by you and your teammates or see who made the specific edits.','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936123,250,'ItemSaasDocsTips2','ru','<b>Совет №2.</b> Используйте опцию <b>История версий</b>, чтобы отследить изменения, внесенные в файл вами или вашими коллегами, или узнать, кто внес те или иные поправки.',NULL,'2016-12-16 09:16:38','text',2,NULL,'Svetlana'),(950141,250,'ItemSaasDocsTips3','de','<b>Tipp #3.</b> Nutzen Sie die Funktion <b>Review</b>, um manuelle Nachverfolgen von Änderungen und Zusammenführen zu vermeiden. Gewähren Sie einen schnellen Zugriff auf Ihr Dokument für die Überprüfung und lassen Sie andere Mitglieder die  Änderungen vornehmen, ohne das Dokument tatsächlich zu bearbeiten. Nehmen Sie die Vorschläge an oder lehnen Sie diese ab.',NULL,'2017-01-30 14:01:04','text',2,NULL,'Evgenia'),(950525,250,'ItemSaasDocsTips3','es','<b>Consejo №3.</b> Use la opción <b>Revisión</b> para evitar el seguimiento de cambios manual. Comparta el documento concediendo los permisos para revisarlo para que otros usuarios puedan aconsejar sus correcciones sin editar este documento. 	Fácilmente acepte o rechace los cambios aconsejados.',NULL,'2017-02-02 09:27:42','text',2,NULL,'Ekaterina.Heidel'),(938169,250,'ItemSaasDocsTips3','fi','<b>Vinkki #3.</b> Käytä <b>Arvioi</b> ominaisuutta jotta voit välttää manuaalista muutosten seurantaa ja yhdistelyä. Anna välittömästi pääsy asiakirjaasi arviointia varten ja anna muiden ehdottaa muutoksia niin että he eivät varsinaisesti muokkaa asiakirjaa.  Voit helposti hyväksyä tai hylätä ehdotetut muutokset.',NULL,'2017-01-09 16:20:59','text',2,NULL,'Arto Ryynanen'),(949062,250,'ItemSaasDocsTips3','fr','<b>Conseil №3.</b> Utilisez la fonctionnalité de <b>Révision</b> pour éviter le suivi manuel des modifications. Accordez un accès rapide pour réviser votre document et pour permettre aux autres de proposer des modifications sans modifier le document. Acceptez ou refusez facilement les modifications suggérées.',NULL,'2017-01-26 08:02:03','text',2,NULL,'Nadine Yablonskaya'),(934223,250,'ItemSaasDocsTips3','Neutral','<b>Tip #3.</b> Use the <b>Review</b> feature to avoid manual tracking changes and merging. Grant a quick access to your document for reviewing and let others suggest changes without actually editing the document. Easily accept or reject suggested changes.','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936125,250,'ItemSaasDocsTips3','ru','<b>Совет №3.</b> Используйте возможность <b>Рецензирования</b>, чтобы избежать отслеживания и объединения изменений вручную. Предоставляйте доступ к документу с правами на рецензирование, чтобы другие могли предлагать свои правки, не редактируя при этом сам документ. Легко принимайте или отклоняйте предложенные изменения.',NULL,'2016-12-16 09:47:46','text',2,NULL,'Svetlana'),(950142,250,'ItemSaasDocsTips4','de','<b>Tipp #4.</b> Teilen Sie Dokumente mit anderen Benutzern oder Personen außerhalb des Cloud-Office. Hängen Sie Dokumente als Links an Ihre E-Mails an, um E-Mail-Datenverkehr zu verringern.',NULL,'2017-01-30 14:12:37','text',2,NULL,'Evgenia'),(950582,250,'ItemSaasDocsTips4','es','<b>Consejo №4.</b> Comparta documentos con otros usuarios, también con unas personas no registradas en su portal en la nube. Adjunte documentos como enlaces a sus mensajes de correo para reducir el tráfico de correo.',NULL,'2017-02-02 12:01:52','text',2,NULL,'Ekaterina.Heidel'),(938171,250,'ItemSaasDocsTips4','fi','<b>Vinkki #4.</b> Jaa asiakirjoja muille käyttäjile tai nettitoimistosi ulkopuolisille henkilöille. Liitä asiakirjat linkkeinä sähköpostiisi, jotta voit vähentää sähköpostiliikennettä.',NULL,'2017-01-09 16:26:31','text',2,NULL,'Arto Ryynanen'),(949067,250,'ItemSaasDocsTips4','fr','<b>Conseil №4.</b> Partagez des documents avec d\'autres utilisateurs ou des personnes à l\'extérieur de votre bureau dans le nuage. Joignez des documents en tant que liens à votre courriel pour diminuer le trafic de messages électroniques.',NULL,'2017-01-26 08:26:31','text',2,NULL,'Nadine Yablonskaya'),(934224,250,'ItemSaasDocsTips4','Neutral','<b>Tip #4.</b> Share documents with other users or people outside your cloud office. Attach documents as links to your email to reduce the mail traffic.','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936126,250,'ItemSaasDocsTips4','ru','<b>Совет №4.</b> Предоставляйте доступ к документам для других пользователей, а также для тех, кто не зарегистрирован в вашем облачном офисе. Прикрепляйте документы к письмам в виде ссылок для уменьшения почтового трафика.',NULL,'2016-12-16 09:50:30','text',2,NULL,'Svetlana'),(950144,250,'ItemSaasDocsTips5','de','<b>Tipp #5.</b> Integrieren Sie Ihr Web-Office mit verschiedenen Cloud-Speicher, um alle Dokumente auf dem Portal zu verwalten.',NULL,'2017-01-30 14:15:35','text',2,NULL,'Evgenia'),(950583,250,'ItemSaasDocsTips5','es','<b>Consejo №5.</b> Integre su oficina web con diferentes almacenamientos en la nube para manejar todos los documentos dentro del portal.',NULL,'2017-02-02 13:28:59','text',2,NULL,'Ekaterina.Heidel'),(938175,250,'ItemSaasDocsTips5','fi','<b>Vinkki #5.</b> Liitä nettitoimistosi useisiin erilaisiin pilvitallennus palveluihin, jotta voit hallinnoida kaikki asiakirjasi portaalin sisällä.',NULL,'2017-01-09 16:32:39','text',2,NULL,'Arto Ryynanen'),(949090,250,'ItemSaasDocsTips5','fr','<b>Conseil №5.</b> Intégrez votre bureau virtuel aux différents stockages en nuage pour gérer toute votre documentation sur le portail.',NULL,'2017-01-26 08:45:48','text',2,NULL,'Nadine Yablonskaya'),(934225,250,'ItemSaasDocsTips5','Neutral','<b>Tip #5.</b> Integrate your web-office with different Cloud Storages to manage all your documents inside the portal.','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936135,250,'ItemSaasDocsTips5','ru','<b>Совет №5.</b> Интегрируйте свой виртуальный офис с различными облачными хранилищами, чтобы управлять всеми документами внутри портала.',NULL,'2016-12-16 10:09:37','text',2,NULL,'Svetlana'),(950146,250,'ItemSaasDocsTips6','de','<b>Tipp #6.</b> Laden Sie kostenlose Anwendung ONLYOFFICE Desktop Editors für die Arbeit an Dokumenten ohne Internetverbindung. Merken Sie bitte, dass die App mit Ihrem ONLYOFFICE-Portal verbunden werden kann, um auf dort gespeicherte Dokumente zuzugreifen.',NULL,'2017-01-30 15:04:46','text',2,NULL,'Evgenia'),(950636,250,'ItemSaasDocsTips6','es','<b>Consejo №6.</b> Descargue Editores Desktop de ONLYOFFICE gratuitos para trabajar con documentos sin conexión al Internet. Note que esta aplicación puede ser conectada al portal ONLYOFFICE para acceder a los documentos almacenados ahí.',NULL,'2017-02-06 06:07:02','text',2,NULL,'Ekaterina.Heidel'),(938178,250,'ItemSaasDocsTips6','fi','<b>Vinkki #6.</b> Lataa ilmainen ONLYOFFICE Desktop Editori, niin voit työskennellä asiakirjojen kanssa ilman internet yhteyttä. Huomaa, että tämä sovellus voidaan yhdistää ONLYOFFICE portaaliisi, jotta saat pääsyn siellä sijaitseviin asiakirjoihin.',NULL,'2017-01-09 16:35:30','text',2,NULL,'Arto Ryynanen'),(949095,250,'ItemSaasDocsTips6','fr','<b>Conseil №6.</b> Téléchargez les éditeurs de bureau ONLYOFFICE gratuitement pour travailler sur les documents sans la connexion internet. Notez que vous pouvez connecter ce logiciel à votre portail ONLYOFFICE pour accéder aux documents qui y sont stockés.',NULL,'2017-01-26 08:53:26','text',2,NULL,'Nadine Yablonskaya'),(934226,250,'ItemSaasDocsTips6','Neutral','<b>Tip #6.</b> Download free ONLYOFFICE Desktop Editors to work on documents without Internet connection. Note that the app can be connected to your ONLYOFFICE portal to access documents stored there.','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936138,250,'ItemSaasDocsTips6','ru','<b>Совет №6.</b> Скачайте бесплатные десктопные редакторы ONLYOFFICE для работы с документами без подключения к интернету. Обратите внимание на то, что это приложение можно подключить к порталу ONLYOFFICE и получить доступ к сохраненным на нем документам.',NULL,'2016-12-16 10:14:47','text',2,NULL,'Svetlana'),(950173,250,'ItemSaasDocsTips7','de','<b>Tipp #7.</b>Laden Sie<b>ONLYOFFICE Documents App</b> herunter und lassen Sie sie auf Ihrem iOS Gerät installieren, um mit Dokumenten überall, jederzeit auch unterwegs zu arbeiten.',NULL,'2017-01-31 08:17:40','text',2,NULL,'Evgenia'),(950638,250,'ItemSaasDocsTips7','es','<b>Consejo №7.</b> Descargue la aplicación móvil <b>ONLYOFFICE Documentos</b> e instale en su dispositivo iOS para trabajar con documentos a cualquier lugar, a cualquier hora, aún en movimiento.',NULL,'2017-02-06 06:14:24','text',2,NULL,'Ekaterina.Heidel'),(938180,250,'ItemSaasDocsTips7','fi','<b>Vinkki #7.</b> Lataa <b>ONLYOFFICE Asiakirjojen sovellus</b> ja asenna se iOS laitteeseen, niin voit työskennellä asiakirjojen kanssa missä vaan, milloin vaan ja jopa liikenteessä.',NULL,'2017-01-09 16:37:16','text',2,NULL,'Arto Ryynanen'),(949097,250,'ItemSaasDocsTips7','fr','<b>Conseil №7.</b> Téléchargez et installez l\'application <b>ONLYOFFICE Documents</b> sur votre appareil iOS pour travailler sur les documents à tout moment et en tout lieu.',NULL,'2017-01-26 09:08:34','text',2,NULL,'Nadine Yablonskaya'),(934227,250,'ItemSaasDocsTips7','Neutral','<b>Tip #7.</b> Download <b>ONLYOFFICE Documents app</b> and install it on your iOS device to work with documents anywhere, anytime, even on the go.','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936140,250,'ItemSaasDocsTips7','ru','<b>Совет №7.</b> Скачайте мобильное приложение <b>ONLYOFFICE Документы</b> и установите на iOS-устройство, чтобы работать с документами в любое время, из любой точки мира, где бы вы ни находились.',NULL,'2016-12-16 10:17:57','text',2,NULL,'Svetlana'),(937150,250,'ItemSecureAccess','fi','Vinkki #5: Turvaa pääsy nettitoimistoosi',NULL,'2017-01-07 13:32:55','text',2,NULL,'Arto Ryynanen'),(460932,250,'ItemSecureAccess','Neutral','Tip #5: Secure the access to your web-office','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938155,250,'ItemSecureAccessText','fi','${LetterLogoText}  portaalit ovat hostattu Amazonin Web Palveluissa, mikä on eräs arvostetuimista pilvipalveluista. Mutta voit myös halutessa käyttää ylimääräistä turvatasoa aktivoimalla varmenteen tekstiviesti vaihtoehdon. Siirry Asetukset >> Turvallisuus >> Portaaliin pääsy ',NULL,'2017-01-09 15:52:01','text',2,NULL,'Arto Ryynanen'),(460933,250,'ItemSecureAccessText','Neutral','${LetterLogoText} portals are hosted on Amazon Web Services, which is one of the most well-established cloud computing platform today. But you can always make use of an extra security level by enabling the confirmation SMS code option. Go to Settings >> Security >> Portal Access','','2016-09-19 10:41:10','text',2,NULL,'Console'),(960572,250,'ItemSecureAccessText','nl','${LetterLogoText} portalen worden gehost bij Amazon Web Services, wat vandaag de dag een van de meest gerenomeerde cloud computing platform is. Maar u kunt altijd een extra beveilig toevoegen door de SMS verificatie optie in te schakelen. Ga hiervoor naar Instellingen -> Beveiliging -> Portaal toegang.',NULL,'2017-03-27 06:56:00','text',2,NULL,'Hsing-Foo Wang'),(460934,250,'ItemTryOnlineDocEditor','Neutral','Try full-featured online document editing in your browser','','2016-09-19 10:41:10','text',2,NULL,'Console'),(938312,250,'ItemUploadCrm','fi','Lataa Asiakkuudenhallinnan kontakteja',NULL,'2017-01-09 20:25:11','text',2,NULL,'Arto Ryynanen'),(460935,250,'ItemUploadCrm','Neutral','Upload CRM contacts','','2016-09-19 10:41:10','text',2,NULL,'Console'),(935725,250,'ItemUploadCrmContacts','de','Laden Sie CRM Kontakte zu ${LetterLogoText}, um überall und jederzeit darauf zugreifen.',NULL,'2016-12-01 08:54:23','text',2,NULL,'Александр'),(935726,250,'ItemUploadCrmContacts','es','Subir contactos CRM a ${LetterLogoText} para accederlos en cualquier lugar',NULL,'2016-12-01 08:54:28','text',2,NULL,'Александр'),(938314,250,'ItemUploadCrmContacts','fi','Lataa Asiakkuudenhallinnan kontakteja > ${LetterLogoText} ja sinulla on pääsy niihin missä vaan',NULL,'2017-01-09 20:26:33','text',2,NULL,'Arto Ryynanen'),(935727,250,'ItemUploadCrmContacts','fr','Téléchargez contacts CRM dans ${LetterLogoText} pour y accéder partout',NULL,'2016-12-01 08:54:34','text',2,NULL,'Александр'),(460936,250,'ItemUploadCrmContacts','Neutral','Upload CRM contacts to ${LetterLogoText} to access them everywhere','','2016-12-01 08:54:20','text',2,NULL,'Console'),(935728,250,'ItemUploadCrmContacts','ru','Загрузите контакты CRM в ${LetterLogoText}, чтобы всегда иметь к ним доступ онлайн',NULL,'2016-12-01 08:54:37','text',2,NULL,'Александр'),(938313,250,'ItemUploadCrmContactsCsv','fi','Lataa Asiakkuudenhallinnan kontakteja csv tiedostosta',NULL,'2017-01-09 20:25:41','text',2,NULL,'Arto Ryynanen'),(460937,250,'ItemUploadCrmContactsCsv','Neutral','Upload CRM contacts from a csv. file','','2016-09-19 10:41:11','text',2,NULL,'Console'),(951070,250,'ItemWebToLead','es','Forma de Web-to-Lead',NULL,'2017-02-17 07:03:32','text',2,NULL,'Ekaterina.Heidel'),(938320,250,'ItemWebToLead','fi','Web-to-Lead toiminto',NULL,'2017-01-09 20:30:36','text',2,NULL,'Arto Ryynanen'),(460938,250,'ItemWebToLead','Neutral','Web-to-Lead','','2016-09-19 10:41:11','text',2,NULL,'Console'),(938217,250,'ItemWebToLeadText','fi','Luo ja upota yhteydenottolomake yrityksesi sivustoon. Kerää uusien liidien tietoja automaattisesti ja hanki asiakasprospekteja vaivattomammin.',NULL,'2017-01-09 19:45:46','text',2,NULL,'Arto Ryynanen'),(460939,250,'ItemWebToLeadText','Neutral','Create and embed the contact form into your company website. Gather new lead information automatically and gain more prospective customers effortlessly.','','2016-09-19 10:41:11','text',2,NULL,'Console'),(938275,250,'LinkLearnMore','fi','Lisätietoa >>',NULL,'2017-01-09 20:09:50','text',2,NULL,'Arto Ryynanen'),(460940,250,'LinkLearnMore','Neutral','Learn More >>','','2016-09-19 10:41:11','text',2,NULL,'Console'),(950220,250,'pattern_activate','de','Sehr geehrte/r Frau/Herr $UserName,\n\n $__AuthorName hat Sie eingeladen, ${LetterLogoText} beizutreten - das Portal Ihres Teams, das interne Zusammenarbeit verbessern würde. Ihre Portaladresse ist \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Das Hinzufügen dieses Links dem Lesezeichen ist eine gute Idee. Per Lesezeichen speichern Sie häufig genutzte Webadressen für einen schnellen Zugriff). \n\nUm die Einladung anzunehmen, folgen Sie dem Link unter, der nur für 7 Tage gültig ist:\n\np=. \"Klicken Sie hier, um dem Portal beizutreten\":\"$InviteLink\"\n\nFalls Sie einige Hilfe mit Ihrem Portal brauchen, besuchen Sie unser \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-31 13:42:48','text',2,NULL,'Evgenia'),(961528,250,'pattern_activate','es','Estimado(a) $UserName,\n\n$ __ AuthorName le ha invitado a unirse a ${LetterLogoText} - portal de su equipo que mejoraría cooperación interna. Su dirección de portal es \"${__VirtualRootPath}\":\"$InviteLink\" (la adición de este enlace a su marcador es una buena idea, es muy probable que llegue a usarlo mucho).\n\nPuede aceptar la invitación, siguiendo el enlace de abajo, sólo es válida durante 7 días:\n\np=. \"Haga clic aquí para unirse al portal\":\"$InviteLink\"\n\nSi usted necesita ayuda con su portal, le invitamos a navegar por nuestro \"Centro de ayuda\": \"https://helpcenter.onlyoffice.com\" o visitar nuestro \"Foro\": \"http://cloud.onlyoffice.org\".\n\nMuy atentamente,\nEquipo ONLYOFFICE \n\"www.onlyoffice.com\": \"http://onlyoffice.com/\"',NULL,'2017-03-30 08:18:05','text',2,NULL,'Ekaterina.Heidel'),(938376,250,'pattern_activate','fi','Hyvä $UserName,\n\n $__AuthorName on kutsunut sinut liittymään ${LetterLogoText} - portaaliin, mikä tukee tiimisi yhteistoimintaa. Portaalisi osoite on \"${__VirtualRootPath}\":\"$InviteLink\" (tämän linkin lisääminen selaimen kirjanmerkkeihin voi olla hyvä idea, koska tulet luultavasti käyttämään sitä paljon).\n\n Voit hyväksyä kutsun seuraamalla allaolevaa linkkiä. Huom.: linkki on voimassa vain 7 päivän ajan:\n\np=. \"Klikkaa tätä liittyäksesi portaaliin\":\"$InviteLink\"\n\nJos tarvitset tukea, niin suosittelemme tutustumista \"Tukikeskukseen\":\"https://helpcenter.onlyoffice.com\" tai vierailemaan \"Foorumiin\":\"http://cloud.onlyoffice.org\".\n\nParhain terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-10 04:54:33','text',2,NULL,'Arto Ryynanen'),(935648,250,'pattern_activate','fr','Bonjour $UserName,\n\n$__AuthorName vous a invité à rejoindre ${LetterLogoText} - le portail de votre équipe qui permettrait d\'améliorer la coopération interne. L\'adresse de votre portail est \"${__VirtualRootPath}\":\"$InviteLink\" (ajout de ce lien à vos signets est une bonne idée, il est susceptible que vous l\'utiliserez beaucoup).\n\nVous pouvez accepter l\'invitation en suivant le lien ci-dessous, il est valide pour 7 jours seulement:\n\np=. \"Cliquez ici pour joindre le portail\":\"$InviteLink\"\n\nSi vous avez besoin d\'aide avec votre portail, nous vous invitons à 