ortal beizutreten\":\"$InviteLink\"',NULL,'2017-01-31 13:43:24','text',2,NULL,'Evgenia'),(961530,250,'pattern_activate_freecloud','es','Estimado(a) $UserName,\n\n$ __ AuthorName le ha invitado a unirse a ${LetterLogoText} Free Cloud  - el portal de su equipo que majoraría cooperación interna. Su dirección de portal es \"${__VirtualRootPath}\":\"$InviteLink\" (la adición de este enlace a su marcador es una buena idea, es muy probable que llegue a usarlo mucho).\n\nPuede aceptar la invitación, siguiendo el enlace de abajo, es válida sólo durante 7 días:\np=. \"Haga clic aquí para unirse al portal\":\"$InviteLink\"',NULL,'2017-03-30 08:18:35','text',2,NULL,'Ekaterina.Heidel'),(938379,250,'pattern_activate_freecloud','fi','Hyvä $UserName,\n\n $__AuthorName on kutsunut sinut liittymään ${LetterLogoText} - portaaliin, mikä tukee tiimisi yhteistoimintaa. Portaalisi osoite on \"${__VirtualRootPath}\":\"$InviteLink\" (tämän linkin lisääminen selaimen kirjanmerkkeihin voi olla hyvä idea, koska tulet luultavasti käyttämään sitä paljon).\n\n Voit hyväksyä kutsun seuraamalla allaolevaa linkkiä. Huom.: linkki on voimassa vain 7 päivän ajan:\n\np=. \"Klikkaa tätä liittyäksesi portaaliin\":\"$InviteLink\"\n\n',NULL,'2017-01-10 04:56:08','text',2,NULL,'Arto Ryynanen'),(935756,250,'pattern_activate_freecloud','fr','Bonjour $UserName,\n\n$__AuthorName vous a invité à rejoindre ${LetterLogoText} Free Cloud - le portail de votre équipe qui permettrait d\'améliorer la coopération interne. L\'adresse de votre portail est \"${__VirtualRootPath}\":\"$InviteLink\" (ajout de ce lien à vos signets est une bonne idée, il est susceptible que vous l\'utiliserez beaucoup).\n\nVous pouvez accepter l\'invitation en suivant le lien ci-dessous, il est valide pour 7 jours seulement:\n\np=. \"Cliquez ici pour joindre le portail\":\"$InviteLink\"',NULL,'2016-12-01 08:57:42','text',2,NULL,'Александр'),(460944,250,'pattern_activate_freecloud','Neutral','Dear $UserName,\n\n$__AuthorName has invited you to j