, $UserName,\n\n $__AuthorName ha invitado a Usted a participar en ${LetterLogoText} - portal de su equipo para organizar un trabajo eficaz en colaboración. Dirección de su portal - \"${__VirtualRootPath}\":\"$InviteLink\" (recomendamos añadir este enlace en	sus marcadores: lo más probable es que Usted lo use a menudo).\n\n Usted puede aceptar la invitación siguiendo el enlace abajo, este enlace es válido durante 7 días:\n\np=. \"Pulse aquí para participar en el portal\":\"$InviteLink\"\n\nMuy atentamente,\nEquipo de ONLYOFFICE',NULL,'2017-02-06 08:23:42','text',2,NULL,'Ekaterina.Heidel'),(938378,250,'pattern_activate_whitelabel','fi','Hyvä $UserName,\n\n $__AuthorName on kutsunut sinut liittymään ${LetterLogoText} - portaaliin, mikä tukee tiimisi yhteistoimintaa. Portaalisi osoite on \"${__VirtualRootPath}\":\"$InviteLink\" (tämän linkin lisääminen selaimen kirjanmerkkeihin voi olla hyvä idea, koska tulet luultavasti käyttämään sitä paljon).\n\n Voit hyväksyä kutsun seuraamalla allaolevaa linkkiä. Huom.: linkki on voimassa vain 7 päivän ajan:\n\np=. \"Klikkaa tätä liittyäksesi portaaliin\":\"$InviteLink\"\n\nParhain terveisin,\nONLYOFFICE Tiimi\n',NULL,'2017-01-10 04:55:50','text',2,NULL,'Arto Ryynanen'),(935654,250,'pattern_activate_whitelabel','fr','Bonjour $UserName,\n\n $__AuthorName vous invite à joindre ${LetterLogoText} - le portail de votre équipe pour renforcer la coopération interne. L\'adresse de votre portail est \"${__VirtualRootPath}\":\"$InviteLink\" (vous pouvez ajouter ce lien à vos favoris, selon toute probabilité, vous allez l\'utiliser souvent).\n\nVous pouvez accepter l’invitation en suivant le lien ci-dessous. Ce lien n\'est valable que pour une durée de 7 jours :\n\np=. \"Cliquez ici pour rejoindre le portail\":\"$InviteLink\"\n\nSincèrement,\nÉquipe de ONLYOFFICE',NULL,'2016-12-01 08:46:44','text',2,NULL,'Александр'),(460950,250,'pattern_activate_whitelabel','Neutral','Dear $UserName,\n\n $__AuthorName has invited you to join ${LetterLogoText} - your team\'s portal that would enhance internal cooperation. Your portal address is \"${__VirtualRootPath}\":\"$InviteLink\" (adding this link to your bookmarks is a good idea, you are most likely to get to use it a lot).\n\n You can accept the invitation by following the link below, it is only valid for 7 days:\n\np=. \"Click here to join the portal\":\"$InviteLink\"\n\nTruly yours,\nONLYOFFICE Team','','2016-12-01 08:46:39','text',2,NULL,'Console'),(935655,250,'pattern_activate_whitelabel','ru','Здравствуйте, $UserName,\n\n $__AuthorName приглашает Вас стать участником ${LetterLogoText} - портала вашей команды для организации эффективной совместной работы. Адрес Вашего портала - \"${__VirtualRootPath}\":\"$InviteLink\" (советуем добавить эту ссылку в закладки: по всей вероятности, Вы будете ей часто пользоваться).\n\n Вы можете принять приглашение, перейдя по следующей ссылке, она действительна только 7 дней:\n\np=. \"Нажмите сюда, чтобы стать участником портала\":\"$InviteLink\"\n\nС уважением,\nкоманда ONLYOFFICE',NULL,'2016-12-01 08:46:49','text',2,NULL,'Александр'),(460951,250,'pattern_admin_sms_balance','Neutral','h1.Message from the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal\r\n\r\nCurrent SMS balance: $Body\r\n\r\n*Please note* that when you are out of SMS the two-factor authentication portal access option will be automatically disabled. Do not forget to buy additional SMS package in good time.','','2016-09-19 10:41:11','text',2,NULL,'Console'),(460952,250,'pattern_admin_voip_blocked','Neutral','h1.Message from the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" VoIP disabled','','2016-09-19 10:41:11','text',2,NULL,'Console'),(460953,250,'pattern_admin_voip_warning','Neutral','h1.Message from the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal\r\n\r\nVoIP Balance: $Body','','2016-09-19 10:41:11','text',2,NULL,'Console'),(946347,250,'pattern_admin_welcome','fi','Hyvä $UserName,\n\nOn luultavaa, että ${LetterLogoText} on uusi kokemus sinulle, joten ajattelimme että haluaisit saada muutamia vinkkejä aloitukseen.\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n   \nTehty. On aika kutsua tiimisi jäseniä nettitoimistoosi!\n\nLisätietoa varten kutsumme sinut tutustumaan \"Tukikeskukseemme\":\"https://helpcenter.onlyoffice.com\".\n\nParhain terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-16 19:07:00','text',2,NULL,'Arto Ryynanen'),(930737,250,'pattern_admin_welcome','fr','Bonjour $UserName,\n\nIl est probable que ${LetterLogoText} est une expérience nouvelle pour vous, donc nous avons pensé que vous aimeriez quelques conseils et astuces pour vous aider à démarrer.\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nEffectué. Il est temps d\'inviter les coéquipiers à votre web-office !\n\nPour plus d\'informations, nous vous invitons à parcourir notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nSincèrement vôtre,\nEquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-10-17 11:18:37','text',2,NULL,'Svetlana'),(460954,250,'pattern_admin_welcome','Neutral','Dear $UserName,\r\n\r\nIt’s likely that ${LetterLogoText} is a new experience for you so we figured that you might like some tips and tricks to get you started.\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\r\n$GreenButton\r\n   \r\nDone. It\'s time to invite teammates to your web-office!\r\n\r\nFor more information we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:11','text',2,NULL,'Console'),(950300,250,'pattern_admin_welcome_enterprise','fr','Bonjour $UserName,\n\nPour rendre la gestion de portail rapide et facile, vous pouvez utiliser le Panneau de configuration, un ensemble d\'outils d\'automatisation qui vous permet de :\n\n- Modifier des logos par défaut du portail pour utiliser un bureau virtuel sous votre marque ;\n\n- Activer le protocole HTTPS pour garder vos données du portail en sécurité ;\n\n- Importer des utilisateurs à partir de votre serveur LDAP ;\n\n- Sauvegarder vos données du portail sur une base régulière afin d\'éviter toute perte de données ;\n\n- Vérifier des mises à jour de ${LetterLogoText} disponibles ;\n\n- Suivre une historique de connexion et recevoir les données du piste d\'audit.\n\n$GreenButton\n\nPour plus d\'informations, nous vous invitons à parcourir notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nSincèrement vôtre,\nÉquipe ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-01 10:19:45','text',2,NULL,'Nadine Yablonskaya'),(460955,250,'pattern_admin_welcome_enterprise','Neutral','Dear $UserName,\r\n\r\nTo make the portal management quick and easy, ${LetterLogoText} provides you with Control Panel, a set of automation tools that allows you to:\r\n\r\n- Change the default portal logos to brand your web-office;\r\n\r\n- Turn on HTTPS to keep your portal data secure;\r\n\r\n- Import users from your LDAP server;\r\n\r\n- Backup your portal data on a regular basis to avoid any data-loss;\r\n\r\n- Check for available ${LetterLogoText} updates;\r\n\r\n- Track login history and receive the audit trail data.\r\n\r\n$GreenButton\r\n\r\nFor more information we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:11','text',2,NULL,'Console'),(950820,250,'pattern_admin_welcome_whitelabel','de','Sehr geehrte/r Frau/Herr $UserName,\n\nUm das Management-Portal schnell und einfach zu machen, ${LetterLogoText}nutzen Sie Control Panel, eine Reihe von Automatisierungstools, welche Ihnen ermöglichen:\n\n- Standardlogo des Portals zu ändern, um Ihr Web-Office zu umbenennen;\n\n- HTTPS einzuschalten, um Ihre persönlichen Daten zu schützen;\n\n- Benutzer von Ihrem LDAP-Server zu importieren;\n\n- Datenbackup-Portal auf regelmäßiger Basis zu erstellen, um Datenverlust zu vermeiden;\n\n- Verfügbare Updates von $ {LetterLogoText}zu prüfen;\n\n- Anmeldeverlauf zu verfolgen und Audit-Trail Daten zu erhalten.\n\n$GreenButton\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team',NULL,'2017-02-08 08:38:43','text',2,NULL,'Evgenia'),(962229,250,'pattern_admin_welcome_whitelabel','es','Buenos días, $UserName,\n\nPara facilitar la gestión del portal, ${LetterLogoText} proporciona Panel de Control, un juego de herramientas de automatización, que le permite:\n\n- Cambiar los logos de portal predeterminados para usar su oficina web bajo su marca;\n\n- Activar HTTPS para proteger y mantener seguros los datos de portal;\n\n- Importar usuarios del servidor LDAP;\n\n- Hacer copias de seguridad de portal de manera regular para evitar la pérdida de datos;\n\n- Verificar las actualizaciones de ${LetterLogoText} disponibles;\n\n- Monitorizar historial de conexión al sistema y recibir datos de rastro de auditoría.\n\n$GreenButton\n\nMuy atentamente,\nEquipo de ONLYOFFICE',NULL,'2017-04-03 13:30:39','text',2,NULL,'Ekaterina.Heidel'),(933572,250,'pattern_admin_welcome_whitelabel','fr','Bonjour $UserName,\n\nPour faciliter la gestion du portail ${LetterLogoText} vous pouvez utiliser le Panneau de configuration dont les outils permettent de : \n\n- Changer les logos du portail par défaut et utiliser votre marque pour le bureau virtuel ;\n\n- Activer HTTPS pour sécuriser les données du portail ;\n\n- Importer des utilisateurs à partir du serveur LDAP ;\n\n- Faire la sauvegarde des données du portail régulièrement afin d’éviter toute perte de données ;\n\n- Vérifier les mises à jour disponibles pour ${LetterLogoText} ;\n\n- Afficher l\'historique de connexion et recevoir des données des pistes de vérification.\n\n$GreenButton\n\nSincèrement,\nÉquipe de ONLYOFFICE',NULL,'2016-11-01 12:07:29','text',2,NULL,'Nadine Yablonskaya'),(460956,250,'pattern_admin_welcome_whitelabel','Neutral','Dear $UserName,\r\n\r\nTo make the portal management quick and easy, ${LetterLogoText} provides you with Control Panel, a set of automation tools that allows you to:\r\n\r\n- Change the default portal logos to brand your web-office;\r\n\r\n- Turn on HTTPS to keep your portal data secure;\r\n\r\n- Import users from your LDAP server;\r\n\r\n- Backup your portal data on a regular basis to avoid any data-loss;\r\n\r\n- Check for available ${LetterLogoText} updates;\r\n\r\n- Track login history and receive the audit trail data.\r\n\r\n$GreenButton\r\n\r\nTruly yours,\r\nONLYOFFICE Team','','2016-09-19 10:41:11','text',2,NULL,'Console'),(950922,250,'pattern_after_creation1','es','Estimado(a) $UserName,\n\nLa oficina en la nube para su equipo ya está creada en \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Es hora de invitar a sus compañeros de equipo a su portal.\nLa forma más fácil de hacerlo es enviar el enlace de invitación usando la opción *Invitar a usuarios al portal*.\n\n$GreenButton\n\nSi Usted tiene acceso a la información detallada de las personas de contacto, añada sus compañeros de equipo manualmente uno por uno usando el botón *Crear nuevo...* en el módulo *Personas*. \"Aprender Más >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nO añada usuarios a la vez de:\n    \"su cuenta de Yahoo o Google\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\n    \"su libro de direcciones de correo de clientes\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\n    \"un archivo CSV\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \n\nPor último, se puede permitir a su compañeros de equipo auto-registro de configuración de *Ajustes del dominio de correo confiado*. \"Aprender Más >>\": \"http://helpcenter.onlyoffice.com/gettingstarted/configuration.aspx#TrustedDomain\"\n\nUna vez añadido, gestione los derechos de acceso. Para aprender más acerca de como gestionar los derechos de acceso visite nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-13 09:05:28','text',2,NULL,'Ekaterina.Heidel'),(949151,250,'pattern_after_creation1','fr','Bonjour $UserName,\n\nLe bureau en nuage pour votre équipe est déjà créé à \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Il est temps d\'y inviter vos collègues. \nLa façon la plus simple de le faire est de distribuer le lien d\'invitation à l\'aide de l\'option *Inviter les utilisateurs au portail*.\n\n$GreenButton\n\nSi vous avez accès aux informations de contact détaillées, ajoutez vos coéquipiers manuellement un par un à l\'aide du bouton\' *Créer...* dans le module *Personnes*. \"En savoir plus >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nOu ajoutez des utilisateurs à la fois en utilisant :\n\"votre compte Yahoo ou Google\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\n\"votre carnet d\'adresses de client de messagerie\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\n\"un fichier CSV\":http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\n\nEnfin, vous pouvez permettre à vos coéquipiers de configurer des paramètres de *Domaine de messagerie de confiance*. \"En savoir plus >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nUne fois ajouté, gérez leurs droits d\'accès. Pour plus d\'informations sur la gestion des droits d\'accès, visitez notre Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nSincèrement vôtre,\nÉquipe ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-26 09:58:26','text',2,NULL,'Nadine Yablonskaya'),(460957,250,'pattern_after_creation1','Neutral','Dear $UserName,\r\n\r\nThe cloud office for your team is already created at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". It\'s time to invite your teammates to join it. \r\nThe easiest way to do that is to distribute the invitation link using the *Invite users to portal* option.\r\n\r\n$GreenButton\r\n\r\nIf you have access to the detailed contact information of the people, add your teammates manually one by one using the *Create New...* button in the *People* module. \"Learn more >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\r\n\r\nOr add users all at once from:\r\n    \"your Yahoo or Google account\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\r\n    \"your mail client address book\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\r\n    \"a CSV file\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \r\n\r\nFinally, you can allow your teammates self-registration configuring the *Trusted Mail Domain* settings. \"Learn more >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/configuration.aspx#TrustedDomain\"\r\n\r\nOnce added, manage their access rights. For more information about ARM, visit our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:11','text',2,NULL,'Console'),(937108,250,'pattern_after_creation1_enterprise','fi','Hyvä $UserName,\n\nOn luultavaa että ${LetterLogoText} on sinulle uusi kokemus, joten lähetämme tässä muutamia vinkkejä jotka auttavat sinua aloittamaan nettitoimiston käytön.\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\n$GreenButton\n   \nTehty. Nyt voit vaikkapa kutsua tiimisi jäseniä nettitoimistoosi!\n\nVoit saada lisätietoa \"Ohjekeskuksestamme\":\"https://helpcenter.onlyoffice.com\".\n\nParhain terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-07 09:55:23','text',2,NULL,'Arto Ryynanen'),(930738,250,'pattern_after_creation1_enterprise','fr','Bonjour $UserName,\n\nIl est probable que ${LetterLogoText} est une expérience nouvelle pour vous, donc nous avons pensé que vous aimeriez quelques conseils et astuces pour vous aider à démarrer.\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\n$GreenButton\n\nEffectué. Il est temps d\'inviter les coéquipiers à votre web-office !\n\nPour plus d\'informations, nous vous invitons à parcourir notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nSincèrement vôtre,\nEquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-10-17 11:24:42','text',2,NULL,'Svetlana'),(460958,250,'pattern_after_creation1_enterprise','Neutral','Dear $UserName,\r\n\r\nIt’s likely that ${LetterLogoText} is a new experience for you so we figured that you might like some tips and tricks to get you started.\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\r\n$GreenButton\r\n   \r\nDone. It\'s time to invite teammates to your web-office!\r\n\r\nFor more information we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:11','text',2,NULL,'Console'),(946352,250,'pattern_after_creation1_freecloud','fi','Hyvä $UserName,\n\nPilvitoimisto \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" on lisätty tiimillesi. Voit nyt jakaa kutsulinkkejä tiimisi jäsenille. Ole hyvä ja seuraa näitä ohjeita:\n\n    # Siirry *Käyttäjät* moduuliin\n    # Klikkaa *Enemmän toimintoja* painiketta ja valitse  *Kutsulinkin* vaihtoehto alasvetovalikosta\n    # Valitse *Lisää käyttäjät vierailijoina* ruutu, ja voit kutsua käyttäjiä, joilla on vain selailuoikeus portaaliisi (jos haluat antaa heille oikeuden luoda portaalin sisältöä, niin jätä valitsematta tämä valintaruutu)\n    # Kopioi linkki ja lähetä se tiimisi jäsenille\nh2. Miten voit aloittaa työskentelyn?\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm',NULL,'2017-01-16 19:24:10','text',2,NULL,'Arto Ryynanen'),(460959,250,'pattern_after_creation1_freecloud','Neutral','Dear $UserName,\r\n\r\nRecently a cloud office \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" has been created for your team. To add colleagues distribute the invitation link available in your cloud office. Please follow these instructions:\r\n\r\n    # Go to the *People* module\r\n    # Click the *More actions* button and select the *Invitation Link* option from the drop-down menu\r\n    # Check the *Add users as guests* box to invite people who will have view-only permissions on your portal (if you want these people to create portal content, leave this box unchecked)\r\n    # Copy the link and send it to your teammates\r\n\r\nh2. What to start your work with?\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm','','2016-09-19 10:41:11','text',2,NULL,'Console'),(949377,250,'pattern_after_creation2','fr','La messagerie électronique reste le meilleur et le plus populaire moyen de communication avec les clients et les partenaires. Chaque jour, nous recevons une grande quantité de messages en utilisant plusieurs comptes de messagerie à partir de différents services.Il peut sembler impossible de ne pas rater quelque chose d\'important.\n\nUtilisez ces 5 trucs pour organiser et améliorer votre expérience email:\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nVous n\'avez pas encore configuré le serveur de messagerie à l\'aide de votre propre nom de domaine? - Suivez les \"instructions\" suivantes :\"https://helpcenter.onlyoffice.com/gettingstarted/mail.aspx#MailServer_block\".\n\nSi vous avez besoin d\'aide pour le travail avec votre portail, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\" ou visitez notre \"Forum\":\"http://cloud.onlyoffice.org\".\n\nSincèrement vôtre,\nÉquipe ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-26 13:18:51','text',2,NULL,'Nadine Yablonskaya'),(460960,250,'pattern_after_creation2','Neutral','Email is still the best and most popular way to communicate with customers and partners. Every day we receive a great amount of messages using multiple email accounts from different services and it may seem impossible not to miss anything important.\r\n\r\nMake use of these 5 tips and tricks to get organized and improve your email experience:\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\r\n$GreenButton\r\n\r\nStill not yet configured the mail server using your own domain name? - Follow the instructions \"here\":\"https://helpcenter.onlyoffice.com/gettingstarted/mail.aspx#MailServer_block\".\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\" or visit our \"Forum\":\"http://cloud.onlyoffice.org\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:11','text',2,NULL,'Console'),(949392,250,'pattern_after_creation2_enterprise','fr','La messagerie électronique reste le meilleur et le plus populaire moyen de communication avec les clients et les partenaires. Chaque jour, nous recevons une grande quantité de messages en utilisant plusieurs comptes de messagerie à partir de différents services.Il peut sembler impossible de ne pas rater quelque chose d\'important.\n\nUtilisez ces 5 trucs pour organiser et améliorer votre expérience email:\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nVous n\'avez pas encore configuré le serveur de messagerie à l\'aide de votre propre nom de domaine? - Suivez les \"instructions\" suivantes :\"https://helpcenter.onlyoffice.com/gettingstarted/mail.aspx#MailServer_block\".\n\nSi vous avez besoin d\'aide pour le travail avec votre portail, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nSincèrement vôtre,\nÉquipe ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-26 13:20:35','text',2,NULL,'Nadine Yablonskaya'),(460961,250,'pattern_after_creation2_enterprise','Neutral','Email is still the best and most popular way to communicate with customers and partners. Every day we receive a great amount of messages using multiple email accounts from different services and it may seem impossible not to miss anything important.\r\n\r\nMake use of these 5 tips and tricks to get organized and improve your email experience:\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\r\n$GreenButton\r\n\r\nStill not yet configured the mail server using your own domain name? - Follow the instructions \"here\":\"https://helpcenter.onlyoffice.com/gettingstarted/mail.aspx#MailServer_block\".\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:11','text',2,NULL,'Console'),(946353,250,'pattern_after_creation3','fi','Hyvä $UserName,\n\nJoskus kaikkein hyödyllisimmät työkalut eivät ole kaikkein ilmeisimpiä. On aina paljon löydettävää, joten teemme parhaimpamme, jotta voimme opastaa sinua tutustumaan nettitoimistosi jokaiseen nurkkaan. \n\nTässä on Top 5 ${LetterLogoText} Asiakkuudenhallinnan ominaisuutta, joista et ole ehkä tietoinen:\n\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nJos tarvitset apua portaalisi käytössä, niin kutsumme sinut \"Tukikeskukseemme\":\"https://helpcenter.onlyoffice.com\" tai vieraile \"Foorumissa\":\"http://cloud.onlyoffice.org\".\n\nParhain terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-16 19:30:00','text',2,NULL,'Arto Ryynanen'),(460962,250,'pattern_after_creation3','Neutral','Dear $UserName,\r\n\r\nSometimes the most useful tools are not the most obvious. There is always much to be discovered, so we do our best to guide you through the every single corner of your cloud office. \r\n\r\nHere is the Top 5 ${LetterLogoText} CRM features which you might have missed:\r\n\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\" or visit our \"Forum\":\"http://cloud.onlyoffice.org\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:11','text',2,NULL,'Console'),(460964,250,'pattern_after_creation30_freecloud','Neutral','Dear $UserName,\r\n\r\nThank you for using ${LetterLogoText} service. Hope, everything\'s going fine.\r\nIs everything clear? Please share your impression. The feedback is the best contribution!\r\n\r\nAt this moment the number of active users in the portal is $ActiveUsers\r\n\r\nIf you\'re planning to increase the amount of disc space on your portal, need some extra possibilities or security measures, you can migrate to ${LetterLogoText} Commercial Cloud.\r\n\r\n\"Learn more\":\"http://www.onlyoffice.com/saas.aspx\"\r\n\r\n$BlueButton','','2016-09-19 10:41:11','text',2,NULL,'Console'),(946354,250,'pattern_after_creation3_enterprise','fi','Hyvä $UserName,\n\nJoskus kaikkein hyödyllisimmät työkalut eivät ole kaikkein ilmeisimpiä. On aina paljon löydettävää, joten teemme parhaimpamme, jotta voimme opastaa sinua tutustumaan nettitoimistosi jokaiseen nurkkaan. \n\nTässä on Top 5 ${LetterLogoText} Asiakkuudenhallinnan ominaisuutta, joista et ole ehkä tietoinen:\n\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nJos tarvitset apua portaalisi käytössä, niin kutsumme sinut \"Tukikeskukseemme\":\"https://helpcenter.onlyoffice.com\" tai vieraile \"Foorumissa\":\"http://cloud.onlyoffice.org\".\n\nParhain terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-16 19:30:18','text',2,NULL,'Arto Ryynanen'),(460963,250,'pattern_after_creation3_enterprise','Neutral','Dear $UserName,\r\n\r\nSometimes the most useful tools are not the most obvious. There is always much to be discovered, so we do our best to guide you through the every single corner of your cloud office. \r\n\r\nHere is the Top 5 ${LetterLogoText} CRM features which you might have missed:\r\n\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:11','text',2,NULL,'Console'),(949179,250,'pattern_after_creation4','fr','Bonjour $UserName,\n\nAvec ${LetterLogoText} toutes vos données sont stockées dans un seul endroit et disponibles à partir du nuage. Il n\'y a plus besoin d\'autres logiciels de bureau ou des lecteurs flash. Soyez productif et accèdez à votre bureau à \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" à partir de n\'importe où !\n\nCommencez votre migration vers le bureau en nuage avec ces 5 étapes :\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n\n$GreenButton\n\nPour plus d\'informations, nous vous invitons à parcourir notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\" ou visitez notre \"Forum\":\"http://cloud.onlyoffice.org\".\n\nSincèrement vôtre,\nÉquipe ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-26 10:24:49','text',2,NULL,'Nadine Yablonskaya'),(460965,250,'pattern_after_creation4','Neutral','Dear $UserName,\r\n\r\nWith ${LetterLogoText} you have all your data stored in one place available from the cloud. There is no more need for additional desktop software or flash drives. Be productive and access your office at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" from anywhere!\r\n\r\nStart your migration to the cloud office with these 5 steps:\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\r\n\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\" or visit our \"Forum\":\"http://cloud.onlyoffice.org\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:11','text',2,NULL,'Console'),(460966,250,'pattern_after_creation4_enterprise','Neutral','Dear $UserName,\r\n\r\nWith ${LetterLogoText} you have all your data stored in one place. There is no more need for additional desktop software or flash drives. Be productive and access your office at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" from anywhere!\r\n\r\nStart your migration to the cloud office with these 5 steps:\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\r\n\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:11','text',2,NULL,'Console'),(950270,250,'pattern_after_creation5','de','Sehr geehrte/r Frau/Herr $UserName,\n\nMein Name ist Tim und ich vertrete ${LetterLogoText}. Ich startete meine Arbeit hier seit langem, am Anfang des Projekts. Glauben Sie mir, ich weiß alles über diese Anwendung!\n\nWie läuft es? Ist alles klar? Teilen Sie bitte Ihre Eindrücke mit. Ihr Feedback ist das beste Lob!\n\nWenn Sie Fragen bezüglich der ${LetterLogoText}-Verwendung haben oder Hilfe benötigen, geben Sie mir bitte Bescheid. Verbesserungsvorschläge und Ideen rund um ${LetterLogoText} senden Sie mir einfach per Email.\n\nSeien Sie immer produktiv und greifen Sie auf Ihr Büro unter \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" von überall zu!\n\nKontaktieren Sie mich bitte unter dieser E-Mail Adresse \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\", wenn Sie Fragen haben.\n',NULL,'2017-02-01 09:03:08','text',2,NULL,'Evgenia'),(460967,250,'pattern_after_creation5','Neutral','Hello $UserName,\r\n\r\nMy name is Tim and I work for ${LetterLogoText}. I started my work here long time ago, at the very beginning of the project. Believe me, I know everything about this application!\r\n\r\nHow is it going there? Is everything clear? Please share with me your impression. The feedback is the best contribution!\r\n\r\nIf you have questions regarding how to use ${LetterLogoText} or need help to start using it, just let me know. You can also send me feedback or ideas to help improve ${LetterLogoText}.\r\n\r\nBe productive and access your office at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" from anywhere!\r\n\r\nMail me at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\" whenever you need help.','','2016-09-19 10:41:11','text',2,NULL,'Console'),(946343,250,'pattern_after_creation6','fi','Hyvä $UserName,\n\nMelkein jokaisessa liiketoiminnassa joudumme käyttämään päivittäin asiakirjoja - sopimuksia, raportteja, papereita, laskuja jne. - ja hukkaamme huomattavan määrän aikaa niitä käsitellessä. Jotta voit toimia tehokkaamminen ja vähentää aikaa paperitöihin, niin voit hyödyntää seuraavia viittä yksinkertaista vinkkiä.\n\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nJos haluat apua portaalin käytössä, niin me kutsumme sinut tutustumaan \"Tukikeskukseemme\":\"https://helpcenter.onlyoffice.com\" tai vieraile \"Foorumissa\":\"http://cloud.onlyoffice.org\".\n\nParhain terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-16 19:02:26','text',2,NULL,'Arto Ryynanen'),(460968,250,'pattern_after_creation6','Neutral','Dear $UserName,\r\n\r\nIn almost every business we are to deal with documents every day - contracts, reports, white papers, invoices, etc. - and waste a lot of time moving it around. To help you work more efficiently and reduce time and efforts spent on paperwork, make use of these 5 simple tips and tricks.\r\n\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\" or visit our \"Forum\":\"http://cloud.onlyoffice.org\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:11','text',2,NULL,'Console'),(946344,250,'pattern_after_creation6_enterprise','fi','Hyvä $UserName,\n\nMelkein jokaisessa liiketoiminnassa joudumme käyttämään päivittäin asiakirjoja - sopimuksia, raportteja, papereita, laskuja jne. - ja hukkaamme huomattavan määrän aikaa niitä käsitellessä. Jotta voit toimia tehokkaamminen ja vähentää aikaa paperitöihin, niin voit hyödyntää seuraavia viittä yksinkertaista vinkkiä.\n\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nJos haluat apua portaalin käytössä, niin me kutsumme sinut tutustumaan \"Tukikeskukseemme\":\"https://helpcenter.onlyoffice.com\" tai vieraile \"Foorumissa\":\"http://cloud.onlyoffice.org\".\n\nParhain terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-16 19:02:41','text',2,NULL,'Arto Ryynanen'),(460969,250,'pattern_after_creation6_enterprise','Neutral','Dear $UserName,\r\n\r\nIn almost every business we are to deal with documents every day - contracts, reports, white papers, invoices, etc. - and waste a lot of time moving it around. To help you work more efficiently and reduce time and efforts spent on paperwork, make use of these 5 simple tips and tricks.\r\n\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:11','text',2,NULL,'Console'),(938372,250,'pattern_after_creation7','fi','Yhteistoiminta on eräs tehokkaimmista tavoista ratkaista ongelma. Mutta tiimissä työskentely ei ole aina helppoa. ${LetterLogoText} tarjoaa sinulle työkalusetin, joka on suunniteltu tukemaan tiimisi yhteistoimintaa:\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nJos haluat apua portaalisi käytössä, suosittelemme tutustumista meidän \"Tukikeskukseen\":\"https://helpcenter.onlyoffice.com\" tai vieraile \"Foorumissamme\":\"http://cloud.onlyoffice.org\".\n\nParhain Terveisin,\nONLYOFFICE Tiimi',NULL,'2017-01-10 04:39:01','text',2,NULL,'Arto Ryynanen'),(460970,250,'pattern_after_creation7','Neutral','Collaboration is the most effective way to solve a problem. But working as a team is not always easy. ${LetterLogoText} offers you a set of tools designed to help you to improve your team collaboration:\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\" or visit our \"Forum\":\"http://cloud.onlyoffice.org\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:11','text',2,NULL,'Console'),(938371,250,'pattern_after_creation7_enterprise','fi','Yhteistoiminta on eräs tehokkaimmista tavoista ratkaista ongelma. Mutta tiimissä työskentely ei ole aina helppoa. ${LetterLogoText} tarjoaa sinulle työkalusetin, joka on suunniteltu tukemaan tiimisi yhteistoimintaa:\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nJos haluat apua portaalisi käytössä, suosittelemme tutustumista meidän \"Tukikeskukseen\":\"https://helpcenter.onlyoffice.com\".\n\nParhain Terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-10 04:36:31','text',2,NULL,'Arto Ryynanen'),(460971,250,'pattern_after_creation7_enterprise','Neutral','Collaboration is the most effective way to solve a problem. But working as a team is not always easy. ${LetterLogoText} offers you a set of tools designed to help you to improve your team collaboration:\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:12','text',2,NULL,'Console'),(950919,250,'pattern_after_creation8_enterprise','es','Estimado(a) $UserName,\n\nLa oficina en la nube para su equipo ya está creada en \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Es la hora de invitar a sus compañeros de equipo a su portal.\nLa forma más fácil de hacerlo es enviar el enlace de invitación usando la opción *Invitar a usuarios al portal*.\n\n$GreenButton\n\nSi Usted tiene acceso a la información de contacto detallada de las personas, añada sus compañeros de equipo manualmente uno por uno usando el botón *Crear nuevo...* en el módulo *Personas*. \"Aprender Más >>\": \"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nO añada usuarios a la vez de:\n    \"su base de datos LDAP\":\"http://helpcenter.onlyoffice.com/server/windows/community/ldap-settings.aspx\",\n    \"su cuenta de Yahoo o Google\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\n    \"su libro de direcciones de correo de clientes\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\n    \"un archivo CSV\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \n\nUna vez añadido, gestione los derechos de acceso. Para aprender más acerca de como gestionar los derechos de acceso, visite nuestro \"Centro de Ayuda\": \"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\": \"http://onlyoffice.com/\"',NULL,'2017-02-13 09:00:40','text',2,NULL,'Ekaterina.Heidel');
INSERT  IGNORE INTO `res_data` VALUES (460972,250,'pattern_after_creation8_enterprise','Neutral','Dear $UserName,\r\n\r\nThe cloud office for your team is already created at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". It\'s time to invite your teammates to join it. \r\nThe easiest way to do that is to distribute the invitation link using the *Invite users to portal* option.\r\n\r\n$GreenButton\r\n\r\nIf you have access to the detailed contact information of the people, add your teammates manually one by one using the *Create New...* button in the *People* module. \"Learn more >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\r\n\r\nOr add users all at once from:\r\n    \"your LDAP database\":\"http://helpcenter.onlyoffice.com/server/windows/community/ldap-settings.aspx\",\r\n    \"your Yahoo or Google account\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\r\n    \"your mail client address book\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\r\n    \"a CSV file\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \r\n\r\nOnce added, manage their access rights. For more information about ARM, visit our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:12','text',2,NULL,'Console'),(950278,250,'pattern_after_payment1','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie haben zum dritten Mal ein monatliches ${LetterLogoText} Abonnement ausgewählt.\n\nWozu mehr bezahlen? Da Sie unser wiederkehrender Kunde sind, möchten wir Ihnen für ein 1-Jahres-Preismodell 10% Rabatt anbieten.\n\nUm den Rabatt auszunutzen, verwenden Sie bitte den Gutscheincode auf der Zahlungsseite: ==<b>10%yearlysubsc2015 </b>==\n\nWenn Sie Fragen haben, kontaktieren Sie uns bitte unter dieser E-Mail Adresse \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\". Wir helfen Ihnen gerne dabei!\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-01 09:27:13','text',2,NULL,'Evgenia'),(460973,250,'pattern_after_payment1','Neutral','Hi $UserName,\r\n\r\nYou selected a monthly ${LetterLogoText} subscription for the third time already.\r\n\r\nWhy pay more? As you are our returning customer, we would like to offer you the 10% for the 1 year pricing plan.\r\n\r\nTo pay with the discount please apply the coupon at the payment page: ==<b>10%yearlysubsc2015 </b>==\r\n\r\nIf you have any questions feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\". We will be glad to help you!\r\n \r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:12','text',2,NULL,'Console'),(937107,250,'pattern_after_registration_personal1','fi','$HeaderStart Tervetuloa ${LetterLogoText} henkilökohtaiseen toimistoosi $HeaderEnd\n\nOlet juuri luonut henkilökohtaisen toimistosi pilvessä.\n\nSe on selaimeen perustuva työympäristö, missä voit mm. tallentaa ja käsitellä asiakirjoja missä vaan ja jakaa niitä ystävillesi ja työtovereillesi.\n\n$FrameStart ${LetterLogoText} tukee Microsoft Office™ asiakirja formaatteja. $FrameEnd\n\n$StrongStart Tässä on perustoiminnot nopeaan aloitukseen: $StrongEnd\n\n$MarkerStart Lataa tiedostoja tietokoneeltasi tai luo uusia. $MarkerEnd\n\n$MarkerStart Muokkaa *.docx*, *.xlsx* ja *.pptx* asiakirjoja netissä. $MarkerEnd\n\n$MarkerStart Lataa tiedostoja missä tahansa tunnetussa formaatissa. $MarkerEnd\n\n$SignatureStart Onnea aloitukselle!\n\nTerveisin,\nONLYOFFICE tiimi $SignatureEnd',NULL,'2017-01-07 09:24:59','text',2,NULL,'Arto Ryynanen'),(460974,250,'pattern_after_registration_personal1','Neutral','$HeaderStart Welcome to ${LetterLogoText} personal $HeaderEnd\r\n\r\nYou have just created your personal office in the cloud.\r\n\r\nIt\'s a desktopless workspace available in your browser, where you can store documents, work with them anywhere providing access to your friends or colleagues.\r\n\r\n$FrameStart ${LetterLogoText} is compatible with Microsoft Office™ document formats. We promise to relieve you from formatting fidelity headache. $FrameEnd\r\n\r\n$StrongStart Here are the basic features for a quick start: $StrongEnd\r\n\r\n$MarkerStart Upload files from your computer or create new. $MarkerEnd\r\n\r\n$MarkerStart Edit *.docx*, *.xlsx* and *.pptx* documents online. $MarkerEnd\r\n\r\n$MarkerStart Download files in any popular format. $MarkerEnd\r\n\r\n$SignatureStart Have a good start!\r\n\r\nSincerely,\r\nONLYOFFICE team $SignatureEnd','','2016-09-19 10:41:12','text',2,NULL,'Console'),(935626,250,'pattern_after_registration_personal14','de','$HeaderStart Ein paar Tipps für freiberufliche Tätigkeit $HeaderEnd\n\n${LetterLogoText} bietet eine ganze Reihe der Funktionen für freiberufliche Gemeinschaft, ob Sie ein Auftragnehmer sind oder die stellen jemand für ein Projekt ein. Mal schauen was kann vielleicht am interessantesten sein:\n\n$MarkerStart Nur-Lese-/Vollständiger Zugriff-Dateien Sharing $MarkerEnd\n\n$MarkerStart Echtzeite gemeinsame Bearbeitung und Kommentierung $MarkerEnd\n\n$MarkerStart Versions- und Revisionskontrolle $MarkerEnd\n\nEs gibt keine Notwendigkeit, Dateien herunterzuladen und sie per E-Mail zu senden. Einfach teilen Sie sie aus Ihrem Cloud Office und arbeiten, wo alles Sie sind.\n\n$StrongStart Benötigen Sie mehr kollaborative Funktionalität? $StrongEnd\n\n${LetterLogoText} Business Edition ist kostenlos für 30-Tage-Testzeit und bietet Ihnen noch mehr Möglichkeiten für freiberufliche Arbeit oder Telearbeit. Zum Beispiel können Sie Rechnungen an Ihren Kunden erstellen und bestätigen. Wollen Sie mehr erfahren? Gehen Sie zu \"CRM im Überblick\": \"http://www.onlyoffice.com/crm.aspx\".\n\n$SignatureStart Mit freundlichen Grüßen,\nONLYOFFICE-Team $SignatureEnd',NULL,'2016-12-01 08:43:12','text',2,NULL,'Александр'),(935627,250,'pattern_after_registration_personal14','es','$HeaderStart Algunos consejos para el trabajo independiente $HeaderEnd\n\n${LetterLogoText} ofrece un buen número de características para la comunidad freelance si usted es un contratista o contrata a alguien para un proyecto. Vamos a ver lo que podría ser del mayor interés para usted:\n\n$MarkerStart compartir archivos de sólo lectura /acceso completo $MarkerEnd\n\n$MarkerStart edición colaborativa y comentarios en tiempo real $MarkerEnd\n\n$MarkerStart versión y control de revisión $MarkerEnd\n\nNo hay necesidad de descargar archivos y enviarlos por correo electrónico. Simplemente compartálos desde su oficina en nube y colabore desde cualquier lugar.\n\n$StrongStart ¿Necesita más funcionalidades colaborativas? $StrongEnd\n\n${LetterLogoText} edición de negocio es gratis durante un período de prueba de 30 días y le ofrece aún más oportunidades para freelance o trabajo a distancia. Por ejemplo, puede crear y enviar las facturas a sus clientes. ¿Le gustaría saber más? Proceda a nuestra \"visión CRM\": \"http://www.onlyoffice.com/crm.aspx\".\n\n$SignatureStart Atentamente,\nequipo ONLYOFFICE $SignatureEnd',NULL,'2016-12-01 08:43:17','text',2,NULL,'Александр'),(935628,250,'pattern_after_registration_personal14','fr','$HeaderStart Quelques conseils pour le travail indépendant $HeaderEnd\n\n${LetterLogoText} fournit un nombre de fonctionnalités pour ceux qui ont le travail indépendant même si vous êtes un entrepreneur ou embauchez quelqu\'un pour un projet. Allons voir ce qui pourrait être intéressant pour vous :\n\n$MarkerStart Partage des fichiers en sélectionnant l\'un des types d\'accès : Lecture seule ou Accès complet $MarkerEnd\n\n$MarkerStart Édition et commentaires collaboratifs en temps réel $MarkerEnd\n\n$MarkerStart Contrôle de version et révision $MarkerEnd\n\nIl n\'y a pas besoin de télécharger des fichiers et de les envoyer par courriel. Il suffit de les partager à votre bureau de nuage et de collaborer de n\'importe où que vous soyez.\n\n$StrongStart Besoin de plus de fonctionnalités de collaboration? $StrongEnd\n\nEdition d\'entreprise ${LetterLogoText} est gratuite pour une période d\'essai de 30 jours et offre plus de possibilités de travail indépendant ou lointain. Par exemple, vous pouvez créer et soumettre des factures à vos clients. Voulez-vous en savoir plus? Procédez à notre \"vue d\'ensemble de CRM:\"http://www.onlyoffice.com/crm.aspx\".\n\n$SignatureStart Cordialement,\nEquipe ONLYOFFICE $SignatureEnd',NULL,'2016-12-01 08:43:21','text',2,NULL,'Александр'),(460975,250,'pattern_after_registration_personal14','Neutral','$HeaderStart A few tips for freelance work $HeaderEnd\n\n${LetterLogoText} provides a good number of features for freelance community whether you are a contractor or hiring somebody for a project. Let\'s see what might be of the most interest for you:\n\n$MarkerStart Read Only/Full Access files sharing $MarkerEnd\n\n$MarkerStart Realtime collaborative editing and commenting $MarkerEnd\n\n$MarkerStart Version & revision control $MarkerEnd\n\nThere is no need to download files and send them via email. Simply share them from your cloud office and collaborate wherever you are.\n\n$StrongStart Need more collaborative functionality? $StrongEnd\n\n${LetterLogoText} business edition is free for a 30 day trial period and provides you with even more opportunities for freelance or distant work. For instance, you can create and submit invoices to your clients. Would like to learn more? Proceed to our \"CRM overview\":\"http://www.onlyoffice.com/crm.aspx\".\n\n$SignatureStart Sincerely,\nONLYOFFICE team $SignatureEnd','','2016-12-01 08:43:07','text',2,NULL,'Console'),(960596,250,'pattern_after_registration_personal14','nl','$HeaderStart Een aantal tips voor freelance werk $HeaderEnd\n\n${LetterLogoText} voorziet in een goed aantal mogelijkheden voor freelancers of u nu contractor bent of iemand inhuurd voor een project. Laten we eens kijken wat u wellicht het meest interesseert:\n\n$MarkerStart Alleen lezen/Volledige toegang bestand delen $MarkerEnd\n\n$MarkerStart Realtime collaboratieve bewerking en opmerkingen $MarkerEnd\n\n$MarkerStart Versie & revisie controle $MarkerEnd\n\nHet is niet noodzakelijk om bestanden te downloaden en per email te verzenden. U deelt deze eenvoudig vanuit uw cloud office en u kunt samenwerken waar u ook bent..\n\n$StrongStart Heeft u meer samenwerkings hulpmiddelen nodig? $StrongEnd\n\n${LetterLogoText} business edition is vrij te gebruiken voor een periode van 30 dagen en voorziet u van nog meer hulpmiddelen en mogelijkheden voor freelancers en flexwerkers. Als voorbeeld, u kunt facturen maken en verzenden aan uw klanten. Wilt u meer weten?? Kijk dan op onze  \"CRM overview\":\"http://www.onlyoffice.com/crm.aspx\".\n\n$SignatureStart Hoogachtend,\nONLYOFFICE team $SignatureEnd',NULL,'2017-03-27 07:23:54','text',2,NULL,'Hsing-Foo Wang'),(935629,250,'pattern_after_registration_personal14','ru','$HeaderStart Инструменты в помощь фрилансеру $HeaderEnd\n\nИнструменты ${LetterLogoText} будут полезны всем, кто работает на удаленной основе. Давайте посмотрим, какие возможности могут представлять для вас наибольший интерес:\n\n$MarkerStart Полный доступ к документам/Доступ в режиме \"Только чтение\" $MarkerEnd\n\n$MarkerStart Совместное редактирование и комментирование документов в режиме онлайн $MarkerEnd\n\n$MarkerStart Управление версиями файла и ревизиями $MarkerEnd\n\nТаким образом, у вас нет необходимости скачивать файлы и пересылать их по электронной почте. Просто предоставьте ссылку на документ с установленными правами доступа и работайте над ним совместно, где бы вы ни были.\n\n$StrongStart Еще больше возможностей для удаленной работы $StrongEnd\n\nМы также предоставляем бизнес-решение ${LetterLogoText}. Оно бесплатно в течение 30 дней пробного периода и включает целый ряд функций, которые значительно облегчают удаленную работу. Так, например, вы можете выставлять счета своим клиентам. Хотите узнать больше? Перейдите к \"обзору нашей системы CRM\":\"http://www.onlyoffice.com/ru/crm.aspx\".\n\n$SignatureStart С уважением,\nкоманда ONLYOFFICE $SignatureEnd',NULL,'2016-12-01 08:43:25','text',2,NULL,'Александр'),(460976,250,'pattern_after_registration_personal21','Neutral','$HeaderStart Give a try to ${LetterLogoText} for teams $HeaderEnd\r\n\r\nIn case you need to collaborate with a team or manage a project, we offer you to try the business edition of ${LetterLogoText}. In addition to the online editors and document management features, you\'ll be able to:\r\n\r\n$MarkerStart control tasks and use Gantt chart in the Project Management module; $MarkerEnd\r\n\r\n$MarkerStart track sales, relations with customers and create invoices in CRM; $MarkerEnd\r\n\r\n$MarkerStart manage all your email accounts in one Email aggregator $MarkerEnd\r\n\r\nand do many other operations that aim at creating a single collaborative work space and your teammates. See details \"here\":\"http://www.onlyoffice.com/highlights.aspx\".\r\n\r\nFor a start you can create a trial account that is free for 30 days. It doesn\'t have any functional restrictions.\r\n\r\n$SignatureStart Sincerely,\r\nONLYOFFICE team $SignatureEnd','','2016-09-19 10:41:12','text',2,NULL,'Console'),(935630,250,'pattern_after_registration_personal7','de','$HeaderStart Verbinden Sie Ihre Lieblings-Cloud-Speicher zu ${LetterLogoText} $HeaderEnd\n\nEs war eine Woche seit Sie Ihre Cloud-Office erstellten, so glauben wir, dass es an der Zeit ist, einige vorteilhafte Funktionen, die Sie vielleicht verpasst haben, zu enthüllen.\n\n$FrameStart Verbinden Sie Dropbox, Google Drive, Box oder Microsoft OneDrive Cloud-Speicher zu ${LetterLogoText}, und erstellen Sie einen einzelnen Arbeitsbereich für alle Ihre Dokumente. Sie können externe Dateien mit der Hilfe von ${LetterLogoText} ohne zusätzliche Downloads bearbeiten. Sehen Sie weitere Details, wie man kann das machen, \"hier\":\"http://helpcenter.onlyoffice.com/tipstricks/add-resource.aspx\". $FrameEnd\n\n$StrongStart Benötigen Sie mehr Dokumentsverwaltungsoptionen? $StrongEnd\n\nUnsere \"Business Edition\": \"http://www.onlyoffice.com/\" ist frei für eine 30-tägige Testzeit und bietet erweiterte Dokumentsverwaltungsmöglichkeiten und einem Business-Toolset:\n\n$MarkerStart Projektdokumentation Verfolgung. $MarkerEnd\n\n$MarkerStart Unnige Integration mit CRM und E-Mail. $MarkerEnd\n\n$MarkerStart Individual- und Gruppenbeteiligung. $MarkerEnd\n\nInteressiert? Erfahren Sie mehr über \"${LetterLogoText} für Business\":\"http://www.onlyoffice.com/document-management.aspx\".\n\n$SignatureStart Mit freundlichen Grüßen,\nONLYOFFICE-Team $SignatureEnd',NULL,'2016-12-01 08:43:57','text',2,NULL,'Александр'),(935631,250,'pattern_after_registration_personal7','es','$HeaderStart Conecte su almacenamiento en la nube favorito a ${LetterLogoText} $HeaderEnd\n\nHace una semana que usted ha creado su oficina de la nube, pues creemos que es la hora de revelar algunas de las características beneficiosas que podría haber pasado por alto.\n\n$FrameStart Conecte almacenamiento en la nube Dropbox, Google Drive, Box o OneDrive a ${LetterLogoText} y cree un único espacio de trabajo para todos sus documentos. Usted será capaz de editar archivos externos por medio de ${LetterLogoText} sin descargas adicionales. Vea detalles de cómo hacerlo \"aquí\":\"http://helpcenter.onlyoffice.com/tipstricks/add-resource.aspx\". $FrameEnd\n\n$StrongStart ¿Necesita más opciones de administración de documentos? $StrongEnd\n\nNuestro \"business edition\": \"http://www.onlyoffice.com/\" es gratis durante un período de prueba de 30 días y ofrece oportunidades de gestión de documentos extendidas junto con un conjunto de herramientas de negocio:\n\n$MarkerStart Seguimiento de la documentación de proyecto. $MarkerEnd\n\n$MarkerStart Cerrar integración con CRM y correo electrónico. $MarkerEnd\n\n$MarkerStart Reparto individual y de grupo. $MarkerEnd\n\n¿Está interesado? Aprenda más sobre \"${LetterLogoText} for business\":\"http://www.onlyoffice.com/document-management.aspx\".\n\n$SignatureStart Atentamente,\nequipo ONLYOFFICE $SignatureEnd',NULL,'2016-12-01 08:44:11','text',2,NULL,'Александр'),(946337,250,'pattern_after_registration_personal7','fi','$HeaderStart Yhdistä haluamasi pilvitallenne palvelu: ${LetterLogoText} $HeaderEnd\n\nNyt on noin viikko sen jälkeen kun loit pilvitoimistosi, joten ajattelimme että on aika paljastaa muutamia hyödyllisiä ominaisuuksia, joista et ole välttämättä tietoinen.\n\n$FrameStart Yhdistä Dropbox, Google Drive, Box tai OneDrive pilvitallenne palvelu: ${LetterLogoText} ja luo yksi työtila kaikille asiakirjoillesi. Voit luoda ulkoisia tiedostoja ${LetterLogoText} toiminnoilla ilman ylimääräisiä latauksia. Katso lisätietoa tästä \"täällä\":\"http://helpcenter.onlyoffice.com/tipstricks/add-resource.aspx\". $FrameEnd\n\n$StrongStart Tarvitsetko enemmän asiakirjan hallinnan vaihtoehtoja? $StrongEnd\n\n\"Business versiomme\":\"http://www.onlyoffice.com/\" on ilmainen 30 päivän jaksolle ja antaa laajennetut asiakirjan hallinnan mahdollisuudet, kuten myös liiketoiminnan työkalusetin:\n\n$MarkerStart Projektin asiakirjojen seuranta. $MarkerEnd\n\n$MarkerStart Tiivin integroinnin Asiakkuudenhallintaan ja Sähköpostiin. $MarkerEnd\n\n$MarkerStart Asiakirjojen jaot yksilöille ja ryhmälle. $MarkerEnd\n\nKiinnostunut? Lue lisää \"${LetterLogoText} yritykselle\":\"http://www.onlyoffice.com/document-management.aspx\".\n\n$SignatureStart Parhain terveisin,\nONLYOFFICE tiimi $SignatureEnd',NULL,'2017-01-16 18:44:27','text',2,NULL,'Arto Ryynanen'),(935632,250,'pattern_after_registration_personal7','fr','$HeaderStart Connectez votre stockage en nuage préféré à ${LetterLogoText} $HeaderEnd\n\nIl y a une semaine que vous avez créé votre bureau en nuage et nous avons envie de dévoiler quelques fonctions utiles que vous auriez pu manquer.\n\n$FrameStart Connectez Dropbox, Google Drive, Box or OneDrive stockage en nuage à ${LetterLogoText} et créez un espace de travail unique pour tous vos documents. Vous pourrez éditer des fichiers externes par le biais de ${LetterLogoText} sans aucun téléchargement supplémentaire. Voir les détails comment le faire \"ici\" : \"http://helpcenter.onlyoffice.com/tipstricks/add-resource.aspx\". $FrameEnd\n\n$StrongStart Besoin de plus d\'options de gestion de documents? $StrongEnd\n\nNotre \"edition d\'entreprise\":\"http://www.onlyoffice.com/\" est gratuit 30 jours de période d\'essai et offre des possibilités élargies de gestion de documents, mais aussi des outils d\'affaires :\n\n$MarkerStart Suivi de la documentation du projet. $MarkerEnd\n\n$MarkerStart Intégration étroite avec CRM et Email. $MarkerEnd\n\n$MarkerStart Droits d\'accès individuels et collectifs. $MarkerEnd\n\nIntéressant? En savoir plus sur \"${LetterLogoText} pour entreprise\" : \"http://www.onlyoffice.com/document-management.aspx\".\n\n$SignatureStart Cordialement,\nEquipe ONLYOFFICE $SignatureEnd',NULL,'2016-12-01 08:44:22','text',2,NULL,'Александр'),(460977,250,'pattern_after_registration_personal7','Neutral','$HeaderStart Connect your favorite cloud storage to ${LetterLogoText} $HeaderEnd\n\nIt has been a week since you created your cloud office, so we believe it\'s time to unveil some beneficial features you might have missed.\n\n$FrameStart Connect Dropbox, Google Drive, Box or OneDrive cloud storage to ${LetterLogoText} and create a single workspace for all your documents. You\'ll be able to edit external files by means of ${LetterLogoText} without any additional downloads. See details how to do it \"here\":\"http://helpcenter.onlyoffice.com/tipstricks/add-resource.aspx\". $FrameEnd\n\n$StrongStart Need more document management options? $StrongEnd\n\nOur \"business edition\":\"http://www.onlyoffice.com/\" is free for a 30 day trial period and provides extended document management opportunities together with a business toolset:\n\n$MarkerStart Project documentation tracking. $MarkerEnd\n\n$MarkerStart Close integration with CRM and Email. $MarkerEnd\n\n$MarkerStart Individual and group sharing. $MarkerEnd\n\nInterested? Learn more about \"${LetterLogoText} for business\":\"http://www.onlyoffice.com/document-management.aspx\".\n\n$SignatureStart Sincerely,\nONLYOFFICE team $SignatureEnd','','2016-12-01 08:43:41','text',2,NULL,'Console'),(935633,250,'pattern_after_registration_personal7','ru','$HeaderStart Подключите свое облачное хранилище к ${LetterLogoText} $HeaderEnd\n\nПрошла неделя с тех пор, как вы создали свой облачный офис, и мы хотели бы рассказать вам о некоторых полезных возможностях, которые вы могли не заметить.\n\n$FrameStart Подключите облачное хранилище Dropbox, Google Drive, Box или OneDrive к ${LetterLogoText}, чтобы создать единое рабочее пространство для всех своих документов. Вы сможете редактировать сторонние файлы в ${LetterLogoText} без дополнительных загрузок. Инструкции по подключению облачных хранилищ можно найти \"здесь\":\"http://helpcenter.onlyoffice.com/tipstricks/add-resource.aspx\". $FrameEnd\n\n$StrongStart Еще больше возможностей для управления документами $StrongEnd\n\nМы также предоставляем \"бизнес-решение\":\"http://www.onlyoffice.com/\". Оно бесплатно в течение 30 дней пробного периода и наряду с набором инструментов для бизнеса включает в себя расширенные возможности управления документами:\n\n$MarkerStart Отслеживание проектной документации. $MarkerEnd\n\n$MarkerStart Тесная интеграция с CRM и электронной почтой. $MarkerEnd\n\n$MarkerStart Индивидуальные и групповые права доступа. $MarkerEnd\n\nУзнайте больше о \"бизнес-решении ${LetterLogoText}\":\"http://www.onlyoffice.com/document-management.aspx\".\n\n$SignatureStart С уважением,\nкоманда ONLYOFFICE $SignatureEnd',NULL,'2016-12-01 08:44:32','text',2,NULL,'Александр'),(460978,250,'pattern_backup_created','Neutral','h1.\"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal backup created\r\n\r\nDear $OwnerName,\r\n\r\nA backup file containing data from your \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal has been created.\r\n\r\nTo learn more on the backup procedure please refer to our \"Data backup\":\"http://helpcenter.onlyoffice.com/tipstricks/data-backup-restore.aspx\" user guide.\r\n\r\n\r\nIf you have any questions or need assistance please feel free to contact us at \"support.onlyoffice.com\":\"http://support.onlyoffice.com\"\r\n\r\nBest regards,\r\nONLYOFFICE™ Support Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:12','text',2,NULL,'Console'),(950879,250,'pattern_change_email','de','h1.Anfrage auf Änderung der Email-Adresse\n\nSie haben angefragt, Ihre Email-Adresse  zu ändern, die Sie zum Einloggen ins Portal ${LetterLogoText} verwenden.\n\nBitte folgen Sie dem unten angegebenen Link, um Ihre Ihre Email-Adresse zu ändern:\np=. \"Email-Adresse ändern\":\"$InviteLink\"\n\n*Hinweis*: Dieser Link ist nur 7 Tage gültig. Bitte schließen Sie die Aktivierung Ihrer E-Mail-Adresse in dieser Zeitperiode ab.\n\nSie benötigen Ihre alte E-Mail-Adresse, um auf das Portal zugreifen können. Wenn Sie sich jedoch nicht an Ihre alte E-Mail-Adresse erinnern können,  wenden Sie sich bitte an Ihren Portaladministrator.\n\nWenn Sie Ihre Email-Adresse nicht ändern möchten oder diese Mail aus Versehen erhalten haben, lassen Sie diese außer Acht oder kontaktieren Sie den Administrator des Portals, um Details zu erfahren.\n\nFalls Sie einige Fragen haben oder Hilfe brauchen, kontaktieren Sie uns bitte unter \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n\nMit freundlichen Grüßen,\nONLYOFFICE™ Support Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-09 09:16:33','text',2,NULL,'Evgenia'),(935686,250,'pattern_change_email','es','h1.Solicitud de Cambio de la Dirección de Correo Electrónico\n\nUsted ha solicitado cambiar su dirección de correo electrónico utilizada para entrar en el portal ${LetterLogoText}.\n\nPor favor, siga el siguiente enlace para cambiar su dirección de correo electrónico:\np=. \"Change Email Address\":\"$InviteLink\"\n\n*Note*: este enlace tiene una validez sólo de 7 días. Por favor complete el proceso de cambio de correo electrónico dentro de ese período.\n\nEs posible que necesite su dirección de correo electrónico anterior para acceder al portal cuando sigue el enlace. Si usted no recuerda la dirección de correo electrónico anterior, por favor póngase en contacto con el administrador del portal.\n\nSi no desea cambiar su correo electrónico o ha recibido este correo electrónico por error, por favor, ignórelo o póngase en contacto con el administrador del portal para recibir más detalles.\n\nSi usted tiene alguna pregunta o necesita ayuda no dude en contactar con nosotros en \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n\nAtentamente,\nEquipo de Soporte ONLYOFFICE™ \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-01 08:50:35','text',2,NULL,'Александр'),(935687,250,'pattern_change_email','fr','h1.Demande de changement d\'adresse de messagerie\n\nVous avez demandé à modifier votre adresse e-mail utilisée pour entrer au portail ${LetterLogoText}.\n\nVeuillez suivre le lien ci-dessous pour modifier votre adresse e-mail:\np=. \"Changement d\'adresse de messagerie\":\"$InviteLink\"\n\n*Note*: ce lien est valable pour 7 jours seulement. Veuillez remplir votre le processus de changement d\'email au cours de cette période.\n\nVous pourriez avoir besoin de votre ancienne adresse e-mail pour accéder au portail quand vous suivez le lien. Si vous ne vous souvenez pas de votre ancienne adresse de courriel, veuillez communiquer avec l\'administrateur de votre portail.\n\nSi vous ne voulez pas changer votre adresse de courriel ou reçu ce message par erreur, veuillez l\'ignorer ou contacter l\'administrateur de votre portail pour trouver les détails.\n\nSi vous avez des questions ou besoin d\'aide, n\'hésitez pas à nous contacter à  \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n\nCordialement,\nÉquipe d\'assistance ONLYOFFICE™ \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"\n',NULL,'2016-12-01 08:50:38','text',2,NULL,'Александр'),(460979,250,'pattern_change_email','Neutral','h1.Email address change request\n\nYou have requested to change your email address used to enter the ${LetterLogoText} portal.\n\nPlease follow the link below to change your email address:\np=. \"Change Email Address\":\"$InviteLink\"\n\n*Note*: this link is valid for 7 days only. Please complete your email change process within that period.\n\nYou might need your old email address to access the portal when you follow the link. If you do not remember the old email address, please contact your portal administrator.\n\nIf you do not want to change your email or received this email by mistake, please ignore it or contact your portal administrator to find out the details.\n\nIf you have any questions or need assistance please feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n\nBest regards,\nONLYOFFICE™ Support Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-12-01 08:50:29','text',2,NULL,'Console'),(935688,250,'pattern_change_email','ru','h1.Запрос на смену адреса электронной почты\n\nВы запросили смену адреса электронной почты, служащего для доступа к порталу ${LetterLogoText}.\n\nПожалуйста, перейдите по следующей ссылке для смены Вашего адреса электронной почты:\np=. \"Изменить адрес электронной почты\":\"$InviteLink\"\n\n*Обратите внимание*: эта ссылка действительна только в течение 7 дней. Пожалуйста, выполните изменение адреса электронной почты в течение этого времени.\n\nСтарый адрес электронной почты может Вам потребоваться для входа на портал при переходе по ссылке. Если Вы не помните старый адрес электронной почты, обратитесь к администратору портала.\n\nЕсли Вы не хотите менять адрес электронной почты или получили это письмо по ошибке, пожалуйста, проигнорируйте его или обратитесь к администратору вашего портала за разъяснениями.\n\nЕсли у Вас есть какие-то вопросы, Вы всегда можете написать нам по адресу \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n\nС уважением,\nкоманда ONLYOFFICE™\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-01 08:50:42','text',2,NULL,'Александр'),(460980,250,'pattern_change_email_personal','Neutral','You have requested to change your email address used to enter the ${LetterLogoText} portal.\r\n\r\nPlease follow the link below to change your email address:\r\np=. \"Change email address\":\"$InviteLink\"\r\n\r\n*Note*: this link is valid for 7 days only. Please complete your email change process within that period.\r\n\r\nIf you do not want to change your email or received this email by mistake, please ignore it.\r\n\r\n$SignatureStart Sincerely,\r\nONLYOFFICE team $SignatureEnd','','2016-09-19 10:41:12','text',2,NULL,'Console'),(950875,250,'pattern_change_password','de','h1.Anfrage aif die Kennwortänderung auf dem Portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\"\n\nEs wurde die Änderung Ihres Kennworts angefragt, das Sie zum Einloggen ins Portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" verwenden.\n\nBitte folgen Sie dem unten angegebenen Link, um Ihr Kennwort zu ändern:\np=. \"Kennwort ändern\":\"$InviteLink\"\n\n*Hinweis*: Dieser Link ist nur 7 Tage gültig. Bitte schließen Sie die Änderung des Kennworts in dieser Zeitperiode ab.\n\nWenn Sie Ihr Kennwort nicht ändern möchten oder diese Mail aus Versehen erhalten haben, lassen Sie diese außer Acht oder kontaktieren Sie den Administrator des Portals \"${__VirtualRootPath}\":\"${__VirtualRootPath}\", um Details zu erfahren.\n\n\nWenn Sie Fragen haben oder Unterstützung brauchen, wenden Sie sich bitte an uns unter\n\"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n\nMit freundlichen Grüßen\nONLYOFFICE™-Kundendienst\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-09 09:06:09','text',2,NULL,'Evgenia'),(930771,250,'pattern_change_password','fr','h1.Demande de changement de mot de passe pour le portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\"\n\nIl y a eu une demande pour changer votre mot de passe utilisé pour entrer au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nVeuillez suivre le lien ci-dessous pour modifier votre mot de passe:\np=. \"Changer un mot de passe\":\"$InviteLink\"\n\n*Note*: ce lien est valable pour 7 jours seulement. Veuillez compléter le processus de changement de mot de passe au cours de cette période.\n\nSi vous ne voulez pas changer votre mot de passe ou recevez ce message par erreur, veuillez l\'ignorer ou contacter l\'administrateur de votre portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" pour en savoir plus.\n\nSi vous avez des questions ou besoin d\'aide, n\'hésitez pas à nous contacter à \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n\nMeilleures salutations,\nÉquipe d\'assistance ONLYOFFICE™ \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-10-24 12:45:22','text',2,NULL,'Nadine Yablonskaya'),(460981,250,'pattern_change_password','Neutral','h1.Password change request for the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal\r\n\r\nThere has been a request to change your password used to enter the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal.\r\n\r\nPlease follow the link below to change your password:\r\np=. \"Change Password\":\"$InviteLink\"\r\n\r\n*Note*: this link is valid for 7 days only. Please complete the password change process within that period.\r\n\r\nIf you do not want to change your password or received this email by mistake, please ignore it or contact your \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal administrator to find out the details.\r\n\r\n\r\nIf you have any questions or need assistance please feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\r\n\r\nBest regards,\r\nONLYOFFICE™ Support Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:12','text',2,NULL,'Console'),(460982,250,'pattern_change_password_personal','Neutral','There has been a request to change your password used to enter the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal.\r\n\r\nPlease follow the link below to change your password:\r\np=. \"Change password\":\"$InviteLink\"\r\n\r\n*Note*: this link is valid for 7 days only. Please complete the password change process within that period.\r\n\r\nIf you do not want to change your password or received this email by mistake, please ignore it.\r\n\r\n$SignatureStart Sincerely,\r\nONLYOFFICE team $SignatureEnd','','2016-09-19 10:41:12','text',2,NULL,'Console'),(950869,250,'pattern_change_phone','de','h1.ein Antrag auf Änderung der Handynummer\n\nSie haben angefragt, Ihre Handynummer zu ändern, die Sie zum Einloggen ins Portal ${LetterLogoText} verwenden.\n\nBitte folgen Sie dem unten angegebenen Link, um Ihre Handynummer zu ändern:\n\np.= \"Handynummer ändern\":\"$InviteLink\"\n\nWenn Sie Ihre Handynummer nicht ändern möchten oder diese Mail aus Versehen erhalten haben, lassen Sie diese außer Acht oder kontaktieren Sie den Administrator des Portals, um Details zu erfahren.',NULL,'2017-02-09 08:37:19','text',2,NULL,'Evgenia'),(935695,250,'pattern_change_phone','es','h1.Solicitud de Cambio de Móvil\n \nUsted ha solicitado cambiar su móvil utilizado para entrar en el portal ${LetterLogoText}.\n\nPor favor, siga el siguiente enlace para cambiar su móvil:\np.= \"Change mobile phone number\":\"$InviteLink\"\n\nSi no desea cambiar su móvil o ha recibido este correo electrónico por error, por favor, ignórelo o póngase en contacto con el administrador del portal para recibir más detalles.',NULL,'2016-12-01 08:51:38','text',2,NULL,'Александр'),(935696,250,'pattern_change_phone','fr','h1.Demande de changement de téléphone mobile \n\nVous avez demandé à changer votre téléphone mobile utilisé pour entrer au portail ${LetterLogoText}.\n\nVeuillez suivre le lien ci-dessous pour modifier votre téléphone mobile:\n\np.= \"Changer un numéro de téléphone mobile\":\"$InviteLink\"\n\nSi vous ne voulez pas changer votre téléphone mobile ou vous recevez ce message par erreur, veuillez l\'ignorer ou contacter l\'administrateur de votre portail pour trouver les détails.',NULL,'2016-12-01 08:51:41','text',2,NULL,'Александр'),(460983,250,'pattern_change_phone','Neutral','h1.Mobile phone change request\n\nYou have requested to change your mobile phone used to enter the ${LetterLogoText} portal.\n\nPlease follow the link below to change your mobile phone:\n\np.= \"Change mobile phone number\":\"$InviteLink\"\n\nIf you do not want to change your mobile phone or received this email by mistake, please ignore it or contact your portal administrator to find out the details.','','2016-12-01 08:51:33','text',2,NULL,'Console'),(935697,250,'pattern_change_phone','ru','h1.Запрос на изменение номера мобильного телефона\n\nБыл сделан запрос на изменение вашего номера мобильного телефона, служащего для доступа к порталу ${LetterLogoText}.\n\nПожалуйста, перейдите по следующей ссылке для изменения номера мобильного телефона:\n\np.= \"Изменить номер мобильного телефона\":\"$InviteLink\"\n\nЕсли Вы не хотите изменять номер мобильного телефона или получили это письмо по ошибке, пожалуйста, проигнорируйте его или обратитесь к администратору вашего портала за разъяснениями.',NULL,'2016-12-01 08:51:45','text',2,NULL,'Александр'),(460984,250,'pattern_change_pwd','Neutral','[outdated - do not translate]','','2016-09-19 10:41:12','text',2,NULL,'Console'),(460986,250,'pattern_confirmation_personal','Neutral','Hello,\r\n\r\nyou\'ve just registered an account at the ${LetterLogoText} solution for personal use. Click \"here\":\"$InviteLink\" to confirm the registration and create a password.\r\n\r\nIf you can\'t open the link, please copy the following \"$InviteLink\":\"$InviteLink\" and paste it into your browser address bar.\r\n\r\n$SignatureStart Sincerely,\r\nONLYOFFICE team $SignatureEnd','','2016-09-19 10:41:12','text',2,NULL,'Console'),(460985,250,'pattern_confirm_owner_change','Neutral','h1.Change of \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal owner\r\n\r\nDear $OwnerName,\r\n\r\nThere has been a request to change the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal owner to $UserName.\r\n\r\nPlease follow the link below to confirm the operation:\r\np=. \"Confirm Portal Owner Update\":\"$ConfirmPortalOwnerUpdate\"\r\n\r\n*Note*: this link is valid for 7 days only. Please complete the portal owner change process within that period.\r\n\r\n\r\nIf you have any questions or need assistance please feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\r\n\r\nBest regards,\r\nONLYOFFICE™ Support Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:12','text',2,NULL,'Console'),(950589,250,'pattern_congratulations','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie haben gerade das ${LetterLogoText}Portal erstellt, das die interne Zusammenarbeit verbessern wird. Ihre Portaladresse ist \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Das Hinzufügen dieses Links dem Lesezeichen ist eine gute Idee. Per Lesezeichen speichern Sie häufig genutzte Webadressen für einen schnellen Zugriff). Folgen Sie dem Link unten, um Ihre E-Mail-Adresse zu bestätigen:\n\np=. \"Klicken Sie hier für die Bestätigung\":\"$InviteLink\"\n\nBitte vervollständigen Sie Ihre E-Mail-Aktivierung innerhalb einer Woche. Der Link ist nur für 7 Tage gültig.\n\nHinweis: Wir senden keine vertrauliche Information (wie Ihr Passwort) in E-Mails aus Sicherheitsgründen. Sie können Ihre E-Mail oder Passwort auf Ihrer \"persönlichen Profilseite \" ändern:\"$MyStaffLink\".\n\nFür weitere Information besuchen Sie unser \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-03 09:12:48','text',2,NULL,'Evgenia'),(961533,250,'pattern_congratulations','es','Estimado(a) $UserName,\n\nUsted acaba de crear el portal ${LetterLogoText}, el portal de su equipo que mejore la cooperación interna. Su dirección de portal es \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (añadir este enlace a tu marcador es una buena idea, es probable que llegue a usarlo mucho). Siga el enlace para confirmar su dirección de correo electrónico:\n\np=. \"Haga clic aquí para unirse al portal\":\"$InviteLink\"\n\nPor favor, complete la activación de correo electrónico dentro de una semana, ya que el enlace es válido sólo 7 días.\n\nNote: no enviamos información confidencial (como la contraseña) en los correos electrónicos por razones de seguridad. Usted puede cambiar su correo electrónico o contraseña en su \"página de perfil personal\":\"$MyStaffLink\".\n\nPara obtener más información le invitamos a navegar por nuestro \"Centro de ayuda\": \"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-03-30 08:19:02','text',2,NULL,'Ekaterina.Heidel'),(937109,250,'pattern_congratulations','fi','Hyvä $UserName,\n\nOlet juuri luonut ${LetterLogoText} portaalin, joka auttaa tiimisi sisäistä kommunikaatiota ja yhteistoimintaa. Portaalisi osoite on \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (tämän linkin lisääminen muistiin selaimesi kirjanmerkkeihin on hyvä idea, tulet luultavasti käyttämään sitä paljon). Seuraa allaolevaa linkkiä, jotta voit varmentaa sähköpostiosoitteesi:\n\n p=. \"Klikkaa tätä ja varmenna\":\"$InviteLink\"\n\nOle hyvä ja suorita varmennus viikon sisällä koska linkki on voimassa vain 7 päivän ajan.\n\nHuom: turvallisuussyistä emme lähetä luottamuksellisia tietoja (kuten salasanaasi) sähköpostin välityksellä. Voit vaihtaa sähköpostisi tai salasanasi profiilisi sivulla:\"$MyStaffLink\".\n\nLisätietoa saat \"Ohjekeskuksestamme\":\"https://helpcenter.onlyoffice.com\".\n\nParhain terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-07 10:09:36','text',2,NULL,'Arto Ryynanen'),(460987,250,'pattern_congratulations','Neutral','Dear $UserName,\r\n\r\nYou have just created the ${LetterLogoText} portal, your team\'s portal that would enhance internal cooperation. Your portal address is \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (adding this link to your bookmarks is a good idea, you are most likely to get to use it a lot). Follow the link below to confirm your email address:\r\n\r\n p=. \"Click here for confirmation\":\"$InviteLink\"\r\n\r\nPlease, complete your email activation within a week as the link is valid for 7 days only.\r\n\r\nNote: we do not send out confidential information (like your password) in emails for safety reasons. You may change your email or password in your \"personal profile page\":\"$MyStaffLink\".\r\n\r\nFor more information we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:12','text',2,NULL,'Console'),(950590,250,'pattern_congratulations_enterprise','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie haben gerade das ${LetterLogoText} Portal erstellt, das die interne Zusammenarbeit verbessern wird. Ihre Portaladresse ist \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Das Hinzufügen dieses Links dem Lesezeichen ist eine gute Idee. Per Lesezeichen speichern Sie häufig genutzte Webadressen für einen schnellen Zugriff). Folgen Sie dem Link unten, um Ihre E-Mail-Adresse zu bestätigen:\n\np=. \"Klicken Sie hier für die Bestätigung\":\"$InviteLink\"\n\nBitte vervollständigen Sie Ihre E-Mail-Aktivierung innerhalb einer Woche. Der Link ist nur für 7 Tage gültig.\n\nHinweis: Wir senden keine vertrauliche Information (wie Ihr Passwort) in E-Mails aus Sicherheitsgründen. Sie können Ihre E-Mail oder Passwort auf Ihrer \"persönlichen Profilseite \" ändern:\"$MyStaffLink\".\n\nFür den Nachrichtenversand, haben wir die SMTP-Standardeinstellungen der Mail Server genutzt. Um diese zu ändern, folgen Sie diesen Anweisungen: \"http://helpcenter.onlyoffice.com/server/windows/community/smtp-settings.aspx\".\n\nFür weitere Information besuchen Sie unser \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-03 09:13:48','text',2,NULL,'Evgenia'),(961532,250,'pattern_congratulations_enterprise','es','Estimado(a) $UserName,\n\nUsted acaba de crear el portal ${LetterLogoText}, el portal de su equipo que mejore la cooperación interna. Su dirección de portal es \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (añadir este enlace a su marcador es una buena idea, es probable que llegue a usarlo mucho). Siga el enlace para confirmar su dirección de correo electrónico:\n\np=. \"Haga clic aquí para unirse al portal\":\"$InviteLink\"\n\nPor favor, complete la activación de correo electrónico dentro de una semana, ya que el enlace es válido sólo 7 días.\n\nNote: no enviamos información confidencial (como la contraseña) en los correos electrónicos por razones de seguridad. Usted puede cambiar su correo electrónico o contraseña en su \"página de perfil personal\":\"$MyStaffLink\".\n\nPara enviar mensajes, utilizamos la configuración SMTP de nuestro servidor de correo notify.onlyoffice.com estándar. Puede cambiar la configuración SMTP siguiendo las instrucciones \"aquí\":\"http://helpcenter.onlyoffice.com/server/windows/community/smtp-settings.aspx\".\n\nPara obtener más información le invitamos a navegar por nuestro \"Centro de ayuda\": \"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-03-30 08:18:50','text',2,NULL,'Ekaterina.Heidel'),(460988,250,'pattern_congratulations_enterprise','Neutral','Dear $UserName,\r\n\r\nYou have just created the ${LetterLogoText} portal, your team\'s portal that would enhance internal cooperation. Your portal address is \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (adding this link to your bookmarks is a good idea, you are most likely to get to use it a lot). Follow the link below to confirm your email address:\r\n\r\n p=. \"Click here for confirmation\":\"$InviteLink\"\r\n\r\nPlease, complete your email activation within a week as the link is valid for 7 days only.\r\n\r\nNote: we do not send out confidential information (like your password) in emails for safety reasons. You may change your email or password in your \"personal profile page\":\"$MyStaffLink\".\r\n\r\nTo send messages, we used SMTP settings of our default notify.onlyoffice.com mail server. You may change the SMTP settings following the instructions \"here\":\"http://helpcenter.onlyoffice.com/server/windows/community/smtp-settings.aspx\".\r\n\r\nFor more information we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:12','text',2,NULL,'Console'),(950824,250,'pattern_congratulations_freecloud','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie haben gerade Ihr ${LetterLogoText} Portal unter \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" erstellt. Von hier an haben Sie die Möglichkeit ${LetterLogoText} Free Cloud ohne zeitliche Einschränkungen zu erkunden. Folgen Sie dem Link unten, um Ihre E-Mail-Adresse zu bestätigen:\n\n p=. \"Klicken Sie hier für die Bestätigung\":\"$InviteLink\"\n\nBitte vervollständigen Sie Ihre E-Mail-Aktivierung innerhalb einer Woche. Der Link ist nur für 7 Tage gültig.\n\nHinweis: Wir senden keine vertrauliche Informationen (wie Ihr Passwort) in E-Mails aus Sicherheitsgründen. Sie können Ihre E-Mail oder Passwort auf Ihrer \"persönliche Profilseite\" ändern:\"$MyStaffLink\".\n\nSprache und Zeitzone kann man in Bereich \"Allgemeine Einstellungen\" ändern:\"$SettingsLink\".\nNachdem das Portal individuell gestaltet wird, können Sie Ihre Teammitglieder auf das Portal einladen.\nAlles gute!',NULL,'2017-02-08 08:50:49','text',2,NULL,'Evgenia'),(961535,250,'pattern_congratulations_freecloud','es','Estimado(a) $UserName,\n\nUsted acaba de crear su portal ${LetterLogoText} en \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". A partir de ahora usted tendrá la oportunidad de explorar ${LetterLogoText} Free Cloud sin limitación de tiempo. Siga el enlace para confirmar su dirección de correo electrónico: \n\np=. \"Haga clic aquí para confirmar\":\"$InviteLink\"\n\nPor favor, complete la activación de correo electrónico dentro de una semana, ya que el enlace tiene una validez de sólo 7 días.\n\nNote: no enviamos información confidencial (como la contraseña) en los correos electrónicos por razones de seguridad. Usted puede cambiar su correo electrónico o contraseña en su \"página de perfil personal\":\"$MyStaffLink\".\nEl idioma y la zona horaria pueden ser cambiados en \"Ajustes generales\":\"$SettingsLink\".\nDespués de la personalización del portal usted puede empezar a invitar a miembros de su equipo en el portal.\n¡Disfrute del vuelo!\n',NULL,'2017-03-30 08:19:52','text',2,NULL,'Ekaterina.Heidel'),(460989,250,'pattern_congratulations_freecloud','Neutral','Dear $UserName,\r\n\r\nYou have just created your ${LetterLogoText} portal at  \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Starting from now you will have an opportunity to explore ${LetterLogoText} Free Cloud without any time limitations. Follow the link below to confirm your email address:\r\n\r\n p=. \"Click here for confirmation\":\"$InviteLink\"\r\n\r\nPlease, complete your email activation within a week as the link is valid for 7 days only.\r\n\r\nNote: we do not send out confidential information (like your password) in emails for safety reasons. You may change your email or password in your \"personal profile page\":\"$MyStaffLink\".\r\nLanguage and time zone can be altered in \"general settings\":\"$SettingsLink\".\r\nAfter the portal customization you may start inviting your team members to the portal.\r\nEnjoy the flight! ','','2016-09-19 10:41:12','text',2,NULL,'Console'),(950585,250,'pattern_congratulations_whitelabel','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie haben gerade das Portal ${LetterLogoText} erstellt, das die interne Zusammenarbeit verbessern wird. Ihre Portaladresse ist \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Das Hinzufügen dieses Links dem Lesezeichen ist eine gute Idee. Per Lesezeichen speichern Sie häufig genutzte Webadressen für einen schnellen Zugriff). Folgen Sie dem Link unten, um Ihre E-Mail-Adresse zu bestätigen:\n$GreenButton\n\nBitte vervollständigen Sie Ihre E-Mail-Aktivierung innerhalb einer Woche. Der Link ist nur für 7 Tage gültig.\n\nHinweis: Wir senden keine vertrauliche Information (wie Ihr Passwort) in E-Mails aus Sicherheitsgründen. Sie können Ihre E-Mail oder Passwort auf Ihrer \"persönlichen Profilseite \" ändern:\"$MyStaffLink\".\n\nFür den Nachrichtenversand, haben wir die SMTP-Standardeinstellungen der Mail Server notify.onlyoffice.com genutzt.\n\nMit freundlichen Grüßen,\nONLYOFFICE Team',NULL,'2017-02-03 09:05:40','text',2,NULL,'Evgenia'),(951003,250,'pattern_congratulations_whitelabel','es','Buenos días, $UserName,\n\nUsted acaba de crear el portal ${LetterLogoText} para organizar un trabajo en colaboración efectivo. Dirección de su portal - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Le recomendamos añadir este enlace a marcadores: es probable que Usted lo use a menudo). Para confirmar su dirección de correo electrónico, por favor, siga el enlace siguiente:\n$GreenButton\n\nPor favor, termine la activación de su correo electrónico durante la semana, porque el enlace es válido solo durante 7 días.\n\nNote, por favor: por razones de seguridad no enviamos la información confidencial (como su contraseña) en los mensajes de correo. Usted puede cambiar su dirección de correo electrónico o contraseña en \"la página de su perfil personal\":\"$MyStaffLink\".\n\nPara enviar mensajes hemos usado los ajustes SMTP de nuestro servidor de correo estándar notify.onlyoffice.com.\n\nMuy atentamente,\nEquipo de ONLYOFFICE',NULL,'2017-02-14 11:49:23','text',2,NULL,'Ekaterina.Heidel'),(933573,250,'pattern_congratulations_whitelabel','fr','Bonjour $UserName,\n\nVous venez de créer le portail ${LetterLogoText} qui va améliorer la collaboration au sein de votre équipe. L\'adresse de votre portail est  \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (vous pouvez ajouter le lien à vos favoris, apparemment vous allez l\'utiliser souvent). Suivez le lien ci-dessous pour confirmer votre adresse e-mail :\n$GreenButton\n\nVeuillez compléter l\'activation durant une semaine car le lien n\'est valable que pour une durée de 7 jours.\n\nRemarque : pour des raisons de sécurité nous n’envoyons pas d’informations confidentielles (tels que votre mot de passe) par e-mail. Vous pouvez changer votre adresse e-mail ou votre mot de passe sur la \"page de votre profil personnel\":\"$MyStaffLink\".\n\nPour envoyer de messages nous avons utilisé les paramètres de notre serveur de messagerie par défaut notify.onlyoffice.com.\n\nSincèrement,\nÉquipe de ONLYOFFICE',NULL,'2016-11-01 13:57:37','text',2,NULL,'Nadine Yablonskaya'),(460990,250,'pattern_congratulations_whitelabel','Neutral','Dear $UserName,\r\n\r\nYou have just created the ${LetterLogoText} portal, your team\'s portal that would enhance internal cooperation. Your portal address is \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (adding this link to your bookmarks is a good idea, you are most likely to get to use it a lot). Follow the link below to confirm your email address:\r\n$GreenButton\r\n\r\nPlease, complete your email activation within a week as the link is valid for 7 days only.\r\n\r\nNote: we do not send out confidential information (like your password) in emails for safety reasons. You may change your email or password in your \"personal profile page\":\"$MyStaffLink\".\r\n\r\nTo send messages, we used SMTP settings of our default notify.onlyoffice.com mail server.\r\n\r\nTruly yours,\r\nONLYOFFICE Team','','2016-09-19 10:41:12','text',2,NULL,'Console'),(460991,250,'pattern_dns_change','Neutral','h1.Change of portal address\r\n\r\nDear $OwnerName,\r\n\r\nThere has been a request to change the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal address to \"$PortalAddress\":\"$PortalAddress\" #if($PortalDns != \"\") (\"$PortalDns\":\"$PortalDns\" )#end.\r\n\r\nPlease follow the link below to confirm the operation:\r\np=. \"Confirm Portal Address Change\":\"$ConfirmDnsUpdate\"\r\n\r\n*Note*: this link is valid for 7 days only. Please complete the portal address change process within that period.\r\n\r\n\r\nIf you have any questions or need assistance please feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\r\n\r\nBest regards,\r\nONLYOFFICE™ Support Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:12','text',2,NULL,'Console'),(950586,250,'pattern_enterprise_admin_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie haben gerade das ONLYOFFICE Portal erstellt, das die interne Zusammenarbeit verbessern wird. Ihre Portaladresse ist \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Das Hinzufügen dieses Links dem Lesezeichen ist eine gute Idee. Per Lesezeichen speichern Sie häufig genutzte Webadressen für einen schnellen Zugriff). Folgen Sie dem Link unten, um Ihre E-Mail-Adresse zu bestätigen:\n\np=. \"Klicken Sie hier für die Bestätigung\":\"$InviteLink\"\n\nBitte vervollständigen Sie Ihre E-Mail-Aktivierung innerhalb einer Woche. Der Link ist nur für 7 Tage gültig.\n\nHinweis: Wir senden keine vertrauliche Information (wie Ihr Passwort) in E-Mails aus Sicherheitsgründen. Sie können Ihre E-Mail oder Passwort auf Ihrer \"persönlichen Profilseite \" ändern:\"$MyStaffLink\".\n\nFür den Nachrichtenversand, haben wir die SMTP-Standardeinstellungen der Mail Server genutzt. Um diese zu ändern, folgen Sie diesen Anweisungen: \"http://helpcenter.onlyoffice.com/server/windows/community/smtp-settings.aspx\".\n\nFür weitere Information besuchen Sie unser \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-03 09:10:23','text',2,NULL,'Evgenia'),(951004,250,'pattern_enterprise_admin_activation','es','Buenos días, $UserName,\n\nUsted acaba de crear el portal ONLYOFFICE para organizar un trabajo en colaboración efectivo. Dirección de su portal - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Le recomendamos añadir este enlace a marcadores: es probable que Usted lo use a menudo). Para confirmar su dirección de correo electrónico, por favor, siga el enlace siguiente:\n\n p=. \"Pulse aquí para confirmar\":\"$InviteLink\"\n\nPor favor, termine la activación de su correo electrónico durante la semana, porque el enlace es válido solo durante 7 días.\n\nNote, por favor: por razones de seguridad no enviamos la información confidencial (como su contraseña) en los mensajes de correo. Usted puede cambiar su dirección de correo electrónico o contraseña en \"la página de su perfil personal\":\"$MyStaffLink\".\n\nPara enviar notificaciones usamos los ajustes SMTP de nuestro servidor de correo estándar. Para cambiarlos, por favor, siga estas \"instrucciones\":\"http://helpcenter.onlyoffice.com/server/windows/community/smtp-settings.aspx\".\n\nPara recibir una información adicional le invitamos a nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-14 12:02:35','text',2,NULL,'Ekaterina.Heidel'),(950796,250,'pattern_enterprise_admin_activation','fr','Bonjour $UserName,\n\nVous venez de créer le portail ONLYOFFICE, qui vous aidera à améliorer la coopération interne au sein de votre entreprise. L\'adresse de votre portail est \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (vous pouvez ajouter ce lien à vos favoris, probablement vous allez l\'utiliser souvent). Suivez le lien ci-dessous pour confirmer votre adresse e-mail :\n\n p=. \"Cliquez sur ce lien de confirmation\":\"$InviteLink\"\n\nVeuillez effectuer l\'activation par e-mail dans une semaine car le lien n\'est valable que 7 jours.\n\nRemarque : pour des raisons de sécurité nous n\'envoyons pas de renseignements confidentiels par courriel (tels que mot de passe). Vous pouvez changer votre e-mail ou mot de passe sur la page de votre \"profil\":\"$MyStaffLink\".\n\nPour envoyer des notifications, nous utilisons les paramètres SMTP de votre serveur de messagerie par défault. Pour les changer, suivez les instructions qui sont disponibles \"ici\":\"http://helpcenter.onlyoffice.com/server/windows/community/smtp-settings.aspx\".\n\nPour plus d\'informations, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nSincérement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-07 11:36:04','text',2,NULL,'Nadine Yablonskaya'),(934115,250,'pattern_enterprise_admin_activation','Neutral','Dear $UserName,\r\n\r\nYou have just created the ONLYOFFICE portal, your company\'s portal that would enhance internal cooperation. Your portal address is \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (adding this link to your bookmarks is a good idea, you are most likely to get to use it a lot). Follow the link below to confirm your email address:\r\n\r\n p=. \"Click here for confirmation\":\"$InviteLink\"\r\n\r\nPlease, complete your email activation within a week as the link is valid for 7 days only.\r\n\r\nNote: we do not send out confidential information (like your password) in emails for safety reasons. You may change your email or password in your \"personal profile page\":\"$MyStaffLink\".\r\n\r\nTo send notifications, we use the SMTP settings of our default mail server. To change them, please follow the instructions \"here\":\"http://helpcenter.onlyoffice.com/server/windows/community/smtp-settings.aspx\".\r\n\r\nFor more information we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936239,250,'pattern_enterprise_admin_activation','ru','Здравствуйте, $UserName,\n\nВы только что создали портал ONLYOFFICE для организации эффективной совместной работы. Адрес Вашего портала - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Советуем добавить эту ссылку в закладки: по всей вероятности, Вы будете ей часто пользоваться). Для подтверждения адреса электронной почты перейдите по следующей ссылке:\n\n p=. \"Нажмите сюда для подтверждения\":\"$InviteLink\"\n\nПожалуйста, выполните активацию электронной почты в течение недели, так как ссылка действительна только 7 дней.\n\nОбратите внимание: из соображений безопасности мы не высылаем в электронных письмах конфиденциальную информацию (такую, как ваш пароль). Вы можете изменить свой адрес электронной почты или пароль на \"странице вашего личного профиля\":\"$MyStaffLink\".\n\nДля отправки оповещений мы используем SMTP-настройки нашего стандартного почтового сервера. Чтобы их изменить, пожалуйста, следуйте этим \"инструкциям\":\"http://helpcenter.onlyoffice.com/server/windows/community/smtp-settings.aspx\".\n\nДля получения дополнительной информации приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 15:29:22','text',2,NULL,'Svetlana'),(950679,250,'pattern_enterprise_admin_customize_portal','de','Sehr geehrte/r Frau/Herr $UserName,\n \nHöchstwahrscheinlich ist das Einstellen Ihres Web-Offices eine neue Erfahrung für Sie, so dass Sie vielleicht einige Tipps und Tricks für den Start brauchen.\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\n$GreenButton\n   \nErledigt. Es ist Zeit, Ihre Teamkollegen ins Ihr Web-Office einzuladen!\n \nMehr Informationen finden Sie in unserem \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n \nBitte merken Sie, dass alle Teammitglieder für die Arbeit mit Dokumenten offline ONLYOFFICE Desktop Editors nutzen können. Die Anwendung ist absolut kostenlos und kann an Ihr Portal angeschlossen werden. \"Jetzt herunterladen now\":\"http://www.onlyoffice.com/desktop.aspx\"\n  \nMit freundlichen Grüßen,\n${LetterLogoText} Team\n',NULL,'2017-02-06 09:19:10','text',2,NULL,'Evgenia'),(950832,250,'pattern_enterprise_admin_customize_portal','es','Buenos días, $UserName,\n\nEs probable que ONLYOFFICE sea una experiencia nueva para Usted, por eso creemos que le ayudarán algunos consejos acerca de como empezar el trabajo.\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\n$GreenButton\n   \nHecho. ¡Es hora de invitar a otros compañeros de equipo a su oficina web!\n\nPara recibir una información adicional le invitamos a nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\".\n\nNote que todos sus compañeros de equipo pueden usar los editores desktop de ONLYOFFICE para trabajar con documentos offline. Es la aplicación gratuita, que también puede ser conectada al portal ONLYOFFICE. \"Descargar ahora\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-08 10:40:35','text',2,NULL,'Ekaterina.Heidel'),(946351,250,'pattern_enterprise_admin_customize_portal','fi','Hyvä $UserName,\n\nOn luultavaa, että ${LetterLogoText} on uusi kokemus sinulle, joten ajattelimme että haluaisit saada muutamia vinkkejä aloitukseen.\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\n$GreenButton\n   \nTehty. On aika kutsua tiimisi jäseniä nettitoimistoosi!\n\nLisätietoa varten kutsumme sinut tutustumaan \"Tukikeskukseemme\":\"https://helpcenter.onlyoffice.com\".\n\nHuomaa että kaikki tiimisi jäsenet voivat käyttää ONLYOFFICE desktop editoreita ja työskentelemään myös  ilman internettiä. Sovellus on ilmainen ja voidaan yhdistää ONLYOFFICE portaaliisi. \"Lataa Nyt\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nParhain terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-16 19:10:46','text',2,NULL,'Arto Ryynanen'),(950201,250,'pattern_enterprise_admin_customize_portal','fr','Bonjour $UserName,\n\nProbablement, la solution ONLYOFFICE est une nouvelle expérience pour vous, alors quelques conseils et astuces peuvent être utiles pour commencer le travail avec le service. \n$TableIDontemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\n$GreenButton\n   \nVoilà ! Il est temps d’inviter vos collègues à votre bureau virtuel !\n\nPour en savoir plus, consultez notre \"Centre d\'aide\" :\"https://helpcenter.onlyoffice.com\".\n\nNotez que tous les membres de votre équipe peuvent utiliser les éditeurs de bureau ONLYOFFICE pour travailler sur les documents hors connexion. L\'application est gratuite et peut être connectée à votre portail ONLYOFFICE. \"Téléchargez maintenant\" :\"http://www.onlyoffice.com/desktop.aspx\"\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-31 11:40:18','text',2,NULL,'Nadine Yablonskaya'),(934185,250,'pattern_enterprise_admin_customize_portal','Neutral','Dear $UserName,\r\n\r\nIt’s likely that ONLYOFFICE is a new experience for you so we figured that you might like some tips and tricks to get you started.\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\r\n$GreenButton\r\n   \r\nDone. It\'s time to invite teammates to your web-office!\r\n\r\nFor more information we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nNote that all members of your team can use ONLYOFFICE Desktop Editors to work on documents offline. The application is free and can be connected to your ONLYOFFICE portal. \"Download now\":\"http://www.onlyoffice.com/desktop.aspx\"\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:52','text',2,NULL,'Console'),(936202,250,'pattern_enterprise_admin_customize_portal','ru','Здравствуйте, $UserName,\n\nВозможно, раньше вам не приходилось работать с ONLYOFFICE, поэтому мы посчитали, что вам могут пригодиться несколько советов о том, с чего начать.\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\n$GreenButton\n   \nГотово. Пора пригласить в ваш виртуальный офис других участников команды!\n\nДля получения дополнительной информации приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nОбратите внимание, что все участники вашей команды могут использовать десктопные редакторы ONLYOFFICE для работы с документами офлайн. Это бесплатное приложение, его также можно подключить к порталу ONLYOFFICE. \"Скачать сейчас\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 12:27:30','text',2,NULL,'Svetlana'),(950814,250,'pattern_enterprise_admin_invite_teammates','de','Sehr geehrte/r Frau/Herr $UserName,\n\nDas Cloud-Office für Ihr Team ist bereits auf \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" erstellt. Es ist Zeit, Ihre Teamkollegen einzuladen.\nAm einfachsten können Sie das Einladungslink mit der Hilfe der Option *Laden zum Portal* verteilen.\n\n$GreenButton\n\nFals Sie Zugriff zu die detaillierten Kontaktinformation haben, fügen Sie Ihre Teamkollegen manuell mit der Taste *Neu erstellen...* in den Modul *Personen* ein. \"Mehr erfahren >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nOder fügen Sie alle Benutzer auf einmal ein. Dafür nutzen Sie:\n  \"Ihre LDAP-Datenbank\":\"http://helpcenter.onlyoffice.com/server/windows/community/ldap-settings.aspx\",\n  \"Ihr Yahoo- oder Google-Konto\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\n  \"Ihr E-Mail-Client-Adressbuch\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\n   \"eine CSV-Datei\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \n\nNach dem Hinzufügen verwalten Sie die Zugriffsrechte. Für weitere Information über Zugangsrechtsverwaltung, besuchen Sie unser \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-08 08:01:35','text',2,NULL,'Evgenia'),(950920,250,'pattern_enterprise_admin_invite_teammates','es','Estimado(a) $UserName,\n\nLa oficina en la nube para su equipo ya está creada en \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Es la hora de invitar a sus compañeros de equipo a su portal.\nLa forma más fácil de hacerlo es enviar el enlace de invitación utilizando la opción *Invitar a usuarios al portal*.\n\n$GreenButton\n\nSi Usted tiene acceso a la información de contacto detallada de las personas, añada sus compañeros de equipo manualmente uno por uno usando el botón *Crear nuevo...* en el módulo *Personas*. \"Aprender más >>\": \"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nO añada usuarios a la vez de:\n    \"su base de datos LDAP\":\"http://helpcenter.onlyoffice.com/server/windows/community/ldap-settings.aspx\",\n    \"su cuenta de Yahoo o Google\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\n    \"su libro de direcciones de correo de clientes\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\n    \"un archivo CSV\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \n\nUna vez añadido, gestione los derechos de acceso. Para aprender más acerca de como gestionar los derechos de acceso visite nuestro \"Centro de Ayuda\": \"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\": \"http://onlyoffice.com/\"',NULL,'2017-02-13 09:00:56','text',2,NULL,'Ekaterina.Heidel'),(949152,250,'pattern_enterprise_admin_invite_teammates','fr','Bonjour $UserName, \n\nLe bureau en nuage pour votre équipe a été déjà créé à \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Il est temps d\'y inviter vos collègues.  \nLa façon la plus simple de le faire c\'est distribuer le lien d\'invitation à l\'aide de l\'option *Inviter les utilisateurs au portail*.\n\n$GreenButton\n\nSi vous avez accès aux informations de contact détaillées, ajoutez vos coéquipiers manuellement un par un à l\'aide du bouron *Créer ...* dans le module *Personnes*. \"En savoir plus >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nOu ajoutez des utilisateurs à la fois à partir de :\n\"votre base de données LDAP\":\"http://helpcenter.onlyoffice.com/server/windows/community/ldap-settings.aspx\",\n\"votre compte Yahoo ou Google\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\n\"votre carnet d\'adresses du client de messagerie\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\n\"un fichier CSV\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\".\n\nUne fois ajouté, gérez leurs droits d\'accès. Pour plus d\'informations sur la gestion des droits d\'accès, visitez notre Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nSincèrement vôtre,\nÉquipe ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-26 10:00:09','text',2,NULL,'Nadine Yablonskaya'),(934186,250,'pattern_enterprise_admin_invite_teammates','Neutral','Dear $UserName,\r\n\r\nThe cloud office for your team is already created at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". It\'s time to invite your teammates to join it. \r\nThe easiest way to do that is to distribute the invitation link using the *Invite users to portal* option.\r\n\r\n$GreenButton\r\n\r\nIf you have access to the detailed contact information of the people, add your teammates manually one by one using the *Create New...* button in the *People* module. \"Learn more >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\r\n\r\nOr add users all at once from:\r\n    \"your LDAP database\":\"http://helpcenter.onlyoffice.com/server/windows/community/ldap-settings.aspx\",\r\n    \"your Yahoo or Google account\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\r\n    \"your mail client address book\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\r\n    \"a CSV file\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \r\n\r\nOnce added, manage their access rights. For more information about ARM, visit our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:52','text',2,NULL,'Console'),(936226,250,'pattern_enterprise_admin_invite_teammates','ru','Здравствуйте, $UserName,\n\nОблачный офис для вашей команды уже создан по адресу \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Пора пригласить в него других участников команды. \nПроще всего сделать это, разослав пригласительную ссылку с помощью опции *Пригласить пользователей*.\n\n$GreenButton\n\nЕсли вы располагаете подробными контактными данными, добавьте участников команды вручную по одному с помощью кнопки *Создать...* в модуле *Люди*. \"Подробнее >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nИли добавьте всех пользователей сразу, используя один из следующих источников:\n    \"база данных LDAP\":\"http://helpcenter.onlyoffice.com/server/windows/community/ldap-settings.aspx\",\n    \"ваш аккаунт Yahoo или Google\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\n    \"адресная книга почтового клиента\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\n    \"файл CSV\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \n\nКогда пользователи будут добавлены, настройте права доступа. Для получения дополнительной информации об управлении правами доступа посетите наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 14:22:15','text',2,NULL,'Svetlana'),(950776,250,'pattern_enterprise_admin_payment_warning','de','Sehr geehrte/r Frau/Herr $UserName,\n \nBitte beachten Sie, dass Ihr ONLYOFFICE Abonnement heute abläuft.\n \nUm Ihr Abonnement zu verlängern, müssen Sie eine Verlängerung für ONLYOFFICE erwerben.\n \nKlicken Sie auf den folgenden Link, um die Verlängerung zu starten:\n\"Preisinformation\":\"$PricingPage\"\n \nWenn Sie Ihre nächste Verlängerung erwerben, können Sie auch die Lizenzoption \"Auto-renew\" aktivieren. In diesem Fall wird Ihre Lizenz automatisch nach Ablauf der Gültigkeit verlängert.\n \nSie bekommen eine separate E-Mail mit Abrechnungsinformationen am Fälligkeitstermin.\n \nEs ist möglich, automatische Verlängerungsoption jederzeit durch den Zugriff auf myAccount(My Products section)zu deaktivieren: \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n \nFalls Sie noch Fragen zur ONLYOFFICE Installation, Aktivierung haben oder technische Unterstützung benötigen, kontaktieren Sie uns unter \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n \nWenn es zahlungsbezogene Frage entstehen, nehmen Sie Kontakt mit Avangate auf: \"support@avangate.com\":\"mailto:support@avangate.com\"\n \nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"\n',NULL,'2017-02-07 09:03:10','text',2,NULL,'Evgenia'),(950891,250,'pattern_enterprise_admin_payment_warning','es','Buenos días, $UserName,\n\nNote, por favor, que su suscripción para ONLYOFFICE va a expirar hoy.\n\nPara continuar usando el servicio se necesita adquirir renovación del producto para ONLYOFFICE.\n\nPulse el enlace abajo para empezar el proceso de prolongación:\n\"Página con precios\":\"$PricingPage\"\n\nPara su comodidad Usted podrá activar la opción de renovación automática al comprar la suscripción siguiente, en este caso la suscripción será renovada automáticamente a la expiración del periodo de uso.\n\nEn la fecha de expiración Usted recibirá un mensaje de correo separado con los detalles de pago para los pagos recurrentes.\n\nUsted podrá desactivar la opción de renovación automática para su suscripción en cualquier momento en su cuenta privada Avangate myAccount (en la sección My Products): \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n\nSi tiene algunas preguntas sobre la instalación, activación y asistencia técnica de ONLYOFFICE, contacte con nuestro equipo de soporte técnico \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nSi tiene algunas preguntas relacionadas con pagos, por favor, contacte con Avangate por correo \"support@avangate.com\":\"mailto:support@avangate.com\"\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-09 13:33:57','text',2,NULL,'Ekaterina.Heidel'),(950297,250,'pattern_enterprise_admin_payment_warning','fr','Bonjour $UserName,\n\nVeuillez noter que votre abonnement à ONLYOFFICE arrive à expiration aujourd\'hui.\n\nPour prolonger votre abonnement, vous avez besoin d\'acheter un revouvellement de la licence de ONLYOFFICE.\n\nCliquez sur le lien pour lancer le processus de renouvellement :\n\"Page de la tarification\":\"$PricingPage\"\n\nPour votre commodité, lors de l\'achat de votre prochain renouvellement, vous pouvez activer l’option « renouvellement automatique » de la licence, pour que votre licence soit renouvelée automatiquement à la date d’expiration.\n\nPour les paiements récurrents, un courriel avec les détails de paiement vous sera envoyé à la date d\'expiration.\n\nVous pouvez désactiver l’option de « renouvellement automatique » à tout moment en accédant à votre compte (la section My products) : \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n\nSi vous aves des questions d\'installation, d\'activation ou des problèmes lors de l\'utilisation de ONLYOFFICE, veuillez contacter notre équipe d\'assistance \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nPour les questions de paiement, contactez Avangate par e-mail à \"support@avangate.com\":\"mailto:support@avangate.com\"\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-01 09:49:02','text',2,NULL,'Nadine Yablonskaya'),(934217,250,'pattern_enterprise_admin_payment_warning','Neutral','Dear $UserName,\r\n\r\nPlease note that your ONLYOFFICE subscription is due to expire today.\r\n\r\nIn order to extend your subscription, you need to purchase a product renewal for ONLYOFFICE.\r\n\r\nClick on the link below to start the renewal process:\r\n\"Pricing page\":\"$PricingPage\"\r\n\r\nFor your convenience, when you purchase your next renewal, you can also enable the \"auto-renew\" license option, in which case your license will be renewed automatically at expiration time.\r\n\r\nA separate email with payment details for the recurrent billing will be sent on the expiration date.\r\n\r\nYou will be able to disable the \"auto-renew\" option at any time by accessing myAccount (My Products section) at: \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\r\n\r\nFor any further product installation, activation and technical support issues, please contact our support team at \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\r\n\r\nFor payment related issues please contact Avangate by email at \"support@avangate.com\":\"mailto:support@avangate.com\"\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936217,250,'pattern_enterprise_admin_payment_warning','ru','Добрый день, $UserName,\n\nПожалуйста, обратите внимание, что сегодня истекает срок действия вашей подписки на ONLYOFFICE.\n\nВам необходимо приобрести продление подписки на ONLYOFFICE.\n\nНажмите на следующую ссылку, чтобы начать продление:\n\"Страница с ценами\":\"$PricingPage\"\n\nДля вашего удобства при покупке следующего продления вы сможете включить опцию автоматического продления лицензии, и в этом случае лицензия будет продлеваться автоматически по окончании срока действия.\n\nДля регулярных платежей в день истечения срока действия подписки будет приходить отдельное письмо с информацией о платеже.\n\nВы в любое время сможете отключить опцию автоматического продления лицензии в личном кабинете Avangate myAccount (в разделе My Products): \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n\nПо вопросам установки, активации и технической поддержки продукта обращайтесь в нашу службу поддержки \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nПо вопросам оплаты, пожалуйста, обращайтесь в Avangate по адресу \"support@avangate.com\":\"mailto:support@avangate.com\"\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 13:39:57','text',2,NULL,'Svetlana'),(950773,250,'pattern_enterprise_admin_payment_warning_before7','de','Sehr geehrte/r Frau/Herr $UserName,\n \nBitte beachten Sie, dass Ihr ONLYOFFICE Abonnement in eine Woche abgeläuft.\n \nUm Ihr Abonnement zu verlängern, müssen Sie eine Verlängerung für ONLYOFFICE erwerben.\n \nKlicken Sie auf den folgenden Link, um die Verlängerung zu starten:\n\"Preisinformation\":\"$PricingPage\"\n \nWenn Sie Ihre nächste Verlängerung erwerben, können Sie auch die Lizenzoption \"Auto-renew\" aktivieren. In diesem Fall wird Ihre Lizenz automatisch nach Ablauf der Gültigkeit verlängert.\n \nSie bekommen eine separate E-Mail mit Abrechnungsinformationen am Fälligkeitstermin.\n \nEs ist möglich, automatische Verlängerungsoption jederzeit durch den Zugriff auf myAccount(My Products section)zu deaktivieren: \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n \nFalls Sie noch Fragen zur ONLYOFFICE Installation, Aktivierung haben oder technische Unterstützung benötigen, kontaktieren Sie uns unter \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n \nWenn es zahlungsbezogene Frage entstehen, nehmen Sie Kontakt mit Avangate auf: \"support@avangate.com\":\"mailto:support@avangate.com\"\n \nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"\n',NULL,'2017-02-07 09:00:36','text',2,NULL,'Evgenia'),(950888,250,'pattern_enterprise_admin_payment_warning_before7','es','Buenos días, $UserName,\n\nNote, por favor, que su suscripción para ONLYOFFICE expirará al cabo de una semana.\n\nPara continuar usando el servicio se necesita adquirir renovación del producto para ONLYOFFICE.\n\nPulse el enlace abajo para empezar el proceso de prolongación:\n\"Página con precios\":\"$PricingPage\"\n\nPara su comodidad Usted podrá activar la opción de renovación automática al comprar la suscripción siguiente, en este caso la suscripción será renovada automáticamente a la expiración del periodo de uso.\n\nEn la fecha de expiración Usted recibirá un mensaje de correo separado con los detalles de pago para los pagos recurrentes.\n\nUsted podrá desactivar la opción de renovación automática para su suscripción en cualquier momento en su cuenta privada Avangate myAccount (en la sección My Products): \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n\nSi tiene algunas preguntas sobre la instalación, activación y asistencia técnica de ONLYOFFICE, contacte con nuestro equipo de soporte técnico \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nSi tiene algunas preguntas relacionadas con pagos, por favor, contacte con Avangate por correo \"support@avangate.com\":\"mailto:support@avangate.com\"\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-09 13:08:55','text',2,NULL,'Ekaterina.Heidel'),(950268,250,'pattern_enterprise_admin_payment_warning_before7','fr','Bonjour $UserName,\n\nVeuillez noter que votre abonnement à ONLYOFFICE arrive à expiration dans une semaine.\n\nPour prolonger votre abonnement, vous avez besoin d\'acheter