ращайтесь в Avangate по адресу \"support@avangate.com\":\"mailto:support@avangate.com\"\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 13:30:47','text',2,NULL,'Svetlana'),(950783,250,'pattern_enterprise_admin_trial_warning','de','Sehr geehrte/r Frau/Herr $UserName,\n\nVielen Dank, dass Sie ONLYOFFICE ausprobiert haben. Kostenlose Probeperiode der Enterprise Edition läuft heute ab.\n \nUm Ihr Konto weiter nutzen zu dürfen, besuchen Sie \"Preise\" Seite :\"http://www.onlyoffice.com/enterprise-edition.aspx\", wo Sie alle Tarife ansehen und bestgeeignete Lösung wählen können oder Enterprise Edition Standard \"ab sofort\":\"$PricingPage\" kaufen.\n\nFalls Sie Fragen zur Preisgestaltung und Zahlungsbedingungen haben, kontaktieren Sie uns unter \"sales@onlyoffice.com\":\"mailto:sales@onlyoffice.com\". Sollten Sie technische Probleme, Bemerkungen oder Tipps haben: nehmen Sie dann Kontakt zu uns auf: \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n',NULL,'2017-02-07 10:41:49','text',2,NULL,'Evgenia'),(950900,250,'pattern_enterprise_admin_trial_warning','es','Buenos días, $UserName,\n\nGracias a Usted por hacer pruebas del servicio ONLYOFFICE. El periodo de prueba para la versión de servidor Enterprise Edition va a expirar hoy.\n\nPara continuar usando el servicio, por favor, pase a la \"Página con precios para la versión de servidor\":\"http://www.onlyoffice.com/enterprise-edition.aspx\", donde Usted puede enterarse de todos los planes de precios y elija lo más apropiado, o compre la suscripción para Enterprise Edition Standard \"ahora mismo\":\"$PricingPage\".\n\nSi tiene algunas preguntas adicionales relacionadas con la política de precios, por favor, contáctenos por correo  \"sales@onlyoffice.com\":\"sales@onlyoffice.com\". Si tiene algunas preguntas técnicas, por favor, contáctenos por correo \"support@onlyoffice.com\":\"support@onlyoffice.com\"',NULL,'2017-02-10 09:16:16','text',2,NULL,'Ekaterina.Heidel'),(950691,250,'pattern_enterprise_admin_trial_warning','fr','Bonjour $UserName,\n\nNous vous remercions de bien vouloir essayer le service ONLYOFFICE. La version d\'évaluation de Enterprise Edition expire aujourd\'hui.\n\nSi vous souhaitez continuer à utiliser le service, veuillez consulter la \"Page des tarifs pour la version serveur\":\"http://www.onlyoffice.com/enterprise-edition.aspx\" où vous pouvez consulter tous les modèles et choisir le plan approprié ou acheter Enterprise Edition Standard \"maintenant\":\"$PricingPage\".\n\nSi vous avez des questions consernant les tarifs et les paiements, contactez-nous à \"sales@onlyoffice.com\":\"mailto:sales@onlyoffice.com\". Pour des questions techniques, contactez-nous en utilisant l\'adresse suivante \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"',NULL,'2017-02-06 11:49:34','text',2,NULL,'Nadine Yablonskaya'),(934204,250,'pattern_enterprise_admin_trial_warning','Neutral','Dear $UserName,\r\n\r\nThank you for having given ONLYOFFICE a try. Your trial version of Enterprise Edition is due to expire today.\r\n\r\nTo continue using it please visit our \"Server pricing page\":\"http://www.onlyoffice.com/enterprise-edition.aspx\" where you can check out all the pricing plans and choose the most suitable one for you or buy the Enterprise Edition Standard \"right now\":\"$PricingPage\".\r\n\r\nIf any questions related to our pricing and payment policy arise, please, contact us at \"sales@onlyoffice.com\":\"mailto:sales@onlyoffice.com\". For solving any technical problems you face do not hesitate to write to \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936225,250,'pattern_enterprise_admin_trial_warning','ru','Здравствуйте, $UserName,\n\nБлагодарим Вас за то, что Вы опробовали ONLYOFFICE. Сегодня должен закончиться пробный период для серверной версии Enterprise Edition.\n\nЧтобы продолжить ее использование, перейдите на \"Страницу с ценами на серверную версию\":\"http://www.onlyoffice.com/enterprise-edition.aspx\", где можно ознакомиться со всеми тарифными планами и выбрать наиболее подходящий, или купите подписку Enterprise Edition Standard \"прямо сейчас\":\"$PricingPage\".\n\nЕсли у вас остались вопросы относительно ценовой политики, пожалуйста, свяжитесь с нами по адресу электронной почты  \"sales@onlyoffice.com\":\"sales@onlyoffice.com\". По любым техническим вопросам, пожалуйста, обращайтесь по адресу \"support@onlyoffice.com\":\"support@onlyoffice.com\"',NULL,'2016-12-16 14:21:34','text',2,NULL,'Svetlana'),(950670,250,'pattern_enterprise_admin_trial_warning_before7','de','Sehr geehrte/r Frau/Herr $UserName,\n\nVielen Dank für Ihr Interesse an ONLYOFFICE Service. Hoffentlich läuft alles bestens! Wir erinnern Sie daran, dass Probezeit für Ihre Enterprise Edition in fünf Tagen vorbei wird.\n\nBitte überprüfen Sie alle verfügbaren Preispläne für Enterprise Edition und wählen Sie die am besten geeignete Lösung für Ihr Unternehmen.\n\n$GreenButton\n\n$BlueButton\n\nFalls Sie Fragen zur Preisgestaltung und Zahlungsbedingungen haben, kontaktieren Sie uns unter \"sales@onlyoffice.com\":\"mailto:sales@onlyoffice.com\". Sollten Sie technische Probleme, Bemerkungen oder Tipps haben: nehmen Sie dann Kontakt zu uns auf: \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n\n\n',NULL,'2017-02-06 08:31:12','text',2,NULL,'Evgenia'),(950896,250,'pattern_enterprise_admin_trial_warning_before7','es','Buenos días, $UserName,\n\nGracias a Usted por trabajar con el servicio ONLYOFFICE. Esperamos que todo esté bien. Queremos recordar, que el periodo de prueba para la versión de servidor Enterprise Edition expirará al cabo de 7 días.\n\nPor favor, entérese de todos los planes de precios disponibles para Enterprise Edition y elija lo más apropiado.\n\n$GreenButton\n\n$BlueButton\n\nSi tiene algunas preguntas adicionales relacionadas con la política de precios, por favor, contáctenos por correo \"sales@onlyoffice.com\":\"sales@onlyoffice.com\". Si tiene algunas preguntas técnicas, por favor, contáctenos por correo \"support@onlyoffice.com\":\"support@onlyoffice.com\"',NULL,'2017-02-10 08:37:23','text',2,NULL,'Ekaterina.Heidel'),(950687,250,'pattern_enterprise_admin_trial_warning_before7','fr','Bonjour $UserName,\n\nNous vous remercions de bien vouloir essayer le service ONLYOFFICE. Nous espérons que tout va bien. Nous vous informons que la période d\'essai de Enterprise Edition se termine dans sept jours. \n\nVeuillez consulter les plans tarifaires disponibles pour Enterprise Edition et choisissez le tarif le plus approprié.\n\n$GreenButton\n\n$BlueButton\n\nSi vous avez des questions consernant les tarifs et les paiements, contactez-nous à \"sales@onlyoffice.com\":\"mailto:sales@onlyoffice.com\". Pour des questions techniques, vous pouvez utiliser l\'adresse suivante \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"',NULL,'2017-02-06 10:31:23','text',2,NULL,'Nadine Yablonskaya'),(934205,250,'pattern_enterprise_admin_trial_warning_before7','Neutral','Dear $UserName,\r\n\r\nThank  you for checking out ONLYOFFICE service. Hope, everything\'s  going fine. We just want to remind you that the trial period for your Enterprise Edition will be over in seven days. \r\n\r\nPlease, check all the available pricing plans for Enterprise Edition and choose the most suitable rate for your business.\r\n\r\n$GreenButton\r\n\r\n$BlueButton\r\n\r\nIf any questions related to our pricing and payment policy arise, please, contact us at \"sales@onlyoffice.com\":\"mailto:sales@onlyoffice.com\". For solving any technical problems you face do not hesitate to write to \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936222,250,'pattern_enterprise_admin_trial_warning_before7','ru','Здравствуйте, $UserName,\n\nБлагодарим Вас за работу с сервисом ONLYOFFICE. Надеемся, всё в порядке. Мы просто хотим напомнить, что пробный период дл