ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-10 08:37:29','text',2,NULL,'Ekaterina.Heidel'),(946356,250,'pattern_enterprise_admin_user_crm_tips','fi','Hyvä $UserName,\n\nJoskus kaikkein hyödyllisimmät työkalut eivät ole kaikkein ilmeisimpiä. On aina paljon löydettävää, joten teemme parhaimpamme, jotta voimme opastaa sinua tutustumaan nettitoimistosi jokaiseen nurkkaan. \n\nTässä on Top 5 ${LetterLogoText} Asiakkuudenhallinnan ominaisuutta, joista et ole ehkä tietoinen:\n\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nJos tarvitset apua portaalisi käytössä, niin kutsumme sinut \"Tukikeskukseemme\":\"https://helpcenter.onlyoffice.com\" tai vieraile \"Foorumissa\":\"http://cloud.onlyoffice.org\".\n\nParhain terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-16 19:30:41','text',2,NULL,'Arto Ryynanen'),(950682,250,'pattern_enterprise_admin_user_crm_tips','fr','Bonjour $UserName,\n\nParfois les outils les plus nécessaires ne sont pas si visibles. Il y a toujours beaucoup à découvrir, c\'est pourquoi nous faisons tout possible pour vous guider à travers chaque coin de votre bureau dans le nuage. \n\nVoici un top 5 des fonctions ONLYOFFICE CRM que vous avez pu rater:\n\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nSi vous avez des questions consernant le travail avec le portail, nous vous invitons à consulter notre \"Centre d\'aide \":\"https://helpcenter.onlyoffice.com\".\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-06 10:10:30','text',2,NULL,'Nadine Yablonskaya'),(934206,250,'pattern_enterprise_admin_user_crm_tips','Neutral','Dear $UserName,\r\n\r\nSometimes the most useful tools are not the most obvious. There is always much to be discovered, so we do our best to guide you through the every single corner of your office. \r\n\r\nHere is the Top 5 ONLYOFFICE CRM features which you might have missed:\r\n\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936219,250,'pattern_enterprise_admin_user_crm_tips','ru','Здравствуйте, $UserName,\n\nИногда самые полезные инструменты не так очевидны. Многое надо еще обнаружить, поэтому мы постараемся продемонстрировать Вам каждый уголок вашего офиса. \n\nВот 5 возможностей ONLYOFFICE CRM, которые вы могли не заметить:\n\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 13:47:25','text',2,NULL,'Svetlana'),(950674,250,'pattern_enterprise_admin_user_docs_tips','de','Sehr geehrte/r Frau/Herr $UserName,\n\nViele Unternehmen - auch kleine und mittlere bewältigen täglich ein hohes Dokumentenaufkommen: Verträge, Berichte, Rechnungen usw. Nutzen Sie diese 7 einfache Tipps und Tricks, um effizienter zu arbeiten.\n\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItem6 $TableItem7 $TableItemsBtm\n$GreenButton\n\nBenötigen Sie Unterstützumg bei der Arbeit mit Ihrem Portal, besuchen Sie unser \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-06 09:01:29','text',2,NULL,'Evgenia'),(950811,250,'pattern_enterprise_admin_user_docs_tips','es','Buenos días, $UserName,\n\nCasi en cada negocio hay que tratar con documentos cada día - contratos, reportes, libros blancos, facturas etc. - y perder mucho tiempo en su circulación. Para aumentar efectividad de trabajo con documentos y reducir tiempo y esfuerzos, use estos 7 consejos sencillos.\n\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItem6 $TableItem7 $TableItemsBtm\n$GreenButton\n\nSi le necesita ayuda al trabajar con el portal, le invitamos a nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-08 07:19:14','text',2,NULL,'Ekaterina.Heidel'),(946346,250,'pattern_enterprise_admin_user_docs_tips','fi','Hyvä $UserName,\n\nMelkein jokaisessa liiketoiminnassa joudumme käyttämään päivittäin asiakirjoja - sopimuksia, raportteja, papereita, laskuja jne. - ja hukkaamme huomattavan määrän aikaa niitä käsitellessä. Jotta voit toimia tehokkaamminen ja vähentää aikaa paperitöihin, niin voit hyödyntää seuraavia seitsemää yksinkertaista vinkkiä.\n\n\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItem6 $TableItem7 $TableItemsBtm\n$GreenButton\n\nJos haluat apua portaalin käytössä, niin me kutsumme sinut tutustumaan \"Tukikeskukseemme\":\"https://helpcenter.onlyoffice.com\" tai vieraile \"Foorumissa\":\"http://cloud.onlyoffice.org\".\n\nParhain terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-16 19:04:09','text',2,NULL,'Arto Ryynanen'),(950224,250,'pattern_enterprise_admin_user_docs_tips','fr','Bonjour $UserName,\n\nPresque chaque jour nous avons besoin de travailler sur des documents différents - rapports, contrats, factures, livres blancs, etc. - et perdons beaucoup de temps pour leur déplacement. Pour travailler plus efficacement et réduire le temps et l\'effort nécessaires à la gestion des documents, vous pouvez utiliser ces 7 conseils et astuces simples.\n\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItem6 $TableItem7 $TableItemsBtm\n$GreenButton\n\nSi vous avez besoin de l\'aide avec votre portail, nous vous invitons à consulter notre \"Centre d\'aide\" :\"https://helpcenter.onlyoffice.com\".\n\nSincerement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-01 06:52:47','text',2,NULL,'Nadine Yablonskaya'),(934193,250,'pattern_enterprise_admin_user_docs_tips','Neutral','Dear $UserName,\r\n\r\nIn almost every business we are to deal with documents every day - contracts, reports, white papers, invoices, etc. - and waste a lot of time moving it around. To help you work more efficiently and reduce time and efforts spent on paperwork, make use of these 7 simple tips and tricks.\r\n\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItem6 $TableItem7 $TableItemsBtm\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936197,250,'pattern_enterprise_admin_user_docs_tips','ru','Здравствуйте, $UserName,\n\nПочти в любой сфере деятельности каждый день приходится иметь дело с документами - договорами, отчетами, официальными бумагами, счетами и так далее - и тратить массу времени на их перемещение. Чтобы повысить эффективность работы с документами и сократить затраты времени и сил, воспользуйтесь этими семью простыми советами.\n\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItem6 $TableItem7 $TableItemsBtm\n$GreenButton\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 11:51:09','text',2,NULL,'Svetlana'),(950830,250,'pattern_enterprise_admin_user_mail_tips','de','E-Mail ist immer noch der beste und beliebteste Weg für die Kommunikation mit Kunden und Partnern. Täglich erhalten wir eine große Menge der Nachrichten mit der Hilfe mehrerer E-Mail-Konten von verschiedenen Dienste-Anbietern und es scheint unmöglich zu sein, etwas Wichtiges zu verpassen.\n\nNutzen Sie diese 5 Tipps und Tricks, um Ihre E-Mail-Erfahrung zu verbessern:\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nHaben Sie das Mail-Server mit Ihrem eigenen Domain-Namen noch nicht konfiguriert? - Folgen Sie den Anweisungen \"hier\":\"https://helpcenter.onlyoffice.com/gettingstarted/mail.aspx#MailServer_block\".\nBenötigen Sie Unterstützumg bei der Arbeit mit Ihrem Portal, besuchen Sie unser \"Hilfe-Center:\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-08 09:53:07','text',2,NULL,'Evgenia'),(951033,250,'pattern_enterprise_admin_user_mail_tips','es','Correo electrónico sigue siendo la mejor y más popular forma de comunicarse con los clientes y socios. Todos los días recibimos una gran cantidad de mensajes a través de varias cuentas de correo electrónico de diferentes servicios y puede parecer imposible no pasar por alto nada importante.\n\nHaga uso de estos 5 consejos y trucos para organizar y mejorar su trabajo con correo electrónico:\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\n¿Aún no se configura el servidor de correo utilizando su propio nombre de dominio? - Siga las instrucciones de \"aquí\":\"https://helpcenter.onlyoffice.com/gettingstarted/mail.aspx#MailServer_block\".\nSi Usted necesita ayuda con su portal, le invitamos a navegar por nuestro \"Centro de ayuda\": \"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-16 07:27:49','text',2,NULL,'Ekaterina.Heidel'),(949400,250,'pattern_enterprise_admin_user_mail_tips','fr','La messagerie électronique reste le meilleur et le plus populaire moyen de communication avec les clients et les partenaires. Chaque jour, nous recevons une grande quantité de messages en utilisant plusieurs comptes de messagerie à partir de différents services.Il peut sembler impossible de ne pas rater quelque chose d\'important.\n\nUtilisez ces 5 trucs pour organiser et améliorer votre expérience email:\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nVous n\'avez pas encore configuré le serveur de messagerie à l\'aide de votre propre nom de domaine? - Suivez les \"instructions\" suivantes :\"https://helpcenter.onlyoffice.com/gettingstarted/mail.aspx#MailServer_block\".\n\nSi vous avez besoin d\'aide pour le travail avec votre portail, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nSincèrement vôtre,\nÉquipe ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-26 13:21:17','text',2,NULL,'Nadine Yablonskaya'),(934207,250,'pattern_enterprise_admin_user_mail_tips','Neutral','Email is still the best and most popular way to communicate with customers and partners. Every day we receive a great amount of messages using multiple email accounts from different services and it may seem impossible not to miss anything important.\r\n\r\nMake use of these 5 tips and tricks to get organized and improve your email experience:\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\r\n$GreenButton\r\n\r\nStill not yet configured the mail server using your own domain name? - Follow the instructions \"here\":\"https://helpcenter.onlyoffice.com/gettingstarted/mail.aspx#MailServer_block\".\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936109,250,'pattern_enterprise_admin_user_mail_tips','ru','Электронная почта по-прежнему остается самым лучшим и популярным способом общения с клиентами и партнерами. Ежедневно мы получаем огромное количество писем на множество аккаунтов в разных сервисах, и может показаться невозможным не пропустить что-нибудь важное.\n\nВоспользуйтесь этими пятью советами, чтобы оптимизировать работу с почтой:\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nВы еще не настроили почтовый сервер, используя собственное доменное имя? - Следуйте этим \"инструкциям\":\"https://helpcenter.onlyoffice.com/gettingstarted/mail.aspx#MailServer_block\".\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-15 14:37:34','text',2,NULL,'Svetlana'),(950191,250,'pattern_enterprise_admin_user_team_tips','de','Zusammenarbeit ist die effektivste Möglichkeit bei der Lösung der Probleme. Doch selbst im Team zu arbeiten, ist es nicht einfach. ONLYOFFICE bietet Ihnen eine Reihe von Tools, die Ihnen helfen, Ihre Teamarbeit zu verbessern::\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nBenötigen Sie Unterstützung in Ihrem Portal, besuchen Sie unser \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit ferundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-31 08:50:16','text',2,NULL,'Evgenia'),(950657,250,'pattern_enterprise_admin_user_team_tips','es','Colaboración es un modo más eficaz para solucionar un problema. Pero trabajar en equipo no es siempre sencillo. ONLYOFFICE ofrece un juego de herramientas para organizar una colaboración eficaz:\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nSi Usted necesita ayuda al trabajar con su portal, visite nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-06 07:18:38','text',2,NULL,'Ekaterina.Heidel'),(938374,250,'pattern_enterprise_admin_user_team_tips','fi','Yhteistoiminta on eräs tehokkaimmista tavoista ratkaista ongelma. Mutta tiimissä työskentely ei ole aina helppoa. ${LetterLogoText} tarjoaa sinulle työkalusetin, joka on suunniteltu tukemaan tiimisi yhteistoimintaa:\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nJos haluat apua portaalisi käytössä, suosittelemme tutustumista meidän \"Tukikeskukseen\":\"https://helpcenter.onlyoffice.com\".\n\nParhain Terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-10 04:40:58','text',2,NULL,'Arto Ryynanen'),(949557,250,'pattern_enterprise_admin_user_team_tips','fr','La collaboration est le moyen le plus efficace pour résoudre un problème. Mais le travail en équipe n’est toujours facile. ONLYOFFICE vous propose un ensemble d’outils conçus pour améliorer la collaboration au sein de l\'équipe :\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nSi vous avez des questions concernant le travail avec le portail, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-27 08:12:44','text',2,NULL,'Nadine Yablonskaya'),(934208,250,'pattern_enterprise_admin_user_team_tips','Neutral','Collaboration is the most effective way to solve a problem. But working as a team is not always easy. ONLYOFFICE offers you a set of tools designed to help you to improve your team collaboration:\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936182,250,'pattern_enterprise_admin_user_team_tips','ru','Совместная работа - самый действенный способ решить проблему. Но работать в команде не всегда просто. ONLYOFFICE предоставляет набор инструментов для организации эффективной совместной работы:\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 10:30:31','text',2,NULL,'Svetlana'),(950821,250,'pattern_enterprise_admin_welcome','de','Sehr geehrte/r Frau/Herr $UserName,\n\nUm das Management-Portal schnell und einfach zu machen, ONLYOFFICE bietet Ihnen Control Panel, eine Reihe von Automatisierungstools, welche Ihnen ermöglichen:\n\n- Standardlogo des Portals zu ändern, um Ihr Web-Office zu umbenennen;\n\n- HTTPS einzuschalten, um Ihre persönlichen Daten zu schützen;\n\n- Benutzer von Ihrem LDAP-Server zu importieren;\n\n- Datenbackup-Portal auf regelmäßiger Basis zu erstellen, um Datenverlust zu vermeiden;\n\n- Verfügbare Updates von $ {LetterLogoText}zu prüfen;\n\n- Anmeldeverlauf zu verfolgen und Audit-Trail Daten zu erhalten.\n\n$GreenButton\n\nMehr Informationen finden Sie in unserem \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-08 08:40:19','text',2,NULL,'Evgenia'),(962231,250,'pattern_enterprise_admin_welcome','es','Buenos días, $UserName,\n\nPara facilitar la gestión del portal, ONLYOFFICE proporciona Panel de Control, un juego de herramientas de automatización, que le permite::\n\n- Cambiar los logos de portal predeterminados para usar su oficina web bajo su marca;\n\n- Activar HTTPS para proteger y mantener seguros los datos de portal;\n\n- Importar usuarios del servidor LDAP;\n\n- Hacer copias de seguridad de portal de manera regular para evitar la pérdida de datos;\n\n- Verificar las actualizaciones de ONLYOFFICE disponibles;\n\n- Monitorizar historial de conexión al sistema y recibir datos de rastro de auditoría.\n\n$GreenButton\n\nPara recibir una información adicional invitamos a visitar nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-04-03 13:31:32','text',2,NULL,'Ekaterina.Heidel'),(950315,250,'pattern_enterprise_admin_welcome','fr','Bonjour $UserName,\n\nPour faire la gestion du portail rapide et facile, vous pouvez utiliser le Panneau de configuration, un ensemble d\'outils d\'automatisation qui vous permet de :\n\n- Modifier des logos par défaut du portail pour utiliser un bureau virtuel sous votre marque ;\n\n- Activer le protocole HTTPS pour garder vos données du portail en sécurité ;\n\n- Importer des utilisateurs à partir de votre serveur LDAP ;\n\n- Sauvegarder vos données du portail sur une base régulière afin d\'éviter toute perte de données ;\n\n- Vérifier des mises à jour de ONLYOFFICE disponibles ;\n\n- Suivre une historique de connexion et recevoir les données du piste d\'audit.\n\n$GreenButton\n\nPour en savoir plus, consultez notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-01 11:53:07','text',2,NULL,'Nadine Yablonskaya'),(934123,250,'pattern_enterprise_admin_welcome','Neutral','Dear $UserName,\r\n\r\nTo make the portal management quick and easy, ONLYOFFICE provides you with Control Panel, a set of automation tools that allows you to:\r\n\r\n- Change the default portal logos to brand your web-office;\r\n\r\n- Turn on HTTPS to keep your portal data secure;\r\n\r\n- Import users from your LDAP server;\r\n\r\n- Backup your portal data on a regular basis to avoid any data-loss;\r\n\r\n- Check for available ONLYOFFICE updates;\r\n\r\n- Track login history and receive the audit trail data.\r\n\r\n$GreenButton\r\n\r\nFor more information we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936221,250,'pattern_enterprise_admin_welcome','ru','Здравствуйте, $UserName,\n\nЧтобы упростить управление порталом, в ONLYOFFICE предоставляется Панель управления, набор инструментов автоматизации, с помощью которых вы можете:\n\n- Заменить стандартные логотипы портала, чтобы использовать виртуальный офис под вашим брендом;\n\n- Включить HTTPS для обеспечения безопасности данных портала;\n\n- Импортировать пользователей с сервера LDAP;\n\n- Создавать резервные копии портала на регулярной основе для предотвращения потери данных;\n\n- Проверять наличие доступных обновлений ONLYOFFICE;\n\n- Отслеживать историю входов в систему и получать данные журнала аудита.\n\n$GreenButton\n\nДля получения дополнительной информации приглашаем вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 13:52:12','text',2,NULL,'Svetlana'),(950271,250,'pattern_enterprise_admin_without_activity','de','Sehr geehrte/r Frau/Herr $UserName,\n\nMein Name ist Katarina und ich vertrete ONLYOFFICE. Ich startete meine Arbeit hier seit langem, am Anfang des Projekts. Glauben Sie mir, ich weiß alles über diese Anwendung!\n\nWie läuft es? Ist alles klar? Teilen Sie bitte Ihre Eindrücke mit. Ihr Feedback ist das beste Lob!\n\nWenn Sie Fragen bezüglich der ONLYOFFICE-Verwendung haben oder Hilfe benötigen, geben Sie mir bitte Bescheid. Verbesserungsvorschläge und Ideen rund um ONLYOFFICE senden Sie mir einfach per Email.\n\nSeien Sie immer produktiv und greifen Sie auf Ihr Büro unter \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" von überall zu!\n\nKontaktieren Sie mich bitte unter dieser E-Mail Adresse \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\", wenn Sie Fragen haben.',NULL,'2017-02-01 09:03:27','text',2,NULL,'Evgenia'),(951036,250,'pattern_enterprise_admin_without_activity','es','Buenos días, $UserName,\n\nMe llamo Katarina y trabajo para ONLYOFFICE. Empecé a trabajar aquí hace mucho tiempo, en la fase inicial de este proyecto. Créame, yo sé todo sobre esta aplicación!\n\n¿Cómo está su trabajo con el servicio? ¿Todo está claro? Por favor, comparta sus impresiones con nosotros. Comentarios de nuestros clientes es una contribución mejor al mejoramiento del producto.\n\nSi USted tiene algunas preguntas acerca de como usar ONLYOFFICE o necesita ayuda para empezar el trabajo con el producto, solo déjeme saber. También Usted puede enviarme sus comentarios o ideas acerca de mejoramiento de ONLYOFFICE.\n\nSea productivo y acceda a su oficina \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" desde cualquier parte del mundo.\n\nUsted siempre puede contactarme por correo \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\".',NULL,'2017-02-16 10:33:15','text',2,NULL,'Ekaterina.Heidel'),(950833,250,'pattern_enterprise_admin_without_activity','fr','Bonjour $UserName,\n\nJe m\'appelle Katarina et je travaille pour ONLYOFFICE. J\'ai commencé à travailler ici dès le début du projet. Vous pouvez me croire, je connais tout sur ce logiciel !\n\nAvez-vous des questions lors de l\'utilisation du service?  N\'hésitez pas à me faire part de vos questions et commentaires. Toutes vos suggestions sont les bienvenues !\n\nSi vous avez des questions concernant l\'utilisation de ONLYOFFICE ou besoin d’aide pour commencer à utiliser le service, laissez-moi savoir. Vous pouvez également m’envoyer vos commentaires ou vos idées pour améliorer ONLYOFFICE.\n\nSoyez productif et accédez à votre bureau \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" accessible depuis n\'importe où !\n\nSi vous avez besoin d\'aide, écrivez-moi à l\'adresse \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\".',NULL,'2017-02-08 11:25:37','text',2,NULL,'Nadine Yablonskaya'),(934187,250,'pattern_enterprise_admin_without_activity','Neutral','Hello $UserName,\r\n\r\nMy name is Katarina and I work for ONLYOFFICE. I started my work here long time ago, at the very beginning of the project. Believe me, I know everything about this application!\r\n\r\nHow is it going there? Is everything clear? Please share with me your impression. The feedback is the best contribution!\r\n\r\nIf you have questions regarding how to use ONLYOFFICE or need help to start using it, just let me know. You can also send me feedback or ideas to help improve ONLYOFFICE.\r\n\r\nBe productive and access your office at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" from anywhere!\r\n\r\nMail me at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\" whenever you need help.','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936183,250,'pattern_enterprise_admin_without_activity','ru','Добрый день, $UserName,\n\nМеня зовут Катерина. Я работаю в ONLYOFFICE очень давно, с самого начала этого проекта. Поверьте, я знаю все об этом приложении!\n\nКак идет работа с сервисом? Все ли понятно? Пожалуйста, поделитесь с нами своими впечатлениями. Отзывы пользователей - это лучший вклад в развитие продукта!\n\nЕсли у Вас есть вопросы по поводу использования ONLYOFFICE или Вам нужна помощь, чтобы начать работу с ним, просто дайте мне знать. Вы также можете присылать мне свои комментарии или идеи по улучшению ONLYOFFICE.\n\nОставайтесь продуктивными, имея доступ к своему офису \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" из любой точки мира!\n\nВы всегда можете написать мне по адресу \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\".',NULL,'2016-12-16 10:34:08','text',2,NULL,'Svetlana'),(950596,250,'pattern_enterprise_guest_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie sind als Gast auf das Portal \"${__VirtualRootPath}\":\"$InviteLink\" eingeladen worden. Bitte akzeptieren Sie die E-Mail-Einladung und folgen Sie diesem Link. Der Link ist 7 Tage lang gültig:\n\np=. \"Klicken Sie hier, um dem Portal beizutreten\":\"$InviteLink\"\n\nWenn Sie Unterstützung bei der Arbeit mit dem Portal benötigen, besuchen Sie under \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE Support Team\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"',NULL,'2017-02-03 09:17:51','text',2,NULL,'Evgenia'),(950996,250,'pattern_enterprise_guest_activation','es','Buenos días, $UserName,\n\nUsted ha sido invitado al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" como el visitante. Para aceptar la invitación, por favor, siga el enlace abajo, este anlace es válido solo durante 7 días:\n\np=. \"Pulse aquí para hacerse el miembro del portal\":\"$InviteLink\"\n\nSi necesita ayuda al trabajar con el portal, le invitamos a nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-14 09:20:24','text',2,NULL,'Ekaterina.Heidel'),(950765,250,'pattern_enterprise_guest_activation','fr','Bonjour $UserName,\n\nVous êtes invité en tant qu\'un utilisateur invité au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Veuillez accepter l’invitation en suivant le lien ci-dessous. Ce lien n\'est valable que pour une durée de 7 jours :\n\np=. \"Cliquez ici pour rejoindre le portail\":\"$InviteLink\"\n\nSi vous avez besoin de l\'aide avec votre portail, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nSincérement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-07 08:21:39','text',2,NULL,'Nadine Yablonskaya'),(934159,250,'pattern_enterprise_guest_activation','Neutral','Dear $UserName,\r\n\r\nYou have been invited as a guest user to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Please accept the invitation by following the link below, it is only valid for 7 days:\r\n\r\np=. \"Click here to join the portal\":\"$InviteLink\"\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:52','text',2,NULL,'Console'),(936233,250,'pattern_enterprise_guest_activation','ru','Здравствуйте, $UserName,\n\nВас пригласили на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" в качестве гостя. Чтобы принять приглашение, перейдите по следующей ссылке, она действительна только 7 дней:\n\np=. \"Нажмите сюда, чтобы стать участником портала\":\"$InviteLink\"\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 14:48:36','text',2,NULL,'Svetlana'),(950607,250,'pattern_enterprise_guest_welcome','de','Sehr geehrte/r Frau/Herr $UserName,\n\nIhr Gastprofil wurde erfolgreich dem Portal unter\"${__VirtualRootPath}\":\"${__VirtualRootPath}\" hinzugefügt.\n\nh3.Fangen Sie die Arbeit mit Ihrem Portal an \n\n# Bearbeiten Sie Ihr \"Profil\":\"$MyStaffLink\", um Personalangaben und Kontaktdaten hinzuzufügen.\n# Sehen Sie an und kommentieren Sie Inhalte, die für alle Portalbenutzer in Modul \"Community\":\"${__VirtualRootPath}/products/community/\", \"Projekte\":\"${__VirtualRootPath}/products/projects/\" zugänglich sind.\n# Fügen Sie Dateien hinzu und laden Sie die verfügbaren Dateien in Modul \"Dokumente\":\"${__VirtualRootPath}/products/files/\" herunter.\n# Gestalten Sie Ihren Arbeitsprozess mit eingebautem \"Kalender\":\"${__VirtualRootPath}/addons/calendar/\".\n# Starten Sie \"Talk\":\"${__VirtualRootPath}/addons/talk/\" um mit Ihren Teammitgliedern online zu chatten.\n\n$GreenButton\n\nWenn Sie Hilfe benötigen, besuchen Sie unser \"Hilfe-Center\":\"http://helpcenter.onlyoffice.com/\".\n\nEin kleiner Tipp: Nutzen Sie kostenlose ONLYOFFICE Desktop Editors, wenn Sie Dokumente, Tabellen und Präsentationen ohne Internetverbindung bearbeiten möchten. \"Jetzt herunterladen\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-03 10:22:18','text',2,NULL,'Evgenia'),(951019,250,'pattern_enterprise_guest_welcome','es','Buenos días, $UserName,\n\nSu perfil de visitante ha sido añadido con éxito al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Empieze a trabajar con su portal:\n\n# Edite su \"perfil\":\"$MyStaffLink\" para añadir los detalles personales y de contacto.\n# Visualice y comente el contenido disponible para todos los usuarios de portal en los módulos \"Comunidad\":\"${__VirtualRootPath}/products/community/\" y \"Proyectos\":\"${__VirtualRootPath}/products/projects/\".\n# Añada y descargue archivos disponibles para Usted en el módulo \"Documentos\":\"${__VirtualRootPath}/products/files/\".\n# Planee su horario de trabajo con ayuda de \"Calendario\" incorporado:\"${__VirtualRootPath}/addons/calendar/\".\n# Inicie \"Chat\":\"${__VirtualRootPath}/addons/talk/\" para chatear con otros usuarios de portal en línea.\n\n$GreenButton\n\nSi necesita ayuda al trabajar con portal, le invitamos a nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\".\n\nConsejo: use editores desktop gratuitos de ONLYOFFICE, si le necesita editar documentos, hojas de cálculo y presentaciones sin conexión al Internet. \"Descargar ahora\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-15 12:28:52','text',2,NULL,'Ekaterina.Heidel'),(950805,250,'pattern_enterprise_guest_welcome','fr','Bonjour $UserName,\n\nVotre profil d\'invité a été ajouté au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Commencez à utiliser le portail et:\n\n# Modifiez votre \"profil\":\"$MyStaffLink\" en ajoutant vos données personnelles et de contact.\n# Parcourez et commentez le contenu du portail disponible pour tous les utilisateurs dans le modules \"Communauté\":\"${__VirtualRootPath}/products/community/\", \"Projets\":\"${__VirtualRootPath}/products/projects/\".\n# Ajoutez et téléchargez les fichiers disponibles dans le module \"Documents\":\"${__VirtualRootPath}/products/files/\".\n# Organisez votre horaire avec le \"Calendrier\" intégré :\"${__VirtualRootPath}/addons/calendar/\".\n# Démarrez le \"Chat\" :\"${__VirtualRootPath}/addons/talk/\" pour communiquer en ligne avec les autres utilisateurs du portail.\n\n$GreenButton\n\nSi vous avez besoin d\'aide avec votre portail, nous vous invitons à consulter notre \"Centre d\'aide \":\"https://helpcenter.onlyoffice.com\".\n\nPetite astuce: si vous avez besoin de travailler sur des documents, classeurs, présentations hors connexion, vous pouvez utiliser les éditeurs de bureau ONLYOFFICE gratuits. \"Téléchargez maintenant\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nSincérement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-07 12:43:42','text',2,NULL,'Nadine Yablonskaya'),(934160,250,'pattern_enterprise_guest_welcome','Neutral','Dear $UserName,\r\n\r\nYour guest profile has been successfully added to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\r\n\r\nh3.Get started with your portal:\r\n\r\n# Edit your \"profile\":\"$MyStaffLink\" to add personal and contact details.\r\n# View and comment the content open available for all portal users in the \"Community\":\"${__VirtualRootPath}/products/community/\", \"Projects\":\"${__VirtualRootPath}/products/projects/\" modules.\r\n# Add and download files available for you in the \"Documents\":\"${__VirtualRootPath}/products/files/\" module.\r\n# Organize your schedule with the built-in \"Calendar\":\"${__VirtualRootPath}/addons/calendar/\".\r\n# Start \"Talk\":\"${__VirtualRootPath}/addons/talk/\" to chat with other portal users online.\r\n\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nJust a tip: use free ONLYOFFICE Desktop Editors, if you need to edit documents, spreadsheets and presentations without Internet connection. \"Download now\":\"http://www.onlyoffice.com/desktop.aspx\"\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:52','text',2,NULL,'Console'),(936248,250,'pattern_enterprise_guest_welcome','ru','Здравствуйте, $UserName,\n\nВаш гостевой профиль успешно добавлен на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Начните работать со своим порталом:\n\n# Отредактируйте свой \"профиль\":\"$MyStaffLink\", добавив личную и контактную информацию.\n# Просматривайте и комментируйте контент, доступный для всех пользователей портала в модулях \"Сообщество\":\"${__VirtualRootPath}/products/community/\" и \"Проекты\":\"${__VirtualRootPath}/products/projects/\".\n# Добавляйте и скачивайте файлы, доступные для Вас, в модуле \"Документы\":\"${__VirtualRootPath}/products/files/\".\n# Планируйте свой график с помощью встроенного \"Календаря\":\"${__VirtualRootPath}/addons/calendar/\".\n# Запустите \"Чат\":\"${__VirtualRootPath}/addons/talk/\", чтобы общаться с другими пользователями портала онлайн.\n\n$GreenButton\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nНебольшой совет: используйте бесплатные десктопные редакторы ONLYOFFICE, если вам требуется редактировать текстовые документы, электронные таблицы и презентации без подключения к интернету. \"Скачать сейчас\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-19 07:58:39','text',2,NULL,'Svetlana'),(950612,250,'pattern_enterprise_user_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\n$__AuthorName hat Sie eingeladen, dem ONLYOFFICE Portal bezutreten, um die interne Zusammenarbeit zu verbessern. Ihre Portaladresse ist \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Das Hinzufügen dieses Links dem Lesezeichen ist eine gute Idee. Per Lesezeichen speichern Sie häufig genutzte Webadressen für einen schnellen Zugriff).\n\nUm die Einladung anzunehmen, folgen Sie dem Link unten. Der Link ist nur für 7 Tage gültig:\n\np=. \"Klicken Sie hier, um dem Portal beizutreten\":\"$InviteLink\"\n\nBenötigen Sie Unterstützumg bei der Arbeit mit Ihrem Portal, besuchen Sie unser \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-03 10:35:13','text',2,NULL,'Evgenia'),(950777,250,'pattern_enterprise_user_activation','es','Buenos días, $UserName,\n\n$__AuthorName ha invitado a Usted a participar en ONLYOFFICE - portal de su equipo para organizar un trabajo en colaboración efectivo - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (le recomendamos que añada este enlace a marcadores: es muy probable que Usted lo use a menudo).\n\nUsted puede aceptar esta invitación siguiendo el enlace abajo, este enlace es válido durante 7 días:\n\np=. \"Pulse aquí para participar en el portal\":\"$InviteLink\"\n\nSi le necesita ayuda al trabajar con el portal, le invitamos a visitar nuestro \"Centro de Ayuda\"::\"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-07 09:08:34','text',2,NULL,'Ekaterina.Heidel'),(946341,250,'pattern_enterprise_user_activation','fi','Hyvä $UserName,\n\n$__AuthorName on kutsunut sinut liittymään: ${LetterLogoText} - tiimisi portaaliin, mikä auttaa sisäistä yhteistoimintaa. Portaalisi osoite on \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (tämän osoitteen lisääminen kirjanmerkkeihisi voi olla hyvä idea, koska tulet käyttämään sitä paljon).\n\nVoit hyväksyä kutsun seuraamalla allaolevaa linkkiä, mikä on voimassa vain 7 päivää:\n\np=. \"Klikkaa tätä liittyäksesi portaaliin\":\"$InviteLink\"\n\nJos haluat tukea portaalisi käytössä, niin me kutsumme sinun tutustumaan \"Tukikeskukseemme\":\"https://helpcenter.onlyoffice.com\" tai vierailemaan \"Foorumissa\":\"http://cloud.onlyoffice.org\".\n\n\nParhain terveisin,\n${LetterLogoText} Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-16 18:53:51','text',2,NULL,'Arto Ryynanen'),(949600,250,'pattern_enterprise_user_activation','fr','Bonjour $UserName,\n\n$__AuthorName vous a invité à rejoindre ONLYOFFICE - le portail de votre équipe visant à améliorer la coopération interne. L\'adresse de votre portail est \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (ajoutez ce lien à vos favoris, probablement vous allez l\'utiliser souvent).\n\nVous pouvez accepter le lien en suivant le lien suivant ( il est valable pendant 7 jours):\n\np=. \"Cliquez ici pour rejoindre le portail\":\"$InviteLink\"\n\nSi vous avez des questions consernant le travail avec le portail, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-27 10:11:39','text',2,NULL,'Nadine Yablonskaya'),(934135,250,'pattern_enterprise_user_activation','Neutral','Dear $UserName,\r\n\r\n$__AuthorName has invited you to join ONLYOFFICE - your team\'s portal that would enchance internal cooperation. Your portal address is \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (adding this link to your bookmarks is a good idea, you are most likely to get to use it a lot).\r\n\r\nYou can accept the invitation by following the link below, it is only valid for 7 days:\r\n\r\np=. \"Click here to join the portal\":\"$InviteLink\"\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936189,250,'pattern_enterprise_user_activation','ru','Здравствуйте, $UserName,\n\n$__AuthorName приглашает Вас стать участником ONLYOFFICE - портала вашей команды для организации эффективной совместной работы. Адрес Вашего портала - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (советуем добавить эту ссылку в закладки: по всей вероятности, Вы будете ей часто пользоваться).\n\nВы можете принять приглашение, перейдя по следующей ссылке, она действительна только 7 дней:\n\np=. \"Нажмите сюда, чтобы стать участником портала\":\"$InviteLink\"\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 11:14:55','text',2,NULL,'Svetlana'),(950822,250,'pattern_enterprise_user_organize_workplace','de','Sehr geehrte/r Frau/Herr $UserName,\n\nMit ${LetterLogoText} haben Sie alle Ihre Daten an einem Ort. Es gibt keine weitere Notwendigkeit für zusätzliche Desktop-Software oder Flash-Laufwerke. Seien Sie produktiv und greifen Sie auf Ihr Office unter \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" von überall zu!\n\nStarten Sie Ihre Migration ins Cloud Office mit diesen 5 Schritten:\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n\n$GreenButton\n\nBenötigen Sie Unterstützung in Ihrem Portal, besuchen Sie unser \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-08 08:43:16','text',2,NULL,'Evgenia'),(950985,250,'pattern_enterprise_user_organize_workplace','es','Estimado(a) $UserName,\n\nCon ${LetterLogoText} Usted tiene todos sus datos almacenados en un solo lugar. No hay más necesidad de programas desktop adicionales o unidades flash. ¡Sea productivo y acceda a su oficina en \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" desde cualquier lugar!\n\nComience su migración a la oficina en la nube con estos 5 pasos:\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n\n$GreenButton\n\nSi Usted necesita ayuda con su portal, le invitamos a navegar por nuestro \"Centro de Ayuda\": \"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-13 13:24:59','text',2,NULL,'Ekaterina.Heidel'),(949178,250,'pattern_enterprise_user_organize_workplace','fr','Bonjour $UserName,\n\nAvec ${LetterLogoText} toutes vos données sont disponibles dans un seul endroit. Il n\'y a plus besoin d\'autres logiciels de bureau ou des lecteurs flash. Soyez productif et accèdez à votre bureau à \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" à partir de n\'importe où !\n\nCommencez votre migration vers le bureau en nuage avec ces 5 étapes :\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n\n$GreenButton\n\nPour plus d\'informations, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nSincèrement vôtre,\nÉquipe ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-26 10:24:19','text',2,NULL,'Nadine Yablonskaya'),(934188,250,'pattern_enterprise_user_organize_workplace','Neutral','Dear $UserName,\r\n\r\nWith ${LetterLogoText} you have all your data stored in one place. There is no more need for additional desktop software or flash drives. Be productive and access your office at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" from anywhere!\r\n\r\nStart your migration to the cloud office with these 5 steps:\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\r\n\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936205,250,'pattern_enterprise_user_organize_workplace','ru','Здравствуйте, $UserName,\n\nС ${LetterLogoText} все инструменты, необходимые Вам в работе, доступны из облачного офиса. Больше нет необходимости устанавливать дополнительное ПО на компьютер и использовать карты памяти. Оставайтесь продуктивными, имея доступ к своему офису \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" из любой точки мира!\n\nНачните свой переезд в облако с 5 шагов:\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n\n$GreenButton\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 12:44:13','text',2,NULL,'Svetlana'),(950304,250,'pattern_enterprise_user_welcome','de','Sehr geehrte/r Frau/Herr $UserName,\n\nIhr Benutzerprofil wurde erfolgreich dem Portal unter\"${__VirtualRootPath}\":\"${__VirtualRootPath}\" hinzugefügt.\n\nh3.Fangen Sie die Arbeit mit Ihrem Portal an \n\n# Bearbeiten Sie Ihr \"Profil\":\"$MyStaffLink\", um Personalangaben und Kontaktdaten hinzuzufügen.\n# Erstellen, bearbeiten und organisieren Sie Ihre Dateien im Modul \"Dokumente\":\"${__VirtualRootPath}/products/files/\".\n# Fügen Sie Ihr E-Mail-Konto dem Modul \"${LetterLogoText} E-Mail\":\"${__VirtualRootPath}/addons/mail/\" hinzu.\n# Erstellen Sie \"Projekte\":\"${__VirtualRootPath}/products/projects/\" und verwalten Sie Ihren Workflow, indem Sie Meilensteine und Aufgaben hinzufügen.\n# Verwalten Sie Ihre Kundenbeziehungen mit Modul \"CRM\"::\"${__VirtualRootPath}/products/community/\" bestimmen Sie Prioritätskontakte, verfolgen Sie Nachrichtenhistorie und Umsatzentwicklung.\n# Nutzen Sie Modul \"Community\":\"${__VirtualRootPath}/products/community/\" um Ihre Blogs, Foren, Ereignisse, Lesezeichen hinzuzufügen.\n# Gestalten Sie Ihren Arbeitsprozess mit eingebautem \"Kalender\":\"${__VirtualRootPath}/addons/calendar/\".\n# Starten Sie \"Talk\":\"${__VirtualRootPath}/addons/talk/\" um mit Ihren Teammitgliedern online zu chatten.\n\n$GreenButton\n\nWenn Sie Hilfe benötigen, besuchen Sie unser \"Hilfe-Center\":\"http://helpcenter.onlyoffice.com/\".\n\nEin zusätzlicher Tipp: Nutzen Sie kostenlose ONLYOFFICE Desktop Editors für die Arbeit an Dokumenten, Tabellen und Präsentationen offline. Schließen Sie die Anwendung an Ihr Portal an, um Zugriff auf Dokumente zu erhalten, die in der Cloud gespeichert sind und arbeiten Sie zusammen daran. \"Jetzt herunterladen\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"',NULL,'2017-02-01 10:31:27','text',2,NULL,'Evgenia'),(951028,250,'pattern_enterprise_user_welcome','es','Buenos días, $UserName,\n\nSu perfil de usuario ha sido añadido con éxito al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Empieze a trabajar con su portal:\n\n# Edite su \"perfil\":\"$MyStaffLink\" para añadir los detalles personales y de contacto.\n# Cree, edite y organice \"Documentos\":\"${__VirtualRootPath}/products/files/\".\n# Añada su cuenta de correo al módulo \"Correo ONLYOFFICE\":\"${__VirtualRootPath}/addons/mail/\".\n# Cree \"Proyectos\":\"${__VirtualRootPath}/products/projects/\" y maneje flujo de trabajo añadiendo hitos y asignando tareas.\n# Maneje relaciones con sus clientes usando el módulo \"CRM\":\"${__VirtualRootPath}/products/crm/\", identifique los contactos de prioridad, monitorice historia de comunicación y rendimiento en ventas.\n# Use \"Comunidad\":\"${__VirtualRootPath}/products/community/\" para crear blogs, comunicarse en foros, añadir eventos y compartir marcadores.\n# Planee su horario de trabajo con ayuda de \"Calendario\":\"${__VirtualRootPath}/addons/calendar/\".\n# Inicie \"Chat\":\"${__VirtualRootPath}/addons/talk/\" para chatear con miembros de su equipo en línea.\n\n$GreenButton\n\nSi necesita ayuda al trabajar con portal, le invitamos a nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\".\n\nUn consejo adicional: use los editores desktop de ONLYOFFICE gratuitos para trabajar con documentos, hojas de cálculo y presentaciones offline. Conecte esta aplicación a su portal para tener acceso a los documentos almacenados en el portal. \"Descargar ahora\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-16 07:13:36','text',2,NULL,'Ekaterina.Heidel'),(950827,250,'pattern_enterprise_user_welcome','fr','Bonjour $UserName,\n\nVotre profil d\'utilisateur a été ajouté au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Commencez à utiliser le portail et :\n\n# Modifiez votre \"profil\":\"$MyStaffLink\" en ajoutant vos données personnelles et de contact.\n# Créez, modifiez et organisez des \"Documents\":\"${__VirtualRootPath}/products/files/\".\n# Ajoutez votre compte de messagerie au \"Mail ONLYOFFICE\":\"${__VirtualRootPath}/addons/mail/\".\n# Créez des \"Projets\":\"${__VirtualRootPath}/products/projects/\" et gérez votre flux de travail en ajoutant des tâches et des jalons.\n# Gérez les relations avec la clientèle en utilisant le module \"CRM\" :\"${__VirtualRootPath}/products/crm/\", identifiez les contacts de priorité, suivez l’historique des communications et la performance des ventes.\n# Utilisez le module \"Communauté\":\"${__VirtualRootPath}/products/community/\" pour démarrer vos blogs, forums, ajouter des évenementsents, partagez des signets.\n# Organisez votre horaire avec le \"Calendrier\" intégré\":\"${__VirtualRootPath}/addons/calendar/\".\n# Démarrez le \"Chat\":\"${__VirtualRootPath}/addons/talk/\" pour communiquer en ligne avec les autres utilisateurs du portail.\n\n$GreenButton\n\nSi vous avez des questions conсernant le travail avec le portail, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nConseil : utilisez les éditeurs de documents ONLYOFFICE pour travailler sur des documents, classeurs et présentations hors connexion .Connectez l\'application au portail pour accéder aux documents stockés ici. \"Téléchargez maintenant\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nSincérement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-08 09:15:21','text',2,NULL,'Nadine Yablonskaya'),(934136,250,'pattern_enterprise_user_welcome','Neutral','Dear $UserName,\r\n\r\nYour user profile has been successfully added to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\r\n\r\nh3.Get started with your portal:\r\n\r\n# Edit your \"profile\":\"$MyStaffLink\" to add personal and contact details.\r\n# Create, edit and organize \"Documents\":\"${__VirtualRootPath}/products/files/\".\r\n# Add your email account to \"ONLYOFFICE Mail\":\"${__VirtualRootPath}/addons/mail/\".\r\n# Create \"Projects\":\"${__VirtualRootPath}/products/projects/\" and manage your workflow by adding milestones and tasks.\r\n# Manage your customer relations using \"CRM\":\"${__VirtualRootPath}/products/crm/\" module, identify priority contacts, track communication history and sales performance.\r\n# Use \"Community\":\"${__VirtualRootPath}/products/community/\" to start your blogs, forums, add events, share bookmarks.\r\n# Organize your work schedule with the built-in \"Calendar\":\"${__VirtualRootPath}/addons/calendar/\".\r\n# Start \"Talk\":\"${__VirtualRootPath}/addons/talk/\" to chat with your teammates online.\r\n\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nAn additional tip: use free ONLYOFFICE Desktop Editors to work on documents, spreadsheets and presentations offline. Connect the application to your portal to get access to documents stored there. \"Download now\":\"http://www.onlyoffice.com/desktop.aspx\"\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936257,250,'pattern_enterprise_user_welcome','ru','Здравствуйте, $UserName,\n\nВаш пользовательский профиль успешно добавлен на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Начните работать со своим порталом:\n\n# Отредактируйте свой \"профиль\":\"$MyStaffLink\", добавив личную и контактную информацию.\n# Создавайте, редактируйте и систематизируйте \"Документы\":\"${__VirtualRootPath}/products/files/\".\n# Добавьте свою учетную запись электронной почты в \"Почту ONLYOFFICE\":\"${__VirtualRootPath}/addons/mail/\".\n# Создавайте \"Проекты\":\"${__VirtualRootPath}/products/projects/\" и управляйте рабочим процессом, добавляя вехи и ставя задачи.\n# Управляйте взаимоотношениями с клиентами, используя модуль \"CRM\":\"${__VirtualRootPath}/products/crm/\", определяйте приоритетные контакты, следите за историей взаимодействия и эффективностью продаж.\n# Используйте \"Сообщество\":\"${__VirtualRootPath}/products/community/\", чтобы вести блоги, общаться на форумах, добавлять события, делиться закладками.\n# Планируйте рабочий график с помощью встроенного \"Календаря\":\"${__VirtualRootPath}/addons/calendar/\".\n# Запустите \"Чат\":\"${__VirtualRootPath}/addons/talk/\", чтобы общаться со своей командой онлайн.\n\n$GreenButton\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nДополнительный совет: используйте бесплатные десктопные редакторы ONLYOFFICE для работы с текстовыми документами, электронными таблицами и презентациями в офлайн-режиме. Подключите это приложение к своему порталу, чтобы получить доступ к сохраненным на нем документам. \"Скачать сейчас\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-19 08:58:48','text',2,NULL,'Svetlana'),(950584,250,'pattern_enterprise_whitelabel_admin_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie haben gerade das Portal ${LetterLogoText} erstellt, das die interne Zusammenarbeit verbessern wird. Ihre Portaladresse ist \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Das Hinzufügen dieses Links dem Lesezeichen ist eine gute Idee. Per Lesezeichen speichern Sie häufig genutzte Webadressen für einen schnellen Zugriff). Folgen Sie dem Link unten, um Ihre E-Mail-Adresse zu bestätigen:\n\np=. \"Klicken Sie hier für die Bestätigung\":\"$InviteLink\"\n\nBitte vervollständigen Sie Ihre E-Mail-Aktivierung innerhalb einer Woche. Der Link ist nur für 7 Tage gültig.\n\nHinweis: Wir senden keine vertrauliche Information (wie Ihr Passwort) in E-Mails aus Sicherheitsgründen. Sie können Ihre E-Mail oder Passwort auf Ihrer \"persönlichen Profilseite \" ändern:\"$MyStaffLink\".\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-03 08:43:30','text',2,NULL,'Evgenia'),(951002,250,'pattern_enterprise_whitelabel_admin_activation','es','Buenos días, $UserName,\n\nUsted acaba de crear el portal ${LetterLogoText} para organizar un trabajo en colaboración efectivo. Dirección de su portal - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Le recomendamos añadir este enlace a marcadores: es probable que Usted lo use a menudo). Para confirmar su dirección de correo electrónico, por favor, siga el enlace siguiente:\n\n p=. \"Pulse aquí para confirmar\":\"$InviteLink\"\n\nPor favor, termine la activación de su correo electrónico durante la semana, porque el enlace es válido solo durante 7 días.\n\nNote, por favor: por razones de seguridad no enviamos la información confidencial (como su contraseña) en los mensajes de correo. Usted puede cambiar su dirección de correo electrónico o contraseña en \"la página de su perfil personal\":\"$MyStaffLink\".\n\nMuy atentamente,\nEquipo de ${LetterLogoText}',NULL,'2017-02-14 11:42:34','text',2,NULL,'Ekaterina.Heidel'),(950785,250,'pattern_enterprise_whitelabel_admin_activation','fr','Bonjour $UserName,\n\nVous venez de créer le portail ${LetterLogoText} qui vous aidera à améliorer la coopération interne au sein de votre entreprise. L\'adresse de votre portail est \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" ( vous pouvez ajouter ce lien à vos favoris, probablement vous allez l\'utiliser souvent). Suivez le lien ci-dessous pour confirmer votre adresse e-mail :\n\n p=. \"Cliquez sur ce lien de confirmation\":\"$InviteLink\"\n\nVeuillez effectuer l\'activation par e-mail dans une semaine car le lien n\'est valable que 7 jours.\n\nRemarque : pour des raisons de sécurité nous n\'envoyons pas de renseignements confidentiels par courriel (tels que mot de passe). Vous pouvez changer votre e-mail ou mot de passe sur la page de votre \"profil\":\"$MyStaffLink\".\n\nSincérement,\nÉquipe ${LetterLogoText}',NULL,'2017-02-07 11:15:19','text',2,NULL,'Nadine Yablonskaya'),(934117,250,'pattern_enterprise_whitelabel_admin_activation','Neutral','Dear $UserName,\r\n\r\nYou have just created the ${LetterLogoText} portal, your company\'s portal that would enhance internal cooperation. Your portal address is \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (adding this link to your bookmarks is a good idea, you are most likely to get to use it a lot). Follow the link below to confirm your email address:\r\n\r\n p=. \"Click here for confirmation\":\"$InviteLink\"\r\n\r\nPlease, complete your email activation within a week as the link is valid for 7 days only.\r\n\r\nNote: we do not send out confidential information (like your password) in emails for safety reasons. You may change your email or password in your \"personal profile page\":\"$MyStaffLink\".\r\n\r\nTruly yours,\r\n${LetterLogoText} Team','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936238,250,'pattern_enterprise_whitelabel_admin_activation','ru','Здравствуйте, $UserName,\n\nВы только что создали портал ${LetterLogoText} для организации эффективной совместной работы. Адрес Вашего портала - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Советуем добавить эту ссылку в закладки: по всей вероятности, Вы будете ей часто пользоваться). Для подтверждения адреса электронной почты перейдите по следующей ссылке:\n\n p=. \"Нажмите сюда для подтверждения\":\"$InviteLink\"\n\nПожалуйста, выполните активацию электронной почты в течение недели, так как ссылка действительна только 7 дней.\n\nОбратите внимание: из соображений безопасности мы не высылаем в электронных письмах конфиденциальную информацию (такую, как ваш пароль). Вы можете изменить свой адрес электронной почты или пароль на \"странице вашего личного профиля\":\"$MyStaffLink\".\n\nС уважением,\nкоманда ${LetterLogoText}',NULL,'2016-12-16 15:00:21','text',2,NULL,'Svetlana'),(950684,250,'pattern_enterprise_whitelabel_admin_payment_warning','de','Sehr geehrte/r Frau/Herr $UserName,\n\nBitte merken Sie, dass Ihr ${LetterLogoText}Abonnement heute abläuft.\n\nUm Ihr Abonnement zu verlängern, müssen Sie eine Verlängerung für ${LetterLogoText} erwerben.\n\nKlicken Sie auf den Link unterhalb, um den Verlängerungsprozess zu starten. \n\"Preisinformation\":\"$PricingPage\"\n\nWenn Sie Ihre nächste Verlängerung erwerben, können Sie auch die Lizenzoption \"Auto-renew\" aktivieren. In diesem Fall wird Ihre Lizenz automatisch nach Ablauf der Gültigkeit verlängert.\n\nSie bekommen eine separate E-Mail mit Abrechnungsinformationen am Fälligkeitstermin.\n\nMit freundlichen Grüßen,\n${LetterLogoText} Team',NULL,'2017-02-06 10:26:06','text',2,NULL,'Evgenia'),(950884,250,'pattern_enterprise_whitelabel_admin_payment_warning','es','Buenos días, $UserName,\n\nNote, por favor, que su suscripción para ${LetterLogoText} va a expirar hoy.\n\nPara continuar usando el servicio se necesita adquirir renovación del producto para ${LetterLogoText}.\n\nPulse el enlace abajo para empezar el proceso de prolongación:\n\"Página con precios\":\"$PricingPage\"\n\nPara su comodidad Usted podrá activar la opción de renovación automática al comprar la suscripción siguiente, en este caso la suscripción será renovada automáticamente a la expiración del periodo de uso.\n\nEn la fecha de expiración Usted recibirá un mensaje de correo separado con los detalles de pago para los pagos recurrentes.\n\nMuy atentamente,\nEquipo de ${LetterLogoText}',NULL,'2017-02-09 12:30:45','text',2,NULL,'Ekaterina.Heidel'),(950223,250,'pattern_enterprise_whitelabel_admin_payment_warning','fr','Bonjour $UserName,\n\nVeuillez noter que votre votre abonnement à ${LetterLogoText} arrive à expiration aujourd\'hui.\n\nPour prolonger l\'inscription, vous avez besoin d\'acheter le renouvellement de l\'abonnement à ${LetterLogoText}.\n\nCliquez sur le lien pour lancer le processus de renouvellement :\n\"Page de la tarification\":\"$PricingPage\"\n\nPour votre commodité, lors de l\'achat de votre votre prochain renouvellement, vous pouvez activer l’option « renouvellement automatique » de la licence, pour que votre licence soit renouvelée automatiquement à la date d’expiration.\n\nPour les paiements récurrents, un courriel avec les détails de paiement vous sera envoyé à la date d\'expiration.\n\nCordialement,\nÉquipe ${LetterLogoText}',NULL,'2017-01-31 13:49:08','text',2,NULL,'Nadine Yablonskaya'),(934218,250,'pattern_enterprise_whitelabel_admin_payment_warning','Neutral','Dear $UserName,\r\n\r\nPlease note that your ${LetterLogoText} subscription is due to expire today.\r\n\r\nIn order to extend your subscription, you need to purchase a product renewal for ${LetterLogoText}.\r\n\r\nClick on the link below to start the renewal process:\r\n\"Pricing page\":\"$PricingPage\"\r\n\r\nFor your convenience, when you purchase your next renewal, you can also enable the \"auto-renew\" license option, in which case your license will be renewed automatically at expiration time.\r\n\r\nA separate email with payment details for the recurrent billing will be sent on the expiration date.\r\n\r\nTruly yours,\r\n${LetterLogoText} Team','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936211,250,'pattern_enterprise_whitelabel_admin_payment_warning','ru','Добрый день, $UserName,\n\nПожалуйста, обратите внимание, что сегодня истекает срок действия вашей подписки на ${LetterLogoText}.\n\nВам необходимо приобрести продление подписки на ${LetterLogoText}.\n\nНажмите на следующую ссылку, чтобы начать продление:\n\"Страница с ценами\":\"$PricingPage\"\n\nДля вашего удобства при покупке следующего продления вы сможете включить опцию автоматического продления лицензии, и в этом случае лицензия будет продлеваться автоматически по окончании срока действия.\n\nДля регулярных платежей в день истечения срока действия подписки будет приходить отдельное письмо с информацией о платеже.\n\nС уважением,\nкоманда ${LetterLogoText}',NULL,'2016-12-16 13:22:18','text',2,NULL,'Svetlana'),(950683,250,'pattern_enterprise_whitelabel_admin_payment_warning_before7','de','Sehr geehrte/r Frau/Herr $UserName,\n\nBitte merken Sie, dass Ihr ${LetterLogoText}Abonnement in einer Woche abläuft.\n\nUm Ihr Abonnement zu verlängern, müssen Sie eine Verlängerung für $ {LetterLogoText} erwerben.\n\nKlicken Sie auf den Link unterhalb, um den Verlängerungsprozess zu starten. \n\"Preisinformation\":\"$PricingPage\"\n\nWenn Sie Ihre nächste Verlängerung erwerben, können Sie auch die Lizenzoption \"Auto-renew\" aktivieren. In diesem Fall wird Ihre Lizenz automatisch nach Ablauf der Gültigkeit verlängert.\n\nSie bekommen eine separate E-Mail mit Abrechnungsinformationen am Fälligkeitstermin.\n\nMit freundlichen Grüßen,\n${LetterLogoText} Team\n\n',NULL,'2017-02-06 10:25:00','text',2,NULL,'Evgenia'),(950883,250,'pattern_enterprise_whitelabel_admin_payment_warning_before7','es','Buenos días, $UserName,\n\nNote, por favor, que su suscripción para ${LetterLogoText} expirará al cabo de una semana.\n\nPara continuar usando el servicio se necesita adquirir renovación del producto para ${LetterLogoText}.\n\nPulse el enlace abajo para empezar el proceso de prolongación:\n\"Página con precios\":\"$PricingPage\"\n\nPara su comodidad Usted podrá activar la opción de renovación automática al comprar la suscripción siguiente, en este caso la suscripción será renovada automáticamente a la expiración del periodo de uso.\n\nEn la fecha de expiración Usted recibirá un mensaje de correo separado con los detalles de pago para los pagos recurrentes.\n\nMuy atentamente,\nEquipo de ${LetterLogoText}',NULL,'2017-02-09 12:30:38','text',2,NULL,'Ekaterina.Heidel'),(950216,250,'pattern_enterprise_whitelabel_admin_payment_warning_before7','fr','Bonjour $UserName,\n\nNotez que votre votre abonnement ${LetterLogoText} arrive à expiration dans une semaine.\n\nVous avez besoin d\'acheter le renouvellement de l\'abonnement à ${LetterLogoText}.\n\nCliquez sur le lien pour lancer le processus de renouvellement:\n\"Page de la tarification\":\"$PricingPage\"\n\nPour votre commodité, lors de l\'achat de votre votre prochain renouvellement, vous pouvez activer l’option « renouvellement automatique » de la licence, pour que votre licence soit renouvelée automatiquement à la date d’expiration.\n\nPour les paiements récurrents, un courriel avec les détails de paiement vous sera envoyé à la date d\'expiration.\n\nCordialement,\nÉquipe ${LetterLogoText}',NULL,'2017-01-31 13:35:16','text',2,NULL,'Nadine Yablonskaya'),(934209,250,'pattern_enterprise_whitelabel_admin_payment_warning_before7','Neutral','Dear $UserName,\r\n\r\nPlease note that your ${LetterLogoText} subscription is about to expire in a week.\r\n\r\nIn order to extend your subscription, you need to purchase a product renewal for ${LetterLogoText}.\r\n\r\nClick on the link below to start the renewal process:\r\n\"Pricing page\":\"$PricingPage\"\r\n\r\nFor your convenience, when you purchase your next renewal, you can also enable the \"auto-renew\" license option, in which case your license will be renewed automatically at expiration time.\r\n\r\nA separate email with payment details for the recurrent billing will be sent on the expiration date.\r\n\r\nTruly yours,\r\n${LetterLogoText} Team','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936212,250,'pattern_enterprise_whitelabel_admin_payment_warning_before7','ru','Добрый день, $UserName,\n\nПожалуйста, обратите внимание, что срок действия вашей подписки на ${LetterLogoText} истечет через неделю.\n\nВам необходимо приобрести продление подписки на ${LetterLogoText}.\n\nНажмите на следующую ссылку, чтобы начать продление:\n\"Страница с ценами\":\"$PricingPage\"\n\nДля вашего удобства при покупке следующего продления вы сможете включить опцию автоматического продления лицензии, и в этом случае лицензия будет продлеваться автоматически по окончании срока действия.\n\nДля регулярных платежей в день истечения срока действия подписки будет приходить отдельное письмо с информацией о платеже.\n\nС уважением,\nКоманда ${LetterLogoText}',NULL,'2016-12-16 13:22:25','text',2,NULL,'Svetlana'),(950819,250,'pattern_enterprise_whitelabel_admin_welcome','de','Sehr geehrte/r Frau/Herr $UserName,\n\nUm das Management-Portal schnell und einfach zu machen, ${LetterLogoText}nutzen Sie Control Panel, eine Reihe von Automatisierungstools, welche Ihnen ermöglichen:\n\n- Standardlogo des Portals zu ändern, um Ihr Web-Office zu umbenennen;\n\n- HTTPS einzuschalten, um Ihre persönlichen Daten zu schützen;\n\n- Benutzer von Ihrem LDAP-Server zu importieren;\n\n- Datenbackup-Portal auf regelmäßiger Basis zu erstellen, um Datenverlust zu vermeiden;\n\n- Verfügbare Updates von $ {LetterLogoText}zu prüfen;\n\n- Anmeldeverlauf zu verfolgen und Audit-Trail Daten zu erhalten.\n\n$GreenButton\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-08 08:38:23','text',2,NULL,'Evgenia'),(962230,250,'pattern_enterprise_whitelabel_admin_welcome','es','Buenos días, $UserName,\n\nPara facilitar la gestión del portal, ${LetterLogoText} proporciona Panel de Control, un juego de herramientas de automatización, que le permite:\n\n- Cambiar los logos de portal predeterminados para usar su oficina web bajo su marca;\n\n- Activar HTTPS para proteger y mantener seguros los datos de portal;\n\n- Importar usuarios del servidor LDAP;\n\n- Hacer las copias de seguridad de portal de manera regular para evitar la pérdida de datos;\n\n- Verificar las actualizaciones de ${LetterLogoText} disponibles;\n\n- Monitorizar historial de conexiones al sistema y recibir datos de rastro de auditoría.\n\n$GreenButton\n\nMuy atentamente,\nEquipo de ${LetterLogoText}',NULL,'2017-04-03 13:30:59','text',2,NULL,'Ekaterina.Heidel'),(950310,250,'pattern_enterprise_whitelabel_admin_welcome','fr','Bonjour $UserName,\n\nPour faire la gestion du portail rapide et facile, vous pouvez utiliser le Panneau de configuration, un ensemble d\'outils d\'automatisation qui vous permet de :\n\n- Modifier des logos par défaut du portail pour utiliser un bureau virtuel sous votre marque ;\n\n- Activer le protocole HTTPS pour garder vos données du portail en sécurité ;\n\n- Importer des utilisateurs à partir de votre serveur LDAP ;\n\n- Sauvegarder vos données du portail sur une base régulière afin d\'éviter toute perte de données ;\n\n- Vérifier des mises à jour pour ${LetterLogoText} disponibles ;\n\n- Suivre une historique de connexion et recevoir les données du piste d\'audit.\n\n$GreenButton\n\nCordialement,\nÉquipe ${LetterLogoText} Team',NULL,'2017-02-01 11:36:45','text',2,NULL,'Nadine Yablonskaya'),(934124,250,'pattern_enterprise_whitelabel_admin_welcome','Neutral','Dear $UserName,\r\n\r\nTo make the portal management quick and easy, ${LetterLogoText} provides you with Control Panel, a set of automation tools that allows you to:\r\n\r\n- Change the default portal logos to brand your web-office;\r\n\r\n- Turn on HTTPS to keep your portal data secure;\r\n\r\n- Import users from your LDAP server;\r\n\r\n- Backup your portal data on a regular basis to avoid any data-loss;\r\n\r\n- Check for available ${LetterLogoText} updates;\r\n\r\n- Track login history and receive the audit trail data.\r\n\r\n$GreenButton\r\n\r\nTruly yours,\r\n${LetterLogoText} Team','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936220,250,'pattern_enterprise_whitelabel_admin_welcome','ru','Здравствуйте, $UserName,\n\nЧтобы упростить управление порталом, в ${LetterLogoText} предоставляется Панель управления, набор инструментов автоматизации, с помощью которых вы можете:\n\n- Заменить стандартные логотипы портала, чтобы использовать виртуальный офис под вашим брендом;\n\n- Включить HTTPS для обеспечения безопасности данных портала;\n\n- Импортировать пользователей с сервера LDAP;\n\n- Создавать резервные копии портала на регулярной основе для предотвращения потери данных;\n\n- Проверять наличие доступных обновлений ${LetterLogoText};\n\n- Отслеживать историю входов в систему и получать данные журнала аудита.\n\n$GreenButton\n\nС уважением,\nкоманда ${LetterLogoText}',NULL,'2016-12-16 13:50:04','text',2,NULL,'Svetlana'),(950598,250,'pattern_enterprise_whitelabel_guest_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie sind als Gast auf das Portal \"${__VirtualRootPath}\":\"$InviteLink\" eingeladen worden. Bitte akzeptieren Sie die E-Mail-Einladung und folgen Sie diesem Link. Der Link ist 7 Tage lang gültig:\n\np=. \"Klicken Sie hier, um dem Portal beizutreten\":\"$InviteLink\"\n\nMit freundlichen Grüßen,\n${LetterLogoText} Team',NULL,'2017-02-03 09:18:32','text',2,NULL,'Evgenia'),(950998,250,'pattern_enterprise_whitelabel_guest_activation','es','Buenos días, $UserName,\n\nUsted ha sido invitado al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" como el visitante. Para aceptar la invitación, por favor, siga el enlace abajo, este anlace es válido solo durante 7 días:\n\np=. \"Pulse aquí para hacerse el miembro del portal\":\"$InviteLink\"\n\nMuy atentamente,\nEquipo de ${LetterLogoText}',NULL,'2017-02-14 09:22:42','text',2,NULL,'Ekaterina.Heidel'),(950767,250,'pattern_enterprise_whitelabel_guest_activation','fr','Bonjour $UserName,\n\nVous êtes invité en tant qu\'un utilisateur invité au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Veuillez accepter l’invitation en suivant le lien ci-dessous. Ce lien n\'est valable que pour une durée de 7 jours :\n\np=. \"Cliquez ici pour rejoindre le portail\":\"$InviteLink\"\n\nSincérement,\nÉquipe ${LetterLogoText}',NULL,'2017-02-07 08:32:55','text',2,NULL,'Nadine Yablonskaya'),(934161,250,'pattern_enterprise_whitelabel_guest_activation','Neutral','Dear $UserName,\r\n\r\nYou have been invited as a guest user to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Please accept the invitation by following the link below, it is only valid for 7 days:\r\n\r\np=. \"Click here to join the portal\":\"$InviteLink\"\r\n\r\nTruly yours,\r\n${LetterLogoText} Team','','2016-11-22 14:57:52','text',2,NULL,'Console'),(936235,250,'pattern_enterprise_whitelabel_guest_activation','ru','Здравствуйте, $UserName,\n\nВас пригласили на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" в качестве гостя. Чтобы принять приглашение, перейдите по следующей ссылке, она действительна только 7 дней:\n\np=. \"Нажмите сюда, чтобы стать участником портала\":\"$InviteLink\"\n\nС уважением,\nкоманда ${LetterLogoText}',NULL,'2016-12-16 14:50:44','text',2,NULL,'Svetlana'),(950602,250,'pattern_enterprise_whitelabel_guest_welcome','de','Sehr geehrte/r Frau/Herr $UserName,\n\nIhr Benutzerprofil wurde erfolgreich dem Portal unter\"${__VirtualRootPath}\":\"${__VirtualRootPath}\" hinzugefügt.\n\nh3.Fangen Sie die Arbeit mit Ihrem Portal an \n\n# Bearbeiten Sie Ihr \"Profil\":\"$MyStaffLink\", um Personalangaben und Kontaktdaten hinzuzufügen.\n# Sehen Sie an und kommentieren Sie Inhalte, die für alle Portalbenutzer in Modul \"Community\":\"${__VirtualRootPath}/products/community/\", \"Projekte\":\"${__VirtualRootPath}/products/projects/\" zugänglich sind.\n# Fügen Sie Dateien hinzu und laden Sie die verfügbaren Dateien in Modul \"Dokumente\":\"${__VirtualRootPath}/products/files/\" herunter.\n# Gestalten Sie Ihren Arbeitsprozess mit eingebautem \"Kalender\":\"${__VirtualRootPath}/addons/calendar/\".\n# Starten Sie \"Talk\":\"${__VirtualRootPath}/addons/talk/\" um mit Ihren Teammitgliedern online zu chatten.\n\n$GreenButton\n\nMit freundlichen Grüßen,\n${LetterLogoText} Team',NULL,'2017-02-03 09:36:26','text',2,NULL,'Evgenia'),(951018,250,'pattern_enterprise_whitelabel_guest_welcome','es','Buenos días, $UserName,\n\nSu perfil de visitante ha sido añadido con éxito al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Empieze a trabajar con su portal\n\n# Edite su \"perfil\":\"$MyStaffLink\" para añadir los detalles personales y de contacto.\n# Visualice y comente el contenido disponible para todos los usuarios de portal en los \nmódulos \"Comunidad\":\"${__VirtualRootPath}/products/community/\" y \"Proyectos\":\"${__VirtualRootPath}/products/projects/\".\n# Añada y descargue archivos disponibles para Usted en el módulo \"Documentos\":\"${__VirtualRootPath}/products/files/\".\n# Planee su horario de trabajo con ayuda de \"Calendario\" incorporado:\"${__VirtualRootPath}/addons/calendar/\".\n# Inicie \"Chat\":\"${__VirtualRootPath}/addons/talk/\" para chatear con otros usuarios de portal en línea.\n\n$GreenButton\n\nMuy atentamente,\nEquipo de ${LetterLogoText}',NULL,'2017-02-15 12:28:40','text',2,NULL,'Ekaterina.Heidel'),(950801,250,'pattern_enterprise_whitelabel_guest_welcome','fr','Bonjour $UserName,\n\nVotre profil d\'invité a été ajouté avec succès au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Pour commencer à utiliser le portail\n\n# Modifiez votre \"profil\":\"$MyStaffLink\" en ajoutant vos données personnelles et de contact.\n# Parcourez et commentez le contenu du portail disponible pour tous les utilisateurs dans le modules \"Communauté\":\"${__VirtualRootPath}/products/community/\", \"Projets\":\"${__VirtualRootPath}/products/projects/\".\n# Ajoutez et téléchargez les fichiers disponibles dans le module \"Documents\":\"${__VirtualRootPath}/products/files/\".\n# Organisez votre horaire avec le \"Calendrier\" intégré :\"${__VirtualRootPath}/addons/calendar/\".\n# Démarrez le \"Chat\":\"${__VirtualRootPath}/addons/talk/\" pour communiquer en ligne avec les autres utilisateurs du portail.\n\n$GreenButton\n\nSincérement,\nÉquipe ${LetterLogoText}',NULL,'2017-02-07 12:19:33','text',2,NULL,'Nadine Yablonskaya'),(934162,250,'pattern_enterprise_whitelabel_guest_welcome','Neutral','Dear $UserName,\r\n\r\nYour guest profile has been successfully added to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\r\n\r\nh3.Get started with your portal\r\n\r\n# Edit your \"profile\":\"$MyStaffLink\" to add personal and contact details.\r\n# View and comment the content open available for all portal users in the \"Community\":\"${__VirtualRootPath}/products/community/\", \"Projects\":\"${__VirtualRootPath}/products/projects/\" modules.\r\n# Add and download files available for you in the \"Documents\":\"${__VirtualRootPath}/products/files/\" module.\r\n# Organize your schedule with the built-in \"Calendar\":\"${__VirtualRootPath}/addons/calendar/\".\r\n# Start \"Talk\":\"${__VirtualRootPath}/addons/talk/\" to chat with other portal users online.\r\n\r\n$GreenButton\r\n\r\nTruly yours,\r\n${LetterLogoText} Team','','2016-11-22 14:57:52','text',2,NULL,'Console'),(936244,250,'pattern_enterprise_whitelabel_guest_welcome','ru','Здравствуйте, $UserName,\n\nВаш гостевой профиль успешно добавлен на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Начните работать со своим порталом\n\n# Отредактируйте свой \"профиль\":\"$MyStaffLink\", добавив личную и контактную информацию.\n# Просматривайте и комментируйте контент, доступный для всех пользователей портала в модулях \"Сообщество\":\"${__VirtualRootPath}/products/community/\" и \"Проекты\":\"${__VirtualRootPath}/products/projects/\".\n# Добавляйте и скачивайте файлы, доступные для Вас, в модуле \"Документы\":\"${__VirtualRootPath}/products/files/\".\n# Планируйте свой график с помощью встроенного \"Календаря\":\"${__VirtualRootPath}/addons/calendar/\".\n# Запустите \"Чат\":\"${__VirtualRootPath}/addons/talk/\", чтобы общаться с другими пользователями портала онлайн.\n\n$GreenButton\n\nС уважением,\nкоманда ${LetterLogoText}',NULL,'2016-12-16 15:44:29','text',2,NULL,'Svetlana'),(950608,250,'pattern_enterprise_whitelabel_user_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\n$__AuthorName hat Sie eingeladen, dem ${LetterLogoText} Portal bezutreten, um die interne Zusammenarbeit zu verbessern. Ihre Portaladresse ist \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Das Hinzufügen dieses Links dem Lesezeichen ist eine gute Idee. Per Lesezeichen speichern Sie häufig genutzte Webadressen für einen schnellen Zugriff).\n\nUm die Einladung anzunehmen, folgen Sie dem Link unten. Der Link ist nur für 7 Tage gültig:\n\np=. \"Klicken Sie hier, um dem Portal beizutreten\":\"$InviteLink\"\n\nMit freundlichen Grüßen\n${LetterLogoText} Team',NULL,'2017-02-03 10:30:44','text',2,NULL,'Evgenia'),(950760,250,'pattern_enterprise_whitelabel_user_activation','es','Buenos días, $UserName,\n\n$__AuthorName ha invitado a Usted a participar en ${LetterLogoText} - portal de su equipo para organizar trabajo en colaboración efectivo. Dirección de su portal - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (le recomendamos que añada este enlace a marcadores: es muy probable que Usted lo use a menudo).\n\nUsted puede aceptar esta invitación siguiendo el enlace abajo, este enlace es válido durante 7 días:\n\np=. \"Pulse aquí para participar en el portal\":\"$InviteLink\"\n\nMuy atentamente, \nEquipo de ${LetterLogoText}',NULL,'2017-02-07 07:52:08','text',2,NULL,'Ekaterina.Heidel'),(946338,250,'pattern_enterprise_whitelabel_user_activation','fi','Hyvä $UserName,\n\n$__AuthorName on kutsunut sinut liittymään: ${LetterLogoText} - tiimisi portaaliin, mikä auttaa sisäistä yhteistoimintaa. Portaalisi osoite on \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (tämän osoitteen lisääminen kirjanmerkkeihisi voi olla hyvä idea, koska tulet käyttämään sitä paljon).\n\nVoit hyväksyä kutsun seuraamalla allaolevaa linkkiä, mikä on voimassa vain 7 päivää:\n\np=. \"Klikkaa tätä liittyäksesi portaaliin\":\"$InviteLink\"\n\nParhain terveisin,\n${LetterLogoText} Tiimi',NULL,'2017-01-16 18:50:42','text',2,NULL,'Arto Ryynanen'),(949594,250,'pattern_enterprise_whitelabel_user_activation','fr','Bonjour $UserName,\n\n$__AuthorName vous a invité à rejoindre ${LetterLogoText} - le portail de votre équipe visant une amélioration de la coopération interne. L\'adresse de votre portail est \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (vous pouvez ajouter ce lien à vos favoris, très probablement vous allez l\'utiliser souvent).\n\nVous pouvez accepter l\'invitation en suivant le lien suivant (il est valable pendant 7 jours ):\n\np=. \"Cliquez ici pour rejoindre le portail\":\"$InviteLink\"\n\nCordialement,\nÉquipe ${LetterLogoText}',NULL,'2017-01-27 09:35:49','text',2,NULL,'Nadine Yablonskaya'),(934137,250,'pattern_enterprise_whitelabel_user_activation','Neutral','Dear $UserName,\r\n\r\n$__AuthorName has invited you to join ${LetterLogoText} - your team\'s portal that would enchance internal cooperation. Your portal address is \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (adding this link to your bookmarks is a good idea, you are most likely to get to use it a lot).\r\n\r\nYou can accept the invitation by following the link below, it is only valid for 7 days:\r\n\r\np=. \"Click here to join the portal\":\"$InviteLink\"\r\n\r\nTruly yours,\r\n${LetterLogoText} Team','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936185,250,'pattern_enterprise_whitelabel_user_activation','ru','Здравствуйте, $UserName,\n\n$__AuthorName приглашает Вас стать участником ${LetterLogoText} - портала вашей команды для организации эффективной совместной работы. Адрес Вашего портала - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (советуем добавить эту ссылку в закладки: по всей вероятности, Вы будете ей часто пользоваться).\n\nВы можете принять приглашение, перейдя по следующей ссылке, она действительна только 7 дней:\n\np=. \"Нажмите сюда, чтобы стать участником портала\":\"$InviteLink\"\n\nС уважением,\nкоманда ${LetterLogoText}',NULL,'2016-12-16 11:04:51','text',2,NULL,'Svetlana'),(950295,250,'pattern_enterprise_whitelabel_user_welcome','de','Sehr geehrte/r Frau/Herr $UserName,\n\nIhr Benutzerprofil wurde erfolgreich dem Portal unter\"${__VirtualRootPath}\":\"${__VirtualRootPath}\" hinzugefügt.\n\nh3.Fangen Sie die Arbeit mit Ihrem Portal an \n\n# Bearbeiten Sie Ihr \"Profil\":\"$MyStaffLink\", um Personalangaben und Kontaktdaten hinzuzufügen.\n# Erstellen, bearbeiten und organisieren Sie Ihre Dateien im Modul \"Dokumente\":\"${__VirtualRootPath}/products/files/\".\n# Fügen Sie Ihr E-Mail-Konto dem Modul \"${LetterLogoText} E-Mail\":\"${__VirtualRootPath}/addons/mail/\" hinzu.\n# Erstellen Sie \"Projekte\":\"${__VirtualRootPath}/products/projects/\" und verwalten Sie Ihren Workflow, indem Sie Meilensteine und Aufgaben hinzufügen.\n# Verwalten Sie Ihre Kundenbeziehungen mit Modul \"CRM\"::\"${__VirtualRootPath}/products/community/\" bestimmen Sie Prioritätskontakte, verfolgen Sie Nachrichtenhistorie und Umsatzentwicklung.\n# Nutzen Sie Modul \"Community\":\"${__VirtualRootPath}/products/community/\" um Ihre Blogs, Foren, Ereignisse, Lesezeichen hinzuzufügen.\n# Gestalten Sie Ihren Arbeitsprozess mit eingebautem \"Kalender\":\"${__VirtualRootPath}/addons/calendar/\".\n# Starten Sie \"Talk\":\"${__VirtualRootPath}/addons/talk/\" um mit Ihren Teammitgliedern online zu chatten.\n\n$GreenButton\n\nMit freundlichen Grüßen,\n${LetterLogoText} Team',NULL,'2017-02-01 09:47:43','text',2,NULL,'Evgenia'),(951024,250,'pattern_enterprise_whitelabel_user_welcome','es','Buenos días, $UserName,\n\nSu perfil de usuario ha sido añadido con éxito al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Empieze a trabajar con su portal:\n\n# Edite su \"perfil\":\"$MyStaffLink\" para añadir los detalles personales y de contacto.\n# Cree, edite y organice \"Documentos\":\"${__VirtualRootPath}/products/files/\".\n# Añada su cuenta de correo al módulo \"Correo ${LetterLogoText}\":\"${__VirtualRootPath}/addons/mail/\".\n# Cree \"Proyectos\":\"${__VirtualRootPath}/products/projects/\" y maneje flujo de trabajo añadiendo hitos y asignando tareas.\n# Maneje relaciones con sus clientes usando el módulo \"CRM\":\"${__VirtualRootPath}/products/crm/\", identifique los contactos de prioridad, monitorice historia de comunicación y rendimiento en ventas.\n# Use \"Comunidad\":\"${__VirtualRootPath}/products/community/\" para crear blogs, comunicarse en foros, añadir eventos y compartir marcadores.\n# Planee su horario de trabajo con ayuda de \"Calendario\" incorporado:\"${__VirtualRootPath}/addons/calendar/\".\n# Inicie \"Chat\":\"${__VirtualRootPath}/addons/talk/\" para chatear con miembros de su equipo en línea.\n\n$GreenButton\n\nMuy atentamente,\nEquipo de ${LetterLogoText}',NULL,'2017-02-15 13:23:05','text',2,NULL,'Ekaterina.Heidel'),(950807,250,'pattern_enterprise_whitelabel_user_welcome','fr','Bonjour $UserName,\n\nVotre profil d\'utilisateur a été ajouté au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Commencez à utiliser le portail et :\n\n# Modifiez votre \"profil\":\"$MyStaffLink\" en ajoutant vos données personnelles et de contact.\n# Créez, modifiez et organisez les \"Documents\":\"${__VirtualRootPath}/products/files/\".\n# Ajoutez votre compte de messagerie à \"${LetterLogoText} Mail\":\"${__VirtualRootPath}/addons/mail/\".\n# Créez des \"Projets\":\"${__VirtualRootPath}/products/projects/\" et gérez votre flux de travail en ajoutant des tâches et des jalons.\n# Gérez les relations avec la clientèle en utilisant le module \"CRM\":\"${__VirtualRootPath}/products/crm/\", identifiez les contacts de priorité, suivez l’historique des communications et la performance des ventes.\n# Utilisez le module \"Communauté\":\"${__VirtualRootPath}/products/community/\" pour commencer vos blogs, forums, ajouter des événements , partager des signets.\n# Organisez votre horaire avec le \"Calendrier\" intégré:\"${__VirtualRootPath}/addons/calendar/\".\n# Démarrez le \"Chat\" :\"${__VirtualRootPath}/addons/talk/\" pour communiquer en ligne avec les autres utilisateurs du portail.\n\n$GreenButton\n\nSincérement,\nÉquipe ${LetterLogoText}',NULL,'2017-02-07 13:23:55','text',2,NULL,'Nadine Yablonskaya'),(934138,250,'pattern_enterprise_whitelabel_user_welcome','Neutral','Dear $UserName,\r\n\r\nYour user profile has been successfully added to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\r\n\r\nh3.Get started with your portal:\r\n\r\n# Edit your \"profile\":\"$MyStaffLink\" to add personal and contact details.\r\n# Create, edit and organize \"Documents\":\"${__VirtualRootPath}/products/files/\".\r\n# Add your email account to \"${LetterLogoText} Mail\":\"${__VirtualRootPath}/addons/mail/\".\r\n# Create \"Projects\":\"${__VirtualRootPath}/products/projects/\" and manage your workflow by adding milestones and tasks.\r\n# Manage your customer relations using \"CRM\":\"${__VirtualRootPath}/products/crm/\" module, identify priority contacts, track communication history and sales performance.\r\n# Use \"Community\":\"${__VirtualRootPath}/products/community/\" to start your blogs, forums, add events, share bookmarks.\r\n# Organize your work schedule with the built-in \"Calendar\":\"${__VirtualRootPath}/addons/calendar/\".\r\n# Start \"Talk\":\"${__VirtualRootPath}/addons/talk/\" to chat with your teammates online.\r\n\r\n$GreenButton\r\n\r\nTruly yours,\r\n${LetterLogoText} Team','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936250,250,'pattern_enterprise_whitelabel_user_welcome','ru','Здравствуйте, $UserName,\n\nВаш пользовательский профиль успешно добавлен на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Начните работать со своим порталом:\n\n# Отредактируйте свой \"профиль\":\"$MyStaffLink\", добавив личную и контактную информацию.\n# Создавайте, редактируйте и систематизируйте \"Документы\":\"${__VirtualRootPath}/products/files/\".\n# Добавьте свою учетную запись электронной почты в \"Почту ${LetterLogoText}\":\"${__VirtualRootPath}/addons/mail/\".\n# Создавайте \"Проекты\":\"${__VirtualRootPath}/products/projects/\" и управляйте рабочим процессом, добавляя вехи и ставя задачи.\n# Управляйте взаимоотношениями с клиентами, используя модуль \"CRM\":\"${__VirtualRootPath}/products/crm/\", определяйте приоритетные контакты, следите за историей взаимодействия и эффективностью продаж.\n# Используйте \"Сообщество\":\"${__VirtualRootPath}/products/community/\", чтобы вести блоги, общаться на форумах, добавлять события, делиться закладками.\n# Планируйте рабочий график с помощью встроенного \"Календаря\":\"${__VirtualRootPath}/addons/calendar/\".\n# Запустите \"Чат\":\"${__VirtualRootPath}/addons/talk/\", чтобы общаться со своей командой онлайн.\n\n$GreenButton\n\nС уважением,\nкоманда ${LetterLogoText}',NULL,'2016-12-19 08:20:02','text',2,NULL,'Svetlana'),(460992,250,'pattern_for_admin_notify','Neutral','h1.Message from the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal\r\n\r\nEmail: $UserEmail\r\n\r\n$Body','','2016-09-19 10:41:12','text',2,NULL,'Console'),(950825,250,'pattern_freecloud_admin_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie haben gerade Ihr ${LetterLogoText} Portal unter \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" erstellt. Von hier an haben Sie die Möglichkeit ${LetterLogoText} Free Cloud ohne zeitliche Einschränkungen zu erkunden. Folgen Sie dem Link unten, um Ihre E-Mail-Adresse zu bestätigen:\n\n p=. \"Klicken Sie hier für die Bestätigung\":\"$InviteLink\"\n\nBitte vervollständigen Sie Ihre E-Mail-Aktivierung innerhalb einer Woche. Der Link ist nur für 7 Tage gültig.\n\nHinweis: Wir senden keine vertrauliche Informationen (wie Ihr Passwort) in E-Mails aus Sicherheitsgründen. Sie können Ihre E-Mail oder Passwort auf Ihrer \"persönliche Profilseite\" ändern:\"$MyStaffLink\".\n\nSprache und Zeitzone kann man in Bereich \"Allgemeine Einstellungen\" ändern:\"$SettingsLink\".\nNachdem das Portal individuell gestaltet wird, können Sie Ihre Teammitglieder auf das Portal einladen.\nAlles gute!',NULL,'2017-02-08 08:50:51','text',2,NULL,'Evgenia'),(951007,250,'pattern_freecloud_admin_activation','es','Buenos días, $UserName,\n\nUsted acaba de crear su portal ${LetterLogoText} en \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". A partir de ahora Usted tendrá la posibilidad de usar ${LetterLogoText} Free Cloud sin limitación de tiempo. Para confirmar su dirección de correo electrónico, por favor, siga el enlace siguiente:\n\n p=. \"Pulse aquí para confirmar\":\"$InviteLink\"\n\nPor favor, termine la activación de su correo electrónico durante la semana, porque el enlace es válido solo durante 7 días.\n\nNote, por favor: por razones de seguridad no enviamos la información confidencial (como su contraseña) en los mensajes de correo. Usted puede cambiar su dirección de correo electrónico o contraseña en \"la página de su perfil personal\":\"$MyStaffLink\".\n\nAjustes de idioma y zona horaria se puede cambiar en \"Ajustes comunes\":\"$SettingsLink\".\nDespués de personalizar el portal Usted puede empezar a invitar a compañeros de equipo al portal.\n¡Disfrute de trabajo!',NULL,'2017-02-14 13:06:03','text',2,NULL,'Ekaterina.Heidel'),(950799,250,'pattern_freecloud_admin_activation','fr','Bonjour $UserName,\n\nVous venez de créer votre portail ${LetterLogoText} à l\'adresse \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". À partir de maintenant, vous pouvez utiliser ${LetterLogoText} Free Cloud sans aucune limitation dans le temps. Suivez le lien ci-dessous pour confirmer votre adresse e-mail :\n\n p=. \"Cliquez sur ce lien de confirmation\":\"$InviteLink\"\n\nVeuillez effectuer l\'activation par e-mail dans une semaine car le lien n\'est valable que 7 jours.\n\nRemarque : pour des raisons de sécurité nous n\'envoyons pas de renseignements confidentiels par courriel (tels que mot de passe). Vous pouvez changer votre e-mail ou mot de passe sur la page de votre \"profil\":\"$MyStaffLink\".\n\nLa langue et le fuseau horaire peuvent être modifiés dans les \"Paramètres généraux\":\"$SettingsLink\".\nDès que votre portail est personnalisé, vous pouvez commencer à inviter les membres de votre équipe au portail.\nAppréciez le travail ! ',NULL,'2017-02-07 12:07:43','text',2,NULL,'Nadine Yablonskaya'),(934125,250,'pattern_freecloud_admin_activation','Neutral','Dear $UserName,\r\n\r\nYou have just created your ${LetterLogoText} portal at  \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Starting from now you will have an opportunity to explore ${LetterLogoText} Free Cloud without any time limitations. Follow the link below to confirm your email address:\r\n\r\n p=. \"Click here for confirmation\":\"$InviteLink\"\r\n\r\nPlease, complete your email activation within a week as the link is valid for 7 days only.\r\n\r\nNote: we do not send out confidential information (like your password) in emails for safety reasons. You may change your email or password in your \"personal profile page\":\"$MyStaffLink\".\r\n\r\nLanguage and time zone can be altered in \"general settings\":\"$SettingsLink\".\r\nAfter the portal customization you may start inviting your team members to the portal.\r\nEnjoy the flight! ','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936243,250,'pattern_freecloud_admin_activation','ru','Здравствуйте, $UserName,\n\nВы только что создали свой портал ${LetterLogoText} по адресу \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Начиная с этого момента, у Вас будет возможность использовать ${LetterLogoText} Free Cloud без ограничений по времени. Для подтверждения адреса электронной почты перейдите по следующей ссылке:\n\n p=. \"Нажмите сюда для подтверждения\":\"$InviteLink\"\n\nПожалуйста, выполните активацию электронной почты в течение недели, так как ссылка действительна только 7 дней.\n\nОбратите внимание: из соображений безопасности мы не высылаем в электронных письмах конфиденциальную информацию (такую, как ваш пароль). Вы можете изменить свой адрес электронной почты или пароль на \"странице вашего личного профиля\":\"$MyStaffLink\".\n\nЯзык и часовой пояс можно изменить в \"общих настройках\":\"$SettingsLink\".\nПосле настройки портала можно начать приглашать на портал участников команды.\nПриятной работы!',NULL,'2016-12-16 15:40:01','text',2,NULL,'Svetlana'),(950591,250,'pattern_freecloud_guest_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie sind als Gast auf das Portal \"${__VirtualRootPath}\":\"$InviteLink\" eingeladen worden. Bitte akzeptieren Sie die E-Mail-Einladung und folgen Sie diesem Link. Der Link ist 7 Tage lang gültig:\n\np=. \"Klicken Sie hier, um dem Portal beizutreten\":\"$InviteLink\"\n\nWenn Sie Unterstützung bei der Arbeit mit dem Portal benötigen, besuchen Sie under \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\" oder unser \"Forum\":\"http://cloud.onlyoffice.org\".\n\nMit freundlichen Grüßen,\nONLYOFFICE Support Team\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"\n',NULL,'2017-02-03 09:16:11','text',2,NULL,'Evgenia'),(950994,250,'pattern_freecloud_guest_activation','es','Buenos días, $UserName,\n\nUsted ha sido invitado al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" como el visitante. Para aceptar la invitación, por favor, siga el enlace abajo, este anlace es válido solo durante 7 días:\n\np=. \"Pulse aquí para hacerse el miembro del portal\":\"$InviteLink\"\n\nSi necesita ayuda al trabajar con el portal, le invitamos a nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\" o \"Foro\":\"http://cloud.onlyoffice.org\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"',NULL,'2017-02-14 09:14:03','text',2,NULL,'Ekaterina.Heidel'),(950762,250,'pattern_freecloud_guest_activation','fr','Bonjour $UserName,\n\nVous êtes invité en tant qu\'un utilisateur invité au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Veuillez accepter l’invitation en suivant le lien ci-dessous. Ce lien n\'est valable que pour une durée de 7 jours :\n\np=. \"Cliquez ici pour rejoindre le portail\":\"$InviteLink\"\n\nSi vous avez besoin de l\'aide avec votre portail, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\" ou visitez notre \"Forum\":\"http://cloud.onlyoffice.org\".\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"',NULL,'2017-02-07 08:04:43','text',2,NULL,'Nadine Yablonskaya'),(934163,250,'pattern_freecloud_guest_activation','Neutral','Dear $UserName,\r\n\r\nYou have been invited as a guest user to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Please accept the invitation by following the link below, it is only valid for 7 days:\r\n\r\np=. \"Click here to join the portal\":\"$InviteLink\"\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\" or visit our \"Forum\":\"http://cloud.onlyoffice.org\".\r\n\r\nBest regards,\r\nONLYOFFICE Support Team\r\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"','','2016-11-22 14:57:52','text',2,NULL,'Console'),(936229,250,'pattern_freecloud_guest_activation','ru','Здравствуйте, $UserName,\n\nВас пригласили на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" в качестве гостя. Чтобы принять приглашение, перейдите по следующей ссылке, она действительна только 7 дней:\n\np=. \"Нажмите сюда, чтобы стать участником портала\":\"$InviteLink\"\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\" или \"Форум\":\"http://cloud.onlyoffice.org\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"',NULL,'2016-12-16 14:44:29','text',2,NULL,'Svetlana'),(950601,250,'pattern_freecloud_guest_welcome','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie sind als Gäst auf den Portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" eingeladen worden.\n\nh3.Fangen Sie die Arbeit mit Ihrem Portal an \n\n# Bearbeiten Sie Ihr \"Profil\":\"$MyStaffLink\", um Personalangaben und Kontaktdaten hinzuzufügen.\n# View and comment the content open available for all portal users in the \"Community\":\"${__VirtualRootPath}/products/community/\", \"Projects\":\"${__VirtualRootPath}/products/projects/\" modules.\n\n# Add and download files available for you in the \"Documents\":\"${__VirtualRootPath}/products/files/\" module.\n\n# Fügen Sie Dateien hinzu und laden Sie verfügbare in dem Modul \"Dokumente\":\"${__VirtualRootPath}/products/files/\" herunter.\n# Fügen Sie Ihr E-Mail-Konto dem Modul \"${LetterLogoText} E-Mail\":\"${__VirtualRootPath}/addons/mail/\" hinzu.\n# Erstellen Sie \"Projekte\":\"${__VirtualRootPath}/products/projects/\" und verwalten Sie Ihren Workflow, indem Sie Meilensteine und Aufgaben hinzufügen.\n# Verwalten Sie Ihre Kundenbeziehungen mit Modul \"CRM\"::\"${__VirtualRootPath}/products/community/\" bestimmen Sie Prioritätskontakte, verfolgen Sie Nachrichtenhistorie und Umsatzentwicklung.\n# Sehen Sie an und lassen Sie Ihre Kommentare  Sie Modul \"Community\":\"${__VirtualRootPath}/products/community/\" um Ihre Blogs, Foren, Ereignisse, Lesezeichen hinzuzufügen.\n\n# Fügen Sie Dateien hinzu und laden Sie verfügbare in dem Modul \"Dokumente\":\"${__VirtualRootPath}/products/files/\" herunter.\n# Gestalten Sie Ihren Arbeitsprozess mit eingebautem \"Kalender\":\"${__VirtualRootPath}/addons/calendar/\".\n# Starten Sie \"Talk\":\"${__VirtualRootPath}/addons/talk/\" um mit Ihren Teammitgliedern online zu chatten.\n\nWenn Sie Hilfe benötigen, besuchen Sie unser \"Hilfe-Center\":\"http://helpcenter.onlyoffice.com/\" oder unser \"Forum\":\"http://cloud.onlyoffice.org\".\n\nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"',NULL,'2017-02-03 09:29:14','text',2,NULL,'Evgenia'),(951001,250,'pattern_freecloud_guest_welcome','es','Buenos días, $UserName,\n\nUsted ha sido invitado al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" como el visitante.\n\nh3.Empieze a trabajar con su portal:\n\n# Edite su \"Perfil\":\"$MyStaffLink\" para añadir los detalles personales y de contacto.\n# Visualice y comente el contenido disponible para todos los usuarios de portal en los módulos \"Comunidad\":\"${__VirtualRootPath}/products/community/\" y \"Proyectos\":\"${__VirtualRootPath}/products/projects/\".\n# Añada y descargue archivos disponibles para Usted en el módulo \"Documentos\":\"${__VirtualRootPath}/products/files/\".\n# Planee su horario de trabajo con ayuda de \"Calendario\" incorporado:\"${__VirtualRootPath}/addons/calendar/\".\n# Inicie \"Chat\":\"${__VirtualRootPath}/addons/talk/\" para chatear con otros usuarios de portal en línea.\n\nSi necesita ayuda al trabajar con portal, le invitamos a nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\" o \"Foro\":\"http://cloud.onlyoffice.org/\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE™\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-14 11:26:46','text',2,NULL,'Ekaterina.Heidel'),(950779,250,'pattern_freecloud_guest_welcome','fr','Bonjour $UserName,\n\nVous êtes invité en tant qu\'un utilisateur invité au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3. Pour commencer à utiliser le portail:\n\n# Modifiez votre \"profil\":\"$MyStaffLink\" en ajoutant vos données personnelles et de contact.\n# Parcourez et commentez le contenu du portail disponible pour tous les utilisateurs dans le modules \"Communauté\":\"${__VirtualRootPath}/products/community/\", \"Projets\":\"${__VirtualRootPath}/products/projects/\".\n# Ajoutez et téléchargez les fichiers disponibles dans le module \"Documents\":\"${__VirtualRootPath}/products/files/\".\n# Organisez votre horaire avec le \"Calendrier\" intégré :\"${__VirtualRootPath}/addons/calendar/\".\n# Démarrez le \"Chat\":\"${__VirtualRootPath}/addons/talk/\" pour communiquer avec les autres utilisateurs du portail en ligne.\n\nSi vous avez besoin d\'aide avec le portail, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\" ou visitez notre \"Forum\":\"http://cloud.onlyoffice.org/\".\n\nSincérement,\nÉquipe ONLYOFFICE™ \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-07 10:11:35','text',2,NULL,'Nadine Yablonskaya'),(934164,250,'pattern_freecloud_guest_welcome','Neutral','Dear $UserName,\r\n\r\nYou have been invited as guest user to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\r\n\r\nh3.Get started with your portal:\r\n\r\n# Edit your \"profile\":\"$MyStaffLink\" to add personal and contact details.\r\n# View and comment the content open available for all portal users in the \"Community\":\"${__VirtualRootPath}/products/community/\", \"Projects\":\"${__VirtualRootPath}/products/projects/\" modules.\r\n# Add and download files available for you in the \"Documents\":\"${__VirtualRootPath}/products/files/\" module.\r\n# Organize your schedule with the built-in \"Calendar\":\"${__VirtualRootPath}/addons/calendar/\".\r\n# Start \"Talk\":\"${__VirtualRootPath}/addons/talk/\" to chat with other portal users online.\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\" or visit our \"Forum\":\"http://cloud.onlyoffice.org/\".\r\n\r\nBest regards,\r\nONLYOFFICE™ Support Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:52','text',2,NULL,'Console'),(936237,250,'pattern_freecloud_guest_welcome','ru','Здравствуйте, $UserName,\n\nВас пригласили на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" в качестве гостя.\n\nh3.Начните работать со своим порталом:\n\n# Отредактируйте свой \"профиль\":\"$MyStaffLink\", добавив личную и контактную информацию.\n# Просматривайте и комментируйте контент, доступный для всех пользователей портала в модулях \"Сообщество\":\"${__VirtualRootPath}/products/community/\" и \"Проекты\":\"${__VirtualRootPath}/products/projects/\".\n# Добавляйте и скачивайте файлы, доступные для Вас, в модуле \"Документы\":\"${__VirtualRootPath}/products/files/\".\n# Планируйте рабочий график с помощью встроенного \"Календаря\":\"${__VirtualRootPath}/addons/calendar/\".\n# Запустите \"Чат\":\"${__VirtualRootPath}/addons/talk/\", чтобы общаться с другими пользователями портала онлайн.\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\" или \"Форум\":\"http://cloud.onlyoffice.org/\".\n\nС уважением,\nкоманда ONLYOFFICE™\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 14:56:24','text',2,NULL,'Svetlana'),(950609,250,'pattern_freecloud_user_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\n$__AuthorName hat Sie eingeladen, dem ${LetterLogoText} Free Cloud Portal bezutreten, um die interne Zusammenarbeit zu verbessern. Ihre Portaladresse ist \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Das Hinzufügen dieses Links dem Lesezeichen ist eine gute Idee. Per Lesezeichen speichern Sie häufig genutzte Webadressen für einen schnellen Zugriff).\n\nUm die Einladung anzunehmen, folgen Sie dem Link unten. Der Link ist nur für 7 Tage gültig:\n\np=. \"Klicken Sie hier, um dem Portal beizutreten\":\"$InviteLink\"\n',NULL,'2017-02-03 10:31:26','text',2,NULL,'Evgenia'),(950763,250,'pattern_freecloud_user_activation','es','Buenos días, $UserName,\n\n$__AuthorName ha invitado a Usted a participar en ${LetterLogoText} Free Cloud - portal de su equipo para organizar un trabajo en colaboración efectivo. Dirección de su portal - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (le recomendamos que añada este enlace a marcadores: es muy probable que Usted lo use a menudo).\n\nUsted puede aceptar esta invitación siguiendo el enlace abajo, este enlace es válido durante 7 días:\n\np=. \"Pulse aquí para participar en el portal\":\"$InviteLink\"',NULL,'2017-02-07 08:06:09','text',2,NULL,'Ekaterina.Heidel'),(949597,250,'pattern_freecloud_user_activation','fr','Bonjour $UserName,\n\n$__AuthorName vous a invité de rejoindre ${LetterLogoText} Free Cloud - le portail de votre équipe visant à améliorer une coopération interne. L\'adresse de votre portail est \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (vous pouvez ajouter ce lien à vos favoris, probablement vous allez l\'utiliser souvent).\n\nVous pouvez accépter l\'invitation en suivant le lien suivant (il est valable pendant 7 jours)\n\np=. \"Cliquez ici pour rejoindre le portail\":\"$InviteLink\"',NULL,'2017-01-27 09:44:49','text',2,NULL,'Nadine Yablonskaya'),(934139,250,'pattern_freecloud_user_activation','Neutral','Dear $UserName,\r\n\r\n$__AuthorName has invited you to join ${LetterLogoText} Free Cloud - your team\'s portal that would enchance internal cooperation. Your portal address is \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (adding this link to your bookmarks is a good idea, you are most likely to get to use it a lot).\r\n\r\nYou can accept the invitation by following the link below, it is only valid for 7 days:\r\n\r\np=. \"Click here to join the portal\":\"$InviteLink\"','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936186,250,'pattern_freecloud_user_activation','ru','Здравствуйте, $UserName,\n\n$__AuthorName приглашает Вас стать участником ${LetterLogoText} Free Cloud - портала вашей команды для организации эффективной совместной работы. Адрес Вашего портала - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (советуем добавить эту ссылку в закладки: по всей вероятности, Вы будете ей часто пользоваться).\n\nВы можете принять приглашение, перейдя по следующей ссылке, она действительна только 7 дней:\n\np=. \"Нажмите сюда, чтобы стать участником портала\":\"$InviteLink\"',NULL,'2016-12-16 11:07:00','text',2,NULL,'Svetlana'),(950294,250,'pattern_freecloud_user_welcome','de','Sehr geehrte/r Frau/Herr $UserName,\n\nIhr Benutzerprofil wurde erfolgreich dem Portal unter\"${__VirtualRootPath}\":\"${__VirtualRootPath}\" hinzugefügt.\n\nh3.Fangen Sie die Arbeit mit Ihrem Portal an \n\n# Bearbeiten Sie Ihr \"Profil\":\"$MyStaffLink\", um Personalangaben und Kontaktdaten hinzuzufügen.\n# Nutzen Sie Modul \"Community\":\"${__VirtualRootPath}/products/community/\" um Ihre Blogs, Foren, Ereignisse, Lesezeichen zu starten.\n# Erstellen Sie \"Projekte\":\"${__VirtualRootPath}/products/projects/\" und verwalten Sie Ihren Workflow, indem Sie Meilensteine und Aufgaben hinzufügen.\n# Laden, bearbeiten und organizieren Sie Ihre \"Dokumente\":\"${__VirtualRootPath}/products/files/\".\n# Verwalten Sie Ihre Kundenbeziehungen mit Modul \"CRM\"::\"${__VirtualRootPath}/products/community/\" bestimmen Sie Prioritätskontakte, verfolgen Sie Nachrichtenhistorie und Umsatzentwicklung.\n# Starten Sie \"Talk\":\"${__VirtualRootPath}/addons/talk/\" um mit Ihren Teammitgliedern online zu chatten.\n# Fügen Sie Ihr E-Mail-Konto dem Modul \"${LetterLogoText} E-Mail\":\"${__VirtualRootPath}/addons/mail/\" hinzu.\n\nWenn Sie Hilfe benötigen, besuchen Sie unser \"Hilfe-Center\":\"http://helpcenter.onlyoffice.com/\" oder unser \"Forum\":\"http://cloud.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"\n',NULL,'2017-02-01 09:46:01','text',2,NULL,'Evgenia'),(951023,250,'pattern_freecloud_user_welcome','es','Buenos días, $UserName,\n\nSu perfil de usuario ha sido añadido con éxito al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Empieze a trabajar con su portal\n\n# Edite su \"perfil\":\"$MyStaffLink\" para añadir los detalles personales y de contacto.\n# Use \"Comunidad\":\"${__VirtualRootPath}/products/community/\" para crear blogs, comunicarse en foros, añadir eventos y aún más.\n# Cree \"Proyectos\":\"${__VirtualRootPath}/products/projects/\" y maneje flujo de trabajo añadiendo hitos y asignando tareas.\n# Cargue, edite y organice \"Documentos\":\"${__VirtualRootPath}/products/files/\".\n# Maneje relaciones con sus clientes usando el módulo \"CRM\":\"${__VirtualRootPath}/products/crm/\", identifique los contactos de prioridad, monitorice historia de comunicación y rendimiento en ventas.\n# Planee su horario de trabajo con ayuda de \"Calendario\" incorporado:\"${__VirtualRootPath}/addons/calendar/\", monitorice fechas límite de tareas y hitos.\n# Inicie \"Chat\":\"${__VirtualRootPath}/addons/talk/\" para chatear con miembros de su equipo en línea.\n# Añada su cuenta de correo al módulo \"Correo ${LetterLogoText}\":\"${__VirtualRootPath}/addons/mail/\".\n\nSi necesita ayuda al trabajar con portal, le invitamos a nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\" o \"Foro\":\"http://cloud.onlyoffice.org\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"',NULL,'2017-02-15 12:58:57','text',2,NULL,'Ekaterina.Heidel'),(950806,250,'pattern_freecloud_user_welcome','fr','Bonjour $UserName,\n\nVotre profil d\'utilisateur a été ajouté au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Commencez à utiliser le portail et\n\n# Modifiez votre \"profil\" :\"$MyStaffLink\" en ajoutant vos données personnelles et de contact.\n# Utilisez le module \"Communauté\":\"${__VirtualRootPath}/products/community/\" pour démarrer vos blogs, forums, ajouter des évenements ,et plus.\n# Créez des \"Projets\":\"${__VirtualRootPath}/products/projects/\" et gérez votre flux de travail en ajoutant des tâches et des jalons.\n# Téléchargez, modifiez et organisez des \"Documents\":\"${__VirtualRootPath}/products/files/\".\n# Gérez les relations avec la clientèle en utilisant le module \"CRM\":\"${__VirtualRootPath}/products/crm/\", identifiez les contacts de priorité, suivez l’historique des communications et la performance des ventes.\n# Organisez votre horaire avec le \"Calendrier\" intégré:\"${__VirtualRootPath}/addons/calendar/\", suivez des tâches et des jalons et leurs dates d\'échéance.\n# Démarrez le \"Chat\" :\"${__VirtualRootPath}/addons/talk/\" pour communiquer en ligne avec les autres utilisateurs du portail.\n# Ajoutez votre compte de messagerie au \"${LetterLogoText} Mail\":\"${__VirtualRootPath}/addons/mail/\".\n\nSi vous avez besoin d\'aide avec le portail, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\" ou notre \"Forum\":\"http://cloud.onlyoffice.com\".\n\nSincérement,\nÉquipe d\'assistance ONLYOFFICE\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"',NULL,'2017-02-07 13:02:18','text',2,NULL,'Nadine Yablonskaya'),(934140,250,'pattern_freecloud_user_welcome','Neutral','Dear $UserName,\r\n\r\nYour user profile has been successfully added to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\r\n\r\nh3.Get started with your portal\r\n\r\n# Edit your \"profile\":\"$MyStaffLink\" to add personal and contact details.\r\n# Use \"Community\":\"${__VirtualRootPath}/products/community/\" to start your blogs, forums, add events, and more.\r\n# Create \"Projects\":\"${__VirtualRootPath}/products/projects/\" and manage your workflow by adding milestones and tasks.\r\n# Upload, edit and organize \"Documents\":\"${__VirtualRootPath}/products/files/\".\r\n# Manage your customer relations using \"CRM\":\"${__VirtualRootPath}/products/crm/\" module, identify priority contacts, track communication history and sales performance.\r\n# Organize your work schedule with the built-in \"Calendar\":\"${__VirtualRootPath}/addons/calendar/\" tracking tasks and milestones due dates.\r\n# Start \"Talk\":\"${__VirtualRootPath}/addons/talk/\" to chat with your team members online.\r\n# Add your email account to \"${LetterLogoText} Mail\":\"${__VirtualRootPath}/addons/mail/\".\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\" or our \"Forum\":\"http://cloud.onlyoffice.com\".\r\n\r\nBest regards,\r\nONLYOFFICE Support Team\r\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936249,250,'pattern_freecloud_user_welcome','ru','Здравствуйте, $UserName,\n\nВаш пользовательский профиль успешно добавлен на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Начните работать со своим порталом\n\n# Отредактируйте свой \"профиль\":\"$MyStaffLink\", добавив личную и контактную информацию.\n# Используйте \"Сообщество\":\"${__VirtualRootPath}/products/community/\", чтобы вести блоги, общаться на форумах, добавлять события и многое другое.\n# Создавайте \"Проекты\":\"${__VirtualRootPath}/products/projects/\" и управляйте рабочим процессом, добавляя вехи и ставя задачи.\n# Загружайте, редактируйте и систематизируйте \"Документы\":\"${__VirtualRootPath}/products/files/\".\n# Управляйте взаимоотношениями с клиентами, используя модуль \"CRM\":\"${__VirtualRootPath}/products/crm/\", определяйте приоритетные контакты, следите за историей взаимодействия и эффективностью продаж.\n# Планируйте рабочий график с помощью встроенного \"Календаря\":\"${__VirtualRootPath}/addons/calendar/\", отслеживайте сроки выполнения задач и вех.\n# Запустите \"Чат\":\"${__VirtualRootPath}/addons/talk/\", чтобы общаться со своей командой онлайн.\n# Добавьте свою учетную запись электронной почты в \"Почту ${LetterLogoText}\":\"${__VirtualRootPath}/addons/mail/\".\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\" или \"Форум\":\"http://cloud.onlyoffice.org\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"',NULL,'2016-12-19 08:11:24','text',2,NULL,'Svetlana'),(950588,250,'pattern_hosted_admin_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie haben gerade das ONLYOFFICE Portal erstellt, das die interne Zusammenarbeit verbessern wird. Ihre Portaladresse ist \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Das Hinzufügen dieses Links dem Lesezeichen ist eine gute Idee. Per Lesezeichen speichern Sie häufig genutzte Webadressen für einen schnellen Zugriff). Folgen Sie dem Link unten, um Ihre E-Mail-Adresse zu bestätigen:\n\np=. \"Klicken Sie hier für die Bestätigung\":\"$InviteLink\"\n\nBitte vervollständigen Sie Ihre E-Mail-Aktivierung innerhalb einer Woche. Der Link ist nur für 7 Tage gültig.\n\nHinweis: Wir senden keine vertrauliche Information (wie Ihr Passwort) in E-Mails aus Sicherheitsgründen. Sie können Ihre E-Mail oder Passwort auf Ihrer \"persönlichen Profilseite \" ändern:\"$MyStaffLink\".\n\nFür weitere Information besuchen Sie unser \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-03 09:11:53','text',2,NULL,'Evgenia'),(951006,250,'pattern_hosted_admin_activation','es','Buenos días, $UserName,\n\nUsted acaba de crear el portal ONLYOFFICE para organizar un trabajo en colaboración efectivo. Dirección de su portal - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Le recomendamos añadir este enlace a marcadores: es probable que Usted lo use a menudo). Para confirmar su dirección de correo electrónico, por favor, siga el enlace siguiente:\n\n p=. \"Pulse aquí para confirmar\":\"$InviteLink\"\n\nPor favor, termine la activación de su correo electrónico durante la semana, porque el enlace es válido solo durante 7 días.\n\nNote, por favor: por razones de seguridad no enviamos la información confidencial (como su contraseña) en los mensajes de correo. Usted puede cambiar su dirección de correo electrónico o contraseña en \"la página de su perfil personal\":\"$MyStaffLink\".\n\nPara recibir una información adicional le invitamos a nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-14 12:11:14','text',2,NULL,'Ekaterina.Heidel'),(950798,250,'pattern_hosted_admin_activation','fr','Bonjour $UserName,\n\nVous venez de créer le portail ONLYOFFICE pour vous aider à améliorer la coopération interne au sein de votre entreprise. L\'adresse de votre portail est \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (vous pouvez ajouter ce lien à vos favoris, probablement vous allez l\'utiliser souvent). Suivez le lien ci-dessous pour confirmer votre adresse e-mail :\n\n p=. \"Cliquez sur ce lien de confirmation\":\"$InviteLink\"\n\nVeuillez effectuer l\'activation par e-mail dans une semaine car le lien n\'est valable que 7 jours.\n\nRemarque : pour des raisons de sécurité nous n\'envoyons pas de renseignements confidentiels par courriel (tels que mot de passe). Vous pouvez changer votre e-mail ou mot de passe sur la page de votre \"profil\":\"$MyStaffLink\".\n\nPour plus d\'informations, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nSincérement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-07 11:42:57','text',2,NULL,'Nadine Yablonskaya'),(934118,250,'pattern_hosted_admin_activation','Neutral','Dear $UserName,\r\n\r\nYou have just created the ONLYOFFICE portal, your team\'s portal that would enhance internal cooperation. Your portal address is \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (adding this link to your bookmarks is a good idea, you are most likely to get to use it a lot). Follow the link below to confirm your email address:\r\n\r\n p=. \"Click here for confirmation\":\"$InviteLink\"\r\n\r\nPlease, complete your email activation within a week as the link is valid for 7 days only.\r\n\r\nNote: we do not send out confidential information (like your password) in emails for safety reasons. You may change your email or password in your \"personal profile page\":\"$MyStaffLink\".\r\n\r\nFor more information we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936241,250,'pattern_hosted_admin_activation','ru','Здравствуйте, $UserName,\n\nВы только что создали портал ONLYOFFICE для организации эффективной совместной работы. Адрес Вашего портала - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Советуем добавить эту ссылку в закладки: по всей вероятности, Вы будете ей часто пользоваться). Для подтверждения адреса электронной почты перейдите по следующей ссылке:\n\n p=. \"Нажмите сюда для подтверждения\":\"$InviteLink\"\n\nПожалуйста, выполните активацию электронной почты в течение недели, так как ссылка действительна только 7 дней.\n\nОбратите внимание: из соображений безопасности мы не высылаем в электронных письмах конфиденциальную информацию (такую, как ваш пароль). Вы можете изменить свой адрес электронной почты или пароль на \"странице вашего личного профиля\":\"$MyStaffLink\".\n\nДля получения дополнительной информации приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 15:34:01','text',2,NULL,'Svetlana'),(950817,250,'pattern_hosted_admin_invite_teammates','de','Sehr geehrte/r Frau/Herr $UserName,\n\nDas Cloud-Office für Ihr Team ist bereits auf \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" erstellt. Es ist Zeit, Ihre Teamkollegen einzuladen.\nAm einfachsten können Sie das Einladungslink mit der Hilfe der Option *Laden zum Portal* verteilen.\n\n$GreenButton\n\nFals Sie Zugriff zu die detaillierten Kontaktinformation haben, fügen Sie Ihre Teamkollegen manuell mit der Taste *Neu erstellen...* in den Modul *Personen* ein. \"Mehr erfahren >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nOder fügen Sie alle Benutzer auf einmal ein. Dafür nutzen Sie:\n  \"Ihr Yahoo- oder Google-Konto\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\n  \"Ihr E-Mail-Client-Adressbuch\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\n  \"eine CSV-Datei\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \n\nNach dem Hinzufügen verwalten Sie die Zugriffsrechte. Für weitere Information über Zugangsrechtsverwaltung, besuchen Sie unser \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-08 08:10:26','text',2,NULL,'Evgenia'),(950924,250,'pattern_hosted_admin_invite_teammates','es','Buenos días, $UserName,\n\nLa oficina en la nube para su equipo ya está creada en \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Es hora de invitar a otros compañeros de equipo a su portal. \nLa forma más fácil de hacerlo es enviar el enlace de invitación usando la opción *Invitar a usuarios al portal*.\n\n$GreenButton\n\nSi Usted tiene acceso a la información de contactos detallada de las personas, añada compañeros de equipo manualmente uno por uno usando el botón *Crear nuevo...* en el módulo *Personas*. \"Aprender más >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nO añada todos los usuarios a la vez de:\n    \"su cuenta de Yahoo o Google\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\n    \"su libro de direcciones de correo de clientes\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\n    \"un archivo CSV\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \n\nUna vez añadido, gestione los derechos de acceso. Para aprender más acerca de como gestionar los derechos de acceso visite nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-13 09:07:01','text',2,NULL,'Ekaterina.Heidel'),(950693,250,'pattern_hosted_admin_invite_teammates','fr','Bonjour $UserName,\n\nLe bureau dans le nuage pour votre équipe est déjà créé à l\'adresse \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Il est temps d\'inviter vos collègues à le rejoindre. \nPour le faire, envoyez le lien d\'invitation en utilisant l\'option *Iviter les utilisateurs au portail*.\n\n$GreenButton\n\nSi vous avez accès aux informations détaillées sur les personnes, ajoutez des membres de l\'équipe manuellement en utilisant le bouton  *Créer nouveau...* du module *Personnes*. \"En savoir plus >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nOu ajoutez des utilisateurs en une seule fois en utilisant :\n    \"votre compte Yahoo ou Google\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\n    \"votre carnet d\'adresses du client de messagerie électronique\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\n    \"un fichier CSV\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \n\nUne fois les utilisateurs ajoutés, vous pouvez gérer leurs droits d\'accès. Pour en savoir plus sur ARM, consultez notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-06 13:25:04','text',2,NULL,'Nadine Yablonskaya'),(934183,250,'pattern_hosted_admin_invite_teammates','Neutral','Dear $UserName,\r\n\r\nThe cloud office for your team is already created at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". It\'s time to invite your teammates to join it. \r\nThe easiest way to do that is to distribute the invitation link using the *Invite users to portal* option.\r\n\r\n$GreenButton\r\n\r\nIf you have access to the detailed contact information of the people, add your teammates manually one by one using the *Create New...* button in the *People* module. \"Learn more >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\r\n\r\nOr add users all at once from:\r\n    \"your Yahoo or Google account\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\r\n    \"your mail client address book\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\r\n    \"a CSV file\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \r\n\r\nOnce added, manage their access rights. For more information about ARM, visit our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:52','text',2,NULL,'Console'),(936228,250,'pattern_hosted_admin_invite_teammates','ru','Здравствуйте, $UserName,\n\nОблачный офис для вашей команды уже создан по адресу \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Пора пригласить в него других участников команды. \nПроще всего сделать это, разослав пригласительную ссылку с помощью опции *Пригласить пользователей*.\n\n$GreenButton\n\nЕсли вы располагаете подробными контактными данными, добавьте участников команды вручную по одному с помощью кнопки *Создать...* в модуле *Люди*. \"Подробнее >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nИли добавьте всех пользователей сразу, используя один из следующих источников:\n    \"ваш аккаунт Yahoo или Google\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\n    \"адресная книга почтового клиента\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\n    \"файл CSV\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \n\nКогда пользователи будут добавлены, настройте права доступа. Для получения дополнительной информации об управлении правами доступа посетите наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 14:26:36','text',2,NULL,'Svetlana'),(950677,250,'pattern_hosted_admin_welcome','de','Sehr geehrte/r Frau/Herr $UserName,\n\nHöchstwahrscheinlich ist das Einstellen Ihres Web-Offices eine neue Erfahrung für Sie, so dass Sie vielleicht einige Tipps und Tricks für den Start brauchen.\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\n$GreenButton\n   \nErledigt. Es ist Zeit, Ihre Teamkollegen ins Ihr Web-Office einzuladen!\n\nMehr Informationen finden Sie in unserem \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nBitte merken Sie, dass alle Teammitglieder für die Arbeit mit Dokumenten offline ONLYOFFICE Desktop Editors nutzen können. Die Anwendung ist absolut kostenlos und kann an Ihr Portal angeschlossen werden. \"Jetzt herunterladen now\":\"http://www.onlyoffice.com/desktop.aspx\"\n\n\nMit freundlichen Grüßen,\n${LetterLogoText} Team',NULL,'2017-02-06 09:16:55','text',2,NULL,'Evgenia'),(950831,250,'pattern_hosted_admin_welcome','es','Buenos días, $UserName,\n\nEs probable que configuración de su oficina web sea una experiencia nueva para Usted, por eso creemos que le ayudarán algunos consejos acerca de como empezar el trabajo. \n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\n$GreenButton\n   \nHecho. ¡Es hora de invitar o otros compañeros de equipo a su oficina web!\n\nPara recibir una información adicional le invitamos a nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\".\n\nNote que todos sus compañeros de equipo pueden usar editores desktop de ONLYOFFICE para trabajar con documentos offline. Es la aplicación gratuita, que también puede ser conectada a su portal ONLYOFFICE. \"Descargar ahora\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-08 09:53:47','text',2,NULL,'Ekaterina.Heidel'),(946349,250,'pattern_hosted_admin_welcome','fi','Hyvä $UserName,\n\nOn luultavaa, että ${LetterLogoText} on uusi kokemus sinulle, joten ajattelimme että haluaisit saada muutamia vinkkejä aloitukseen.\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n   \nTehty. On aika kutsua tiimisi jäseniä nettitoimistoosi!\n\nLisätietoa varten kutsumme sinut tutustumaan \"Tukikeskukseemme\":\"https://helpcenter.onlyoffice.com\".\n\nHuomaa että kaikki tiimisi jäsenet voivat käyttää ONLYOFFICE desktop editoreita ja työskentelemään myös  ilman internettiä. Sovellus on ilmainen ja voidaan yhdistää ONLYOFFICE portaaliisi. \"Lataa Nyt\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nParhain terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-16 19:09:40','text',2,NULL,'Arto Ryynanen'),(950198,250,'pattern_hosted_admin_welcome','fr','Bonjour $UserName,\n\nProbablement, la configuration de votre bureau virtuel est une nouvelle expérience pour vous, alors quelques conseils et astuces peuvent être utiles pour commencer le travail avec le service. \n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\n$GreenButton\n   \nVoilà. Il est temps d’inviter vos collègues à votre bureau virtuel !\n\nPour en savoir plus, consultez notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nNotez que tous les membres de votre équipe peuvent utiliser les éditeurs de bureau ONLYOFFICE pour travailler sur les documents hors connexion. L\'application est gratuite et peut être connectée à votre portail ONLYOFFICE. \"Téléchargez maintenant\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-31 11:20:31','text',2,NULL,'Nadine Yablonskaya'),(934131,250,'pattern_hosted_admin_welcome','Neutral','Dear $UserName,\r\n\r\nIt’s likely that configuring your web-office is a new experience for you so you might like some tips and tricks to get started. \r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\r\n$GreenButton\r\n   \r\nDone. It\'s time to invite teammates to your web-office!\r\n\r\nFor more information we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nNote that all members of your team can use ONLYOFFICE Desktop Editors to work on documents offline. The application is free and can be connected to your ONLYOFFICE portal. \"Download now\":\"http://www.onlyoffice.com/desktop.aspx\"\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936199,250,'pattern_hosted_admin_welcome','ru','Здравствуйте, $UserName,\n\nВозможно, раньше вам не приходилось настраивать виртуальный офис, поэтому вам могут пригодиться несколько советов о том, с чего начать. \n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\n$GreenButton\n   \nГотово. Пора пригласить в ваш виртуальный офис других участников команды!\n\nДля получения дополнительной информации приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nОбратите внимание, что все участники вашей команды могут использовать десктопные редакторы ONLYOFFICE для работы с документами офлайн. Это бесплатное приложение, его также можно подключить к порталу ONLYOFFICE. \"Скачать сейчас\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 12:20:30','text',2,NULL,'Svetlana'),(950597,250,'pattern_hosted_guest_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie sind als Gast auf das Portal \"${__VirtualRootPath}\":\"$InviteLink\" eingeladen worden. Bitte akzeptieren Sie die E-Mail-Einladung und folgen Sie diesem Link. Der Link ist 7 Tage lang gültig:\n\np=. \"Klicken Sie hier, um dem Portal beizutreten\":\"$InviteLink\"\n\nWenn Sie Unterstützung bei der Arbeit mit dem Portal benötigen, besuchen Sie under \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE Support Team\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"',NULL,'2017-02-03 09:18:06','text',2,NULL,'Evgenia'),(950997,250,'pattern_hosted_guest_activation','es','Buenos días, $UserName,\n\nUsted ha sido invitado al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" como el visitante. Para aceptar la invitación, por favor, siga el enlace abajo, este anlace es válido solo durante 7 días:\n\np=. \"Pulse aquí para hacerse el miembro del portal\":\"$InviteLink\"\n\nSi necesita ayuda al trabajar con el portal, le invitamos a nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-14 09:20:48','text',2,NULL,'Ekaterina.Heidel'),(950766,250,'pattern_hosted_guest_activation','fr','Bonjour $UserName,\n\nVous êtes invité en tant qu\'un utilisateur invité au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Veuillez accepter l’invitation en suivant le lien ci-dessous. Ce lien n\'est valable que pour une durée de 7 jours :\n\np=. \"Cliquez ici pour rejoindre le portail\":\"$InviteLink\"\n\nSi vous avez besoin de l\'aide avec votre portail, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nSincérement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-07 08:21:47','text',2,NULL,'Nadine Yablonskaya'),(934165,250,'pattern_hosted_guest_activation','Neutral','Dear $UserName,\r\n\r\nYou have been invited as a guest user to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Please accept the invitation by following the link below, it is only valid for 7 days:\r\n\r\np=. \"Click here to join the portal\":\"$InviteLink\"\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:52','text',2,NULL,'Console'),(936234,250,'pattern_hosted_guest_activation','ru','Здравствуйте, $UserName,\n\nВас пригласили на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" в качестве гостя. Чтобы принять приглашение, перейдите по следующей ссылке, она действительна только 7 дней:\n\np=. \"Нажмите сюда, чтобы стать участником портала\":\"$InviteLink\"\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 14:49:35','text',2,NULL,'Svetlana'),(950605,250,'pattern_hosted_guest_welcome','de','Sehr geehrte/r Frau/Herr $UserName,\n\nIhr Gastprofil wurde erfolgreich dem Portal unter\"${__VirtualRootPath}\":\"${__VirtualRootPath}\" hinzugefügt.\n\nh3.Fangen Sie die Arbeit mit Ihrem Portal an \n\n# Bearbeiten Sie Ihr \"Profil\":\"$MyStaffLink\", um Personalangaben und Kontaktdaten hinzuzufügen.\n# Sehen Sie an und kommentieren Sie Inhalte, die für alle Portalbenutzer in Modul \"Community\":\"${__VirtualRootPath}/products/community/\", \"Projekte\":\"${__VirtualRootPath}/products/projects/\" zugänglich sind.\n# Fügen Sie Dateien hinzu und laden Sie die verfügbaren Dateien in Modul \"Dokumente\":\"${__VirtualRootPath}/products/files/\" herunter.\n# Gestalten Sie Ihren Arbeitsprozess mit eingebautem \"Kalender\":\"${__VirtualRootPath}/addons/calendar/\".\n# Starten Sie \"Talk\":\"${__VirtualRootPath}/addons/talk/\" um mit Ihren Teammitgliedern online zu chatten.\n\n$GreenButton\n\nWenn Sie Hilfe benötigen, besuchen Sie unser \"Hilfe-Center\":\"http://helpcenter.onlyoffice.com/\" oder unser \"Forum\":\"http://cloud.onlyoffice.org\".\n\nEin kleiner Tipp: Nutzen Sie kostenlose ONLYOFFICE Desktop Editors, wenn Sie Dokumente, Tabellen und Präsentationen ohne Internetverbindung bearbeiten möchten. \"Jetzt herunterladen\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-03 10:21:29','text',2,NULL,'Evgenia'),(951021,250,'pattern_hosted_guest_welcome','es','Buenos días, $UserName,\n\nSu perfil de visitante ha sido añadido con éxito al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Empieze a trabajar con su portal:\n\n# Edite su \"perfil\":\"$MyStaffLink\" para añadir los detalles personales y de contacto.\n# Visualice y comente el contenido disponible para todos los usuarios de portal en los módulos \"Comunidad\":\"${__VirtualRootPath}/products/community/\" y \"Proyectos\":\"${__VirtualRootPath}/products/projects/\".\n# Añada y descargue archivos disponibles para Usted en el módulo \"Documentos\":\"${__VirtualRootPath}/products/files/\".\n# Planee su horario de trabajo con ayuda de \"Calendario\" incorporado:\"${__VirtualRootPath}/addons/calendar/\".\n# Inicie \"Chat\":\"${__VirtualRootPath}/addons/talk/\" para chatear con otros usuarios de portal en línea.\n\n$GreenButton\n\nSi necesita ayuda al trabajar con portal, le invitamos a nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\" o \"Foro\":\"http://cloud.onlyoffice.org\".\n\nConsejo: use editores desktop gratuitos de ONLYOFFICE, si le necesita editar documentos, hojas de cálculo y presentaciones sin conexión al Internet. \"Descargar ahora\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-15 12:29:28','text',2,NULL,'Ekaterina.Heidel'),(950803,250,'pattern_hosted_guest_welcome','fr','Bonjour $UserName,\n\nVotre profil d\'invité a été invité au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Commencez à utiliser le portail et:\n\n# Modifiez votre \"profil\":\"$MyStaffLink\" en ajoutant vos données personnelles et de contact.\n# Parcourez et commentez le contenu du portail disponible pour tous les utilisateurs dans le modules \"Communauté\":\"${__VirtualRootPath}/products/community/\", \"Projets\":\"${__VirtualRootPath}/products/projects/\".\n# Ajoutez et téléchargez les fichiers disponibles dans le module \"Documents\":\"${__VirtualRootPath}/products/files/\".\n# Organisez votre horaire avec le \"Calendrier\" intégré :\"${__VirtualRootPath}/addons/calendar/\".\n# Démarrez le \"Chat\" :\"${__VirtualRootPath}/addons/talk/\" pour communiquer en ligne avec les autres utilisateurs du portail.\n\n$GreenButton\n\nSi vous avez besoin d\'aide avec votre portail, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\" ou visitez notre \"Forum\":\"http://cloud.onlyoffice.org\".\n\nPetite astuce: si vous avez besoin de travailler sur des documents, classeurs et présentations sans connexion Internet, vous pouvez utiliser les éditeurs de bureau ONLYOFFICE gratuits. \"Téléchargez maintenant\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nSincérement,\nÉquipe ONLYOFFICE',NULL,'2017-02-07 12:31:13','text',2,NULL,'Nadine Yablonskaya'),(934166,250,'pattern_hosted_guest_welcome','Neutral','Dear $UserName,\r\n\r\nYour guest profile has been successfully added to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\r\n\r\nh3.Get started with your portal:\r\n\r\n# Edit your \"profile\":\"$MyStaffLink\" to add personal and contact details.\r\n# View and comment the content open available for all portal users in the \"Community\":\"${__VirtualRootPath}/products/community/\", \"Projects\":\"${__VirtualRootPath}/products/projects/\" modules.\r\n# Add and download files available for you in the \"Documents\":\"${__VirtualRootPath}/products/files/\" module.\r\n# Organize your schedule with the built-in \"Calendar\":\"${__VirtualRootPath}/addons/calendar/\".\r\n# Start \"Talk\":\"${__VirtualRootPath}/addons/talk/\" to chat with other portal users online.\r\n\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\" or visit our \"Forum\":\"http://cloud.onlyoffice.org\".\r\n\r\nJust a tip: use free ONLYOFFICE Desktop Editors, if you need to edit documents, spreadsheets and presentations without Internet connection. \"Download now\":\"http://www.onlyoffice.com/desktop.aspx\"\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:52','text',2,NULL,'Console'),(936246,250,'pattern_hosted_guest_welcome','ru','Здравствуйте, $UserName,\n\nВаш гостевой профиль успешно добавлен на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Начните работать со своим порталом:\n\n# Отредактируйте свой \"профиль\":\"$MyStaffLink\", добавив личную и контактную информацию.\n# Просматривайте и комментируйте контент, доступный для всех пользователей портала в модулях \"Сообщество\":\"${__VirtualRootPath}/products/community/\" и \"Проекты\":\"${__VirtualRootPath}/products/projects/\".\n# Добавляйте и скачивайте файлы, доступные для Вас, в модуле \"Документы\":\"${__VirtualRootPath}/products/files/\".\n# Планируйте свой график с помощью встроенного \"Календаря\":\"${__VirtualRootPath}/addons/calendar/\".\n# Запустите \"Чат\":\"${__VirtualRootPath}/addons/talk/\", чтобы общаться с другими пользователями портала онлайн.\n\n$GreenButton\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\" или \"Форум\":\"http://cloud.onlyoffice.org\".\n\nНебольшой совет: используйте бесплатные десктопные редакторы ONLYOFFICE, если вам требуется редактировать текстовые документы, электронные таблицы и презентации без подключения к интернету. \"Скачать сейчас\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-19 07:57:11','text',2,NULL,'Svetlana'),(950610,250,'pattern_hosted_user_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\n$__AuthorName hat Sie eingeladen, dem ONLYOFFICE Portal bezutreten, um die interne Zusammenarbeit zu verbessern. Ihre Portaladresse ist \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Das Hinzufügen dieses Links dem Lesezeichen ist eine gute Idee. Per Lesezeichen speichern Sie häufig genutzte Webadressen für einen schnellen Zugriff).\n\nUm die Einladung anzunehmen, folgen Sie dem Link unten. Der Link ist nur für 7 Tage gültig:\n\np=. \"Klicken Sie hier, um dem Portal beizutreten\":\"$InviteLink\"\n\nBenötigen Sie Unterstützumg bei der Arbeit mit Ihrem Portal, besuchen Sie unser \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\" oder unser \"Forum\":\"http://cloud.onlyoffice.org\".\n\nMit freundlichen Grüßen\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-03 10:33:22','text',2,NULL,'Evgenia'),(950769,250,'pattern_hosted_user_activation','es','Buenos días, $UserName,\n\n$__AuthorName ha invitado a Usted a participar en ONLYOFFICE - portal de su equipo para organizar un trabajo en colaboración efectivo. Dirección de su portal - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (le recomendamos que añada este enlace a marcadores: es muy probable que Usted lo use a menudo).\n\nUsted puede aceptar esta invitación siguiendo el enlace abajo, este enlace es válido durante 7 días:\n\np=. \"Pulse aquí para participar en el portal\":\"$InviteLink\"\n\nSi le necesita ayuda al trabajar con el portal, le invitamos a visitar nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\" o \"Foro\":\"http://cloud.onlyoffice.org\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-07 08:44:37','text',2,NULL,'Ekaterina.Heidel'),(946339,250,'pattern_hosted_user_activation','fi','Hyvä $UserName,\n\n$__AuthorName on kutsunut sinut liittymään: ${LetterLogoText} - tiimisi portaaliin, mikä auttaa sisäistä yhteistoimintaa. Portaalisi osoite on \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (tämän osoitteen lisääminen kirjanmerkkeihisi voi olla hyvä idea, koska tulet käyttämään sitä paljon).\n\nVoit hyväksyä kutsun seuraamalla allaolevaa linkkiä, mikä on voimassa vain 7 päivää:\n\np=. \"Klikkaa tätä liittyäksesi portaaliin\":\"$InviteLink\"\n\nJos haluat tukea portaalisi käytössä, niin me kutsumme sinun tutustumaan \"Tukikeskukseemme\":\"https://helpcenter.onlyoffice.com\" tai vierailemaan \"Foorumissa\":\"http://cloud.onlyoffice.org\".\n\n\nParhain terveisin,\n${LetterLogoText} Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-16 18:53:27','text',2,NULL,'Arto Ryynanen'),(949598,250,'pattern_hosted_user_activation','fr','Bonjour $UserName,\n\n$__AuthorName vous a invité à rejoindre ONLYOFFICE - le portail de votre équipe visant une amélioration de la coopération interne. L\'adresse de votre portail est \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (ajoutez ce lien à vos favoris, probablement vous allez l\'utiliser souvent).\n\nVous pouvez accepter l\'invitation en suivant le lien suivant (il est valable pendant 7 jours) :\n\np=. \"Cliquez ici pour rejoindre le portail\":\"$InviteLink\"\n\nSi vous avez des questions concernant le travail avec le portail, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\" ou visitez notre \"Forum\":\"http://cloud.onlyoffice.org\".\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-27 10:05:25','text',2,NULL,'Nadine Yablonskaya'),(934141,250,'pattern_hosted_user_activation','Neutral','Dear $UserName,\r\n\r\n$__AuthorName has invited you to join ONLYOFFICE - your team\'s portal that would enchance internal cooperation. Your portal address is \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (adding this link to your bookmarks is a good idea, you are most likely to get to use it a lot).\r\n\r\nYou can accept the invitation by following the link below, it is only valid for 7 days:\r\n\r\np=. \"Click here to join the portal\":\"$InviteLink\"\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\" or visit our \"Forum\":\"http://cloud.onlyoffice.org\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936190,250,'pattern_hosted_user_activation','ru','Здравствуйте, $UserName,\n\n$__AuthorName приглашает Вас стать участником ONLYOFFICE - портала вашей команды для организации эффективной совместной работы. Адрес Вашего портала - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (советуем добавить эту ссылку в закладки: по всей вероятности, Вы будете ей часто пользоваться).\n\nВы можете принять приглашение, перейдя по следующей ссылке, она действительна только 7 дней:\n\np=. \"Нажмите сюда, чтобы стать участником портала\":\"$InviteLink\"\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\" или \"Форум\":\"http://cloud.onlyoffice.org\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 11:15:10','text',2,NULL,'Svetlana'),(950301,250,'pattern_hosted_user_welcome','de','Sehr geehrte/r Frau/Herr $UserName,\n\nIhr Benutzerprofil wurde erfolgreich dem Portal unter\"${__VirtualRootPath}\":\"${__VirtualRootPath}\" hinzugefügt.\n\nh3.Fangen Sie die Arbeit mit Ihrem Portal an \n\n# Bearbeiten Sie Ihr \"Profil\":\"$MyStaffLink\", um Personalangaben und Kontaktdaten hinzuzufügen.\n# Erstellen, bearbeiten und organisieren Sie Ihre Dateien im Modul \"Dokumente\":\"${__VirtualRootPath}/products/files/\".\n# Fügen Sie Ihr E-Mail-Konto dem Modul \"${LetterLogoText} E-Mail\":\"${__VirtualRootPath}/addons/mail/\" hinzu.\n# Erstellen Sie \"Projekte\":\"${__VirtualRootPath}/products/projects/\" und verwalten Sie Ihren Workflow, indem Sie Meilensteine und Aufgaben hinzufügen.\n# Verwalten Sie Ihre Kundenbeziehungen mit Modul \"CRM\"::\"${__VirtualRootPath}/products/community/\" bestimmen Sie Prioritätskontakte, verfolgen Sie Nachrichtenhistorie und Umsatzentwicklung.\n# Nutzen Sie Modul \"Community\":\"${__VirtualRootPath}/products/community/\" um Ihre Blogs, Foren, Ereignisse, Lesezeichen hinzuzufügen.\n# Gestalten Sie Ihren Arbeitsprozess mit eingebautem \"Kalender\":\"${__VirtualRootPath}/addons/calendar/\".\n# Starten Sie \"Talk\":\"${__VirtualRootPath}/addons/talk/\" um mit Ihren Teammitgliedern online zu chatten.\n\n$GreenButton\n\nWenn Sie Hilfe benötigen, besuchen Sie unser \"Hilfe-Center\":\"http://helpcenter.onlyoffice.com/\" oder unser \"Forum\":\"http://cloud.onlyoffice.com\".\n\nEin zusätzlicher Tipp: Nutzen Sie kostenlose ONLYOFFICE Desktop Editors für die Arbeit an Dokumenten, Tabellen und Präsentationen offline. Schließen Sie die Anwendung an Ihr Portal an, um Zugriff auf Dokumente zu erhalten, die in der Cloud gespeichert sind und arbeiten Sie zusammen daran. \"Jetzt herunterladen\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"\n',NULL,'2017-02-01 10:27:38','text',2,NULL,'Evgenia'),(951025,250,'pattern_hosted_user_welcome','es','Buenos días, $UserName,\n\nSu perfil de usuario ha sido añadido con éxito al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Empieze a trabajar con su portal:\n\n# Edite su \"perfil\":\"$MyStaffLink\" para añadir los detalles personales y de contacto.\n# Cree, edite y organice \"Documentos\":\"${__VirtualRootPath}/products/files/\".\n# Añada su cuenta de correo al módulo \"Correo\":\"${__VirtualRootPath}/addons/mail/\".\n# Cree \"Proyectos\":\"${__VirtualRootPath}/products/projects/\" y maneje flujo de trabajo añadiendo hitos y asignando tareas.\n# Maneje relaciones con sus clientes usando el módulo \"CRM\":\"${__VirtualRootPath}/products/crm/\", identifique los contactos de prioridad, monitorice historia de comunicacion y rendimiento en ventas.\n# Use \"Comunidad\":\"${__VirtualRootPath}/products/community/\" para crear blogs, comunicarse en foros, añadir eventos y compartir marcadores.\n# Planee su horario de trabajo con ayuda de \"Calendario\":\"${__VirtualRootPath}/addons/calendar/\".\n# Inicie \"Chat\":\"${__VirtualRootPath}/addons/talk/\" para chatear con miembros de su equipo en línea.\n\n$GreenButton\n\nSi necesita ayuda al trabajar con portal, le invitamos a nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\" o \"Foro\":\"http://cloud.onlyoffice.org\".\n\nUn consejo adicional: use los editores desktop de ONLYOFFICE gratuitos para trabajar con documentos, hojas de cálculo y presentaciones offline. Conecte esta aplicación a su portal para tener acceso a los documentos almacenados en la nube y colaborar en estos documentos. \"Descargar ahora\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-16 06:56:28','text',2,NULL,'Ekaterina.Heidel'),(950813,250,'pattern_hosted_user_welcome','fr','Bonjour $UserName,\n\nVotre profil d\'utilisateur a été ajouté au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Commencez à utiliser le portail et :\n\n# Modifiez votre \"profil\":\"$MyStaffLink\" en ajoutant vos données personnelles et de contact.\n# Créez, modifiez et organisez les \"Documents\":\"${__VirtualRootPath}/products/files/\".\n# Ajoutez votre compte de messagerie au \"Mail\":\"${__VirtualRootPath}/addons/mail/\".\n# Créez des \"Projets\":\"${__VirtualRootPath}/products/projects/\" et gérez votre flux de travail en ajoutant des tâches et des jalons.\n# Gérez les relations avec la clientèle en utilisant le module \"CRM\":\"${__VirtualRootPath}/products/crm/\", identifiez les contacts de priorité, suivez l’historique des communications et la performance des ventes.\n# Utilisez le module \"Communauté\":\"${__VirtualRootPath}/products/community/\" pour commencer vos blogs, forums, ajouter des événements, partager des signets.\n# Organisez votre horaire avec le \"Calendrier\" intégré :\"${__VirtualRootPath}/addons/calendar/\".\n# Démarrez le \"Chat\" :\"${__VirtualRootPath}/addons/talk/\" pour communiquer en ligne avec les autres utilisateurs du portail.\n\n$GreenButton\n\nSi vous avez besoin d\'aide avec votre portail, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\" ou notre \"Forum\":\"http://cloud.onlyoffice.com\".\n\nConseil : pour travailler sur des documents, classeurs et présentations vous pouvez utiliser les éditeurs de bureau ONLYOFFICE. Connectez l\'application au portail pour accéder aux documents stockés dans le nuage. \"Téléchargez maintenant\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nSincérement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-08 07:47:04','text',2,NULL,'Nadine Yablonskaya'),(934142,250,'pattern_hosted_user_welcome','Neutral','Dear $UserName,\r\n\r\nYour user profile has been successfully added to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\r\n\r\nh3.Get started with your portal:\r\n\r\n# Edit your \"profile\":\"$MyStaffLink\" to add personal and contact details.\r\n# Create, edit and organize \"Documents\":\"${__VirtualRootPath}/products/files/\".\r\n# Add your email account to \"Mail\":\"${__VirtualRootPath}/addons/mail/\".\r\n# Create \"Projects\":\"${__VirtualRootPath}/products/projects/\" and manage your workflow by adding milestones and tasks.\r\n# Manage your customer relations using \"CRM\":\"${__VirtualRootPath}/products/crm/\" module, identify priority contacts, track communication history and sales performance.\r\n# Use \"Community\":\"${__VirtualRootPath}/products/community/\" to start your blogs, forums, add events, share bookmarks.\r\n# Organize your work schedule with the built-in \"Calendar\":\"${__VirtualRootPath}/addons/calendar/\".\r\n# Start \"Talk\":\"${__VirtualRootPath}/addons/talk/\" to chat with your teammates online.\r\n\r\n$GreenButton\r\n\r\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\" or our \"Forum\":\"http://cloud.onlyoffice.com\".\r\n\r\nAn additional tip: use free ONLYOFFICE Desktop Editors to work on documents, spreadsheets and presentations offline. Connect the application to your portal to get access to documents stored in the cloud and collaborate. \"Download now\":\"http://www.onlyoffice.com/desktop.aspx\"\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936254,250,'pattern_hosted_user_welcome','ru','Здравствуйте, $UserName,\n\nВаш пользовательский профиль успешно добавлен на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Начните работать со своим порталом:\n\n# Отредактируйте свой \"профиль\":\"$MyStaffLink\", добавив личную и контактную информацию.\n# Создавайте, редактируйте и систематизируйте \"Документы\":\"${__VirtualRootPath}/products/files/\".\n# Добавьте свою учетную запись электронной почты в \"Почту\":\"${__VirtualRootPath}/addons/mail/\".\n# Создавайте \"Проекты\":\"${__VirtualRootPath}/products/projects/\" и управляйте рабочим процессом, добавляя вехи и ставя задачи.\n# Управляйте взаимоотношениями с клиентами, используя модуль \"CRM\":\"${__VirtualRootPath}/products/crm/\", определяйте приоритетные контакты, следите за историей взаимодействия и эффективностью продаж.\n# Используйте \"Сообщество\":\"${__VirtualRootPath}/products/community/\", чтобы вести блоги, общаться на форумах, добавлять события, делиться закладками.\n# Планируйте рабочий график с помощью встроенного \"Календаря\":\"${__VirtualRootPath}/addons/calendar/\".\n# Запустите \"Чат\":\"${__VirtualRootPath}/addons/talk/\", чтобы общаться со своей командой онлайн.\n\n$GreenButton\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\" или \"Форум\":\"http://cloud.onlyoffice.org\".\n\nДополнительный совет: используйте бесплатные десктопные редакторы ONLYOFFICE для работы с текстовыми документами, электронными таблицами и презентациями в офлайн-режиме. Подключите это приложение к своему порталу, чтобы получить доступ к документам, сохраненным в облаке, и работать над ними совместно. \"Скачать сейчас\":\"http://www.onlyoffice.com/desktop.aspx\"\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-19 08:37:28','text',2,NULL,'Svetlana'),(950826,250,'pattern_hosted_whitelabel_admin_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie haben gerade das Portal erstellt, das die interne Zusammenarbeit verbessern wird. Ihre Portaladresse ist \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Das Hinzufügen dieses Links dem Lesezeichen ist eine gute Idee. Per Lesezeichen speichern Sie häufig genutzte Webadressen für einen schnellen Zugriff). Folgen Sie dem Link unten, um Ihre E-Mail-Adresse zu bestätigen:\n\n p=. \"Klicken Sie hier für die Bestätigung\":\"$InviteLink\"\n\nBitte vervollständigen Sie Ihre E-Mail-Aktivierung innerhalb einer Woche. Der Link ist nur für 7 Tage gültig.\n\nHinweis: Wir senden keine vertrauliche Informationen (wie Ihr Passwort) in E-Mails aus Sicherheitsgründen. Sie können Ihre E-Mail oder Passwort auf Ihrer \"persönliche Profilseite\" ändern:\"$MyStaffLink\".\n\nMit freundlichen Grüßen,\n${LetterLogoText} Team',NULL,'2017-02-08 08:54:09','text',2,NULL,'Evgenia'),(951008,250,'pattern_hosted_whitelabel_admin_activation','es','Buenos días, $UserName,\n\nUsted acaba de crear el portal para organizar un trabajo en colaboración efectivo. Dirección de su portal - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Le recomendamos añadir este enlace a marcadores: es probable que Usted lo use a menudo). Para confirmar su dirección de correo electrónico, por favor, siga el enlace siguiente:\n\n p=. \"Pulse aquí para confirmar\":\"$InviteLink\"\n\nPor favor, termine la activación de su correo electrónico durante la semana, porque el enlace es válido solo durante 7 días.\n\nNote, por favor: por razones de seguridad no enviamos la información confidencial (como su contraseña) en los mensajes de correo. Usted puede cambiar su dirección de correo electrónico o contraseña en \"la página de su perfil personal\":\"$MyStaffLink\".\n\nMuy atentamente,\nEquipo de ${LetterLogoText}',NULL,'2017-02-14 13:18:01','text',2,NULL,'Ekaterina.Heidel'),(950800,250,'pattern_hosted_whitelabel_admin_activation','fr','Bonjour $UserName,\n\nVous venez de créer le portail de votre équipe visant à améliorer la coopération interne au sein de votre entreprise. L\'adresse de votre portail est \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (vous pouvez ajouter ce lien à vos favoris, probablement vous allez l\'utiliser souvent). Suivez le lien ci-dessous pour confirmer votre adresse e-mail :\n\n p=. \"Cliquez sur ce lien de confirmation\":\"$InviteLink\"\n\nVeuillez effectuer l\'activation par e-mail dans une semaine car le lien n\'est valable que 7 jours.\n\nRemarque : pour des raisons de sécurité nous n\'envoyons pas de renseignements confidentiels par courriel (tels que mot de passe). Vous pouvez changer votre e-mail ou mot de passe sur la page de votre \"profil\":\"$MyStaffLink\".\n\nSincérement,,\nÉquipe ${LetterLogoText}',NULL,'2017-02-07 12:14:07','text',2,NULL,'Nadine Yablonskaya'),(934119,250,'pattern_hosted_whitelabel_admin_activation','Neutral','Dear $UserName,\r\n\r\nYou have just created your team\'s portal that would enhance internal cooperation. Your portal address is \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (adding this link to your bookmarks is a good idea, you are most likely to get to use it a lot). Follow the link below to confirm your email address:\r\n\r\n p=. \"Click here for confirmation\":\"$InviteLink\"\r\n\r\nPlease, complete your email activation within a week as the link is valid for 7 days only.\r\n\r\nNote: we do not send out confidential information (like your password) in emails for safety reasons. You may change your email or password in your \"personal profile page\":\"$MyStaffLink\".\r\n\r\nTruly yours,\r\n${LetterLogoText} Team','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936242,250,'pattern_hosted_whitelabel_admin_activation','ru','Здравствуйте, $UserName,\n\nВы только что создали портал для организации эффективной совместной работы. Адрес Вашего портала - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Советуем добавить эту ссылку в закладки: по всей вероятности, Вы будете ей часто пользоваться). Для подтверждения адреса электронной почты перейдите по следующей ссылке:\n\n p=. \"Нажмите сюда для подтверждения\":\"$InviteLink\"\n\nПожалуйста, выполните активацию электронной почты в течение недели, так как ссылка действительна только 7 дней.\n\nОбратите внимание: из соображений безопасности мы не высылаем в электронных письмах конфиденциальную информацию (такую, как ваш пароль). Вы можете изменить свой адрес электронной почты или пароль на \"странице вашего личного профиля\":\"$MyStaffLink\".\n\nС уважением,\nкоманда ${LetterLogoText}',NULL,'2016-12-16 15:37:18','text',2,NULL,'Svetlana'),(950675,250,'pattern_hosted_whitelabel_admin_welcome','de','Sehr geehrte/r Frau/Herr $UserName,\n\nHöchstwahrscheinlich ist ${LetterLogoText}eine neue Erfahrung für Sie, so dass Sie vielleicht einige Tipps und Tricks für den Start brauchen.\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\n$GreenButton\n\nErledigt. Es ist Zeit, Ihre Teamkollegen ins Ihr Web-Office einzuladen!\n\nMit freundlichen Grüßen,\n${LetterLogoText} Team\n',NULL,'2017-02-06 09:09:46','text',2,NULL,'Evgenia'),(950828,250,'pattern_hosted_whitelabel_admin_welcome','es','Buenos días, $UserName,\n\nEs probable que ${LetterLogoText} sea una experiencia nueva para Usted, por eso creemos que le ayudarán algunos consejos acerca de como empezar el trabajo.\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\n$GreenButton\n   \nHecho. ¡Es hora de invitar a otros compañeros de equipo a su oficina web!\n\nMuy atentamente,\nEquipo de ${LetterLogoText}',NULL,'2017-02-08 09:20:45','text',2,NULL,'Ekaterina.Heidel'),(946348,250,'pattern_hosted_whitelabel_admin_welcome','fi','Hyvä $UserName,\n\nOn luultavaa, että ${LetterLogoText} on uusi kokemus sinulle, joten ajattelimme että haluaisit saada muutamia vinkkejä aloitukseen.\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItem5 $TableItemsBtm\n$GreenButton\n   \nTehty. On aika kutsua tiimisi jäseniä nettitoimistoosi!\n\nLisätietoa varten kutsumme sinut tutustumaan \"Tukikeskukseemme\":\"https://helpcenter.onlyoffice.com\".\n\nParhain terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-16 19:07:08','text',2,NULL,'Arto Ryynanen'),(950199,250,'pattern_hosted_whitelabel_admin_welcome','fr','Bonjour $UserName,\n\nIl est probable que ${LetterLogoText} est une nouvelle expérience pour vous, alors quelques conseils et astuces peuvent être utiles pour commencer le travail avec le service.\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\n$GreenButton\n   \nVoilà. Il est temps d’inviter les collègues à votre bureau virtuel !\n\nCordialement,\nÉquipe ${LetterLogoText}',NULL,'2017-01-31 11:21:50','text',2,NULL,'Nadine Yablonskaya'),(934132,250,'pattern_hosted_whitelabel_admin_welcome','Neutral','Dear $UserName,\r\n\r\nIt’s likely that ${LetterLogoText} is a new experience for you so we figured that you might like some tips and tricks to get you started.\r\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\r\n$GreenButton\r\n   \r\nDone. It\'s time to invite teammates to your web-office!\r\n\r\nTruly yours,\r\n${LetterLogoText} Team','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936200,250,'pattern_hosted_whitelabel_admin_welcome','ru','Здравствуйте, $UserName,\n\nВозможно, раньше вам не приходилось работать с ${LetterLogoText}, поэтому мы посчитали, что вам могут пригодиться несколько советов о том, с чего начать.\n$TableItemsTop $TableItem1 $TableItem2 $TableItem3 $TableItem4 $TableItemsBtm\n$GreenButton\n   \nГотово. Пора пригласить в ваш виртуальный офис других участников команды!\n\nС уважением,\nкоманда ${LetterLogoText}',NULL,'2016-12-16 12:20:45','text',2,NULL,'Svetlana'),(950599,250,'pattern_hosted_whitelabel_guest_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie sind als Gast auf das Portal \"${__VirtualRootPath}\":\"$InviteLink\" eingeladen worden. Bitte akzeptieren Sie die E-Mail-Einladung und folgen Sie diesem Link. Der Link ist 7 Tage lang gültig:\n\np=. \"Klicken Sie hier, um dem Portal beizutreten\":\"$InviteLink\"\n\nMit freundlichen Grüßen,\n${LetterLogoText} Team',NULL,'2017-02-03 09:19:05','text',2,NULL,'Evgenia'),(950999,250,'pattern_hosted_whitelabel_guest_activation','es','Buenos días, $UserName,\n\nUsted ha sido invitado al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" como el visitante. Para aceptar la invitación, por favor, siga el enlace abajo, este anlace es válido solo durante 7 días:\n\np=. \"Pulse aquí para hacerse el miembro del portal\":\"$InviteLink\"\n\nMuy atentamente,\nEquipo de ${LetterLogoText}',NULL,'2017-02-14 09:23:54','text',2,NULL,'Ekaterina.Heidel'),(950768,250,'pattern_hosted_whitelabel_guest_activation','fr','Bonjour $UserName,\n\nVous êtes invité en tant qu\'un utilisateur invité au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Veuillez accepter l’invitation en suivant le lien ci-dessous. Ce lien n\'est valable que pour une durée de 7 jours :\n\np=. \"Cliquez ici pour rejoindre le portail\":\"$InviteLink\"\n\nSincérement,\nÉquipe ${LetterLogoText}',NULL,'2017-02-07 08:33:01','text',2,NULL,'Nadine Yablonskaya'),(934167,250,'pattern_hosted_whitelabel_guest_activation','Neutral','Dear $UserName,\r\n\r\nYou have been invited as a guest user to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Please accept the invitation by following the link below, it is only valid for 7 days:\r\n\r\np=. \"Click here to join the portal\":\"$InviteLink\"\r\n\r\nTruly yours,\r\n${LetterLogoText} Team','','2016-11-22 14:57:52','text',2,NULL,'Console'),(936236,250,'pattern_hosted_whitelabel_guest_activation','ru','Здравствуйте, $UserName,\n\nВас пригласили на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" в качестве гостя. Чтобы принять приглашение, перейдите по следующей ссылке, она действительна только 7 дней:\n\np=. \"Нажмите сюда, чтобы стать участником портала\":\"$InviteLink\"\n\nС уважением,\nкоманда ${LetterLogoText}',NULL,'2016-12-16 14:50:53','text',2,NULL,'Svetlana'),(950603,250,'pattern_hosted_whitelabel_guest_welcome','de','Sehr geehrte/r Frau/Herr $UserName,\n\nIhr Gastprofil wurde erfolgreich dem Portal unter\"${__VirtualRootPath}\":\"${__VirtualRootPath}\" hinzugefügt.\n\nh3.Fangen Sie die Arbeit mit Ihrem Portal an \n\n# Bearbeiten Sie Ihr \"Profil\":\"$MyStaffLink\", um Personalangaben und Kontaktdaten hinzuzufügen.\n# Sehen Sie an und kommentieren Sie Inhalte, die für alle Portalbenutzer in Modul \"Community\":\"${__VirtualRootPath}/products/community/\", \"Projekte\":\"${__VirtualRootPath}/products/projects/\" zugänglich sind.\n# Fügen Sie Dateien hinzu und laden Sie die verfügbaren Dateien in Modul Dokumente\":\"${__VirtualRootPath}/products/files/\" herunter.\n# Gestalten Sie Ihren Arbeitsprozess mit eingebautem \"Kalender\":\"${__VirtualRootPath}/addons/calendar/\".\n# Starten Sie \"Talk\":\"${__VirtualRootPath}/addons/talk/\" um mit Ihren Teammitgliedern online zu chatten.\n\n$GreenButton\n\nMit freundlichen Grüßen,\n${LetterLogoText} Team\n',NULL,'2017-02-03 09:38:08','text',2,NULL,'Evgenia'),(951017,250,'pattern_hosted_whitelabel_guest_welcome','es','Buenos días, $UserName,\n\nSu perfil de visitante ha sido añadido con éxito al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Empieze a trabajar con su portal\n\n# Edite su \"perfil\":\"$MyStaffLink\" para añadir los detalles personales y de contacto.\n# Visualice y comente el contenido disponible para todos los usuarios de portal en los \nmódulos \"Comunidad\":\"${__VirtualRootPath}/products/community/\" y \"Proyectos\":\"${__VirtualRootPath}/products/projects/\".\n# Añada y descargue archivos disponibles para Usted en el módulo \"Documentos\":\"${__VirtualRootPath}/products/files/\".\n# Planee su horario de trabajo con ayuda de \"Calendario\" incorporado:\"${__VirtualRootPath}/addons/calendar/\".\n# Inicie \"Chat\":\"${__VirtualRootPath}/addons/talk/\" para chatear con otros usuarios de portal en línea.\n\n$GreenButton\n\nMuy atentamente,\nEquipo de ${LetterLogoText}',NULL,'2017-02-15 12:28:34','text',2,NULL,'Ekaterina.Heidel'),(950802,250,'pattern_hosted_whitelabel_guest_welcome','fr','Bonjour $UserName,\n\nVotre profil d\'invité a été ajouté avec succès au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Pour commencer à utiliser le portail\n\n# Modifiez votre \"profil\":\"$MyStaffLink\" en ajoutant vos données personnelles et de contact.\n# Parcourez et commentez le contenu du portail disponible pour tous les utilisateurs dans le modules \"Communauté\":\"${__VirtualRootPath}/products/community/\", \"Projets\":\"${__VirtualRootPath}/products/projects/\".\n# Ajoutez et téléchargez les fichiers disponibles dans le module \"Documents\":\"${__VirtualRootPath}/products/files/\".\n# Organisez votre horaire avec le \"Calendrier\" intégré :\"${__VirtualRootPath}/addons/calendar/\".\n# Démarrez le \"Chat\":\"${__VirtualRootPath}/addons/talk/\" pour communiquer en ligne avec les autres utilisateurs du portail.\n\n$GreenButton\n\nSincérement,\nÉquipe ${LetterLogoText}',NULL,'2017-02-07 12:19:41','text',2,NULL,'Nadine Yablonskaya'),(934168,250,'pattern_hosted_whitelabel_guest_welcome','Neutral','Dear $UserName,\r\n\r\nYour guest profile has been successfully added to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\r\n\r\nh3.Get started with your portal\r\n\r\n# Edit your \"profile\":\"$MyStaffLink\" to add personal and contact details.\r\n# View and comment the content open available for all portal users in the \"Community\":\"${__VirtualRootPath}/products/community/\", \"Projects\":\"${__VirtualRootPath}/products/projects/\" modules.\r\n# Add and download files available for you in the \"Documents\":\"${__VirtualRootPath}/products/files/\" module.\r\n# Organize your schedule with the built-in \"Calendar\":\"${__VirtualRootPath}/addons/calendar/\".\r\n# Start \"Talk\":\"${__VirtualRootPath}/addons/talk/\" to chat with other portal users online.\r\n\r\n$GreenButton\r\n\r\nTruly yours,\r\n${LetterLogoText} Team','','2016-11-22 14:57:52','text',2,NULL,'Console'),(936245,250,'pattern_hosted_whitelabel_guest_welcome','ru','Здравствуйте, $UserName,\n\nВаш гостевой профиль успешно добавлен на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Начните работать со своим порталом\n\n# Отредактируйте свой \"профиль\":\"$MyStaffLink\", добавив личную и контактную информацию.\n# Просматривайте и комментируйте контент, доступный для всех пользователей портала в модулях \"Сообщество\":\"${__VirtualRootPath}/products/community/\" и \"Проекты\":\"${__VirtualRootPath}/products/projects/\".\n# Добавляйте и скачивайте файлы, доступные для Вас, в модуле \"Документы\":\"${__VirtualRootPath}/products/files/\".\n# Планируйте свой график с помощью встроенного \"Календаря\":\"${__VirtualRootPath}/addons/calendar/\".\n# Запустите \"Чат\":\"${__VirtualRootPath}/addons/talk/\", чтобы общаться с другими пользователями портала онлайн.\n\n$GreenButton\n\nС уважением,\nкоманда ${LetterLogoText}',NULL,'2016-12-16 15:44:38','text',2,NULL,'Svetlana'),(950613,250,'pattern_hosted_whitelabel_user_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\n$__AuthorName hat Sie eingeladen, dem Portal bezutreten, um die interne Zusammenarbeit zu verbessern. Ihre Portaladresse ist \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Das Hinzufügen dieses Links dem Lesezeichen ist eine gute Idee. Per Lesezeichen speichern Sie häufig genutzte Webadressen für einen schnellen Zugriff).\n\nUm die Einladung anzunehmen, folgen Sie dem Link unten. Der Link ist nur für 7 Tage gültig:\n\np=. \"Klicken Sie hier, um dem Portal beizutreten\":\"$InviteLink\"\n\nBenötigen Sie Unterstützumg bei der Arbeit mit Ihrem Portal, besuchen Sie unser \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\" oder unser \"Forum\":\"http://cloud.onlyoffice.org\".\n\nMit freundlichen Grüßen\n${LetterLogoText} Team',NULL,'2017-02-03 10:35:41','text',2,NULL,'Evgenia'),(950778,250,'pattern_hosted_whitelabel_user_activation','es','Buenos días, $UserName,\n\n$__AuthorName ha invitado a Usted a participar en el portal de su equipo para organizar un trabajo en colaboración efectivo. Dirección de su portal - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (le recomendamos que añada este enlace a marcadores: es muy probable que Usted lo use a menudo).\n\nUsted puede aceptar esta invitación siguiendo el enlace abajo, este enlace es válido durante 7 días:\n\np=. \"Pulse aquí para participar en el portal\":\"$InviteLink\"\n\nMuy atentamente,\nEquipo de ${LetterLogoText}',NULL,'2017-02-07 09:12:11','text',2,NULL,'Ekaterina.Heidel'),(946342,250,'pattern_hosted_whitelabel_user_activation','fi','Hyvä $UserName,\n\n$__AuthorName on kutsunut sinut liittymään: ${LetterLogoText} - tiimisi portaaliin, mikä auttaa sisäistä yhteistoimintaa. Portaalisi osoite on \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (tämän osoitteen lisääminen kirjanmerkkeihisi voi olla hyvä idea, koska tulet käyttämään sitä paljon).\n\nVoit hyväksyä kutsun seuraamalla allaolevaa linkkiä, mikä on voimassa vain 7 päivää:\n\np=. \"Klikkaa tätä liittyäksesi portaaliin\":\"$InviteLink\"\n\n\nParhain terveisin,\n${LetterLogoText} Tiimi',NULL,'2017-01-16 18:54:35','text',2,NULL,'Arto Ryynanen'),(949601,250,'pattern_hosted_whitelabel_user_activation','fr','Bonjour $UserName,\n\n$__AuthorName vous a invité à rejoindre le portail de votre équipe visant une amélioration de la coopération interne. L\'adresse de votre portail est \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (ajoutez ce lien à vos favoris, probablement vous allez l\'utiliser souvent).\n\nVous pouvez accepter l\'invitation en suivant le lien suivant (il est valable pendant 7 jours)\np=. \"Cliquez ici pour rejoindre le portail\":\"$InviteLink\"\n\nCordialement,\nÉquipe ${LetterLogoText}',NULL,'2017-01-27 10:30:50','text',2,NULL,'Nadine Yablonskaya'),(934143,250,'pattern_hosted_whitelabel_user_activation','Neutral','Dear $UserName,\r\n\r\n$__AuthorName has invited you to join your team\'s portal that would enchance internal cooperation. Your portal address is \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (adding this link to your bookmarks is a good idea, you are most likely to get to use it a lot).\r\n\r\nYou can accept the invitation by following the link below, it is only valid for 7 days:\r\n\r\np=. \"Click here to join the portal\":\"$InviteLink\"\r\n\r\nTruly yours,\r\n${LetterLogoText} Team','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936192,250,'pattern_hosted_whitelabel_user_activation','ru','Здравствуйте, $UserName,\n\n$__AuthorName приглашает Вас стать участником портала вашей команды для организации эффективной совместной работы. Адрес Вашего портала - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (советуем добавить эту ссылку в закладки: по всей вероятности, Вы будете ей часто пользоваться).\n\nВы можете принять приглашение, перейдя по следующей ссылке, она действительна только 7 дней:\n\np=. \"Нажмите сюда, чтобы стать участником портала\":\"$InviteLink\"\n\nС уважением,\nкоманда ${LetterLogoText}',NULL,'2016-12-16 11:18:06','text',2,NULL,'Svetlana'),(950302,250,'pattern_hosted_whitelabel_user_welcome','de','Sehr geehrte/r Frau/Herr $UserName,\n\nIhr Benutzerprofil wurde erfolgreich dem Portal unter\"${__VirtualRootPath}\":\"${__VirtualRootPath}\" hinzugefügt.\n\nh3.Fangen Sie die Arbeit mit Ihrem Portal an \n\n# Bearbeiten Sie Ihr \"Profil\":\"$MyStaffLink\", um Personalangaben und Kontaktdaten hinzuzufügen.\n# Erstellen, bearbeiten und organisieren Sie Ihre Dateien im Modul \"Dokumente\":\"${__VirtualRootPath}/products/files/\".\n# Fügen Sie Ihr E-Mail-Konto dem Modul \"${LetterLogoText} E-Mail\":\"${__VirtualRootPath}/addons/mail/\" hinzu.\n# Erstellen Sie \"Projekte\":\"${__VirtualRootPath}/products/projects/\" und verwalten Sie Ihren Workflow, indem Sie Meilensteine und Aufgaben hinzufügen.\n# Verwalten Sie Ihre Kundenbeziehungen mit Modul \"CRM\"::\"${__VirtualRootPath}/products/community/\" bestimmen Sie Prioritätskontakte, verfolgen Sie Nachrichtenhistorie und Umsatzentwicklung.\n# Nutzen Sie Modul \"Community\":\"${__VirtualRootPath}/products/community/\" um Ihre Blogs, Foren, Ereignisse, Lesezeichen hinzuzufügen.\n# Gestalten Sie Ihren Arbeitsprozess mit eingebautem \"Kalender\":\"${__VirtualRootPath}/addons/calendar/\".\n# Starten Sie \"Talk\":\"${__VirtualRootPath}/addons/talk/\" um mit Ihren Teammitgliedern online zu chatten.\n\n$GreenButton\n\nWenn Sie Hilfe benötigen, besuchen Sie unser \"Hilfe-Center\":\"http://helpcenter.onlyoffice.com/\" oder unser \"Forum\":\"http://cloud.onlyoffice.org\".\n\nMit freundlichen Grüßen,\n${LetterLogoText} Team',NULL,'2017-02-01 10:28:40','text',2,NULL,'Evgenia'),(951026,250,'pattern_hosted_whitelabel_user_welcome','es','Buenos días, $UserName,\n\nSu perfil de usuario ha sido añadido con éxito al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Empieze a trabajar con su portal:\n\n# Edite su \"perfil\":\"$MyStaffLink\" para añadir los detalles personales y de contacto.\n# Cree, edite y organice \"Documentos\":\"${__VirtualRootPath}/products/files/\".\n# Añada su cuenta de correo al módulo \"Correo\":\"${__VirtualRootPath}/addons/mail/\".\n# Cree \"Proyectos\":\"${__VirtualRootPath}/products/projects/\" y maneje flujo de trabajo añadiendo hitos y asignando tareas.\n# Maneje relaciones con sus clientes usando el módulo \"CRM\":\"${__VirtualRootPath}/products/crm/\", identifique los contactos de prioridad, monitorice historia de comunicacion y rendimiento en ventas.\n# Use \"Comunidad\":\"${__VirtualRootPath}/products/community/\" para crear blogs, comunicarse en foros, añadir eventos y compartir marcadores.\n# Planee su horario de trabajo con ayuda de \"Calendario\":\"${__VirtualRootPath}/addons/calendar/\".\n# Inicie \"Chat\":\"${__VirtualRootPath}/addons/talk/\" para chatear con miembros de su equipo en línea.\n\n$GreenButton\n\nMuy atentamente,\nEquipo de ${LetterLogoText}',NULL,'2017-02-16 07:00:07','text',2,NULL,'Ekaterina.Heidel'),(950815,250,'pattern_hosted_whitelabel_user_welcome','fr','Bonjour $UserName,\n\nVotre profil d\'utilisateur a été ajouté au portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Commencez à utiliser le portail et:\n\n# Modifiez votre \"profil\":\"$MyStaffLink\" en ajoutant vos données personnelles et de contact.\n# Créez, modifiez et organisez des \"Documents\":\"${__VirtualRootPath}/products/files/\".\n# Ajoutez votre compte de messagerie au \"Mail\":\"${__VirtualRootPath}/addons/mail/\".\n# Créez des \"Projets\":\"${__VirtualRootPath}/products/projects/\" et gérez votre flux de travail en ajoutant des tâches et des jalons.\n# Gérez les relations avec la clientèle en utilisant le module \"CRM\":\"${__VirtualRootPath}/products/crm/\", identifiez les contacts de priorité, suivez l’historique des communications et la performance des ventes.\n# Utilisez le module \"Communauté\":\"${__VirtualRootPath}/products/community/\" pour démarrer vos blogs, forums, ajouter des évenements.\n# Organisez votre horaire avec le \"Calendrier\" intégré \":\"${__VirtualRootPath}/addons/calendar/\".\n# Démarrez le \"Chat\":\"${__VirtualRootPath}/addons/talk/\" pour communiquer en ligne avec les autres utilisateurs du portail.\n\n$GreenButton\n\nSincérement,\nÉquipe ${LetterLogoText}',NULL,'2017-02-08 08:03:50','text',2,NULL,'Nadine Yablonskaya'),(934144,250,'pattern_hosted_whitelabel_user_welcome','Neutral','Dear $UserName,\r\n\r\nYour user profile has been successfully added to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\r\n\r\nh3.Get started with your portal:\r\n\r\n# Edit your \"profile\":\"$MyStaffLink\" to add personal and contact details.\r\n# Create, edit and organize \"Documents\":\"${__VirtualRootPath}/products/files/\".\r\n# Add your email account to \"Mail\":\"${__VirtualRootPath}/addons/mail/\".\r\n# Create \"Projects\":\"${__VirtualRootPath}/products/projects/\" and manage your workflow by adding milestones and tasks.\r\n# Manage your customer relations using \"CRM\":\"${__VirtualRootPath}/products/crm/\" module, identify priority contacts, track communication history and sales performance.\r\n# Use \"Community\":\"${__VirtualRootPath}/products/community/\" to start your blogs, forums, add events, share bookmarks.\r\n# Organize your work schedule with the built-in \"Calendar\":\"${__VirtualRootPath}/addons/calendar/\".\r\n# Start \"Talk\":\"${__VirtualRootPath}/addons/talk/\" to chat with your teammates online.\r\n\r\n$GreenButton\r\n\r\nTruly yours,\r\n${LetterLogoText} Team','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936256,250,'pattern_hosted_whitelabel_user_welcome','ru','Здравствуйте, $UserName,\n\nВаш пользовательский профиль успешно добавлен на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Начните работать со своим порталом:\n\n# Отредактируйте свой \"профиль\":\"$MyStaffLink\", добавив личную и контактную информацию.\n# Создавайте, редактируйте и систематизируйте \"Документы\":\"${__VirtualRootPath}/products/files/\".\n# Добавьте свою учетную запись электронной почты в \"Почту\":\"${__VirtualRootPath}/addons/mail/\".\n# Создавайте \"Проекты\":\"${__VirtualRootPath}/products/projects/\" и управляйте рабочим процессом, добавляя вехи и ставя задачи.\n# Управляйте взаимоотношениями с клиентами, используя модуль \"CRM\":\"${__VirtualRootPath}/products/crm/\", определяйте приоритетные контакты, следите за историей взаимодействия и эффективностью продаж.\n# Используйте \"Сообщество\":\"${__VirtualRootPath}/products/community/\", чтобы вести блоги, общаться на форумах, добавлять события, делиться закладками.\n# Планируйте рабочий график с помощью встроенного \"Календаря\":\"${__VirtualRootPath}/addons/calendar/\".\n# Запустите \"Чат\":\"${__VirtualRootPath}/addons/talk/\", чтобы общаться со своей командой онлайн.\n\n$GreenButton\n\nС уважением,\nкоманда ${LetterLogoText}',NULL,'2016-12-19 08:49:24','text',2,NULL,'Svetlana'),(950866,250,'pattern_invite','de','h1.Einladung, dem Portal ${LetterLogoText} beizutreten\n\nSehr geehrte/r Frau/Herr $UserDisplayName,\n\n$__AuthorName hat Sie eingeladen, ${LetterLogoText} beizutreten - das Portal Ihres Teams, das interne Zusammenarbeit verbessern würde. Ihre Portaladresse ist \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Das Hinzufügen dieses Links dem Lesezeichen ist eine gute Idee. Per Lesezeichen speichern Sie häufig genutzte Webadressen für einen schnellen Zugriff). \n\nSie können die Einladung annehmen, indem Sie dem folgenden Link folgen. Der Link ist nur 7 Tage gültig:\n\np=. \"Klicken Sie hier, um das Portal beizutreten\":\"$InviteLink\"\n',NULL,'2017-02-09 08:22:27','text',2,NULL,'Evgenia'),(961540,250,'pattern_invite','es','h1.Invitación a Unirse al Portal ${LetterLogoText}\n\nEstimado(a) $UserDisplayName,\n\n$ __ AuthorName le ha invitado a unirse a ${LetterLogoText} - el portal de su equipo que mejore cooperación interna. Su dirección de portal es \"${__VirtualRootPath}\":\"$InviteLink\" (la adición de este enlace a sus marcadores es una buena idea, es muy probable que llegue a usarlo mucho).\nPuede aceptar la invitación, siguiendo el enlace de abajo, es válido sólo durante 7 días:\np=. \"Haga clic aquí para unirse al portal\":\"$InviteLink\"\n',NULL,'2017-03-30 08:21:12','text',2,NULL,'Ekaterina.Heidel'),(935693,250,'pattern_invite','fr','h1.Invitation à rejoindre le protail ${LetterLogoText} \n\nBonjour $UserDisplayName,\n\n$__AuthorName vous a invité à rejoindre ${LetterLogoText} - portail de votre équipe qui permettrait d\'améliorer la coopération interne. L\'adresse de votre portail est \"${__VirtualRootPath}\":\"$InviteLink\" (ajout de ce lien à vos signets est une bonne idée, il est susceptibles que vous l\'utiliserez beaucoup).\n\nVous pouvez accepter l\'invitation en suivant le lien ci-dessous, il est valide pour 7 jours seulement:\n\np=. \"Cliquez ici pour rejoindre le portail\":\"$InviteLink\"\n',NULL,'2016-12-01 08:51:24','text',2,NULL,'Александр'),(460993,250,'pattern_invite','Neutral','h1.Invitation to join ${LetterLogoText} portal\n\nDear $UserDisplayName,\n\n$__AuthorName has invited you to join ${LetterLogoText} - your team\'s portal that would enhance internal cooperation. Your portal address is \"${__VirtualRootPath}\":\"$InviteLink\" (adding this link to your bookmarks is a good idea, you are most likely to get to use it a lot).\n\nYou can accept the invitation by following the link below, it is only valid for 7 days:\n\np=. \"Click here to join the portal\":\"$InviteLink\"','','2016-12-01 08:51:14','text',2,NULL,'Console'),(935694,250,'pattern_invite','ru','h1.Приглашение на портал ${LetterLogoText}\n\nЗдравствуйте, $UserDisplayName,\n\n$__AuthorName приглашает Вас стать участником ${LetterLogoText} - портала вашей команды для организации эффективной совместной работы. Адрес Вашего портала - \"${__VirtualRootPath}\":\"$InviteLink\". (Советуем добавить эту ссылку в закладки: по всей вероятности, Вы будете ей часто пользоваться).\n\nВы можете принять приглашение, перейдя по следующей ссылке, она действительна только 7 дней:\n\np=. \"Нажмите сюда, чтобы стать участником портала\":\"$InviteLink\"',NULL,'2016-12-01 08:51:28','text',2,NULL,'Александр'),(950865,250,'pattern_join','de','h1.Einladung dem Portal \"${__VirtualRootPath}\":\"$InviteLink\" beizutreten\n\nHallo,\n\nSie haben angefordert, dem Portal \"${__VirtualRootPath}\":\"$InviteLink\" unter ${LetterLogoText}  beizutreten. Das ist eine Plattform für das Dokumenten- und Projektmanagement. Treten Sie dem Portal bei und starten Sie  die Zusammenarbeit mit den Kollegen und Freunden sofort.\n\nUm die Einladung anzunehmen, klicken Sie bitte auf den folgenden Link und geben Sie Ihren Namen und Passwort an:\np=. \"Join Portal\":\"$InviteLink\"\n\n*Hinweis*: Dieser Link ist nur 48 Tage gültig. Bitte schließen Sie die Aktivierung Ihrer E-Mail-Adresse in dieser Zeitperiode ab.\n\nBei Fragen oder wenn Sie technische Unterstützung brauchen, wenden Sie sich bitte an \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"\n',NULL,'2017-02-09 08:19:28','text',2,NULL,'Evgenia'),(935689,250,'pattern_join','es','h1.Invitaсión a Unirse al Portal \"${__VirtualRootPath}\":\"$InviteLink\"\n\nHola,\n\nUsted ha solicitado a unirse al portal \"${__VirtualRootPath}\":\"$InviteLink\" en ${LetterLogoText} - una plataforma para gestión de documentos y proyectos. Únase al portal y empiece a colaborar con sus colegas o amigos ahora.\n\nPara aceptar la invitación por favor, introduzca su nombre y contraseña siguiendo este enlace:\np=. \"Join Portal\":\"$InviteLink\"\n\n*Note*: este enlace tiene una validez de sólo 48 horas. Por favor, complete la operación en dicho periodo.\n\nSi usted tiene alguna pregunta o necesita ayuda no dude en contactar con nosotros en \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n\nAtentamente,\nEquipo de Soporte ONLYOFFICE™ \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-01 08:51:00','text',2,NULL,'Александр'),(935690,250,'pattern_join','fr','h1.Invitation à rejoindre le portail \"${__VirtualRootPath}\":\"$InviteLink\"\n\nBonjour,\n\nVous avez demandé à rejoindre le portail \"${__VirtualRootPath}\":\"$InviteLink\" à ${LetterLogoText}, une plate-forme pour la gestion de documents et de projets. Rejoignez le portail et commencez à collaborer avec vos collègues ou vos amis.\n\nPour accepter l\'invitation, veuillez entrer votre nom et votre mot de passe en suivant ce lien:\np=. \"Rejoignez le portail\":\"$InviteLink\"\n\n*Note*: ce lien est valable pour 48 heures seulement. Veuillez remplir l\'opération au cours de cette période.\n\nSi vous avez des questions ou besoin d\'aide, n\'hésitez pas à nous contacter à  \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n\nCordialement,\nÉquipe d\'assistance ONLYOFFICE™ \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-01 08:51:04','text',2,NULL,'Александр'),(460994,250,'pattern_join','Neutral','h1.Invitation to join \"${__VirtualRootPath}\":\"$InviteLink\" portal\n\nHello,\n\nYou have requested to join the \"${__VirtualRootPath}\":\"$InviteLink\" portal at ${LetterLogoText} - a platform for document and project management. Join the portal and start collaborating with your colleagues or friends right away.\n\nTo accept the invitation please enter your name and password following this link:\np=. \"Join Portal\":\"$InviteLink\"\n\n*Note*: this link is valid for 48 hours only. Please complete the operation within that period.\n\n\nIf you have any questions or need assistance please feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n\nBest regards,\nONLYOFFICE™ Support Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-12-01 08:50:56','text',2,NULL,'Console'),(935691,250,'pattern_join','ru','h1.Приглашение на портал \"${__VirtualRootPath}\":\"$InviteLink\"\n\nЗдравствуйте,\n\nВы отправили запрос на вступление в участники портала \"${__VirtualRootPath}\":\"$InviteLink\". ${LetterLogoText} - это платформа для управления документами и проектами. Станьте участником портала и начинайте совместно работать с коллегами или друзьями прямо сейчас.\n\nЧтобы принять приглашение, необходимо перейти по ссылке и ввести свое имя и пароль:\np=. \"Стать участником портала\":\"$InviteLink\"\n\n*Обратите внимание*: эта ссылка действительна только 48 часов. Пожалуйста, выполните данную операцию в течение этого времени.\n\n\nЕсли у Вас есть какие-то вопросы, Вы всегда можете написать нам по адресу \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n\nС уважением,\nкоманда ONLYOFFICE™\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-01 08:51:07','text',2,NULL,'Александр'),(460995,250,'pattern_migration_error','Neutral','h1.Another region portal migration error\r\n\r\nAn error has occurred while migrating to the $RegionName region. Please, try once again later.\r\nYour portal is now available at the old address \"$PortalUrl\":\"$PortalUrl\"\r\n\r\nIf you have any questions or need assistance please feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\r\n\r\nBest regards,\r\nONLYOFFICE™ Support Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"\r\n\r\n^You receive this email because you are a registered user of the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal. To change the notification type, please manage your \"subscription settings\":\"$RecipientSubscriptionConfigURL\".^','','2016-09-19 10:41:12','text',2,NULL,'Console'),(460996,250,'pattern_migration_server_failure','Neutral','h1.Another region portal migration error\r\n\r\nAn error has occurred while migrating to another region. Please, try once again later.\r\nYour portal is now available at the old address \"$PortalUrl\":\"$PortalUrl\"\r\n\r\nIf you have any questions or need assistance please feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\r\n\r\nBest regards,\r\nONLYOFFICE™ Support Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"\r\n\r\n^You receive this email because you are a registered user of the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal. To change the notification type, please manage your \"subscription settings\":\"$RecipientSubscriptionConfigURL\".^','','2016-09-19 10:41:12','text',2,NULL,'Console'),(460997,250,'pattern_migration_start','Neutral','h1.Another region portal migration started\r\n\r\nThe portal migration to the $RegionName region is started. It might take some time depending on your data amount.\r\n\r\n*Note*: the portal will not be available during the migration process. After the migration is complete the portal URL will be changed and all the shared documents links will be inaccessible.\r\n\r\nIf you have any questions or need assistance please feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\r\n\r\nBest regards,\r\nONLYOFFICE™ Support Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"\r\n\r\n^You receive this email because you are a registered user of the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal.^','','2016-09-19 10:41:12','text',2,NULL,'Console'),(460998,250,'pattern_migration_success','Neutral','h1.Another region portal migration successfully completed\r\n\r\nThe portal migration to the $RegionName region is successfully completed.\r\nYour portal is now available at \"$PortalUrl\":\"$PortalUrl\"\r\n\r\nIf you have any questions or need assistance please feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\r\n\r\nBest regards,\r\nONLYOFFICE™ Support Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"\r\n\r\n^You receive this email because you are a registered user of the \"$PortalUrl\":\"$PortalUrl\" portal.^','','2016-09-19 10:41:12','text',2,NULL,'Console'),(930748,250,'pattern_payment_warning','de','Hallo $UserName,\n\nBitte beachten Sie, dass Ihre Office Edition Abonnement-Lizenz heute abläuft.\n\nUm Ihre Lizenz zu verlängern, müssen Sie eine Produkterneuerung für Office Edition Abonnement zu erwerben.\n\nKlicken Sie den Link unten, um den Erneuerungsprozess zu starten:\n\"Pricing page\":\"$PricingPage\"\n\nFür Ihre Bequemlichkeit, wenn Sie Ihre nächste Erneuerung kaufen, können Sie auch die \"automatische Verlängerung\" Lizenzoption aktivieren, in diesem Fall wird Ihre Lizenz automatisch nach Ablauf der Zeit erneuert.\n\nFür weitere Produktinstallation, Aktivierung und technische Unterstützung Fragen, kontaktieren Sie bitte unser Unterstützungsteam unter \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nFür die Zahlungsfragen wenden Sie sich bitte per E-Mail an Avangate unter \"support@avangate.com\":\"support@avangate.com\"\n\nMit freundlichen Grüßen,\nONLYOFFICE Team',NULL,'2016-10-19 10:37:43','text',2,NULL,'Svetlana'),(460999,250,'pattern_payment_warning','Neutral','Dear $UserName,\r\n\r\nPlease note that your Office Edition Subscription license is due to expire today.\r\n\r\nIn order to extend your license, you need to purchase a product renewal for Office Edition Subscription.\r\n\r\nClick on the link below to start the renewal process:\r\n\"Pricing page\":\"$PricingPage\"\r\n\r\nFor your convenience, when you purchase your next renewal, you can also enable the \"auto-renew\" license option, in which case your license will be renewed automatically at expiration time.\r\n\r\nFor any further product installation, activation and technical support issues, please contact our support team at \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\r\n\r\nFor payment related issues please contact Avangate by email at \"support@avangate.com\":\"support@avangate.com\"\r\n\r\nSincerely,\r\nONLYOFFICE Team','','2016-09-19 10:41:12','text',2,NULL,'Console'),(930749,250,'pattern_payment_warning','ru','Добрый день, $UserName,\n\nПожалуйста, обратите внимание, что срок действия вашей подписки на Офисную версию истекает сегодня.\n\nВам необходимо приобрести продление подписки на Офисную версию.\n\nНажмите на следующую ссылку, чтобы начать продление:\n\"Страница с ценами\":\"$PricingPage\"\n\nДля вашего удобства при покупке следующего продления вы сможете включить опцию автоматического продления лицензии, и в этом случае лицензия будет продлеваться автоматически по окончании срока действия.\n\nПо вопросам установки, активации и технической поддержки продукта обращайтесь в нашу службу поддержки по адресу \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nПо вопросам оплаты, пожалуйста, обращайтесь в Avangate по адресу \"support@avangate.com\":\"support@avangate.com\"\n\nС уважением,\nКоманда ONLYOFFICE',NULL,'2016-10-19 10:39:11','text',2,NULL,'Svetlana'),(461000,250,'pattern_payment_warning_after3','Neutral','Dear $UserName,\r\n\r\nPlease note that your Office Edition Subscription license has expired on $DueDate.\r\n\r\nIn order to extend your license, you need to purchase a product renewal for Office Edition Subscription.\r\n\r\nClick on the link below to start the renewal process:\r\n\"Pricing page\":\"$PricingPage\"\r\n\r\nPlease renew your license till $DelayDueDate, otherwise, you will not be able to access your web-office data. \r\n\r\nFor your convenience, when you purchase your next renewal, you can also enable the \"auto-renew\" license option, in which case your license will be renewed automatically at expiration time.\r\n\r\nFor any further product installation, activation and technical support issues, please contact our support team at \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\r\n\r\nFor payment related issues please contact Avangate by email at \"support@avangate.com\":\"support@avangate.com\"\r\n\r\nSincerely,\r\nONLYOFFICE Team','','2016-09-19 10:41:12','text',2,NULL,'Console'),(930751,250,'pattern_payment_warning_before7','de','Hallo $UserName,\n\nBitte beachten Sie, dass Ihre Office Edition Abonnement-Lizenz am $DueDate bald abläuft.\n\nUm Ihre Lizenz zu verlängern, müssen Sie eine Produkterneuerung für Office Edition Abonnement zu erwerben.\n\nKlicken Sie den Link unten, um den Erneuerungsprozess zu starten:\n\"Pricing page\":\"$PricingPage\"\n\nFür Ihre Bequemlichkeit, wenn Sie Ihre nächste Erneuerung kaufen, können Sie auch die \"automatische Verlängerung\" Lizenzoption aktivieren, in diesem Fall wird Ihre Lizenz automatisch nach Ablauf der Zeit erneuert.\n\nFür weitere Produktinstallation, Aktivierung und technische Unterstützung Fragen, kontaktieren Sie bitte unser Unterstützungsteam unter \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nFür die Zahlungsfragen wenden Sie sich bitte per E-Mail an Avangate unter \"support@avangate.com\":\"support@avangate.com\"\n\nMit freundlichen Grüßen,\nONLYOFFICE Team',NULL,'2016-10-19 10:45:39','text',2,NULL,'Svetlana'),(461001,250,'pattern_payment_warning_before7','Neutral','Dear $UserName,\r\n\r\nPlease note that your Office Edition Subscription license is about to expire on $DueDate.\r\n\r\nIn order to extend your license, you need to purchase a product renewal for Office Edition Subscription.\r\n\r\nClick on the link below to start the renewal process:\r\n\"Pricing page\":\"$PricingPage\"\r\n\r\nFor your convenience, when you purchase your next renewal, you can also enable the \"auto-renew\" license option, in which case your license will be renewed automatically at expiration time.\r\n\r\nFor any further product installation, activation and technical support issues, please contact our support team at \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\r\n\r\nFor payment related issues please contact Avangate by email at \"support@avangate.com\":\"support@avangate.com\"\r\n\r\nSincerely,\r\nONLYOFFICE Team','','2016-09-19 10:41:12','text',2,NULL,'Console'),(930750,250,'pattern_payment_warning_before7','ru','Добрый день, $UserName,\n\nПожалуйста, обратите внимание, что срок действия вашей подписки на Офисную версию истечет $DueDate.\n\nВам необходимо приобрести продление подписки на Офисную версию.\n\nНажмите на следующую ссылку, чтобы начать продление:\n\"Страница с ценами\":\"$PricingPage\"\n\nДля вашего удобства при покупке следующего продления вы сможете включить опцию автоматического продления лицензии, и в этом случае лицензия будет продлеваться автоматически по окончании срока действия.\n\nПо вопросам установки, активации и технической поддержки продукта обращайтесь в нашу службу поддержки по адресу \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nПо вопросам оплаты, пожалуйста, обращайтесь в Avangate по адресу \"support@avangate.com\":\"support@avangate.com\"\n\nС уважением,\nКоманда ONLYOFFICE',NULL,'2016-10-19 10:45:01','text',2,NULL,'Svetlana'),(950685,250,'pattern_payment_warning_before7_whitelabel','de','Sehr geehrte/r Frau/Herr $UserName,\n \nBitte merken Sie, dass Ihr Office Edition Abonnement $DueDate abläuft.\n \nUm Ihr Abonnement zu verlängern, müssen Sie eine Verlängerung für Office Edition erwerben.\n \nKlicken Sie auf den Link unterhalb, um den Verlängerungsprozess zu starten. \n\"Preisinformation\":\"$PricingPage\"\n \nWenn Sie Ihre nächste Verlängerung erwerben, können Sie auch die Lizenzoption \"Auto-renew\" aktivieren. In diesem Fall wird Ihre Lizenz automatisch nach Ablauf der Gültigkeit verlängert.\n \nMit freundlichen Grüßen,\nONLYOFFICE Team\n',NULL,'2017-02-06 10:27:49','text',2,NULL,'Evgenia'),(950885,250,'pattern_payment_warning_before7_whitelabel','es','Buenos días, $UserName,\n\nNote, por favor, que su suscripción para Edición de Oficina expirará el $DueDate.\n\nPara continuar usando el servicio se necesita adquirir renovación del producto para Edición de Oficina.\n\nPulse el enlace abajo para empezar el proceso de prolongación:\n\"Página con precios\":\"$PricingPage\"\n\nPara su comodidad Usted podrá activar la opción de renovación automática al comprar la suscripción siguiente, en este caso la suscripción será renovada automáticamente a la expiración del periodo de uso.\n\nMuy atentamente,\nEquipo de ONLYOFFICE',NULL,'2017-02-09 12:31:16','text',2,NULL,'Ekaterina.Heidel'),(933518,250,'pattern_payment_warning_before7_whitelabel','fr','Bonjour $UserName,\n\nVeuillez noter que votre licence d\'abonnement de Office Edition arrive à expiration le $DueDate.\n\nPour prolonger votre licence, vous avez besoin d\'acheter le renouvellement du produit Office Edition.\n\nCliquez sur le lien commencer le renouvellement de la licence :\n\"La page des tarifs \":\"$PricingPage\"\n\nPour votre commodité, lors de l\'achat de votre prochain renouvellement, vous pouvez activer l\'option du \"renouvellement automatique\" de la licence, dans ce cas votre licence arrivée à expiration sera renouvelée automatiquement à l’heure d’expiration.\n\nSincèrement,\nÉquipe de ONLYOFFICE',NULL,'2016-11-01 08:10:48','text',2,NULL,'Nadine Yablonskaya'),(461002,250,'pattern_payment_warning_before7_whitelabel','Neutral','Dear $UserName,\r\n\r\nPlease note that your Office Edition Subscription license is about to expire on $DueDate.\r\n\r\nIn order to extend your license, you need to purchase a product renewal for Office Edition Subscription.\r\n\r\nClick on the link below to start the renewal process:\r\n\"Pricing page\":\"$PricingPage\"\r\n\r\nFor your convenience, when you purchase your next renewal, you can also enable the \"auto-renew\" license option, in which case your license will be renewed automatically at expiration time.\r\n\r\nSincerely,\r\nONLYOFFICE Team','','2016-09-19 10:41:12','text',2,NULL,'Console'),(461003,250,'pattern_payment_warning_delaydue','Neutral','Dear $UserName,\r\n\r\nPlease note that your Office Edition Subscription license has expired on $DueDate and the access to your web-office is currently blocked.\r\n\r\nIn order to extend your license and continue to use your web-office, you need to purchase a product renewal for Office Edition Subscription.\r\n\r\nClick on the link below to start the renewal process:\r\n\"Pricing page\":\"$PricingPage\"\r\n\r\nPlease renew your license till $DelayDueDate, otherwise, you will not be able to access your web-office data. \r\n\r\nFor your convenience, when you purchase your next renewal, you can also enable the \"auto-renew\" license option, in which case your license will be renewed automatically at expiration time.\r\n\r\nFor any further product installation, activation and technical support issues, please contact our support team at \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\r\n\r\nFor payment related issues please contact Avangate by email at \"support@avangate.com\":\"support@avangate.com\"\r\n\r\nSincerely,\r\nONLYOFFICE Team','','2016-09-19 10:41:12','text',2,NULL,'Console'),(950686,250,'pattern_payment_warning_whitelabel','de','Sehr geehrte/r Frau/Herr $UserName,\n \nBitte merken Sie, dass Ihr Office Edition Abonnement heute abläuft.\n \nUm Ihr Abonnement zu verlängern, müssen Sie eine Verlängerung für Office Edition erwerben.\n \nKlicken Sie auf den Link unterhalb, um den Verlängerungsprozess zu starten. \n\"Preisinformation\":\"$PricingPage\"\n \nWenn Sie Ihre nächste Verlängerung erwerben, können Sie auch die Lizenzoption \"Auto-renew\" aktivieren. In diesem Fall wird Ihre Lizenz automatisch nach Ablauf der Gültigkeit verlängert.\n \nMit freundlichen Grüßen,\nONLYOFFICE Team\n',NULL,'2017-02-06 10:28:35','text',2,NULL,'Evgenia'),(950882,250,'pattern_payment_warning_whitelabel','es','Buenos días, $UserName,\n\nNote, por favor, que su suscripción para Edición de Oficina va a expirar hoy.\n\nPara continuar usando el servicio se necesita adquirir renovación del producto para Edición de Oficina.\n\nPulse el enlace abajo para empezar el proceso de prolongación:\n\"Página con precios\":\"$PricingPage\"\n\nPara su comodidad Usted podrá activar la opción de renovación automática al comprar la suscripción siguiente, en este caso la suscripción será renovada automáticamente a la expiración del periodo de uso.\n\nMuy atentamente,\nEquipo de ONLYOFFICE',NULL,'2017-02-09 12:29:26','text',2,NULL,'Ekaterina.Heidel'),(933519,250,'pattern_payment_warning_whitelabel','fr','Bonjour $UserName,\n\nVeuillez noter que votre licence d\'abonnement de Office Edition arrive à expiration aujourd\'hui.\n\nPour prolonger votre licence, vous avez besoin d\'acheter le renouvellement de la licence de Office Edition.\n\nCliquez sur le lien pour commencer le renouvellement de la licence :\n\"La page des tarifs\":\"$PricingPage\"\n\nPour votre commodité, lors de l\'achat de votre prochain renouvellement, vous pouvez activer l\'option du \"renouvellement automatique\" de la licence, dans ce cas votre licence arrivée à expiration sera renouvelée automatiquement à l’heure d’expiration\n\nSincèrement,\nÉquipe de ONLYOFFICE',NULL,'2016-11-01 09:01:58','text',2,NULL,'Nadine Yablonskaya'),(461004,250,'pattern_payment_warning_whitelabel','Neutral','Dear $UserName,\r\n\r\nPlease note that your Office Edition Subscription license is due to expire today.\r\n\r\nIn order to extend your license, you need to purchase a product renewal for Office Edition Subscription.\r\n\r\nClick on the link below to start the renewal process:\r\n\"Pricing page\":\"$PricingPage\"\r\n\r\nFor your convenience, when you purchase your next renewal, you can also enable the \"auto-renew\" license option, in which case your license will be renewed automatically at expiration time.\r\n\r\nSincerely,\r\nONLYOFFICE Team','','2016-09-19 10:41:12','text',2,NULL,'Console'),(461005,250,'pattern_portal_deactivate','Neutral','h1.Deactivation of the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal\r\n\r\nDear $OwnerName,\r\n\r\nYou have requested a temporary deactivation of your \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal. Please follow the link below to confirm the operation:\r\np=. \"Deactivate Portal\":\"$DeactivateUrl\"\r\n\r\n*Note*: this link is valid for 7 days only. Please complete the portal deactivation process within that period.\r\n\r\nYou can reactivate your portal any time by clicking the following link:\r\np=. \"Reactivate Portal\":\"$ActivateUrl\" (this link has no time limit)\r\n\r\n\r\nIf you have any questions or need assistance please feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\r\n\r\nBest regards,\r\nONLYOFFICE™ Support Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:12','text',2,NULL,'Console'),(461006,250,'pattern_portal_delete','Neutral','h1.Deletion of the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal\r\n\r\nDear $OwnerName,\r\n\r\nYou have requested to permanently delete your \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal.\r\n\r\n*Important! All the data stored on your portal, as well as your registration details will be lost and cannot be recovered.*\r\n\r\n#if($AutoRenew == \"True\")\r\nBefore you delete the portal, please make sure that automatic billing is turned off. You may check the status of automatic billing in your \"Avangate account\":\"https://secure.avangate.com/myaccount/\".\r\n#end\r\n\r\nIf you still want to delete your \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal please follow the link below to confirm the operation:\r\np=. \"Delete Portal\":\"$DeleteUrl\"\r\n\r\n*Note*: this link is valid for 7 days only. Please complete the portal deletion process within that period.\r\n\r\nIf you have any questions or need assistance please feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\r\n\r\nBest regards,\r\nONLYOFFICE™ Support Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:12','text',2,NULL,'Console'),(935642,250,'pattern_portal_delete_success','de','Sehr geehrte\\r Herr\\Frau,\n\nIhr Portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" wurde erfolgreich gekündigt. Wir freuen uns über Ihr Feedback.  Bitte teilen Sie Ihre Erfahrungen mit  ${LetterLogoText} und geben Sie uns Hinweis, wie man das verbessern kann. Ihre Meinung ist uns sehr wichtig! \n\nBitte, fühllen Sie dieses Formular aus und hinterlassen Sie uns eine Nachricht:\np=. \"Leave Feedback\":\"$FeedBackUrl\"\n\nEs dauert nur paar Minuten. \n\nDanke und alles Gute!\n\nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-01 08:45:23','text',2,NULL,'Александр'),(935643,250,'pattern_portal_delete_success','es','Estimado(a) $OwnerName,\n\nSu portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" ha sido eliminado con éxito pero agradeceríamos sus comentarios. Por favor, comparta su experiencia en el uso de ${LetterLogoText} y denos una pista sobre cómo podríamos mejorarlo. ¡Su opinión es muy impotante para nosotros!\n\nPor favor, rellene este formulario para dejar sus comentarios:\np=. \"Leave Feedback\":\"$FeedBackUrl\"\n\nLe llevará sólo un minuto.\n\n¡Gracias y buena suerte!\n\nMuy atentamente,\nEquipo ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-01 08:45:28','text',2,NULL,'Александр'),(938375,250,'pattern_portal_delete_success','fi','Hyvä $OwnerName,\n\nPortaalisi \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" on onnistuneesti poistettu, mutta arvostaisimme jos sinulla olisi vielä aikaa antaa palautetta. Ole hyvä ja jaa kokemuksiasi ${LetterLogoText} käytössä ja anna meille vinkkejä miten voimme tehdä sen vieläkin paremmaksi. Mielipiteesi on meille tärkeä !\n\nOle hyvä ja täytä tämä lomake palautteen antoon:\np=. \"Jätä palaute\":\"$FeedBackUrl\"\n\nSe vie vain minuutin.\n\nKiitoksia ja Onnea!\n\nParhain terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-10 04:47:36','text',2,NULL,'Arto Ryynanen'),(935644,250,'pattern_portal_delete_success','fr','Bonjour $OwnerName,\n\nVotre portail \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" a été désactivé avec succes, mais nous serions très heureux de recevoir vos commentaires. Veuillez partager votre expérience de l\'utilisation de ${LetterLogoText} et nous donner un indice sur comment on pourrait le faire mieux. Votre opinion est très importante pour nous !\n\nVeuillez remplir ce formulaire pour laisser vos commentaires:\np=. \"Laisser un commentaire\":\"$FeedBackUrl\"\n\nCela ne vous prendra qu\'une minute.\n\nSincèrement vôtre,\nEquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\" ',NULL,'2016-12-01 08:45:32','text',2,NULL,'Александр'),(461007,250,'pattern_portal_delete_success','Neutral','Dear $OwnerName,\n\nYour portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" has been successfully deleted but we would highly appreciate your feedback. Please share your experience of using ${LetterLogoText} and give us a hint on how could we make it better. Your opinion is very impotant for us!\n\nPlease, fill this form to leave your feedback:\np=. \"Leave Feedback\":\"$FeedBackUrl\"\n\nIt will take you just a minute.\n\nThank you and good luck!\n\nTruly yours,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-12-01 08:45:15','text',2,NULL,'Console'),(935645,250,'pattern_portal_delete_success','ru','Добрый день, $OwnerName,\n\nВаш портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" успешно удален, однако мы будем очень признательны, если Вы оставите свой отзыв. Пожалуйста, поделитесь своими впечатлениями от использования ${LetterLogoText}, чтобы мы могли сделать его лучше. Ваше мнение очень важно для нас!\n\nПожалуйста, заполните эту форму, чтобы оставить свой отзыв:\np=. \"Оставить отзыв\":\"$FeedBackUrl\"\n\nЭто займет всего минуту.\n\nБлагодарим Вас!\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-01 08:45:37','text',2,NULL,'Александр'),(461008,250,'pattern_portal_delete_success_freecloud','Neutral','Dear  $OwnerName,\r\n\r\nThank you for giving ${LetterLogoText} Free Cloud a try. Your portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" has been successfully deactivated and we would highly appreciate your feedback. Please share your experience of using ${LetterLogoText} Office and give us a hint on how could we make it better. Your opinion is very important for us!\r\n\r\nPlease, fill this form to leave your feedback - \"$FeedBackUrl\":\"$FeedBackUrl\"\r\n\r\nIt will take you just a minute.\r\n\r\nThank you and good luck!\r\nONLYOFFICE Team.','','2016-09-19 10:41:12','text',2,NULL,'Console'),(461009,250,'pattern_portal_rename','Neutral','h1.Change of portal address\r\n\r\nDear $UserDisplayName,\r\n\r\nYour $PortalUrl portal address was changed to the new \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" address.\r\n\r\n*Note*: All the shared documents links are inaccessible now, as well as DNS settings and single sign-on options stop working until you change them. The third party iCal links added to your calendar will also stop updating until you reload them.\r\n\r\nIf you have any questions or need assistance please feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\r\n\r\nBest regards,\r\nONLYOFFICE™ Support Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:12','text',2,NULL,'Console'),(950874,250,'pattern_profile_delete','de','h1.Löschen des Profils von \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" Portal\n\nSie haben angefragt, Ihr Profil von \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" Portal zu löschen. \n\nWenn Sie Ihr Profil trotzdem löschen möchten, folgen Sie bitte dem untenstehenden Link, um den Vorgang zu bestätigen:\nP =. \"Profil entfernen\": \"$ InviteLink\"\n\n*Hinweis*: Dieser Link ist nur 7 Tage gültig. Bitte schließen Sie die Aktivierung Ihrer E-Mail-Adresse in dieser Zeitperiode ab.\n \n\nWenn Sie Fragen haben oder Hilfe brauchen, wenden Sie sich bitte an uns unter\n\"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n\nTruly yours,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-09 09:04:00','text',2,NULL,'Evgenia'),(461010,250,'pattern_profile_delete','Neutral','h1.Removal of the profile from the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal\r\n\r\nYou have requested to permanently delete your profile from the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal.\r\n\r\nIf you still want to delete your profile please follow the link below to confirm the operation:\r\np=. \"Remove profile\":\"$InviteLink\"\r\n\r\n*Note*: this link is valid for 7 days only. Please complete the profile deletion process within that period.\r\n \r\n\r\nIf you have any questions or need assistance please feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-09-19 10:41:12','text',2,NULL,'Console'),(461011,250,'pattern_profile_updated','Neutral','h1.Your profile at \"$__VirtualRootPath\":\"$__VirtualRootPath\" has been changed\r\n\r\nDear $UserName,\r\n\r\nYour user profile details at \"$__VirtualRootPath\":\"$__VirtualRootPath\" have been changed by \"$__AuthorName\":\"$__AuthorUrl\".\r\n\r\nTo view your profile follow the link below:\r\n\"$UserName\":\"$MyStaffLink\"\r\n\r\n\r\n^You receive this email because you are a registered user of the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal.^\r\n','','2016-09-19 10:41:12','text',2,NULL,'Console'),(461012,250,'pattern_pwd_reminder','Neutral','[outdated - do not translate]','','2016-09-19 10:41:13','text',2,NULL,'Console'),(461013,250,'pattern_request_license','Neutral','h1.Enterprise license request\r\n\r\nh3.First name\r\n$UserName\r\n\r\nh3.Last name\r\n$UserLastName\r\n\r\nh3.Position\r\n$Position\r\n\r\nh3.Email\r\n\"$UserEmail\":\"mailto:$UserEmail\"\r\n\r\nh3.Phone\r\n$Phone\r\n\r\nh3.Company Website\r\n$Website\r\n\r\nh3.Company name\r\n$CompanyTitle\r\n\r\nh3.Company size\r\n$CompanySize\r\n\r\nh3.Request content\r\n$Body\r\n\r\nh3.Portal address\r\n\"${__VirtualRootPath}\":\"${__VirtualRootPath}\"','','2016-09-19 10:41:13','text',2,NULL,'Console'),(461014,250,'pattern_request_tariff','Neutral','h1.SAAS pricing plan request for \"${__VirtualRootPath}\":\"${__VirtualRootPath}\"\r\n\r\nh3.Name\r\n$UserName\r\n\r\nh3.Email\r\n\"$UserEmail\":\"mailto:$UserEmail\"\r\n\r\nh3.Request content\r\n$Body','','2016-09-19 10:41:13','text',2,NULL,'Console'),(951095,250,'pattern_restore_completed','es','%1 más',NULL,'2017-02-17 07:19:22','text',2,NULL,'Ekaterina.Heidel'),(950871,250,'pattern_restore_started','de','h1.Wiederherstellen des Portals\n\nWiederherstellen des Portals wurde gestartet. Je nach Dateigröße kann es einige Zeit dauern.\n\n*Hinweis*: beim Wiederherstellungsprozesses ist das Portal nicht verfügbar.\n\nFalls Sie einige Fragen haben oder Hilfe brauchen, kontaktieren Sie uns bitte unter \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\n\nMit freundlichen Grüßen,\nONLYOFFICE™ Support Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"\n\n^Sie erhalten diese E-Mail-Nachricht, weil Sie ein registrierter Benutzer des  \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" Portals sind. Um den Benachrichtigungstyp zu ändern, verwalten Sie Ihre \"Abonnement-Einstellungen\":\"$RecipientSubscriptionConfigURL\".^',NULL,'2017-02-09 08:55:15','text',2,NULL,'Evgenia'),(461016,250,'pattern_restore_started','Neutral','h1.Portal restoration started\r\n\r\nThe portal restoration is started. It might take some time depending on your data amount.\r\n\r\n*Note*: the portal will not be available during the restoration process.\r\n\r\nIf you have any questions or need assistance please feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\"\r\n\r\nBest regards,\r\nONLYOFFICE™ Support Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"\r\n\r\n^You receive this email because you are a registered user of the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal. To change the notification type, please manage your \"subscription settings\":\"$RecipientSubscriptionConfigURL\".^','','2016-09-19 10:41:13','text',2,NULL,'Console'),(950587,250,'pattern_saas_admin_activation','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie haben gerade das ONLYOFFICE Portal erstellt, das die interne Zusammenarbeit verbessern wird. Ihre Portaladresse ist \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Das Hinzufügen dieses Links dem Lesezeichen ist eine gute Idee. Per Lesezeichen speichern Sie häufig genutzte Webadressen für einen schnellen Zugriff). Folgen Sie dem Link unten, um Ihre E-Mail-Adresse zu bestätigen:\n\np=. \"Klicken Sie hier für die Bestätigung\":\"$InviteLink\"\n\nBitte vervollständigen Sie Ihre E-Mail-Aktivierung innerhalb einer Woche. Der Link ist nur für 7 Tage gültig.\n\nHinweis: Wir senden keine vertrauliche Information (wie Ihr Passwort) in E-Mails aus Sicherheitsgründen. Sie können Ihre E-Mail oder Passwort auf Ihrer \"persönlichen Profilseite \" ändern:\"$MyStaffLink\".\n\nFür weitere Information besuchen Sie unser \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-03 09:11:21','text',2,NULL,'Evgenia'),(951005,250,'pattern_saas_admin_activation','es','Buenos días, $UserName,\n\nUsted acaba de crear el portal ONLYOFFICE para organizar un trabajo en colaboración efectivo. Dirección de su portal - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Le recomendamos añadir este enlace a marcadores: es probable que Usted lo use a menudo). Para confirmar su dirección de correo electrónico, por favor, siga el enlace siguiente:\n\n p=. \"Pulse aquí para confirmar\":\"$InviteLink\"\n\nPor favor, termine la activación de su correo electrónico durante la semana, porque el enlace es válido solo durante 7 días.\n\nNote, por favor: por razones de seguridad no enviamos la información confidencial (como su contraseña) en los mensajes de correo. Usted puede cambiar su dirección de correo electrónico o contraseña en \"la página de su perfil personal\":\"$MyStaffLink\".\n\nPara recibir una información adicional le invitamos a nuestro \"Centro de Ayuda\":\"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-14 12:10:09','text',2,NULL,'Ekaterina.Heidel'),(950797,250,'pattern_saas_admin_activation','fr','Bonjour $UserName,\n\nVous venez de créer le portail ONLYOFFICE pour vous aider à améliorer la coopération interne au sein de votre entreprise. L\'adresse de votre portail est \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (vous pouvez ajouter ce lien à vos favoris, probablement vous allez l\'utiliser souvent). Suivez le lien ci-dessous pour confirmer votre adresse e-mail :\n\n p=. \"Cliquez sur ce lien de confirmation\":\"$InviteLink\"\n\nVeuillez effectuer l\'activation par e-mail dans une semaine car le lien n\'est valable que 7 jours.\n\nRemarque : pour des raisons de sécurité nous n\'envoyons pas de renseignements confidentiels par courriel (tels que mot de passe). Vous pouvez changer votre e-mail ou mot de passe sur la page de votre \"profil\":\"$MyStaffLink\".\n\nPour plus d\'informations, nous vous invitons à consulter notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nSincérement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-07 11:42:35','text',2,NULL,'Nadine Yablonskaya'),(934113,250,'pattern_saas_admin_activation','Neutral','Dear $UserName,\r\n\r\nYou have just created the ONLYOFFICE portal, your team\'s portal that would enhance internal cooperation. Your portal address is \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (adding this link to your bookmarks is a good idea, you are most likely to get to use it a lot). Follow the link below to confirm your email address:\r\n\r\n p=. \"Click here for confirmation\":\"$InviteLink\"\r\n\r\nPlease, complete your email activation within a week as the link is valid for 7 days only.\r\n\r\nNote: we do not send out confidential information (like your password) in emails for safety reasons. You may change your email or password in your \"personal profile page\":\"$MyStaffLink\".\r\n\r\nFor more information we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:51','text',2,NULL,'Console'),(936240,250,'pattern_saas_admin_activation','ru','Здравствуйте, $UserName,\n\nВы только что создали портал ONLYOFFICE для организации эффективной совместной работы. Адрес Вашего портала - \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" (Советуем добавить эту ссылку в закладки: по всей вероятности, Вы будете ей часто пользоваться). Для подтверждения адреса электронной почты перейдите по следующей ссылке:\n\n p=. \"Нажмите сюда для подтверждения\":\"$InviteLink\"\n\nПожалуйста, выполните активацию электронной почты в течение недели, так как ссылка действительна только 7 дней.\n\nОбратите внимание: из соображений безопасности мы не высылаем в электронных письмах конфиденциальную информацию (такую, как ваш пароль). Вы можете изменить свой адрес электронной почты или пароль на \"странице вашего личного профиля\":\"$MyStaffLink\".\n\nДля получения дополнительной информации приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 15:33:37','text',2,NULL,'Svetlana'),(950816,250,'pattern_saas_admin_invite_teammates','de','Sehr geehrte/r Frau/Herr $UserName,\n\nDas Cloud-Office für Ihr Team ist bereits auf \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" erstellt. Es ist Zeit, Ihre Teamkollegen einzuladen.\nAm einfachsten können Sie das Einladungslink mit der Hilfe der Option *Laden zum Portal* verteilen.\n\n$GreenButton\n\nFals Sie Zugriff zu die detaillierten Kontaktinformation haben, fügen Sie Ihre Teamkollegen manuell mit der Taste *Neu erstellen...* in den Modul *Personen* ein. \"Mehr erfahren >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nOder fügen Sie alle Benutzer auf einmal ein. Dafür nutzen Sie:\n  \"Ihr Yahoo- oder Google-Konto\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\n  \"Ihr E-Mail-Client-Adressbuch\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\n  \"eine CSV-Datei\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \n\nSchließlich können Sie Ihren Teamkollegen die Selbstregistrierung erlauben, nachdem Sie die Einstellungen sicherer Mail-Domains konfiguriert haben. \"Mehr darüber >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/configuration.aspx#TrustedDomain\"\n\nNach dem Hinzufügen verwalten Sie die Zugriffsrechte. Für weitere Information über Zugangsrechtsverwaltung, besuchen Sie unser \"Hilfe-Center\":\"https://helpcenter.onlyoffice.com\".\n\nMit freundlichen Grüßen,\nONLYOFFICE-Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-08 08:09:15','text',2,NULL,'Evgenia'),(950923,250,'pattern_saas_admin_invite_teammates','es','Estimado(a) $UserName,\n\nLa oficina en la nube para su equipo ya está creada en \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Es hora de invitar a sus compañeros de equipo a su portal.\nLa forma más fácil de hacerlo es enviar el enlace de invitación utilizando la opción *Invitar a usuarios al portal*.\n\n$GreenButton\n\nSi Usted tiene acceso a la información detallada de las personas de contacto, añada sus compañeros de equipo manualmente uno por uno usando el botón *Crear nuevo...* en el módulo *Personas*. \"Aprender Más >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nO añada usuarios a la vez de:\n    \"su cuenta de Yahoo o Google\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\n    \"su libro de direcciones de correo de clientes\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\n    \"un archivo CSV\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \n\nPor último, se puede permitir a su compañeros de equipo auto-registro de configuración de *Ajustes del dominio de correo confiado*. \"Aprender Más >>\": \"http://helpcenter.onlyoffice.com/gettingstarted/configuration.aspx#TrustedDomain\"\n\nUna vez añadido, gestione los derechos de acceso. Para aprender más acerca de como gestionar los derechos de acceso visite nuestro \"Centro de Ayuda\"\":\"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo de ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-13 09:06:04','text',2,NULL,'Ekaterina.Heidel'),(949150,250,'pattern_saas_admin_invite_teammates','fr','Bonjour $UserName,\n\nLe bureau en nuage pour votre équipe est déjà créé à \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Il est temps d\'y inviter vos collègues. \nLa façon la plus simple de le faire est de distribuer le lien d\'invitation à l\'aide de l\'option *Inviter les utilisateurs au portail*.\n\n$GreenButton\n\nSi vous avez accès aux informations des contacts détaillées, ajoutez vos coéquipiers manuellement un par un à l\'aide du bouton\' *Créer...* dans le module *Personnes*. \"En savoir plus >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nOu ajoutez des utilisateurs à la fois en utilisant :\n\"votre compte Yahoo ou Google\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\n\"votre carnet d\'adresses de client de messagerie\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\n\"un fichier CSV\":http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\n\nEnfin, vous pouvez permettre à vos coéquipiers de configurer des paramètres de *Domaine de messagerie de confiance*. \"En savoir plus >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nUne fois ajouté, gérez leurs droits d\'accès. Pour plus d\'informations sur la gestion des droits d\'accès, visitez notre Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nSincèrement vôtre,\nÉquipe ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-26 09:56:30','text',2,NULL,'Nadine Yablonskaya'),(934228,250,'pattern_saas_admin_invite_teammates','Neutral','Dear $UserName,\r\n\r\nThe cloud office for your team is already created at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". It\'s time to invite your teammates to join it. \r\nThe easiest way to do that is to distribute the invitation link using the *Invite users to portal* option.\r\n\r\n$GreenButton\r\n\r\nIf you have access to the detailed contact information of the people, add your teammates manually one by one using the *Create New...* button in the *People* module. \"Learn more >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\r\n\r\nOr add users all at once from:\r\n    \"your Yahoo or Google account\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\r\n    \"your mail client address book\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\r\n    \"a CSV file\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \r\n\r\nFinally, you can allow your teammates self-registration configuring the *Trusted Mail Domain* settings. \"Learn more >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/configuration.aspx#TrustedDomain\"\r\n\r\nOnce added, manage their access rights. For more information about ARM, visit our \"Help Center\":\"https://helpcenter.onlyoffice.com\".\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:53','text',2,NULL,'Console'),(936227,250,'pattern_saas_admin_invite_teammates','ru','Здравствуйте, $UserName,\n\nОблачный офис для вашей команды уже создан по адресу \"${__VirtualRootPath}\":\"${__VirtualRootPath}\". Пора пригласить в него других участников команды. \nПроще всего сделать это, разослав пригласительную ссылку с помощью опции *Пригласить пользователей*.\n\n$GreenButton\n\nЕсли вы располагаете подробными контактными данными, добавьте участников команды вручную по одному с помощью кнопки *Создать...* в модуле *Люди*. \"Подробнее >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/people.aspx#AddingUsers_block\"\n\nИли добавьте всех пользователей сразу, используя один из следующих источников:\n    \"ваш аккаунт Yahoo или Google\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-web.aspx\",\n    \"адресная книга почтового клиента\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-mail-client.aspx\",\n    \"файл CSV\":\"http://helpcenter.onlyoffice.com/administratorguides/import-contacts-from-csv.aspx\". \n\nНаконец, вы можете разрешить самостоятельную регистрацию пользователей, настроив параметры *Доверенных почтовых доменов*. \"Подробнее >>\":\"http://helpcenter.onlyoffice.com/gettingstarted/configuration.aspx#TrustedDomain\"\n\nКогда пользователи будут добавлены, настройте права доступа. Для получения дополнительной информации об управлении правами доступа посетите наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 14:22:28','text',2,NULL,'Svetlana'),(950280,250,'pattern_saas_admin_payment_after_monthly_subscriptions','de','Sehr geehrte/r Frau/Herr $UserName,\n\nSie haben zum dritten Mal ein monatliches ONLYOFFICE-Abonnement ausgewählt.\n\nWozu mehr bezahlen? Da Sie unser wiederkehrender Kunde sind, möchten wir Ihnen für ein 1-Jahres-Preismodell 10% Rabatt anbieten. \n\nUm den Rabatt auszunutzen, verwenden Sie bitte den Gutscheincode auf der Zahlungsseite: ==<b>10%yearlysubsc2015 </b>==\n\nWenn Sie Fragen haben, kontaktieren Sie uns bitte unter dieser E-Mail Adresse \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\". Wir helfen Ihnen gerne dabei.\n\nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-01 09:27:50','text',2,NULL,'Evgenia'),(951040,250,'pattern_saas_admin_payment_after_monthly_subscriptions','es','Buenos días, $UserName,\n\nUsted ha elegido la suscripción mensual para ONLYOFFICE la tercera vez.\n\n¿Para qué pagar más? Queremos ofrecer a Usted, como a nuestro cliente que vuelve a comprar, 10% de descuento para el plan de precios anual.\n\nPara pagar con descuento, por favor, use este cupón de descuento en la página de pagos: ==<b>10%yearlysubsc2015 </b>==\n\nSi Usted tiene algunas preguntas, contáctenos por correo \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\". ¡Le ayudamos con mucho gusto!\n \nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-16 11:39:43','text',2,NULL,'Ekaterina.Heidel'),(950837,250,'pattern_saas_admin_payment_after_monthly_subscriptions','fr','Bonjour $UserName,\n\nVous avez choisi l\'abonnement mensuel ONLYOFFICE pour la troisième fois.\n\nPourquoi payer plus ? Vous êtes notre client fidèle, et nous voudrions vous offrir une réduction de 10% pour l\'abonnement annuel.\n\nPour payer avec une réduction, utilisez le coupon sur la page de paiement: ==<b>10%yearlysubsc2015 </b>==\n\nSi vous avez des questions, contactez nous à \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\". \n \nSincérement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-08 13:22:06','text',2,NULL,'Nadine Yablonskaya'),(934248,250,'pattern_saas_admin_payment_after_monthly_subscriptions','Neutral','Hi $UserName,\r\n\r\nYou selected a monthly ONLYOFFICE subscription for the third time already.\r\n\r\nWhy pay more? As you are our returning customer, we would like to offer you the 10% for the 1 year pricing plan.\r\n\r\nTo pay with the discount please apply the coupon at the payment page: ==<b>10%yearlysubsc2015 </b>==\r\n\r\nIf you have any questions feel free to contact us at \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\". We will be glad to help you!\r\n \r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:54','text',2,NULL,'Console'),(936203,250,'pattern_saas_admin_payment_after_monthly_subscriptions','ru','Здравствуйте, $UserName,\n\nВы выбрали помесячную подписку на ONLYOFFICE уже третий раз.\n\nЗачем переплачивать? Как нашему постоянному клиенту, мы хотели бы предложить Вам 10% скидку на годовой тариф.\n\nДля оплаты со скидкой воспользуйтесь скидочным купоном: ==<b>10%yearlysubsc2015 </b>==\n\nЕсли у Вас возникнут какие-либо вопросы, обращайтесь к нам на \"support@onlyoffice.com\":\"mailto:support@onlyoffice.com\". Мы будем рады Вам помочь!\n \nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 12:31:04','text',2,NULL,'Svetlana'),(950775,250,'pattern_saas_admin_payment_warning','de','Sehr geehrte/r Frau/Herr $UserName,\n \nBitte beachten Sie, dass Ihr ONLYOFFICE Abonnement heute abläuft.\n \nUm Ihr Abonnement zu verlängern, müssen Sie eine Verlängerung für ONLYOFFICE erwerben.\n \nKlicken Sie auf den folgenden Link, um die Verlängerung zu starten:\n\"Preisinformation\":\"$PricingPage\"\n \nWenn Sie Ihre nächste Verlängerung erwerben, können Sie auch die Lizenzoption \"Auto-renew\" aktivieren. In diesem Fall wird Ihre Lizenz automatisch nach Ablauf der Gültigkeit verlängert.\n \nSie bekommen eine separate E-Mail mit Abrechnungsinformationen am Fälligkeitstermin.\n \nEs ist möglich, automatische Verlängerungsoption jederzeit durch den Zugriff auf myAccount(My Products section)zu deaktivieren: \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n \nFalls Sie noch Fragen zur ONLYOFFICE Installation, Aktivierung haben oder technische Unterstützung benötigen, kontaktieren Sie uns unter \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n \nWenn es zahlungsbezogene Frage entstehen, nehmen Sie Kontakt mit Avangate auf: \"support@avangate.com\":\"mailto:support@avangate.com\"\n \nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"\n',NULL,'2017-02-07 09:02:42','text',2,NULL,'Evgenia'),(950890,250,'pattern_saas_admin_payment_warning','es','Buenos días, $UserName,\n\nNote, por favor, que su suscripción para ONLYOFFICE va a expirar hoy.\n\nPara continuar usando el servicio se necesita adquirir renovación del producto para ONLYOFFICE.\n\nPulse el enlace abajo para empezar el proceso de prolongación:\n\"Página con precios\":\"$PricingPage\"\n\nPara su comodidad Usted podrá activar la opción de renovación automática al comprar la suscripción siguiente, en este caso la suscripción será renovada automáticamente a la expiración del periodo de uso.\n\nEn la fecha de expiración Usted recibirá un mensaje de correo separado con los detalles de pago para los pagos recurrentes.\n\nUsted podrá desactivar la opción de renovación automática para su suscripción en cualquier momento en su cuenta privada Avangate myAccount (en la sección My Products): \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n\nSi tiene algunas preguntas sobre la instalación, activación y asistencia técnica de ONLYOFFICE, contacte con nuestro equipo de soporte técnico \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nSi tiene algunas preguntas relacionadas con pagos, por favor, contacte con Avangate por correo \"support@avangate.com\":\"mailto:support@avangate.com\"\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-09 13:28:32','text',2,NULL,'Ekaterina.Heidel'),(950275,250,'pattern_saas_admin_payment_warning','fr','Bonjour $UserName,\n\nVeuillez noter que l\'abonnement à ONLYOFFICE arrive à expiration aujourd\'hui.\n\nPour prolonger votre abonnement, vous avez besoin d\'acheter un revouvellement de la licence de ONLYOFFICE.\n\nCliquez sur le lien pour lancer le processus de renouvellement :\n\"Page de la tarification\":\"$PricingPage\"\n\nPour votre commodité, lors de l\'achat de votre prochain renouvellement, vous pouvez activer l’option « renouvellement automatique » de la licence, pour que votre licence soit renouvelée automatiquement à la date d’expiration.\n\nPour les paiements récurrents, un courriel avec les détails de paiement vous sera envoyé à la date d\'expiration.\n\nVous pouvez désactiver l’option de « renouvellement automatique » à tout moment en accédant à votre compte (la section My products) : \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n\nSi vous aves des questions d\'installation, d\'activation ou des problèmes lors de l\'utilisation de ONLYOFFICE, veuillez contacter notre équipe d\'assistance  \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nPour les questions de paiement, contactez Avangate par e-mail à \"support@avangate.com\":\"mailto:support@avangate.com\"\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-01 09:13:31','text',2,NULL,'Nadine Yablonskaya'),(934249,250,'pattern_saas_admin_payment_warning','Neutral','Dear $UserName,\r\n\r\nPlease note that your ONLYOFFICE subscription is due to expire today.\r\n\r\nIn order to extend your subscription, you need to purchase a product renewal for ONLYOFFICE.\r\n\r\nClick on the link below to start the renewal process:\r\n\"Pricing page\":\"$PricingPage\"\r\n\r\nFor your convenience, when you purchase your next renewal, you can also enable the \"auto-renew\" license option, in which case your license will be renewed automatically at expiration time.\r\n\r\nA separate email with payment details for the recurrent billing will be sent on the expiration date.\r\n\r\nYou will be able to disable the \"auto-renew\" option at any time by accessing myAccount (My Products section) at: \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\r\n\r\nFor any further ONLYOFFICE installation, activation and technical support issues, please contact our support team at \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\r\n\r\nFor payment related issues please contact Avangate by email at \"support@avangate.com\":\"mailto:support@avangate.com\"\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:54','text',2,NULL,'Console'),(936216,250,'pattern_saas_admin_payment_warning','ru','Добрый день, $UserName,\n\nПожалуйста, обратите внимание, что сегодня истекает срок действия вашей подписки на ONLYOFFICE.\n\nВам необходимо приобрести продление подписки на ONLYOFFICE.\n\nНажмите на следующую ссылку, чтобы начать продление:\n\"Страница с ценами\":\"$PricingPage\"\n\nДля вашего удобства при покупке следующего продления вы сможете включить опцию автоматического продления лицензии, и в этом случае лицензия будет продлеваться автоматически по окончании срока действия.\n\nДля регулярных платежей в день истечения срока действия подписки будет приходить отдельное письмо с информацией о платеже.\n\nВы в любое время сможете отключить опцию автоматического продления лицензии в личном кабинете Avangate myAccount (в разделе My Products): \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n\nПо вопросам установки, активации и технической поддержки ONLYOFFICE обращайтесь в нашу службу поддержки \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nПо вопросам оплаты, пожалуйста, обращайтесь в Avangate по адресу \"support@avangate.com\":\"mailto:support@avangate.com\"\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 13:36:53','text',2,NULL,'Svetlana'),(950772,250,'pattern_saas_admin_payment_warning_after3','de','Sehr geehrte/r Frau/Herr $UserName,\n\nBitte beachten Sie, dass Ihr ONLYOFFICE Abonnement am $DelayDueDate abgelaufen ist.\n\nKlicken Sie auf den folgenden Link, um die Verlängerung zu starten:\n\"Preisinformation\":\"$PricingPage\"\n\nWenn Sie Ihre nächste Verlängerung erwerben, können Sie auch die Lizenzoption \"Auto-renew\" aktivieren. In diesem Fall wird Ihre Lizenz automatisch nach Ablauf der Gültigkeit verlängert.\n\nSie bekommen eine separate E-Mail mit Abrechnungsinformationen am Fälligkeitstermin.\n\nEs ist möglich, automatische Verlängerungsoption jederzeit durch den Zugriff auf myAccount(My Products section)zu deaktivieren: \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n\nFalls Sie noch Fragen zur ONLYOFFICE Installation, Aktivierung haben oder technische Unterstützung benötigen, kontaktieren Sie uns unter \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nWenn es zahlungsbezogene Frage entstehen, nehmen Sie Kontakt mit Avangate auf: \"support@avangate.com\":\"mailto:support@avangate.com\"\n\nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-07 08:57:41','text',2,NULL,'Evgenia'),(950887,250,'pattern_saas_admin_payment_warning_after3','es','Buenos días, $UserName,\n\nNote, por favor, que su suscripción para ONLYOFFICE expiró el $DueDate.\n\nPara continuar usando el servicio se necesita adquirir renovación del producto para ONLYOFFICE.\n\nPulse el enlace abajo para empezar el proceso de prolongación:\n\"Página con precios\":\"$PricingPage\"\n\nPor favor, prolongue su licencia hasta el $DelayDueDate, si no Usted no podrá acceder a los datos de su oficina web. \n\nPara su comodidad Usted podrá activar la opción de renovación automática al comprar la suscripción siguiente, en este caso la suscripción será renovada automáticamente a la expiración del periodo de uso.\n\nEn la fecha de expiración Usted recibirá un mensaje de correo separado con los detalles de pago para los pagos recurrentes.\n\nUsted podrá desactivar la opción de renovación automática para su suscripción en cualquier momento en su cuenta privada Avangate myAccount (en la sección My Products): \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n\nSi tiene algunas preguntas sobre la instalación, activación y asistencia técnica de ONLYOFFICE, contacte con nuestro equipo de soporte técnico \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nSi tiene algunas preguntas relacionadas con pagos, por favor, contacte con Avangate por correo \"support@avangate.com\":\"mailto:support@avangate.com\"\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-09 12:58:43','text',2,NULL,'Ekaterina.Heidel'),(950266,250,'pattern_saas_admin_payment_warning_after3','fr','Bonjour $UserName,\n\nVeuillez noter que votre abonnement à ONLYOFFICE a expiré le $DueDate.\n\nPour prolonger votre abonnement, vous avez besoin d\'acheter un revouvellement de la licence de ONLYOFFICE.\n\nCliquez sur le lien pour lancer le processus de renouvellement :\n\"Page de la tarification\":\"$PricingPage\"\n\nVeuillez renouveler votre license jusqu\'au $DelayDueDate, sinon vous ne pourrez pas accéder aux données du bureau virtuel. \n\nPour votre commodité, lors de l\'achat de votre prochain renouvellement, vous pouvez activer l’option « renouvellement automatique » de la licence, pour que votre licence soit renouvelée automatiquement à la date d’expiration.\n\nPour les paiements récurrents, un courriel avec les détails de paiement vous sera envoyé à la date d\'expiration.\n\nVous pouvez désactiver l’option de « renouvellement automatique » à tout moment en accédant à votre compte (la section My products): \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n\nSi vous aves des questions d\'installation, d\'activation ou des problèmes lors de l\'utilisation, veuillez contacter notre équipe d\'assistance \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nPour les questions de paiement, contactez Avangate par e-mail à \"support@avangate.com\":\"mailto:support@avangate.com\"\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-01 08:41:00','text',2,NULL,'Nadine Yablonskaya'),(934250,250,'pattern_saas_admin_payment_warning_after3','Neutral','Dear $UserName,\r\n\r\nPlease note that your ONLYOFFICE subscription has expired on $DueDate.\r\n\r\nIn order to extend your subscription, you need to purchase a product renewal for ONLYOFFICE.\r\n\r\nClick on the link below to start the renewal process:\r\n\"Pricing page\":\"$PricingPage\"\r\n\r\nPlease renew your license till $DelayDueDate, otherwise, you will not be able to access your web-office data. \r\n\r\nFor your convenience, when you purchase your next renewal, you can also enable the \"auto-renew\" license option, in which case your license will be renewed automatically at expiration time.\r\n\r\nA separate email with payment details for the recurrent billing will be sent on the expiration date.\r\n\r\nYou will be able to disable the \"auto-renew\" option at any time by accessing myAccount (My Products section) at: \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\r\n\r\nFor any further ONLYOFFICE installation, activation and technical support issues, please contact our support team at \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\r\n\r\nFor payment related issues please contact Avangate by email at \"support@avangate.com\":\"mailto:support@avangate.com\"\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:54','text',2,NULL,'Console'),(936213,250,'pattern_saas_admin_payment_warning_after3','ru','Добрый день, $UserName,\n\nПожалуйста, обратите внимание, что срок действия вашей подписки на ONLYOFFICE истек $DueDate.\n\nВам необходимо приобрести продление подписки на ONLYOFFICE.\n\nНажмите на следующую ссылку, чтобы начать продление:\n\"Страница с ценами\":\"$PricingPage\"\n\nПожалуйста, продлите лицензию до $DelayDueDate, иначе вы не сможете получить доступ к данным виртуального офиса. \n\nДля вашего удобства при покупке следующего продления вы сможете включить опцию автоматического продления лицензии, и в этом случае лицензия будет продлеваться автоматически по окончании срока действия.\n\nДля регулярных платежей в день истечения срока действия подписки будет приходить отдельное письмо с информацией о платеже.\n\nВы в любое время сможете отключить опцию автоматического продления лицензии в личном кабинете Avangate myAccount (в разделе My Products): \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avanga