\":\"$PricingPage\"\n\nPara su comodidad Usted podrá activar la opción de renovación automática al comprar la suscripción siguiente, en este caso la suscripción será renovada automáticamente a la expiración del periodo de uso.\n\nEn la fecha de expiración Usted recibirá un mensaje de correo separado con los detalles de pago para los pagos recurrentes.\n\nUsted podrá desactivar la opción de renovación automática para su suscripción en cualquier momento en su cuenta privada de Avangate myAccount (en la sección My Products): \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n\nSi tiene algunas preguntas sobre instalación, activación y asistencia técnica de ONLYOFFICE, contacte con nuestro equipo de soporte técnico \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nSi tiene algunas preguntas relacionadas con pagos, por favor, contacte con Avangate por correo \"support@avangate.com\":\"mailto:support@avangate.com\"\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-09 12:47:09','text',2,NULL,'Ekaterina.Heidel'),(950236,250,'pattern_saas_admin_payment_warning_delaydue','fr','Bonjour $UserName,\n\nVeuillez notez que votre abonnement à ONLYOFFICE a expiré le $DelayDueDate et l’accès à votre web-office est actuellement bloqué.\n\nAfin de prolonger votre abonnement et continuer à utiliser votre web-office, vous avez besoin d\'acheter un renouvellement de l\'abonnement à ONLYOFFICE.\n\nCliquez sur le lien pour lancer le processus de renouvellement :\n\"Page de la tarification \":\"$PricingPage\"\n\nPour votre commodité, lors de l\'achat de votre prochain renouvellement, vous pouvez activer l’option « renouvellement automatique » de la licence, pour que votre licence soit renouvelée automatiquement à la date d’expiration.\n\nPour les paiements récurrents, un courriel avec les détails de paiement vous sera envoyé à la date d\'expiration.\n\nVous pouvez désactiver l’option de « renouvellement automatique » à tout moment en accédant à votre compte Avangate myAccount (dans la section My Products) : \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n\nSi vous avez des questions d\'installation, d\'activation ou des problèmes techniques, contactez notre équipe d\'assistance \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nPour les questions de paiement, contactez Avangate par e-mail à \"support@avangate.com\":\"mailto:support@avangate.com\"\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-01 07:27:47','text',2,NULL,'Nadine Yablonskaya'),(934252,250,'pattern_saas_admin_payment_warning_delaydue','Neutral','Dear $UserName,\r\n\r\nPlease note that your ONLYOFFICE subscription has expired on $DelayDueDate and the access to your web-office is currently blocked.\r\n\r\nIn order to extend your subscription and continue to use your web-office, you need to purchase a product renewal for ONLYOFFICE.\r\n\r\nClick on the link below to start the renewal process:\r\n\"Pricing page\":\"$PricingPage\"\r\n\r\nFor your convenience, when you purchase your next renewal, you can also enable the \"auto-renew\" license option, in which case your license will be renewed automatically at expiration time.\r\n\r\nA separate email with payment details for the recurrent billing will be sent on the expiration date.\r\n\r\nYou will be able to disable the \"auto-renew\" option at any time by accessing myAccount (My Products section) at: \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\r\n\r\nFor any further ONLYOFFICE installation, activation and technical support issues, please contact our support team at \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\r\n\r\nFor payment related issues please contact Avangate by email at \"support@avangate.com\":\"mailto:support@avangate.com\"\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:54','text',2,NULL,'Console'),(936210,250,'pattern_saas_admin_payment_warning_delaydue','ru','Добрый день, $UserName,\n\nПожалуйста, обратите внимание, что срок действия вашей подписки на ONLYOFFICE истек $DelayDueDate, и доступ к вашему виртуальному офису временно заблокирован.\n\nЧтобы продолжить работу в виртуальном офисе, необходимо приобрести продление подписки на ONLYOFFICE.\n\nНажмите на следующую ссылку, чтобы начать продление:\n\"Страница с ценами\":\"$PricingPage\"\n\nДля вашего удобства при покупке следующего продления вы сможете включить опцию автоматического продления лицензии, и в этом случае лицензия будет продлеваться автоматически по окончании срока действия.\n\nДля регулярных платежей в день истечения срока действия подписки будет приходить отдельное письмо с информацией о платеже.\n\nВы в любое время сможете отключить опцию автоматического продления лицензии в личном кабинете Avangate myAccount (в разделе My Products): \"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\":\"https://secure.avangate.com/myaccount/?lang=en&e=example@customer-email.com&k=xxxxxxxxxx\"\n\nПо вопросам установки, активации и технической поддержки ONLYOFFICE обращайтесь в нашу службу поддержки \"http://support.onlyoffice.com/\":\"http://support.onlyoffice.com/\"\n\nПо вопросам оплаты, пожалуйста, обращайтесь в Avangate по адресу \"support@avangate.com\":\"mailto:support@avangate.com\"\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 13:21:59','text',2,NULL,'Svetlana'),(950782,250,'pattern_saas_admin_trial_warning','de','Sehr geehrte/r Frau/Herr $UserName,\n\nVielen Dank, dass Sie ONLYOFFICE ausprobiert haben. Kostenlose Probeperiode für Ihr Portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" läuft heute aus.\n \nUm Ihr Konto weiter nutzen zu dürfen, besuchen Sie \"Preise\" Seite :\"$PricingPage\", wo Sie alle Tarife ansehen und bestgeeignete Lösung wählen können.\n\nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-07 10:37:54','text',2,NULL,'Evgenia'),(950899,250,'pattern_saas_admin_trial_warning','es','Buenos días, $UserName,\n\nGracias a Usted por hacer pruebas del servicio ONLYOFFICE. El plan de prueba gratuito para su portal en \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" va a expirar hoy.\n\nPara continuar usando la cuenta, pase a la \"página con precios\":\"$PricingPage\", donde Usted puede enterarse de todos los modelos y elegir el plan más apropiado para Usted.\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-10 08:55:10','text',2,NULL,'Ekaterina.Heidel'),(950690,250,'pattern_saas_admin_trial_warning','fr','Bonjour $UserName,\n\nNous vous remercions de bien vouloir essayer le service ONLYOFFICE. Le plan d\'utilisation gratuite de votre portail à  \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" expire aujourd\'hui.\n\nPour continuer à utiliser votre compte, accédez à la \"Page des tarifs\":\"$PricingPage\", où vous pouvez consulter tous les modèles et choisir le plan approprié.\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-06 11:30:16','text',2,NULL,'Nadine Yablonskaya'),(934242,250,'pattern_saas_admin_trial_warning','Neutral','Dear $UserName,\r\n\r\nThank you for having given ONLYOFFICE a try. The free plan for your portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" is due to expire today.\r\n\r\nTo continue using your account, proceed to the \"Pricing page\":\"$PricingPage\", where you can check out all the models and choose the most suitable for you.\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:54','text',2,NULL,'Console'),(936224,250,'pattern_saas_admin_trial_warning','ru','Здравствуйте, $UserName,\n\nБлагодарим Вас за то, что Вы опробовали ONLYOFFICE. Сегодня должен закончиться бесплатный пробный план для Вашего портала по адресу \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nЧтобы продолжить использование аккаунта, перейдите на \"страницу платежей\":\"$PricingPage\", где Вы можете ознакомиться со всеми моделями и выбрать наиболее подходящий для Вас план.\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 14:02:45','text',2,NULL,'Svetlana'),(950880,250,'pattern_saas_admin_trial_warning_after30','de','Sehr geehrte/r Frau/Herr $UserName,\n\nWenn Sie kein Team auch kein Projekt zum Verwalten haben,  hat ONLYOFFICE noch viel zu bieten! \n\nWir möchten Sie zu ONLYOFFICE Personal einladen, einem *kostenlosen virtuellen Arbeitsplatz für Dokumentenverwaltung*, der in sich Komfort und Mobilität von online Apps mit dem umfassenden Tools von Desktop-Lösungen vereinigt. \n\nUm die Arbeit schneller zu starten, loggen Sie sich über soziale Netzwerke: Facebook oder Google ein. Sobald du hier sind, ist es für Sie möglich:\n\n# Schließen Sie Ihr Lieblings-Cloudspeicher an: Dropbox, Google Drive, OneDrive oder Box.\n# Arbeiten Sie mit Texten, Tabellen und Präsentationen und teilen Sie sie mit Ihren Teammates.\n# Bearbeiten Sie und kommentieren Sie Dateien, arbeiten Sie daran in Echtzeit zusammen.\n# Betten Sie Dateien in Ihre Web-Seite ein.\n\n$GreenButton\n\nAußerdem können Sie unsere kostenlose ONLYOFFICE Desktop-Editoren nutzen, wenn Sie Dokumente, Tabellen und Präsentationen ohne Internetverbindung bearbeiten möchten. \"Jetzt herunterladen\":\"http://www.onlyoffice.com/desktop.aspx\"\n\n\nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-09 09:31:43','text',2,NULL,'Evgenia'),(950784,250,'pattern_saas_admin_trial_warning_after30','es','Buenos días, $UserName,\n\nAún si Usted no trabaja en equipo y no gestiona proyectos, ONLYOFFICE puede ofrecerle muchas posibilidades útiles! \n\nQueremos invitar a Usted al ONLYOFFICE Personal, *espacio de trabajo gratuito para la gestión de sus documentos*, que combina conveniencia y movilidad de aplicaciones en línea con funcionalidad rica de soluciones desktop.\n\nTodo lo que necesita hacer para empezar el trabajo es registrarse vía su cuenta de Facebook o Google. Después de esto Usted podrá:\n\n# Conectar un almacenamiento en la nube favorito: Dropbox, Google Drive, OneDrive o Box.\n# Trabajar con documentos de texto, hojas de cálculo y presentaciones y compartirlos con sus amigos.\n# Editar en colaboración y comentar archivos en tiempo real.\n# Incorporar documentos a página web.\n\n$GreenButton\n\nAdemás Usted puede usar los editores desktop de ONLYOFFICE gratuitos - un juego de herramientas de oficina para trabajo con documentos de texto, hojas de cálculo y presentaciones sin conexión al Internet. \"Descargar ahora\":\"http://www.onlyoffice.com/desktop.aspx\"\n\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-07 10:56:51','text',2,NULL,'Ekaterina.Heidel'),(950167,250,'pattern_saas_admin_trial_warning_after30','fr','Bonjour $UserName,\n\nMême si vous n\'avez pas d\'équipe ou de projet à gérer, ONLYOFFICE a beaucoup à vous offrir ! \n\nNous vous invitons à rejoindre ONLYOFFICE Personal, un *espace de travail gratuit pour gérer vos documents*, qui regroupe la commodité des applications en ligne et l\'ensemble d\'outils variés des suites bureautiques.\n\nTout ce qu\'il vous suffit de faire c\'est de vous inscrire via votre compte Facebook ou Google. Après quoi vous aurez la possibilité de:\n\n# Lier votre service de stockage préféré : Dropbox, Google Drive, OneDrive ou Box.\n# Travailler sur les textes, classeurs ou présentations et les partager avec vos amis.\n# Travaillez à plusieurs sur vos documents en temps réel.\n# Intégrer les documents à votre page web.\n\n$GreenButton\n\nEn outre, vous pouvez utiliser nos éditeurs de bureau ONLYOFFICE gratuits - une suite bureautique pour travailler sur les documents, classeurs, présentations hors connexion. \"Téléchargez maintenant\":\"http://www.onlyoffice.com/desktop.aspx\"\n\n\nSincerement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-31 08:00:50','text',2,NULL,'Nadine Yablonskaya'),(934253,250,'pattern_saas_admin_trial_warning_after30','Neutral','Dear $UserName,\r\n\r\nEven if you have no team or project to manage, ONLYOFFICE still has a lot to offer! \r\n\r\nWe\'d like to invite you to ONLYOFFICE Personal, a *free workspace to manage your documents*, combining the convenience and mobility of online apps with the rich toolset of desktop solutions.\r\n\r\nTo get a quick start all you do is sign up via your Facebook or Google account. As soon as you\'re there you\'ll be able to:\r\n\r\n# Connect your favorite cloud storage: Dropbox, Google Drive, OneDrive or Box.\r\n# Work with texts, spreadsheets and presentations and share them with your friends.\r\n# Co-edit and comment files, collaborate on them in real-time.\r\n# Embed documents to your web page.\r\n\r\n$GreenButton\r\n\r\nMoreover, you can use our free ONLYOFFICE Desktop Editors - an office suite for working on documents, spreadsheets and presentations without Internet connection. \"Download now\":\"http://www.onlyoffice.com/desktop.aspx\"\n\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-11-22 14:57:54','text',2,NULL,'Console'),(936193,250,'pattern_saas_admin_trial_warning_after30','ru','Добрый день, $UserName,\n\nДаже если Вы не работаете в команде и не управляете проектами, ONLYOFFICE все равно может предложить Вам множество полезных возможностей! \n\nМы хотим пригласить Вас в ONLYOFFICE Personal, *бесплатное рабочее пространство для управления вашими документами*, которое сочетает в себе удобство и мобильность онлайн-приложений c богатым функционалом десктопных решений.\n\nВсе, что Вам надо сделать, чтобы начать работу, - это зарегистрироваться с помощью своего аккаунта Facebook или Google. Сразу после этого Вы сможете:\n\n# Подключить облачное хранилище: Dropbox, Google Drive, OneDrive или Box.\n# Работать с текстовыми документами, таблицами и презентациями и делиться ими с друзьями.\n# Совместно редактировать и комментировать файлы в режиме реального времени.\n# Встраивать документы в веб-страницу.\n\n$GreenButton\n\nКроме того, Вы можете использовать бесплатные десктопные редакторы ONLYOFFICE - офисный пакет для работы с текстовыми документами, электронными таблицами и презентациями без подключения к интернету. \"Скачать сейчас\":\"http://www.onlyoffice.com/desktop.aspx\"\n\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-16 11:44:58','text',2,NULL,'Svetlana'),(950205,250,'pattern_saas_admin_trial_warning_after5','de','Sehr geehrte/r Frau/Herr $UserName,\n\nWir wissen, dass Arbeitstage manchmal verrückt sein können. Wenn Sie keine Möglichkeit hatten, ONLYOFFICE näher anzusehen und möchten Ihre Probezeit noch verlängern, beeilen Sie sich und sparen Sie Ihr Geld! \n\nHeute haben Sie die Chance, 20 zusätzliche Tage der Verlängerung oder 20% Rabatt auf 1 oder 3-Jahres-Abonnement für das ONLYOFFICE Portal zu erhalten.\n\n\n$GreenButton\n\n$BlueButton\n\nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-31 12:48:24','text',2,NULL,'Evgenia'),(950692,250,'pattern_saas_admin_trial_warning_after5','es','Buenos días, $UserName,\n\nSabemos que a veces los días laborales pueden ser muy saturados. Si Usted no ha tenido la oportunidad de examinar ONLYOFFICE en detalles y querría prolongar el periodo de prueba a unos días, estamos listos de satisfacer su deseo. ¡Aún más - si tiene prisa en tomar decisión, ahorre su dinero!\n\nHoy Usted puede obtener 20 días adicionales de periodo de prueba o aprovecharse de 20% de descuento al comprar la suscripción anual o de tres años para el portal ONLYOFFICE. Usted podrá aprovecharse de este descuento durante 5 días después de recibir este mensaje.\n\n$GreenButton\n\n$BlueButton\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-06 12:39:56','text',2,NULL,'Ekaterina.Heidel'),(949575,250,'pattern_saas_admin_trial_warning_after5','fr','Bonjour $UserName,\n\nNous savons que les jours ouvrables peuvent être parfois fous. Si vous n\'avez pas eu l\'occasion d\'examiner plus précisément la solution ONLYOFFICE et voudriez prolonger votre période d\'essai ? S\'il vous plaît !\n\nAujourd\'hui, vous avez une chance d’obtenir 20 jours supplémentaires de la période d\'essai ou une réduction 20% pour l\'abonnement d\'un an ou de 3 ans  on 1 or 3-year au portail ONLYOFFICE. Vous pouvez utiliser la réduction pendant 5 jours suivant la réception de ce message.\n\n$GreenButton\n\n$BlueButton\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-27 09:12:03','text',2,NULL,'Nadine Yablonskaya'),(939616,250,'pattern_saas_admin_trial_warning_after5','Neutral','Dear $UserName,\n\nWe know, business days can be crazy sometimes. If you didn\'t have an opportunity to take a closer look at ONLYOFFICE and would like to get a little bit more of your trial period at, we\'re in! Even more - if you are quick with your decision, you\'ll pay less!\n\nToday you have a chance to get 20 additional days of the trial or a 20% discount on 1 or 3-year subscription to ONLYOFFICE portal. You will be able to use the discount within 5 days after receiving this message.\n\n$GreenButton\n\n$BlueButton\n\nTruly yours,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2017-01-19 16:24:07','text',2,NULL,'Александр'),(949882,250,'pattern_saas_admin_trial_warning_after5','ru','Здравствуйте, $UserName,\n\nМы знаем, что рабочие дни иногда бывают очень насыщенными. У Вас не оказалось возможности детально изучить ONLYOFFICE, и Вы хотели бы еще немного продлить пробный период? Пожалуйста! Более того - если Вы поторопитесь с принятием решения, то сэкономите!\n\nСегодня Вам предоставляется возможность получить дополнительные 20 дней пробного периода или скидку 20% при приобретении подписки на портал ONLYOFFICE сроком на 1 или 3 года. Вы сможете воспользоваться скидкой в течение 5 дней после получения этого сообщения.\n\n$GreenButton\n\n$BlueButton\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-28 09:35:51','text',2,NULL,'Svetlana'),(936072,250,'pattern_saas_admin_trial_warning_after_half_year','de','Hallo $UserName,\n\nSie haben Ihr ONLYOFFICE Cloud Portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" seit mehr als einem halben Jahr nicht betreten. Vielleicht haben Sie sich entschieden, es nicht mehr zu benutzen. Leider werden wir Ihren Account in einer Woche löschen, weil Sie es nicht mehr brauchen.\n\nDer Zugriff auf Ihr Portal ist gesperrt und es wird in der nächsten Zeit vollständig entfernt. Bitte beachten Sie, dass nach dem Löschen des Portals alle erstellten Aufgaben, Daten im CRM, Nachrichten und andere Informationen komplett gelöscht werden.\n\nEs tut uns sehr leid, dass Sie in Ihrer Arbeit ONLYOFFICE Cloud Solution nicht verwendet haben. Wir würden uns freuen, wenn Sie sich die Zeit nehmen, \"uns zu sagen\":\"$FeedBackUrl\", warum Sie sich entschlossen haben, unsere Plattform zu verweigern. Es ist wichtig für uns das zu verstehen, damit wir den Service verbessern und für Sie und für andere Kunden nützlicher machen.\n\nUnd natürlich können Sie sich immer für ein neues ONLYOFFICE Portal anmelden.\n\nArbeiten und kommunizieren mit Freude!\n\nMit freundlichen Grüßen,\nONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-15 07:46:16','text',2,NULL,'Александр'),(936074,250,'pattern_saas_admin_trial_warning_after_half_year','es','Hola $UserName,\n\nNo ha ingresado en su portal de ONLYOFFICE \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" más de medio año. Tal vez usted ha decidido no utilizarlo más. Lo sentimos mucho, vamos a eliminar su cuenta dentro de una semana, si ya no lo necesita.\n\nEl acceso a su portal está bloqueado, en el futuro próximo será eliminado completamente. Tenga en cuenta que después de la eliminación del portal, todas las tareas creadas, los datos de CRM, los mensajes y otra información se eliminarán totalmente.\n\nLamentamos mucho que no use ONLYOFFICE Cloud Solution en su trabajo. Le agradeceríamos que se tomara el tiempo para \"decirnos\":\"$FeedBackUrl\" por qué decidió negarse a utilizar nuestra plataforma. Es importante para nosotros entenderlo, para que podamos mejorar el servicio y hacerlo más útil para usted y para otros clientes.\n\nY por supuesto, siempre puede registrarse para un nuevo portal de ONLYOFFICE.\n\n¡Trabaje y comuníquese con placer!\n\nSaludos cordiales,\nONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-15 07:48:29','text',2,NULL,'Александр'),(936076,250,'pattern_saas_admin_trial_warning_after_half_year','fr','Bonjour $UserName,\n\nVous n\'avez pas visité votre portail ONLYOFFICE dans les nuages \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" pour plus de six mois. Probablement vous avez decidé de ne plus l\'utiliser. Malheureusement nous allons supprimer votre portail dans une semaine car vous n\'en avez pas besoin.\n\nVotre portail sera supprimé complétement dans un bref délai. Veuillez noter que après la suppression du portail tous les données créées sur votre portail seront supporimées complétement aussi.\n\nC\'est dommage que vous n\'utilisez pas ONLYOFFICE dans notre travail. Nous serons reconnaissant si vous pouvez \"préciser\":\"$FeedBackUrl\" pourquoi est-ce que vous avez arrêté l\'utilisation de ONLYOFFICE. C\'est important pour nous de le comprendre pour améliorer le service et le logiciel.\n\nEt bien sur vous pouvez créer un nouveau portail quand vous le voulez.\n\nTravaillez et communiquez avec plaisir !\n\nCordialement,\nONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-15 07:50:30','text',2,NULL,'Александр'),(936041,250,'pattern_saas_admin_trial_warning_after_half_year','Neutral','Dear $UserName,\r\n\r\nYou haven\'t entered your ONLYOFFICE \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" cloud portal for more than half a year. Perhaps you have decided not to use it anymore. Unfortunately, we will delete your account today, because you no longer need it.\r\n\r\nAccess to your portal will be blocked by this day and it will be completely removed in the nearest time. Please note that after the portal deletion all the created tasks, data in CRM, messages and other information will be fully deleted.\r\n\r\nWe are very sorry that you did not use ONLYOFFICE Cloud Solution in your work. We would appreciate if you take the time \"to tell us\":\"$FeedBackUrl\" why you decided to refuse from using our platform. It is important for us to understand this, so that we can improve the service and make it more useful for you and for other clients.\r\n\r\nAnd of course, you can always sign up for a new ONLYOFFICE portal.\r\n\r\nWork and communicate with pleasure!\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-12-08 12:56:13','text',2,NULL,'Console'),(936070,250,'pattern_saas_admin_trial_warning_after_half_year','ru','Добрый день, $UserName,\n\nВы не заходили на Ваш облачный портал ONLYOFFICE \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" уже более полугода. Вероятно, вы решили его больше не использовать. Нам очень жаль, мы удалим ваш