ías.\n\nActualmente el número de los usuarios activos en el portal es $ActiveUsers.\n\nSi tiene planes de aumentar el número de los usuarios activos, le recomendamos el plan de precios $$Price/$PricePeriod.\n\nPor favor, entérese de todos los planes de precios disponibles y elija lo más apropiado.\n\n$GreenButton\n\n$BlueButton\n\nMuy atentamente,\nEquipo de ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-10 08:36:39','text',2,NULL,'Ekaterina.Heidel'),(950688,250,'pattern_saas_admin_trial_warning_before5','fr','Bonjour $UserName,\n\nNous vous remercions de bien vouloir essayer le service ONLYOFFICE. Nous espérons que tout va bien. Nous vous informons que la période d\'essai de votre compte à l\'adresse \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" se termine dans 5 jours.\n\nActuellement, le nombre des utilisateurs actifs sur le portail est $ActiveUsers.\n\nSi vous n’allez pas augmenter considérablement le nombre des utilisateurs, nous vous recommendons le plan $$Price/$PricePeriod.\n\nVeuillez consulter les plans tarifaires disponibles et choisissez le tarif le plus approprié.\n\n$GreenButton\n\n$BlueButton\n\nCordialement,\nÉquipe ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-02-06 11:15:39','text',2,NULL,'Nadine Yablonskaya'),(934243,250,'pattern_saas_admin_trial_warning_before5','Neutral','Dear $UserName,\r\n\r\nThank you for checking out ONLYOFFICE service. Hope, everything\'s going fine. We just want to remind you that the trial period for your account at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" will be over in five days.\r\n\r\nAt the moment the number of active users at the portal is $ActiveUsers.\r\n\r\nIf you\'re not going to increase it considerably, we can recommend you a $$Price/$PricePeriod plan.\r\n\r\nPlease, check all the available options and choose the most suitable rate for your business.\r\n\r\n$GreenButton\r\n\r\n$BlueButton\r\n\r\nTruly yours,\r\nONLYOFFICE Team\r\n\"www.onl