a a su oficina a \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" desde cualquier lugar!\n\nPara conseguir inicio rápido todo lo que tiene que hacer es registrarse a través de su cuenta de Facebook o Google. Tan pronto como usted esté allí usted será capaz de:\n\n# Conectar su almacenamiento en la nube favorito: Dropbox, Google Drive, OneDrive o Box.\n# Trabajar con textos, hojas de cálculo y presentaciones y compartirlas con sus amigos.\n# Co-editar y comentar archivos, colaborar en tiempo real.\n# Insertar documentos a su página web.\n\n$GreenButton\n\nMuy atentamente,\nEquipo ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"\n',NULL,'2016-12-01 08:47:08','text',2,NULL,'Александр'),(938380,250,'pattern_tariff_warning_trial4','fi','Hyvä $UserName,\n\nVaikka sinulla ei ole tiimiä tai projektia hallittavaksi, ${LetterLogoText} palvelulla on paljon annettavaa! \n\nHaluaisimme sinun tutustuvan ${LetterLogoText} Personal sovellukseen, *ilmaiseen asiakirjojen hallinnan työkaluun*, mikä yhdistää online sovellusten mukavuuden ja liikkuvuuden monipuoliseen työkalusettiin.\n\nOle tuottava, ja saat pääsyn \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" palveluun missä tahansa!\n\nPikaista aloitusta varten sinun tarvitsee vain rekisteröityä Facebook tai Google tilin kautta. Heti tämän jälkeen voit:\n\n# Yhdistää mieluisan pilvitallennuksen: Dropbox, Google Drive, OneDrive tai Box.\n# Luoda tekstejä, taulukkolaskentaa ja esityksiä ja jakaa niitä ystävillesi.\n# Muokata ja kommentoida yhteistyössä asiakirjoja, reaaliajassa.\n# Upottaa asiakirjoja webbisivustoosi.\n\n$GreenButton\n\nParhain Terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-10 05:08:26','text',2,NULL,'Arto Ryynanen'),(935658,250,'pattern_tariff_warning_trial4','fr','Bonjour $UserName,\n\nMême si vous n\'avez pas d\'équipe ou de projet à gérer, ${LetterLogoText} a encore beaucoup à offrir !\n\nNous aimerions vous inviter à ${LetterLogoText} Personal, un *espace gratuit de travail pour la gestion de vos documents*, alliant le confort et la mobilité des applications en ligne avec un riche nombre d\'outils de solutions desktop.\n\nSoyez productif et accèdez à votre bureau à \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" à partir de n\'importe où !\n\nPour démarrer rapidement, tout ce que vous devez faire c\'est vous inscrire via votre Facebook ou un compte Google. Là-dessus vous serez capable de :\n\n# Connecter votre stockage de nuage préféré : Dropbox, Google Drive, OneDrive ou Box.\n# Travailler sur textes, feuilles de calcul et présentations, et les partager avec vos amis.\n# Co-éditer et commenter des fichiers, collaborer en temps réel.\n# Incorporer les documents dans votre page web.\n\n$GreenButton\n\nSincèrement vôtre,\nÉquipe ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-01 08:47:13','text',2,NULL,'Александр'),(461023,250,'pattern_tariff_warning_trial4','Neutral','Dear $UserName,\n\nEven if you have no team or project to manage, ${LetterLogoText} still has a lot to offer! \n\nWe\'d like to invite you to ${LetterLogoText} Personal, a *free workspace to manage your documents*, combining the convenience and mobility of online apps with the rich toolset of desktop solutions.\n\nBe productive and access your office at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" from anywhere!\n\nTo get a quick start all you do is sign up via your Facebook or Google account. As soon as you\'re there you\'ll be able to:\n\n# Connect your favorite cloud storage: Dropbox, Google Drive, OneDrive or Box.\n# Work with texts, spreadsheets and presentations and share them with your friends.\n# Co-edit and comment files, collaborate on them in real-time.\n# Embed documents to your web page.\n\n$GreenButton\n\nTruly yours,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-12-01 08:47:00','text',2,NULL,'Console'),(935659,250,'pattern_tariff_warning_trial4','ru','Добрый день, $UserName,\n\nДаже если у Вас нет команды или проектов, нам все равно есть, что Вам предложить! \n\nМы хотим пригласить Вас в ${LetterLogoText} Personal, *бесплатное рабочее пространство для управления вашими документами*, которое сочетает в себе удобство и мобильность онлайн-приложений c богатым функционалом десктопных решений.\n\nОставайтесь продуктивными, имея доступ к своему офису \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" из любой точки мира!\n\nВсе, что Вам надо сделать, чтобы начать работу, - это зарегистрироваться с помощью своего аккаунта Facebook или Google. Сразу после этого Вы сможете:\n\n# Подключить облачное хранилище: Dropbox, Google Drive, SkyDrive или Box.\n# Работать с текстовыми документами, таблицами и презентациями и делиться ими с друзьями.\n# Совместно редактировать и комментировать файлы в режиме реального времени.\n# Встраивать документы в веб-страницу.\n\n$GreenButton\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-01 08:47:20','text',2,NULL,'Александр'),(950672,250,'pattern_tariff_warning_trial_enterprise','de','Sehr geehrte/r Frau/Herr $UserName,\n\nVielen Dank für Ihr Interesse an ${LetterLogoText}Service. Hoffentlich läuft alles bestens! Wir erinnern Sie daran, dass die Probezeit für Ihre Enterprise Edition in 7 Tagen vorbei wird.\n\nBitte überprüfen Sie alle verfügbaren Preispläne für Enterprise Edition und wählen Sie die am besten geeignete Lösung für Ihr Unternehmen.\n\n$GreenButton\n\n$BlueButton\n\nFalls Sie Fragen zur Preisgestaltung und Zahlungsbedingungen haben, kontaktieren Sie uns unter \"sales@onlyoffice.com\":\"sales@onlyoffice.com\". Sollten Sie technische Probleme, Bemerkungen oder Tipps haben: nehmen Sie dann Kontakt zu uns auf: \"support@onlyoffice.com\":\"support@onlyoffice.com\"',NULL,'2017-02-06 08:42:08','text',2,NULL,'Evgenia'),(950676,250,'pattern_tariff_warning_trial_enterprise','es','Buenos días, $UserName,\n\nApreciamos mucho su trabajo con el servicio ${LetterLogoText}. Esperamos que todo esté bien. Solo queremos recordar, que el periodo de prueba para la versión de servidor Enterprise Edition expirará en 7 días.\n\nPor favor, verifique los planes de precios disponibles para Enterprise Edition y seleccione lo más apropiado.\n\n$GreenButton\n\n$BlueButton\n\nSi tiene algunas preguntas relacionadas con la política de precios, por favor, contacte con nosotros por correo \"sales@onlyoffice.com\":\"sales@onlyoffice.com\". Si tiene algunas preguntas técnicas, por favor, decríbalas por correo \"support@onlyoffice.com\":\"support@onlyoffice.com\"',NULL,'2017-02-06 09:10:22','text',2,NULL,'Ekaterina.Heidel'),(935660,250,'pattern_tariff_warning_trial_enterprise','fr','Bonjour $UserName,\n\nMerci pour le travail avec le service ${LetterLogoText}. Nous esperons que tout va bien. Nous voudrions vous rappeler que la période d\'évaluation de l\'Enterprise Edition expire dans 7 jours. \n\nVous pouvez vérifier les plans tarifaires disponibles pour Enterprise Edition et choisir le tarif le plus convenable.\n\n$GreenButton\n\n$BlueButton\n\nPour les questions consernant notre politique de tarification et de paiement, contactez-nous à  \"sales@onlyoffice.com\":\"sales@onlyoffice.com\". Pour résoudre tout problème technique, n’hésitez pas à nous écrire à \"support@onlyoffice.com\":\"support@onlyoffice.com\"',NULL,'2016-12-01 08:47:31','text',2,NULL,'Александр'),(461102,250,'pattern_tariff_warning_trial_enterprise','Neutral','Dear $UserName,\n\nThank  you for checking out ${LetterLogoText} service. Hope, everything\'s  going fine. We just want to remind you that the trial period for your Enterprise Edition will be over in seven days. \n\nPlease, check all the available pricing plans for Enterprise Edition and choose the most suitable rate for your business.\n\n$GreenButton\n\n$BlueButton\n\nIf any questions related to our pricing and payment policy arise, please, contact us at \"sales@onlyoffice.com\":\"sales@onlyoffice.com\". For solving any technical problems you face do not hesitate to write to \"support@onlyoffice.com\":\"support@onlyoffice.com\"','','2016-12-01 08:47:27','text',2,NULL,'Console'),(935661,250,'pattern_tariff_warning_trial_enterprise','ru','Здравствуйте, $UserName,\n\nБлагодарим Вас за работу с сервисом ${LetterLogoText}. Надеемся, всё в порядке. Мы просто хотим напомнить, что пробный период для серверной версии Enterprise Edition завершится через семь дней.\n\nПожалуйста, ознакомьтесь со всеми доступными тарифными планами для Enterprise Edition и выберите наиболее подходящий.\n\n$GreenButton\n\n$BlueButton\n\nЕсли у вас остались вопросы относительно ценовой политики, пожалуйста, свяжитесь с нами по адресу электронной почты \"sales@onlyoffice.com\":\"sales@onlyoffice.com\". По любым техническим вопросам, пожалуйста, обращайтесь по адресу \"support@onlyoffice.com\":\"support@onlyoffice.com\"\n',NULL,'2016-12-01 08:47:34','text',2,NULL,'Александр'),(461024,250,'pattern_user_has_join','Neutral','h1.New user added to \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal\r\n\r\n\"$__AuthorName\":\"$__AuthorUrl\" has joined your portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\r\n\r\n\r\n^You receive this email because you are an administrator user of the \"${__VirtualRootPath}\":\"${__VirtualRootPath}\" portal. If you do not want to receive the notifications about new users, please manage your \"subscription settings\":\"$RecipientSubscriptionConfigURL\".^','','2016-09-19 10:41:13','text',2,NULL,'Console'),(950287,250,'pattern_you_added_after_invite','de','Sehr geehrte/r Frau/Herr $UserName,\n\nIhr Benutzerprofil wurde erfolgreich dem Portal unter\"${__VirtualRootPath}\":\"${__VirtualRootPath}\" hinzugefügt.\n\nh3.Fangen Sie die Arbeit mit Ihrem Portal an \n\n# Bearbeiten Sie Ihr \"Profil\":\"$MyStaffLink\", um Personalangaben und Kontaktdaten hinzuzufügen.\n# Erstellen, bearbeiten und organisieren Sie Ihre Dateien im Modul \"Dokumente\":\"${__VirtualRootPath}/products/files/\".\n# Fügen Sie Ihr E-Mail-Konto dem Modul \"${LetterLogoText} E-Mail\":\"${__VirtualRootPath}/addons/mail/\" hinzu.\n# Erstellen Sie \"Projekte\":\"${__VirtualRootPath}/products/projects/\" und verwalten Sie Ihren Workflow, indem Sie Meilensteine und Aufgaben hinzufügen.\n# Verwalten Sie Ihre Kundenbeziehungen mit Modul \"CRM\"::\"${__VirtualRootPath}/products/community/\" bestimmen Sie Prioritätskontakte, verfolgen Sie Nachrichtenhistorie und Umsatzentwicklung.\n# Nutzen Sie Modul \"Community\":\"${__VirtualRootPath}/products/community/\" um Ihre Blogs, Foren, Ereignisse, Lesezeichen hinzuzufügen.\n# Gestalten Sie Ihren Arbeitsprozess mit eingebautem \"Kalender\":\"${__VirtualRootPath}/addons/calendar/\".\n# Starten Sie \"Talk\":\"${__VirtualRootPath}/addons/talk/\" um mit Ihren Teammitgliedern online zu chatten.\n\n$GreenButton\n\nWenn Sie Hilfe benötigen, besuchen Sie unser \"Hilfe-Center\":\"http://helpcenter.onlyoffice.com/\" oder unser \"Forum\":\"http://cloud.onlyoffice.org\".\n\nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"',NULL,'2017-02-01 09:36:23','text',2,NULL,'Evgenia'),(935673,250,'pattern_you_added_after_invite','es','Estimado(a) $UserName,\n\nSu perfil de usuario se ha agregado al portal en \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Comience usar su portal\n\n# Editar su \"perfil\":\"$MyStaffLink\" para añadir datos personales y de contacto.\n# Crear, editar y organizar \"Documentos\":\"${__VirtualRootPath}/products/files/\".\n# Añadir su cuenta de correo electrónico a \"${LetterLogoText} Mail\":\"${__VirtualRootPath}/addons/mail/\".\n# Crear \"Proyectos\":\"${__VirtualRootPath}/products/projects/\" y administrar su flujo de trabajo agregando hitos y tareas.\n# Administrar sus relaciones con los clientes usando módulo \"CRM\":\"${__VirtualRootPath}/products/crm/\", identificar los contactos prioritarios, seguir historia de la comunicación y el rendimiento de ventas.\n# Usar \"Comunidad\":\"${__VirtualRootPath}/products/community/\" para iniciar sus blogs, foros, añadir eventos, compartir marcadores.\n# Organizar su horario de trabajo con el \"Calendario\" incorporado:\"${__VirtualRootPath}/addons/calendar/\".\n# Iniciar \"Chat\":\"${__VirtualRootPath}/addons/talk/\" para charlar con sus compañeros de equipo en línea.\n\n$GreenButton\n\nSi usted necesita ayuda con su portal, le invitamos a navegar por nuestro \"Centro de ayuda\": \"https://helpcenter.onlyoffice.com\" o visitar nuestro \"Foro\": \"http://cloud.onlyoffice.org\".\n\nMuy atentamente,\nEquipo ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"\n',NULL,'2016-12-01 08:48:52','text',2,NULL,'Александр'),(944738,250,'pattern_you_added_after_invite','fi','Hyvä $UserName,\n\nKäyttäjän profiilisi on onnistuneesti lisätty portaaliin osoitteessa \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Aloita portaalisi käyttö\n\n# Muokkaa \"profiiliasi\":\"$MyStaffLink\" ja lisää henkilökohtaisia tietoja ja yhteystietoja.\n# Luo, muokkaa ja organisoi \"Asiakirjoja\":\"${__VirtualRootPath}/products/files/\".\n# Lisää sähköpostitili \"${LetterLogoText} Sähköpostipalvelussa\":\"${__VirtualRootPath}/addons/mail/\".\n# Luo \"Projekteja\":\"${__VirtualRootPath}/products/projects/\" ja hallinnoi työprosessejasi lisäämällä välitavoitteita ja tehtäviä.\n# \"Asiakkuudenhallinnan\":\"${__VirtualRootPath}/products/crm/\" moduulissa voit tunnistaa etusijalla olevia kontakteja, seurata kommunikaation historiaa ja myynnin tulosta.\n# Käytä \"Yhteisön\":\"${__VirtualRootPath}/products/community/\" osiota blogien aloitukseen, keskustelufoorumiin, tapahtumien lisäykseen ja kirjanmerkkien jakoon.\n# Organisoi työsi aikatauluja \"Kalenterilla\":\"${__VirtualRootPath}/addons/calendar/\".\n# Aloita \"Talk\":\"${__VirtualRootPath}/addons/talk/\" pikaviestin toiminto, vaikkapa tiimisi jäsenten välillä.\n\n$GreenButton\n\nJos tarvitset tukea portaalisi käytössä, niin suosittelemme tutustumista \"Tukikeskukseen\":\"https://helpcenter.onlyoffice.com\" tai vieraile \"Foorumissa\":\"http://cloud.onlyoffice.org\".\n\nParhain terveisin,\nONLYOFFICE Tiimi\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2017-01-15 11:26:22','text',2,NULL,'Arto Ryynanen'),(935674,250,'pattern_you_added_after_invite','fr','Bonjour $UserName,\n\nVotre profil d\'invité a été ajouté avec succès au portail à \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Commencer à  travailler avec votre portail\n\n# Modifiez votre \"profil\":\"$MyStaffLink\" pour ajouter des informations personnelles et de contact.\n# Créez, modifiez et organisez \"Documents\":\"${__VirtualRootPath}/products/files/\".\n# Ajoutez votre compte de messagerie à \"${LetterLogoText} Mail\":\"${__VirtualRootPath}/addons/mail/\". \n# Créez \"Projets\":\"${__VirtualRootPath}/products/projects/\" et gérez votre flux de travail en ajoutant les jalons et les tâches.\n# Gérez vos relations client à l\'aide du module \"CRM\":\"${__VirtualRootPath}/products/crm/\", identifiez des contacts en priorités, voie de communication historique et les performances de ventes.\n# Utilisez \"Communauté\":\"${__VirtualRootPath}/products/community/\" pour commencer vos blogs, forums, ajouter des événements, partagez des signets. \n# Organisez votre emploi du temps avec \"Calendrier\":\"${__VirtualRootPath}/addons/calendar/\".\n# Démarrez \"Chat\":\"${__VirtualRootPath}/addons/talk/\" pour discuter avec d\'autres utilisateurs du portail en ligne.\n\n$GreenButton\n\nSi vous avez besoin d\'aide avec votre portail, nous vous invitons à parcourir notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\" ou visitez notre \"Forum\":\"http://cloud.onlyoffice.org\".\n\nSincèrement vôtre,\nÉquipe ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-01 08:48:57','text',2,NULL,'Александр'),(461025,250,'pattern_you_added_after_invite','Neutral','Dear $UserName,\n\nYour user profile has been successfully added to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Get started with your portal\n\n# Edit your \"profile\":\"$MyStaffLink\" to add personal and contact details.\n# Create, edit and organize \"Documents\":\"${__VirtualRootPath}/products/files/\".\n# Add your email account to \"${LetterLogoText} Mail\":\"${__VirtualRootPath}/addons/mail/\".\n# Create \"Projects\":\"${__VirtualRootPath}/products/projects/\" and manage your workflow by adding milestones and tasks.\n# Manage your customer relations using \"CRM\":\"${__VirtualRootPath}/products/crm/\" module, identify priority contacts, track communication history and sales performance.\n# Use \"Community\":\"${__VirtualRootPath}/products/community/\" to start your blogs, forums, add events, share bookmarks.\n# Organize your work schedule with the built-in \"Calendar\":\"${__VirtualRootPath}/addons/calendar/\".\n# Start \"Talk\":\"${__VirtualRootPath}/addons/talk/\" to chat with your teammates online.\n\n$GreenButton\n\nIf you need help with your portal, we invite you to browse our \"Help Center\":\"https://helpcenter.onlyoffice.com\" or visit our \"Forum\":\"http://cloud.onlyoffice.org\".\n\nTruly yours,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"','','2016-12-01 08:48:42','text',2,NULL,'Console'),(935675,250,'pattern_you_added_after_invite','ru','Здравствуйте, $UserName,\n\nВаш пользовательский профиль успешно добавлен на портал \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Начните работать со своим порталом\n\n# Отредактируйте свой \"профиль\":\"$MyStaffLink\", добавив личную и контактную информацию.\n# Создавайте, редактируйте и систематизируйте \"Документы\":\"${__VirtualRootPath}/products/files/\".\n# Добавьте свою учетную запись электронной почты в \"Почту ${LetterLogoText}\":\"${__VirtualRootPath}/addons/mail/\".\n# Создавайте \"Проекты\":\"${__VirtualRootPath}/products/projects/\" и управляйте рабочим процессом, добавляя вехи и ставя задачи.\n# Управляйте взаимоотношениями с клиентами, используя модуль \"CRM\":\"${__VirtualRootPath}/products/crm/\", определяйте приоритетные контакты, следите за историей взаимодействия и эффективностью продаж.\n# Используйте \"Сообщество\":\"${__VirtualRootPath}/products/community/\", чтобы вести блоги, общаться на форумах, добавлять события, делиться закладками.\n# Планируйте рабочий график с помощью встроенного \"Календаря\":\"${__VirtualRootPath}/addons/calendar/\".\n# Запустите \"Чат\":\"${__VirtualRootPath}/addons/talk/\", чтобы общаться со своей командой онлайн.\n\n$GreenButton\n\nЕсли Вам требуется помощь по работе с порталом, приглашаем Вас посетить наш \"Справочный центр\":\"https://helpcenter.onlyoffice.com\" или \"Форум\":\"http://cloud.onlyoffice.org\".\n\nС уважением,\nкоманда ONLYOFFICE\n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-01 08:49:01','text',2,NULL,'Александр'),(950289,250,'pattern_you_added_after_invite_enterprise','de','Sehr geehrte/r Frau/Herr $UserName,\n\nIhr Benutzerprofil wurde erfolgreich dem Portal unter\"${__VirtualRootPath}\":\"${__VirtualRootPath}\" hinzugefügt.\n\nh3.Fangen Sie die Arbeit mit Ihrem Portal an \n\n# Bearbeiten Sie Ihr \"Profil\":\"$MyStaffLink\", um Personalangaben und Kontaktdaten hinzuzufügen.\n# Erstellen, bearbeiten und organisieren Sie Ihre Dateien im Modul \"Dokumente\":\"${__VirtualRootPath}/products/files/\".\n# Fügen Sie Ihr E-Mail-Konto dem Modul \"${LetterLogoText} E-Mail\":\"${__VirtualRootPath}/addons/mail/\" hinzu.\n# Erstellen Sie \"Projekte\":\"${__VirtualRootPath}/products/projects/\" und verwalten Sie Ihren Workflow, indem Sie Meilensteine und Aufgaben hinzufügen.\n# Verwalten Sie Ihre Kundenbeziehungen mit Modul \"CRM\"::\"${__VirtualRootPath}/products/community/\" bestimmen Sie Prioritätskontakte, verfolgen Sie Nachrichtenhistorie und Umsatzentwicklung.\n# Nutzen Sie Modul \"Community\":\"${__VirtualRootPath}/products/community/\" um Ihre Blogs, Foren, Ereignisse, Lesezeichen hinzuzufügen.\n# Gestalten Sie Ihren Arbeitsprozess mit eingebautem \"Kalender\":\"${__VirtualRootPath}/addons/calendar/\".\n# Starten Sie \"Talk\":\"${__VirtualRootPath}/addons/talk/\" um mit Ihren Teammitgliedern online zu chatten.\n\n$GreenButton\n\nWenn Sie Hilfe benötigen, besuchen Sie unser \"Hilfe-Center\":\"http://helpcenter.onlyoffice.com/\" oder unser \"Forum\":\"http://cloud.onlyoffice.org\".\n\nMit freundlichen Grüßen,\nONLYOFFICE Team\n\"www.onlyoffice.com\":\"http://www.onlyoffice.com/\"',NULL,'2017-02-01 09:38:42','text',2,NULL,'Evgenia'),(935677,250,'pattern_you_added_after_invite_enterprise','es','Estimado(a) $UserName,\n\nSu perfil de usuario se ha añadido al portal \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Comience usar su portal\n\n# Editar su \"perfil\":\"$MyStaffLink\" para añadir datos personales y de contacto.\n# Crear, editar y organizar \"Documentos\":\"${__VirtualRootPath}/products/files/\".\n# Añadir su cuenta de correo electrónico a \"${LetterLogoText} Mail\":\"${__VirtualRootPath}/addons/mail/\".\n# Crear \"Proyectos\":\"${__VirtualRootPath}/products/projects/\" y administrar su flujo de trabajo agregando hitos y tareas.\n# Administrar sus relaciones con los clientes usando módulo \"CRM\":\"${__VirtualRootPath}/products/crm/\", identificar los contactos prioritarios, seguir historia de la comunicación y el rendimiento de ventas.\n# Usar \"Comunidad\":\"${__VirtualRootPath}/products/community/\" para iniciar sus blogs, foros, añadir eventos, compartir marcadores.\n# Organizar su horario de trabajo con el \"Calendario\" incorporado:\"${__VirtualRootPath}/addons/calendar/\".\n# Iniciar \"Chat\":\"${__VirtualRootPath}/addons/talk/\" para charlar con sus compañeros de equipo en línea.\n\n$GreenButton\n\nSi usted necesita ayuda con su portal, le invitamos a navegar por nuestro \"Centro de ayuda\": \"https://helpcenter.onlyoffice.com\".\n\nMuy atentamente,\nEquipo ONLYOFFICE \n\"www.onlyoffice.com\": \"http://onlyoffice.com/\"',NULL,'2016-12-01 08:4