de messagerie à \"${LetterLogoText} Mail\":\"${__VirtualRootPath}/addons/mail/\". \n# Créez \"Projets\":\"${__VirtualRootPath}/products/projects/\" et gérez votre flux de travail en ajoutant les jalons et les tâches.\n# Gérez vos relations client à l\'aide du module \"CRM\":\"${__VirtualRootPath}/products/crm/\", identifiez des contacts en priorités, voie de communication historique et les performances de ventes.\n# Utilisez \"Communauté\":\"${__VirtualRootPath}/products/community/\" pour commencer vos blogs, forums, ajouter des événements, partagez des signets. \n# Organisez votre emploi du temps avec \"Calendrier\":\"${__VirtualRootPath}/addons/calendar/\".\n# Démarrez \"Chat\":\"${__VirtualRootPath}/addons/talk/\" pour discuter avec d\'autres utilisateurs du portail en ligne.\n\n$GreenButton\n\nSi vous avez besoin d\'aide avec votre portail, nous vous invitons à parcourir notre \"Centre d\'aide\":\"https://helpcenter.onlyoffice.com\".\n\nSincèrement vôtre,\nÉquipe ONLYOFFICE \n\"www.onlyoffice.com\":\"http://onlyoffice.com/\"',NULL,'2016-12-01 08:49:29','text',2,NULL,'Александр'),(461026,250,'pattern_you_added_after_invite_enterprise','Neutral','Dear $UserName,\n\nYour user profile has been successfully added to the portal at \"${__VirtualRootPath}\":\"${__VirtualRootPath}\".\n\nh3.Get started with your portal\n\n# Edit your \"profile\":\"$MyStaffLink\" to add personal and contact details.\n# Create, edit and organize \"Documents\":\"${__VirtualRootPath}/products/files/\".\n# Add your email account to \"${LetterLogoText} Mail\":\"${__VirtualRootPath}/addons/mail/\".\n# Create \"Projects\":\"${__VirtualRootPath}/products/projects/\" and manage your workflow by adding milestones and tasks.\n# Manage your customer relations using \"CRM\":\"${__VirtualRootPath}/products/crm/\" module, identify priority contacts, track communication history and sales performance.\n# Use \"Community\":\"${__VirtualRootPath}/products/community/\" to start your blogs, forums, add events,